INSERT INTO `details` (`id`, `film_id`, `locality`, `media_dvd`, `media_hddvd`, `media_bluray`, `media_custom`, `upc`, `collectionnumber`, `collectiontype`, `title`, `disttrait`, `originaltitle`, `origin`, `prodyear`, `released`, `runningtime`, `casetype`, `slipcover`, `srpid`, `srp`, `overview`, `easteregg`, `purchcurrencyid`, `purchprice`, `purchdate`, `created_at`, `updated_at`) VALUES
(1, 1, 'United States', 1, 0, 0, '', '011575-008377', 245, 'Owned', 'Big Fish', '', '', '', '2003', '2004-04-27', 125, 'Keep Case', 0, 'USD', '28.95', 'An adventure as big as life itself. \n\nThroughout his life, Edward Bloom (Ewan McGregor) has always been a man of big appetites, enormous passions and tall tales. In his later years, portrayed by five-time Best Actor Oscar nominee Albert Finney (Best Actor in a Supporting Role, Erin Brockovich, 2000), he remains a huge mystery to his son, William (Billy Crudup). Now, to get to know the real man, Will begins piecing together a true picture of his father from flashbacks of his amazing adventures in this marvel of a movie.', '', 'USD', '28.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(2, 2, 'United States', 1, 0, 0, '', '011575-015344', 610, 'Owned', 'Resident Evil', 'Deluxe Edition', '', 'United States', '2002', '2004-09-07', 100, 'Keep Case', 0, 'USD', '19.94', 'A team of paramilitary commandos must battle flesh-eating undead, killer mutant dogs, and a supercomputer''s deadly defenses before an unleashed virus consumes humanity in this adaption of the hit video games series!', '', 'USD', '19.94', '2008-05-27', '2016-11-15 00:00:00', NULL),
(3, 3, 'United States', 1, 0, 0, '', '011575-020669', 14, 'Owned', 'Jerry Maguire', 'Edition Special', '', '', '1996', '2002-04-30', 139, 'Digipak', 0, 'USD', '27.95', 'What happens when a man tries to apply moral standards to his job in an industry of greed? He gets fired. Tom Cruise plays Jerry Maguire, a slick sports agent who realizes that he hates how he is living his life and encourages his fellow employees to get back to the important basics: people, loyalty, and fairness. Unfortunately, Maguire''s new moral compass costs him his job, and he is left to start his business anew with one work ally, agency accountant Dorothy Boyd (Rene Zellweger), and his least important client, Rod Tidwell (Cuba Gooding, Jr.). Maguire embarks on a journey of personal growth that forces him to reevaluate his life choices and ultimately leads him to both friendship and love. Like his earlier films, SAY ANYTHING and SINGLES, this award-winning Cameron Crowe film features snappy dialogue, comic relief, and the occasional tear-jerking moment. Stellar performances are turned in from Cruise, Zellweger, and Gooding, Jr., as well as supporting cast members Bonnie Hunt, Jay Mohr, Regina King, and Kelly Preston.\n\nJerry Maguire a tout pour lui. Il est agent des stars du sport amricain au sein d''une puissante agence. Pourtant derrire cet idyllique tableau sa cache une ralit plus sombre. Jerry ne s''aime pas...', '', 'USD', '27.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(4, 4, 'United States', 1, 0, 0, '', '011575-061907', 569, 'Owned', 'Spider-Man', 'Full Screen Edition', '', 'United States', '2002', '2002-11-01', 121, 'Keep Case', 0, 'USD', '29.99', 'From Columbia Pictures Presents, A Marvel Enterprises/Laura Ziskin Production, Spider-Man is a live-action feature of one of the world''s most popular comic book superheroes. Directed by Sam Raimi, Spider-Man centers on student Peter Parker (Tobey Maguire) who, after being bitten by a genetically-altered spider, gains superhuman strength and the spider-like ability to cling to any surface. He vows to use his abilities to fight crime, coming to understand the words of his beloved Uncle Ben: "With great power comes great responsibility."\n\nThe journey of Spider-Man, from comic book to celluloid began in 1962 when the character first appeared in the final issue of the failing "Amazing Fantasy" comic book. It was such a hit that "Amazing Fantasy" was renamed "Amazing Spider-Man" and reappeared in 1963. Since then, the web of ''not for the faint of heart'' readers, fans and collectors worldwide has grown into making Spider-Man one of the most popular superheroes among the young, old, women and men. And now, 40 years later, with great power and great responsibility, the tale of Spider-Man jumps from the screen into the home on DVD and VHS for the whole family to enjoy.', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(5, 5, 'United States', 1, 0, 0, '', '011575-101139', 374, 'Owned', 'Guess Who', '', '', '', '2005', '2005-08-02', 105, 'Keep Case', 0, 'USD', '28.95', 'When Theresa (Zoe Saldana) brings fianc Simon Green (Ashton Kutcher) home for her parents 25th wedding anniversary, shes neglects to mention one tiny detail... hes white. Determined to break his daughters engagement, Percy Jones (Bernie Mac) does everything he can to make Simon feel apart of the family, from running his credit report to locking him in the basement at night. But when Percy gleefully exposes Simons most embarrassing secret, it leads to an outrageous series of comic complications that only goes to prove that with a dad like Percy Jones, father doesnt always know best.', '', 'USD', '28.95', '2006-10-08', '2016-11-15 00:00:00', NULL),
(6, 6, 'United States', 1, 0, 0, '', '012236-100027', 327, 'Owned', 'Dirty Dancing', 'Collector''s Edition', '', 'United States', '1987', '2000-01-18', 100, 'Keep Case', 0, 'USD', '24.98', 'Heartthrob Patrick Swayze, Jennifer Grey and dancing sensation Cynthia Rhodes star in this electrifying and sensual film. A vivid love story, ''Dirty Dancing'' is set to pounding rhythms and vibrant dance - guaranteed to be the time of your life.', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(7, 7, 'United States', 1, 0, 0, '', '012236-114123', 403, 'Owned', 'The Crocodile Hunter', '', '', '', '1999', '2000-05-16', 170, 'Keep Case', 0, 'USD', '19.98', 'Was he raised by rattlers? Befriended by crocs? Schooled by piranhas? Here''s your chance to get inside the adrenaline-charged head of Steve Irwin, star of Animal Planet''s The Crocodile Hunter. You''ll learn how an unassuming little tyke from Australia turned into the wildest man on television. Peek into Steve''s family album. Watch private home movies. See candid interviews. \nSteve''s Story is jam-packed with never-before-seen action footage of the Croc Man''s early days. It''s the straight skinny, the real deal, the inside scoop on Animal Planet''s Crocodile Hunter, Steve Irwin. Also includes Steve''s Most Dangerous Adventures and Greatest Crocodile Captures.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(8, 8, 'United States', 1, 0, 0, '', '012236-114390', 528, 'Owned', 'Stargate', 'Special Edition', '', 'United States', '1994', '1999-10-26', 130, 'Keep Case', 0, 'USD', '29.99', 'When a mysterious woman makes Professor Daniel Jackson (James Spader) and offer he can''t refuse, he ends up in a secret Air Force military base.  His mission: to decode an ancient Egyptian artifact known as the Stargate.\n\nThe mission leader, Colonel Jack O''Neil (Kurt Russell), a tough military man with nerves of steel, commands their trip through the Stargate to an ancient civilization on the other side of the universe.  But once there, they must battle the astoundingly powerful Sun God, Ra (Jaye Davidson), before they can find their way back home.', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(9, 9, 'United States', 1, 0, 0, '', '012236-119265', 408, 'Owned', 'Drop Dead Fred', '', '', 'United States', '1991', '2003-07-22', 103, 'Keep Case', 0, 'USD', '14.98', 'Every kid has an imaginary friend. Only Elizabeth (Phoebe Cates) is''t a kid and DROP DEAD FRED(Rik Mayall) is anything but imaginary! With a haircut this bad, he has to be real - and his mischief has Elizabeth in big trouble!\n\nWhen she splits with her husband (Tim Matheson), Elizabeth turns to her best friend (Carrie Fisher). But it''s her mom (Marsha Mason) who sends her back home where she discovers her childhood friend, Fred. Having been locked in a box for twenty-one years, Fred is bursting with enough energy to turn Elizabeth''s life into a rowdy, rollicking, racy adventure!\n\nPresented in 1.33:1 format in which the film was shot.', '', 'USD', '14.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(10, 10, 'United States', 1, 0, 0, '', '012236-119579', 571, 'Owned', 'Total Recall', 'Limited Edition', '', '', '1990', '2001-09-18', 113, 'Keep Case', 0, 'USD', '26.98', 'This Special Edition DVD allows you to experience Total Recall the way it was meant to be seen and heard. \n  16:9 newly remastered widescreen version will immerse you in the action. \n  5.1 newly remastered Dolby Surround with Nearfield Audio mix delivers optimum home theater audio performance. \n\nArnold Schwarzenegger provides a rare audio commentary along with Director Paul Verhoeven. \n\nImagining Total Recall, a documentary created for this special edition, takes you behind the scenes with the films stars and special effects wizards showing you why it won the Academy Award''s Special Achievement Award for Visual Effects. \n\nRekall''s Virtual Vacations will transport you from the deserts of Mars to tropical destinations, allowing for hours of relaxing mini getaways.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(11, 11, 'United States', 1, 0, 0, '', '012236-130437', 529, 'Owned', 'Red Heat', 'Special Edition', '', '', '1988', '2004-09-07', 106, 'Keep Case', 0, 'USD', '19.98', '''Red Heat'' is the first American movie ever to be filmed in Russia''s famed Red Square. Arnold Schwarzenegger is Captain Ivan Danko, a highly disciplined Russian detective. James Belushi is Detective Art Ridzik, a fearless but undisciplined cop. They''re a pair of mismatched cops hot on the trail of Russia''s deadliest drug smuggler throughout the mean streets of Chicago. A nonstop action-adventure, packed with humor and thrills... with this much friction, there''s gotta be heat... ''Red Heat''.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(12, 12, 'United States', 1, 0, 0, '', '012236-146292', 485, 'Owned', 'Terminator 2: Judgment Day', 'Extreme DVD', '', '', '1991', '2003-08-21', 152, 'Keep Case', 0, 'USD', '26.98', 'All new special features include: Commentary with James Cameron, a new digital transfer of the film, two documentaries on the film, and much more.\n\n\nThe Terminator is back with another mission requiring that he travel back in time. A lethal machine (Patrick) has been sent back through time to kill a boy destined to lead the freedom fighters of the future (Furlong). The Terminator (Schwarzenegger) is sent to save the boy, assisted by the boy''s mother (Hamilton), a woman whose warnings of a world headed toward nuclear disaster go unheeded.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(13, 13, 'United States', 1, 0, 0, '', '012236-212850', 311, 'Owned', 'The Ninth Gate', '', '', 'France', '1999', '2000-07-18', 133, 'Keep Case', 0, 'USD', '24.98', 'Johnny Depp stars as Dean Corso, an unscrupulous rare-book dealer who is hired to locate the last remaining copies of "The Nine Gates of the Shadow Kingdom," a demonic manuscript that can summon the Devil. Corso becomes embroiled in the conspiracy involving murder, theft and satanic ritual, and ultimately finds himself confronting the devil incarnate.', '', 'USD', '24.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(14, 14, 'United States', 0, 0, 0, 'Digital', '012569-102323', 1001, 'Owned', 'Exorcist II: The Heretic', '', '', 'United States', '1977', '2002-08-06', 117, 'Snapper', 0, 'USD', '19.98', 'Bizarre nightmares plague Regan MacNeil (Linda Blair) four years after her possession and exorcism. Has the demon returned? And if so, can the combined faith and knowledge of a Vatican investigator (Richard Burton) and a hypnotic research specialist (Louise Fletcher) free her from its grasp?\n\nEmploying production design and special effects that are dizzily exhilarating and a supporting cast (Max von Sydow, Paul Henreid, James Earl Jones) of compelling distinction, director John Boorman draws us into the tangible ''experience'' of evil. We fly with the demon, feel the African landscape vibrate and get engulfed in the terror of swarming locusts as ''Exorcist II: The Heretic'' weaves its fascinating, frightful spell.', '', 'USD', '19.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(15, 15, 'United States', 1, 0, 0, '', '012569-431928', 166, 'Owned', 'Miss Congeniality', 'Deluxe Edition', '', '', '2000', '2005-03-15', 110, 'Keep Case', 0, 'USD', '24.98', '', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(16, 16, 'United States', 1, 0, 0, '', '012569-576421', 149, 'Owned', 'A Christmas Story', 'Special Edition', '', '', '1983', '2003-10-07', 93, 'Digipak', 0, 'USD', '26.99', 'The Christmas spirit isn''t served up with more observant hilarity than in this beloved adaptation of Jean Shepherd''s holiday story. In 1940s Indiana, nine-year-old Ralphie (Peter Billingsley) dreams of his ideal Christmas gift: a genuine Red Ryder 200-shot Carbine Action Air Rifle. But when gruff dad (Darren McGavin) and doting mom (Melinda Dillion) regularly respond with "You''ll shoot your eye out!" Ralphie mounts a full-scale Santa-begging campaign. He encounters a slew of calamities from snowsuit paralysis to the dreaded tongue-on-a-frozen-flagpole gambit. We triple-dog-dare you to unwrap a more welcome Yultide classic!', '', 'USD', '26.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(17, 17, 'United States', 1, 0, 0, '', '012569-593237', 693, 'Owned', 'Million Dollar Baby', '2-Disc Widescreen Edition', '', 'United States', '2004', '2005-07-12', 132, 'Keep Case', 0, 'USD', '29.95', '"I DON''T TRAIN GIRLS,"  trainer Frankie Dunn growls. But something''s different about the spirited boxing hopeful who shows up daily at Dunn''s gym. All she wants is a fighting chance. \n\nClint Eastwood plays Dunn and directs, produces and composes music for this acclaimed, multiaward-winning tale of heart, hope and family. Hilary Swank plays resilient Maggie, determined not to abandon her one dream. And Morgan Freeman is Scrap, gym caretaker and counterpoint to Dunn''s crustiness. Grab your dreams and come out swinging. <i>Million Dollar Baby</i> is an absolute knockout.', '', 'USD', '29.95', '2009-10-15', '2016-11-15 00:00:00', NULL),
(18, 18, 'United States', 1, 0, 0, '', '012569-593251', 355, 'Owned', 'Harry Potter and the Order of the Phoenix', 'Full-Screen Edition', '', 'United Kingdom', '2007', '2007-12-11', 139, 'Keep Case', 0, 'USD', '28.98', '''The rebellion begins!'' Lord Voldemort has returned, but the Ministry of Magic is doing everything it can to keep the wizarding world from knowing the truth - including appointing Ministry official Dolores Umbridge as the new Defense Against the Dark Arts professor at Hogwarts. When Umbridge refuses to teach practical defensive magic, Ron and Hermione convince Harry to secretly train a select group of students for the wizarding war that lies ahead. A terrifying showdown between good and evil awaits in this enthralling film version of the fifth novel in J.K. Rowling''s ''Harry Potter'' series. Prepare for battle!', '', 'USD', '28.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(19, 19, 'United States', 1, 0, 0, '', '012569-593367', 54, 'Owned', 'Charlie and the Chocolate Factory', 'Full-screen', '', '', '2005', '2005-11-08', 115, 'Keep Case', 0, 'USD', '30.98', 'What wonders await you in Willy Wonka''s factory? Explore fields of soft minty sugar grass in the Chocolate Room...Sail along the Chocolate River in a pink sugar boat...Experiment with Everlasting Gobstoppers in the Inventing Room...Observer talented squirrels in the Nut Room and travel to the Television Room by a glass elevator. You''ll find a lot that''s funny, a little that''s mysterious...and an adventure as sweet and satisfying as a Wonka Whipple-Scrumptious Fudgemallow Delight bar. This dazzling film adapted from Roald Dahl''s classic children''s novel, directed by Tim Burton and starring Johnny Depp and Freddie Highmore, is your Golden Ticket to a world so inventive you won''t want to miss a delicious moment!', '', 'USD', '30.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(20, 20, 'United States', 1, 0, 0, '', '012569-593879', 152, 'Owned', 'Harry Potter and the Goblet of Fire', '', '', '', '2005', '2006-03-07', 157, '', 0, 'USD', '28.99', 'When Harry Potter''s (Daniel Radcliffe) name emerges from the Goblet of Fire, he becomes a competitor in a grueling battle for glory among three wizarding schools - the Triwizard Tournament.  But since Harry never submitted his name for the Tournament, who did?  Now Harry must confront a deadly dragon, fierce water demons and an enchanted maze only to find himself in the cruel grasp of He Who Must Not Be Named (Ralph Fiennes).\n\nIn this fourth film adaptation of J.K. Rowling''s Harry Potter series, everything changes as Harry, Ron (Rupert Grint) and Hermione (Emma Watson) leave childhood forever and take on challenges greater than anything they could have imagined.', '', 'USD', '28.99', '2006-06-19', '2016-11-15 00:00:00', NULL),
(21, 21, 'United States', 1, 0, 0, '', '012569-594098', 271, 'Owned', 'Firewall', 'Full-Screen Edition', '', '', '2005', '2006-02-23', 105, 'Keep Case', 0, 'USD', '28.98', 'It''s an ordinary day at Landrock Pacific Bank - ordinary for everyone but I.T. expert Jack Stanfield. His wife and children are held hostage at home. Their kidnappers have one demand: Jack must heist $100 million from the ultra-secure system he designed. And they''ll be watching every move he makes.\n\nShowing the Everyman vulnerability, strength and resourcefulness that make him one of film''s most appealing heroes, Harrison Ford portrays Stanfield in this cyber-edged race against time. Paul Bettany (''The Da Vinci Code'') co-stars as an ice-blooded crime mastermind. And Virginia Madsen (''Sideways'') plays Stanfield''s wife, who disregards her own terror to protect her children. The criminals'' plan is airtight. They figure they can''t lose. But they overlook one thing: the desperation of a man with everything to lose.', '', 'USD', '28.98', '2007-08-12', '2016-11-15 00:00:00', NULL),
(22, 22, 'United States', 1, 0, 0, '', '012569-594142', 323, 'Owned', 'Batman Begins', 'Full-Screen', '', '', '2005', '2005-10-18', 140, 'Keep Case', 0, 'USD', '28.98', 'In ''BATMAN BEGINS'', acclaimed director Christopher Nolan explores the origins of the legendary DARK KNIGHT. In the wake of his parents'' murders, disillusioned heir BRUCE WAYNE (CHRISTIAN BALE) travels the world seeking the means to fight injustice and turn fear against those who prey on the fearful. With the help of his trusted butler ALFRED (MICHAEL CAINE), detective JIM GORDON (GARY OLDMAN) and his ally LUCIUS FOX (MORGAN FREEMAN), Wayne returns to GOTHAM CITY and unleashes his alter ego: BATMAN, a masked crusader who uses strength, intellect and an array of high-tech weaponry to fight the sinister forces that threaten the city.', '', 'USD', '28.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(23, 23, 'United States', 1, 0, 0, '', '012569-699885', 326, 'Owned', 'The Polar Express', '', '', '', '2004', '2005-11-29', 100, 'Keep Case', 0, 'USD', '29.98', 'Get up, get on, and get ready for the ride of your life! It''s Christmas Eve, and you''re about to roller-coaster up and down mountains, slip-slide over ice fields, teeter across mile-high bridges and be served hot chocolate by singing waiters more astonishing than any you can imagine. You''re on ''The Polar Express!''\n\nTom Hanks stars in and Robert Zemeckis directs this instant holiday classic filmed in dazzling performance-capture animation that makes every moment magical. "Seeing is believing," says a mysterious hobo who rides the rails with you. You''ll see wonders. And you''ll believe. All aboooooard!', '', 'USD', '29.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(24, 24, 'United States', 1, 0, 0, '', '012569-700482', 272, 'Owned', 'The Aviator', '', '', 'United States', '2004', '2005-05-24', 170, 'Keep Case', 0, 'USD', '29.95', 'One of the 20th century''s most compelling figures, Howard Hughes was a wily industrialist, glamorous movie producer and unstoppable American innovator - but he thought of himself first and foremost as an aviator.  In this spectacular epic, director Martin Scorsese focuses on the most prolific period in the life of Hughes (played by Best Actor Golden Globe winner Leonardo DiCaprio): the mid- 1920s through the 1940s.  It was a time of brilliant aeronautical invention, turbulent love affairs (including one with Katherine Hepburn, played by Kate Blanchett) and savage corporate battles.  Prepare yourself for the ride of the lifetime of this billionaire, genius, madman.', '', 'USD', '29.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(25, 25, 'United States', 0, 0, 0, 'Digital', '012569-701380', 970, 'Owned', 'The Invasion', 'Widescreen', '', 'United States', '2007', '2008-01-29', 99, 'Keep Case', 0, 'USD', '28.98', 'Something terrifying has come to Earth, something that attacks us while we sleep and turns us into soulless replicants. The clock is ticking as Washington, DC psychiatrist Carol Bennell (Nicole Kidman) and her colleague Ben Driscoll (Daniel Craig) embark on a heart-stopping journey into a nightmarish world where the only way to stay alive is to stay awake. No one can be trusted. No one is safe in producer Joel Silver''s bold new take on Jack Finney''s classic novel <i>The Body Snatchers</i>.\n\nDon''t fall asleep! <i>The Invasion</i> is here.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(26, 26, 'United States', 1, 0, 0, '', '012569-705395', 21, 'Owned', 'Racing Stripes', '', '', '', '2005', '2005-05-10', 102, 'Keep Case', 0, 'USD', '24.95', 'Stripes is a zebra with the heart of a champion and a special dream: to run in Kentucky''s most prestigious horse race!\n\nA barnyard full of talking animals provides lots of wise-quacking, horse sense and baa-baa backtalk as spunky Stripes teams with the young jockey, Channing Walsh, to train for the winner''s circle. Will Channing and Stripes be ready for the ride - and the adventure - of their lives?', '', 'USD', '24.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(27, 27, 'United States', 1, 0, 0, '', '012569-728820', 350, 'Owned', 'Duma', '', '', '', '2005', '2006-05-16', 101, 'Keep Case', 0, 'USD', '19.97', 'If you''re looking for a fast-paced family adventure, consider this: in the time it takes you to read this sentence, a cheetah can go from 0 to 60 MPH!\n\nCarroll Ballard (''The Black Stallion'', ''Fly Away Home'') directs the exciting story of 12-year-old Xan (Alexander Michaletos), who decides to return the cheetah he raised from a cub to the wild instead of allowing pursuers to place it in captivity. Harsh South African landscapes, stalking lions, crocodiles, river rapids and a mysterious drifter (Eamonn Walker) who may intend to turn the big cat in for cash - all will test Xan''s courage and resolve. Join him in this tale of growing up and letting go. It''s a journey you won''t want to miss.', '', 'USD', '19.97', '2006-06-19', '2016-11-15 00:00:00', NULL),
(28, 28, 'United States', 0, 0, 0, 'Digital', '012569-736603', 947, 'Owned', 'V for Vendetta', 'Widescreen Edition', '', 'United States', '2006', '2006-08-01', 132, 'Keep Case', 0, 'USD', '28.98', 'Who is the man who hides his scarred face behind a mask? Hero or madman? Liberator or oppressor? Who is V - and who will join him in his daring plot to destroy the totalitarian regime that dominates his nation?\n\nFrom the creators of <i>The Matrix</i> trilogy comes <i>V For Vendetta</i>, an arresting and uncompromising vision of the future based on the powerfully subversive graphic novel. Natalie Portman stars as Evey, a working-class girl who must determine if her hero has become the very menace he''s fighting against. Hugo Weaving plays V - a bold, charismatic freedom fighter driven to exact revenge on those who disfigured him. And Stephen Rea portrays the detective leading a desperate quest to capture V before he ignites a revolution. The stakes rise. The tension electrifies. The action explodes. Whose side are you on? In V''s world, there is no middle ground.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(29, 29, 'United States', 1, 0, 0, '', '012569-736658', 29, 'Owned', 'The Dukes of Hazzard', 'Unrated Widescreen Edition', '', '', '2005', '2005-12-06', 107, 'Keep Case', 0, 'USD', '28.95', 'With the General Lee tanked up for car-crashin'' action and with more laughs than a dog has fleas, this big-screen version of the long-running TV series is big-time fun. Johnny Knoxville, Seann William Scott, Jessica Simpson, Burt Reynolds, Willie, Nelson, and more help keep the pedal to the metal for 100-MPH laughs. Stars, comedy, spills and thrills - ''The Duks of Hazzard''s'' got it all, y''all!\n\nAnd on top of that, this ''DVD-Exclusive Unrated Version'' features ''Outrageous Footage not shown in theatres.'' These good ol'' boys just got better - and you''re in for a whole lot more fun!', '', 'USD', '28.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(30, 30, 'United States', 0, 0, 0, 'Digital', '012569-736702', 979, 'Owned', 'The Reaping', '', '', 'United States', '2007', '2007-10-16', 99, 'Keep Case', 1, 'USD', '28.98', 'Locusts swarm. Rivers turn to blood. Fire rains from the sky. Are you prepared for <i>The Reaping</i>? Investigative scholar Katherine Winter (two-time Academy Award winner Hilary Swank) is a debunker of modern "miracles," bringing scientific light to superstition and fraud. But events in tiny Haven, Louisiana defy even her expertise. There, the 10 Biblical Plagues seem to be recurring. And the more she seeks answers, the more she questions her own beliefs. Katherine must uncover the truth, because the Plagues are counting down. And time is running out.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(31, 31, 'United States', 1, 0, 0, '', '012569-736733', 362, 'Owned', 'The Lake House', '', '', 'United States', '2006', '2006-09-26', 98, 'Keep Case', 0, 'USD', '19.99', 'Dr. Kate Forster has finally found romance. Trouble is, it''s a long-distance relationship. She''s in downtown Chicago. He''s in a remote lakeside suburb. And there''s more: She''s in 2006. He''s in 2004.\n\nKeanu Reeves and Sandra Bullock team for the first time since ''Speed'' for this heart-lifting story of a love that transcends time. It begins when Kate moves out of her visually stunning lake house and leaves a note for the tenant, architect Alex Wyler. They begin a correspondence and soon come to realize they are meant for each other... and that, somehow, they live two years apart. Can they ever meet? What would happen if they tried? Magical and emotionally rich, ''The Lake House'' is a love story for 2004, for 2006, for all times.', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(32, 32, 'United States', 1, 0, 0, '', '012569-757554', 349, 'Owned', 'Tim Burton''s Corpse Bride', 'Widescreen Edition', '', 'United States', '2005', '2006-01-31', 77, 'Keep Case', 0, 'USD', '28.98', '''Tim Burton''s Corpse Bride'' carries on in the dark, romantic tradition of his classic ''Edward Scissorhands'' and ''Tim Burton''s The Nightmare Before Christmas''.\n\nSet in a 19th-century European village, this stop-motion, animated feature follows the story of Victor (voiced by Johnny Depp), a young man who is whisked away to the underworld and wed to a mysterious Corpse Bride (voiced by Helena Bonham Carter), while his real bride, Victoria (voiced by Emily Watson), waits bereft in the land of the living. Though life in the Land of the Dead proves to be a lot more colorful than his strict upbringing, Victor learns that there is nothing in this world - or the next - that can keep him away from his one true love. It''s a tale of optimism, romance and a very lively afterlife , told in classic Burton style.', '', 'USD', '28.98', '2006-06-19', '2016-11-15 00:00:00', NULL),
(33, 33, 'United States', 1, 0, 0, '', '013131-140491', 410, 'Owned', 'Midnight Madness', '', '', 'United States', '1980', '2001-05-15', 112, 'Keep Case', 0, 'USD', '14.98', 'When eccentric campus genius Leon creates "The Great All Nighter," he invites 5 teams to play his ultimate scavenger hunt. Now, a wild assortment of good guys, geeky nerds, bonehead jocks, mean rich kids and some very strange sorority sisters are off on an all night anything goes adventure all over Los Angeles. The clues are waiting. The game is on. Let the ''MIDNIGHT MADNESS'' begin!\n\n''David Naughton'' (AN AMERICAN WEREWOLF IN LONDON) ''Stephen Furst'' (ANIMAL HOUSE) and ''Eddie Deezen'' (GREASE) co-star in this outrageous ''80s comedy favorite that also features the movie debuts of ''Michael J. Fox'' and ''Paul (PEE WEE HERMAN) Reubens''!', '', 'USD', '14.98', '2007-08-09', '2016-11-15 00:00:00', NULL),
(34, 34, 'United States', 1, 0, 0, '', '013131-140699', 248, 'Owned', 'Space Camp', '', '', '', '1986', '2001-09-25', 107, 'Keep Case', 0, 'USD', '19.98', 'Kathryn (Lea Thompson), Kevin (Tate Donovan), Tish (Kelly Preston), Rudy (Larry B. Scott) and Max (Joaquin ''Leaf'' Phoenix) are a group of bright but incorrigible high school students spending their summer at the NASA SpaceCamp. But when a frightening miscommunication occurs during a space shuttle training mission, the teens and their astronaut instructor (Kate Capshaw) are accidentally launched into orbit. Can this young team of unlikely heroes work together to survive the outer-space adventure of a lifetime?\n\nTom Skerrit co-stars in an out-of-this-world adventure for the whole family that was shot on location at the actual U.S. SpaceCamp in Huntsville, Alabama.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(35, 35, 'United States', 1, 0, 0, '', '014381-006124', 501, 'Owned', 'Short Circuit', '', '', '', '1986', '2004-03-09', 99, 'Keep Case', 0, 'USD', '14.95', 'Steve Guttenberg and Ally Sheedy co-star in this high-tech comedy adventure about Number Five, a robot who escapes into the real world after he short-circuits in an electrical storm and decides that he''s human. Because he''s carrying destructive weapons, the Defense Department and his designer (Guttenberg) are desperate to find him. But Number Five is being protected by a young woman (Sheedy) who is teaching him a gentler way of life.', '', 'USD', '14.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(36, 36, 'United States', 1, 0, 0, '', '014381-258721', 545, 'Owned', 'Jeff Foxworthy: You Might Be A Redneck If... & Check Your Neck', '', '', '', '1992', '2004-03-30', 60, 'Keep Case', 0, 'USD', '14.99', 'Jeff Foxworthy''s sidesplitting observations have made him one of America''s favorite comedians. He''s the bestselling comedy recording artist in history, a multiple GRAMMY Award nominee, a bestselling author and a popular TV, radio and film performer. He''s had three hit comedy specials, won a "Favorite Male Newcomer" People''s Choice Award for his role on TV''s ''The Jeff Foxworthy Show'' and starred in the hit film ''Blue Collar Comedy Tour, The Movie''. Now you can see this outrageously funny comedian talking about life, dating, marriage and family in the classic "YOU MIGHT BE A REDNECK IF..." and the Cable ACE Award-nominated "CHECK YOUR NECK," both guaranteed to tickle your funny bone again and again.', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(37, 37, 'United States', 0, 0, 0, 'Digital', '014381-314724', 997, 'Owned', 'Jeff Dunham: Arguing with Myself', '', '', 'United States', '2005', '2006-04-18', 69, 'Keep Case', 0, 'USD', '14.99', 'As straight man to some of the most hilarious pint-sized partners in show business, Jeff Dunham has become one of the most successful touring comics ever and has amassed legions of loyal fans! At the American Comedy Awards, Dunham was voted Male Stand-Up Comic of the Year, an honor shared with the likes of Jerry Seinfeld, Jeff Foxworthy and Robin Williams. Thousands of sold-out theater and comedy club performances, his own top-rated special on Comedy Central and countless TV guest spots - including numerous <i>Tonight Show</i> appearances (with both Leno and Carson) - have won him accolades and success. The reason why is very simple: He and his buddies are funny as hell. Oh, and by the way...Jeff Dunham is a ventriloquist.\n\nNow see for yourself on a DVD that will set the new standard for how truly awesome a comedy DVD can be. Join Jeff and his outspoken-often-edgy characters: Walter, Peanut, Jos Jalapeo (...on a steeek!), Bubba J and Sweet Daddy Dee for a live show that will have you on the floor laughing!', '', 'USD', '14.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(38, 38, 'United States', 1, 0, 0, '', '014381-394924', 521, 'Owned', 'The Terminator', '', '', '', '1984', '1997-09-03', 107, 'Snapper', 0, 'USD', '29.99', 'The Terminator is an ingenious tale of an invincible robot from the year 2029, transported through time to 1984 Los Angeles on a mission of death. In the not-too-distant future, our ever advancing technology has resulted in a nuts-and-bolts revolution. The machines are now in power. Our former slaves are now our masters. The only threat to their world comes in the form of rebel leader John Conner, unseen freedom fighter and keeper of the human spirit who stirs the people into fighting back. At the brink of defeat the machines are forced to play their ace in the hole.. And a wicked ace it is. Using time displacement equipment, they send an indestructible cyborg into the past to murder Connor''s mother, Sarah, before he can be conceived! Connor sends a warrior of his own after the Terminator in the hope of saving Sarah and assuring a future for mankind.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(39, 39, 'United States', 1, 0, 0, '', '014381-408225', 530, 'Owned', 'Mad Max', '', '', '', '1979', '1999-01-01', 93, 'Snapper', 0, 'USD', '29.99', 'A  police  officer  in the outback of a grim futuristic Australia is  caught up in a struggle with lawless biker gangs.  After  the  death  of  his  partner  at  the  hands of these thugs he realises that not  only his life is in danger, but also  the  lives  of  his  wife  and  child.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(40, 40, 'United States', 1, 0, 0, '', '014381-425420', 604, 'Owned', 'Jeff Dunham: Spark of Insanity', '', '', 'United States', '2007', '2007-09-18', 80, 'Keep Case', 0, 'USD', '14.99', 'Jeff Dunham and his socially reckless "suitcase posse" are back in this highly anticipated follow-up to "Arguing with Myself," his breakthrough television special and multi-platinum selling DVD release!\n\nWhat''s next?\n\nAn ALL NEW show that is Bigger... Better... and Funnier than ever!\n\nThis time, Dunham welcomes two never-before-seen partners "Achmed the Dead Terrorist" and "Melvin the Superhero." Long-time favorites "Peanut," "Walter" and "Jose Jalapeno...on a STEEK!" are back in an entirely original show for everyone!\n\nTaped at the historic Warner Theater in Washington, D.C., this sold out concert is twice the length of the Comedy Central broadcast, with exclusive extras, featuring "The Making of Melvin," "What Would You Put on a Stick?" and a surprise political announcement from Walter!\n\n"Spark of Insanity" is the ultimate event special from one of comedy''s most inventive minds.', '', 'USD', '14.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(41, 41, 'United States', 1, 0, 0, '', '014381-427028', 202, 'Owned', 'Sixteen Candles', '', '', '', '1984', '1998-05-06', 93, 'Snapper', 0, 'USD', '14.99', 'It''s Samantha Baker''s Sweet Sixteen and no one in her family remembers the important occasion.  John Hughes, the writer of National Lampoon''s Vacation shows how coming-of-age can be full of surprises in this warm-hearted teenage comedy starring Molly Ringwald.\n\nShe''s your average teen, enduring crerepy freshmen, spoiled siblings, confused parents and the Big Blonde on Campus who stnads between her and the boy of her dreams.  But wait...the day isn''t over yet!  This sparkling film features a dynamic score, and outstanding performances by Paul Dooley, Emmy winner Blanche Baker and Oscar nominee Justin Henry.', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(42, 42, 'United States', 0, 0, 0, 'Digital', '014381-514926', 998, 'Owned', 'Jeff Dunham''s Very Special Christmas Special', '', '', 'United States', '2008', '2008-11-18', 85, 'Keep Case', 0, 'USD', '14.99', 'Jeff Dunham invites Walter, Peanut, Bubba J, Jos Jalapeo and Achmed the Dead Terrorist to join him on his first holiday special.  Unfortunately, his suitcase posse doesn''t quite share the same Christmas spirit--and the result is a one-of-a-kind live event unlike any yuletide celebration you''ve ever seen!\n\nDunham whose first two television specials drew record ratings multimillion DVD sales and over 200 million views on websites worldwide, brings together all-new material and for the first time, original songs and stories guaranteed to become instant classics: from Achmed''s "Jingle Bombs" to Bubba J''s "Roadkill Christmas" to Peanut''s version of "The Night Before Christmas."\n\nDestined to become a treasured holiday favorite!', '', 'USD', '14.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(43, 43, 'United States', 1, 0, 0, '', '017153-101171', 453, 'Owned', 'Lonesome Dove', '', '', '', '0', '2000-02-15', 360, '', 0, 'USD', '39.98', 'The four-part television western saga from the Pulitzer Prize winning novel by Larry Mc Murtry. Two life-long friends, former Texas Rangers, lead a colorful band of cowhands on a dangerous 3,000 mile cattle drive. Volume 1 - "Part 1: Leaving" and "Part 2: On The Trail" Volume 2 - "Part 3: the Plains" and "Part 4: Return" Sequels: "Return to Lonesome Dove" and "Larry McMurtry''s Streets of Laredo."', '', 'USD', '39.98', '2005-09-17', '2016-11-15 00:00:00', NULL),
(44, 44, 'United States', 1, 0, 0, '', '017153-144543', 466, 'Owned', 'The Running Man', 'Special Edition', '', 'United States', '1987', '2004-03-16', 101, 'Keep Case', 1, 'USD', '19.98', 'THE YEAR IS 2019.\nTelevision is now ruling people''s lives. The most popular "audience participation" game show is "The Running Man" - where convicts can win pardons instead of "parting gifts" by defeating murderous henchmen known as "stalkers." The stalkers haven''t had much of a challenge lately...until Ben Richards (Schwarzenegger) comes along.', '', 'USD', '19.98', '2008-01-21', '2016-11-15 00:00:00', NULL),
(45, 45, 'United States', 1, 0, 0, '', '024543-000068', 365, 'Owned', 'One Fine Day', '', '', 'United States', '1996', '2000-01-18', 109, 'Keep Case', 0, 'USD', '29.98', 'In this charming, romantic comedy, three-time Academy Award nominee Michelle Pfeiffer ("Dangerous Liasons, "The Fabulous Baker Boys", "Love Field") and "ER" star George Clooney find that opposites attract whether they like it or not.  Melanie Parker is juggling single parenthood with a career as an architect. Jack Taylor is a commitment-shy newspaper columnist who only has his daughter every other weekend. When the kids miss a school field trip, Melanie and Jack agree to take shifts babysitting for the day--resulting in twelve hours of hilarious misadventures with one unexpected twist.\n1996, Color, 109 Minutes', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(46, 46, 'United States', 1, 0, 0, '', '024543-001553', 114, 'Owned', 'Drive Me Crazy', '', '', '', '1999', '2000-03-14', 91, 'Keep Case', 0, 'USD', '19.98', 'Opposites attract with irresistible force in this fresh, funny, feel-good comedy about two mismatched teens who scheme to make their ex''s jealous. Melissa Joan Hart (TV''s Sabrina the Teenage Witch) is "picture perfect" (CBS-TV, Fort Worth) as a peppy preppy who performs the ultimate makeover on her scruffy next-door neighbor (Adrian Grenier) and discovers this former "frog" was really a prince all along! With a screenplay by Rob Thomas (Dawson''s Creek), a cast featuring today''s hottest young stars, plus the hit singles "Crazy" (Britney Spears), and "I Want It That Way" (Backstreet Boys) Drive Me Crazy is "worth celebrating!" (Detroit Free Press)', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(47, 47, 'United States', 1, 0, 0, '', '024543-003519', 470, 'Owned', 'Entrapment', 'Special Edition', '', 'United States', '1999', '2000-04-04', 113, 'Keep Case', 0, 'USD', '19.95', 'Sean Connery (''The Rock'') and Catherine Zeta-Jones (''The Mask of Zorro'') blaze a trail of spectacular action in "the most enjoyable thriller of 1999!" (SRN RADIO NETWORK)\n\nWhen a priceless Rembrandt is stolen in New York, the evidence points to a solitary master thief (Connery), who is about to meet the insurance company''s most cunning - and seductive - investigator (Zeta-Jones). Following a nerve-racking game of cat and mouse, the two join forces...or so it seems...to attempt a daring multibillion-dollar heist tied to the dawn of the new millennium.', '', 'USD', '19.95', '2008-01-21', '2016-11-15 00:00:00', NULL),
(48, 48, 'United States', 1, 0, 0, '', '024543-005315', 563, 'Owned', 'My Cousin Vinny', '', '', '', '1992', '2000-07-25', 120, 'Keep Case', 0, 'USD', '29.98', 'In this must-see comedy hit, two carefree pals traveling through Alabama are mistakenly arrested and charged with murder. Fortunately, one of them has a lawyer friend in the family  Vincent Gambini (Joe Pesci), a former auto mechanic from Brooklyn who has never been in court  or in Alabama. When cousin Vinny arrives with his leather-clad girlfriend (Marisa Tomei in her Oscarwinning performance) to handle his first case, its a real shock  for him and the deep south!', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(49, 49, 'United States', 1, 0, 0, '', '024543-005384', 650, 'Owned', 'Edward Scissorhands', '10th Anniversary Edition', '', 'United States', '1990', '2000-09-05', 105, 'Keep Case', 0, 'USD', '19.95', 'Once upon a time in a castle high on a hill lived an inventor whose greatest creation was named Edward. Although Edward had an irresistible charm, he wasn''t quite perfect. The inventor''s sudden death left him unfinished, with sharp shears of metal for hands. Edward lived alone in the darkness until one day a kind Avon lady took him home to live with her family. So began Edward''s fantastical adventures in a pastel paradise known as Suburbia.\n\nFrom Tim Burton comes an unforgettable fairy tale starring Johnny Depp, Winona Ryder, Dianne West and Vincent Price as the Inventor.', '', 'USD', '19.95', '2009-09-27', '2016-11-15 00:00:00', NULL),
(50, 50, 'United States', 1, 0, 0, '', '024543-006350', 67, 'Owned', 'Where the Heart Is', '', '', '', '2000', '2000-09-26', 120, 'Keep Case', 0, 'USD', '34.98', 'Ashley Judd and Natalie Portman star in this offbeat, delicious slice of life about a down-on-her-luck southern teen who, after gaining 15 minutes of fame for giving birth to "The Wal-Mart Baby", begins to put her life together with the help of the kind, quirky strangers who become her surrogate family.\n     Based on the #1 best-selling novel by Bellie Letts, this "brilliantly funny, deeply moving, beautifully acted" (KNX/CBS Radio) film co-stars Stockard Channing and Joan Cusack in an inspiring celebration of love and friendship.', '', 'USD', '34.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(51, 51, 'United States', 1, 0, 0, '', '024543-006428', 572, 'Owned', 'X-Men', '', '', '', '2000', '2000-11-21', 104, 'Digipak', 0, 'USD', '29.98', 'Born into a world filled with prejudice are children who posses extraordinary and dangerous powers--the result of unique genetic mutations. Cyclops unleashes bolts of energy from his eyes. Storm can manipulate the weather at will. Rogue absorbs the life force of anyone she touches. But under the tutelage of Professor Xavier (Patrick Stewart), these and other outcasts learn to harness their powers for the good of mankind. Now they must protect those who fear them as the nefarious Magneto (Ian McKellen), who believes humans and mutants can never co-exist, unveils his sinister plan for the future!', '', 'USD', '29.98', '2005-03-09', '2016-11-15 00:00:00', NULL),
(52, 52, 'United States', 1, 0, 0, '', '024543-008132', 111, 'Owned', 'Bedazzled', 'Special Edition', '', '', '2000', '2001-03-13', 93, 'Keep Case', 0, 'USD', '26.98', 'The Devil''s never been so hot or hilarious! Brendan Fraser is a hapless, love-starved computer technician who falls prey to sinfully sexy Elizabeth Hurley when he agrees to sell her his soul in exchange for seven wishes. But the sly Princess of Darkness has more than a few tricks up her...  sleeve. And before you can say Fire and Brimstone, Elliot''s life becomes a hysterical hell on earth.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(53, 53, 'United States', 1, 0, 0, '', '024543-010920', 471, 'Owned', 'The Siege', 'Enhanced Widescreen', '', 'United States', '1998', '2000-12-26', 116, 'Keep Case', 0, 'USD', '29.98', 'BRUCE WILLIS and DENZEL WASHINGTON deliver action and mayhem in this edge-of-your-seat thrill ride from the director of "Courage Under Fire" and "Glory."\n\nWhen a crowded city bus blows up in Brooklyn and a campaign of terror begins to make its bloody mark on the streets of New York, it''s up to FBI special agent Anthony "Hub" Hubbard (Washington) and U.S. Army General William Devereaux (Willis) to find out who''s responsible...and put an end to the destruction. Together, they face explosive danger at every turn when they team up to wage an all-out war against a ruthless band of terrorists. \n\nCo-starring Annette Bening ("The American President") and Tony Shalhoub ("Men in Black"), THE SIEGE is a "tense and nerve-wracking" (Los Angeles Times) action-adventure that''s "packed with excitement and surprises!" (Journal News).', '', 'USD', '29.98', '2008-01-21', '2016-11-15 00:00:00', NULL),
(54, 54, 'United States', 1, 0, 0, '', '024543-013693', 169, 'Owned', 'Nine Months', '', '', '', '1995', '2001-04-17', 106, 'Keep Case', 0, 'USD', '19.99', 'In this hilarious comedy about pregnancy, parenthood and panic, Sam (Hugh Grant) has it all: a wonderful girlfriend,  a successful child psychology practice and a red porche. But all that changes when his girlfriend (Julianne Moore) tells him she''s pregnant. Torn between advice from an overbearing couple (Tom Arnold, Joan Cusack), his bachelor buddy (Jeff Goldblum) and a crazy Russian gynecologist (Robin Williams), Sam''s got nine months to grow up - or risk losing it all!', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(55, 55, 'United States', 1, 0, 0, '', '024543-018704', 411, 'Owned', 'Love Potion #9', '', '', '', '1992', '2001-05-01', 96, 'Keep Case', 0, 'USD', '26.95', 'In this charming romantic comedy, a brilliant but lonely biochemist ''(Tate Donovan)'' gets a mysterious potion from a gypsy who guarantees it will turn his life around. After showing it to his co-worker ''(Sandra Bullock)'', a shy animal psychobiologist, they achieve amazing amorous results in a chimpanzee experiment. Now the only way to see if it works on humans is to test it on themselves.', '', 'USD', '26.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(56, 56, 'United States', 1, 0, 0, '', '024543-020189', 285, 'Owned', 'Dr. Dolittle', '', '', 'United States', '1998', '2001-10-23', 85, 'Keep Case', 0, 'USD', '19.99', 'Treat yourself to a healthy dose of Eddie Murphy''s untamed animal magnetism in the smash hit comedy that''ll make you "roar, howl and hoot with laughter!" (NBC-TV) A successful physician and devoted family man, John Dolittle (Murphy) seems to have the world by the tail, until a long-suppressed talent he possessed as a child - the ability to communicate with animals is suddenly reawakened...with a vengeance! Now every creature within a squawking distance wants the good doctor''s advice, unleashing an outrageous chain of events that turn his world upside down! Featuring an all-star menagerie of voice talent (including Chris Rock, John Leguizamo, Norm MacDonald, Albert Brooks, Garry Shandling and Ellen DeGeneres), this wild and woolly free-for-all is your prescription for hilarious hijinks and "mischievous fun!" (THE NEW YORK TIMES)', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(57, 57, 'United States', 1, 0, 0, '', '024543-023128', 215, 'Owned', 'Someone Like You', '', '', '', '2001', '2001-09-18', 97, 'Keep Case', 0, 'USD', '29.98', 'Ashley Judd brings irresistible fun to this sassy romantic comedy about a young woman looking for Mr. Right--in all the wrong places! Judd stars as Jane Goodale, a talk show talent scout whose shaky love life drives her into an intensive comparison study of the curious mating habits of the male animal. From there, dizzyingly sexy complications ensue when her research transforms her into a revered love guru, and lands her smack in between hunky heartthrobs Hugh Jackman and Greg Kinnear.', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL);
