(58, 58, 'United States', 1, 0, 0, '', '024543-026631', 611, 'Owned', 'Broken Arrow', '', '', '', '1996', '2002-09-03', 108, 'Keep Case', 0, 'USD', '19.99', 'Major Deakins is a tough U.S. Air Force pilot who is assigned to a flight mission with ''nice-guy'' Captain Hale. They are to fly the B3 Stealth Bomber on wargame maneuvers over Utah loaded with two live nuclear weapons. Deakins, having been continually passed over for promotion, sells out his country and arranges to use the thermonuclear warheads under his command to blackmail the U.S. government. The only thing standing in his way is his old buddy, Captain Hale....Terriosts steal Nuclear Warhead from US government but don''t  count on a pilot and park ranger spoiling their plans.\n\n  "Broken Arrow" is a term used to describe a Nuclear device that has been lost..  A high stake game of cat and mouse.', '', 'USD', '19.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(59, 59, 'United States', 0, 0, 0, 'Digital', '024543-026648', 1029, 'Owned', 'Office Space', '', '', 'United States', '1999', '1999-08-31', 90, 'Keep Case', 0, 'USD', '24.98', 'Fasten your ergonomic seat belt.. You''re in for a hilarious ride through the inner workings of Office Space, the outrageous hit comedy that " will strike fear into the little hearts of bosses everywhere."\nUnable to endure another mind-numbing day at Initech Corporation, cubicle slave Peter Gibbons (Ron Livingston) gets fired up..and decides to get fired. Armed with a leisurely new attitude and a sexy new girlfriend (Jennifer Aniston), he soon masters the art of neglecting his job, which quickly propels him into the ranks of upper management!', '', 'USD', '24.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(60, 60, 'United States', 1, 0, 0, '', '024543-026686', 243, 'Owned', 'Dr. Dolittle 2', 'Special Edition', '', 'United States', '2001', '2001-10-23', 87, 'Keep Case', 0, 'USD', '26.98', 'Superstar Eddie Murphy returns as the beloved doctor with the up-ROAR-ious ability to talk to the animals. This time around, Dolittle plays Cupid to a bumbling circus bear to help a group of forest creatures save their habitat. With the aid of his mangy madcap animal friends, Dolittle must teach this overgrown teddy the ways of true romance in time to save his species and his home!', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(61, 61, 'United States', 1, 0, 0, '', '024543-028437', 688, 'Owned', 'The Poseidon Adventure', '', '', 'United States', '1972', '2001-12-18', 117, 'Keep Case', 0, 'USD', '29.98', 'One of the most gripping disaster films of all time follows ten survivors as they struggle to escape from an ocean liner capsized by a tidal wave. Suspenseful terror, combined with the victim''s intimate and personal stories, results in compelling and heart-stopping drama. The distinguished talents of 15 Academy Award winners, along with incredible special effects, make this film a true classic.', '', 'USD', '29.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(62, 62, 'United States', 1, 0, 0, '', '024543-029243', 250, 'Owned', 'The Sandlot', '', '', '', '1993', '2002-01-29', 101, 'Keep Case', 0, 'USD', '19.98', 'They''re more than a team. They''re the best buddies in the entire history of the world.\n\nIt''s the early 1960''s and 5th grader Scotty Smalls has just moved into town with his folks. Kids call him a dork because he can''t even throw a baseball! But that changes when the leader of the neighborhood gang recruits him to play on the nearby sandlot field. It''s the beginning of a magical summer of baseball, wild adventures, first kisses, and fearsome confrontations with the dreaded beast and its owner (Jones) who live behind the left field fence. Soon nine boys have become best friends, Scotty is apart of a team and their legend, in this hilarious and warmhearted comedy.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(63, 63, 'United States', 1, 0, 0, '', '024543-037804', 695, 'Owned', 'Predator', 'Full Screen', '', '', '1987', '0000-00-00', 107, 'Keep Case', 0, 'USD', '19.99', 'Arnold Schwarzenegger stars in this action-packed adventure story of fighting men pitted against an unseen enemy, a force more powerful than their fiercest weapons. Recruited by the CIA to rescue hostages held by guerrilla fighters in a Central American country, Schwarzenegger and his men encounter an enemy unimaginably more deadly than any on Earth--because the Predator is not of this Earth. Packed with spectacular special effects and combat scenes of gut-wrenching power, Predator is the most terrifying Schwarzenegger movie yet.', '', 'USD', '19.99', '2009-10-25', '2016-11-15 00:00:00', NULL),
(64, 64, 'United States', 1, 0, 0, '', '024543-040965', 404, 'Owned', 'Planet of the Apes', '', '', '', '2001', '2002-03-05', 124, 'Keep Case', 0, 'USD', '19.98', 'After a spectacular crash-landing on an uncharted planet, brash astronaut Leo Davidson (Mark Wahlberg) finds himself trapped in a savage world where talking apes dominate the human race. With the help of a sympathetic chimpanzee named Ari (Helena Bonham Carter), Leo must evade the invincible gorilla army led by the ruthless General Thade (Tim Roth) and his most trusted warrior, Attar (Michael Clarke Duncan). Now the pulse-pounding race is on to reach a sacred temple that may hold the shocking secrets of mankind''s past and the last hope for its salvation!', '', 'USD', '19.98', '2007-08-09', '2016-11-15 00:00:00', NULL),
(65, 65, 'United States', 1, 0, 0, '', '024543-046646', 381, 'Owned', 'Ice Age', '2-Disc Special Edition', '', 'United States', '2002', '2002-11-26', 81, 'Keep Case', 0, 'USD', '29.95', 'They came...they thawed...they conquered the hearts of audiences everywhere in the coolest animated adventure of all time! \n\nHeading south to avoid a bad case of global frostbite, a group of migrating misfit creatures embark on a hilarious quest to reunite a human baby with his tribe.\n\nFeaturing an all-star cast including Ray Romano, John Leguizamo and Denis Leary, ''Ice Age'' is "a pure delight" (''New York Daily News'') for all ages!', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(66, 66, 'United States', 1, 0, 0, '', '024543-046929', 321, 'Owned', 'Hot Shots!', '', '', 'United States', '1991', '2002-08-06', 85, 'Keep Case', 0, 'USD', '24.99', 'CHARLIE SHEEN, LLOYD BRIDGES, CARY ELWES, VALERIA GOLINO and JON CRYER co-star in director Jim Abrahams'' (''Airplane'', ''Naked Gun'') truly hilarious spoof of ''Top Gun.'' Recruited to join a top-secret mission for the Air Force, a renegade pilot (SHEEN) finds himself coping with an incompetent admiral (BRIDGES) and a carefully selected squadron of flyers who are either inept or half-blind. He also winds up in competition with the corps'' model of military perfection (ELWES) for the heart of the base''s sultry psychiatrist (GOLINO).', '', 'USD', '24.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(67, 67, 'United States', 1, 0, 0, '', '024543-046950', 423, 'Owned', 'Hot Shots! Part Deux', '', '', 'United States', '1993', '2002-08-06', 88, 'Keep Case', 0, 'USD', '19.98', 'In this hilarious "Hot Shots!" sequel, former renegade pilot Topper Harley (Charlie Sheen) is once again recruited for a secret mission. This time the country''s incompetent president (Lloyd Bridges) sends him to the Middle East to rescue U.S. hostages and the countless men who have already been sent in to rescue them. Pining for his former lover (Valeria Golino) in a Buddhist temple, Topper manages to pull himself together and sets out on his laugh-filled, action-packed task.', '', 'USD', '19.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(68, 68, 'United States', 1, 0, 0, '', '024543-046998', 3, 'Owned', 'Anywhere But Here', '', '', '', '1999', '2002-08-27', 114, 'Keep Case', 0, 'USD', '19.98', 'Adele is a flashy, flirtatious dreamer. Her daughter Ann is a quiet, no-nonsense realist. On the surface, they''re like oil and water, but deep down, they''re two of a kind. "Susan Sarandon makes magic" (Chicago Tribune) and "Natalie Portman soars" (NY-1) in this funny and touching story about a mother who knows best... and a daughter who knows better!', '', 'USD', '19.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(69, 69, 'United States', 1, 0, 0, '', '024543-051459', 590, 'Owned', 'High Crimes', '', '', '', '2002', '2002-08-27', 115, 'Keep Case', 0, 'USD', '27.98', 'High powered lawyer Claire Kubik finds her world turned upside down when her husband, who she thought was Tom Kubik, is arrested and is revealed to be Ron Chapman. Chapman is on trial for a murder of Latin American villagers while he was in the Marines. Claire soon learns that to navigate the military justice system, she''ll need help from the somewhat unconventional Charlie Grimes; meanwhile, Claire''s sister, Jackie, is falling in love with wet-behind-the-ears Lieutenant Embry assigned as the official defense lawyer. And most of the eyewitnesses have rather too conveniently died.', '', 'USD', '27.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(70, 70, 'United States', 1, 0, 0, '', '024543-056157', 481, 'Owned', 'Star Wars: Episode II: Attack of The Clones', 'Full Screen', '', 'United States', '2002', '2002-11-12', 142, 'Keep Case', 0, 'USD', '29.98', 'The Star Wars saga continues on DVD with Episode II Attack of the Clones. Anakin Skywalker has grown into an accomplished Jedi apprentice, and he faces his most difficult challenge yet as he must choose between his Jedi duty and forbidden love. Relive the adventure the way it was meant to be seen in spectacular digital clarity, including the climactic Clone War battle and Jedi Master Yoda in the ultimate lightsaber duel. Experience this 2 disc set that features over six hours of bonus materials, and see how Episode II unlocks the secrets of the entire Star Wars saga.  \n\nFeatures: \nDisc One\nCommentary by George Lucas, Rick McCallum, Ben Burtt, Rob Coleman, Pablo Helman, John Knoll, and Ben Snow\n\nDisc Two\nEight Deleted Scenes created just for this release, with introductions from George Lucas, Rick McCallum, and Ben Burtt\nWitness the revolution in digital character animation in the all new, full length documentary, "From Puppets to Pixels: featuring the creation of digital Yoda, Dexter, Jettster and more.\nExclusive Documentary, "State of the Art: The Previsualization of Episode II"\nFollow Ben Burtt and his team as they explain the process of creating the sound for Episode II in the all new documentary, "Films are not Released; They Escape"\nThree Featurettes explore Attack of the Clones storyline, action scenes and love story\nComprehensive award winning twelve part web documentary series\n"Across the Stars" music video featuring John Williams\nTheatrical Teaser and Launch Trailer, and Twelve TV Spots\nTheatrical Posters and Print Campaign from around the world\n"R2-D2: Beneath the Dome" mockumentary Trailer\nNever Before Seen Production Photo Gallery with special caption feature\nEpisode II Visual Effects Breakdown Montage\nDVD-ROM weblink to exclusive Star Wars Content', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(71, 71, 'United States', 1, 0, 0, '', '024543-057024', 212, 'Owned', 'Like Mike', '', '', 'United States', '2002', '2002-12-10', 100, 'Keep Case', 0, 'USD', '27.98', 'Teenage rap sensation Lil Bow Wow makes his feature film debut in this "surefire heart-warmer" (Los Angeles Times) about an orphan boy named Calvin who lvies out his dream of playing in the NBA -- with a little help from a magical pair of sneakers! Soon after he laces up the mysterious high-tops, Calvin''s amazing basketball skills land him a spot on the Los Angeles Knights team. In addition to hitting 25-foot jumpers and throwing down rim-rattling dunks, the small superstar sets his sights on another dream having a family. But first he and his pals must defeat Bittleman, the orphanage headmaster trying to sabotage Calvin''s career and dash his hopes of ever being adopted. Filled with high flying fun and hilarious hijinks, Like Mike will have your whole family cheering into overtime!', '', 'USD', '27.98', '2008-01-17', '2016-11-15 00:00:00', NULL),
(72, 72, 'United States', 1, 0, 0, '', '024543-057628', 132, 'Owned', 'Never Been Kissed', '', '', '', '1999', '2003-01-14', 108, 'Keep Case', 0, 'USD', '19.98', 'Eight years ago she was a total geek; now shes back to get it right! Drew Barrymore is brilliant! (Jonathan Foreman, New York Post) in this hilarious, heartwarming comedy about that wacky wonderland of homework, hot lunches and raging hormones known as high school. \n\nNewspaper reporter Josie Geller (Barrymore) is going undercover as a student to learn about todays teens. At first shes thrilleduntil she remembers her nickname: Josie Grossie. Can a former clueless nerd navigate the hallways of high school without tripping over her own feet?', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
