(74, 74, 'United States', 1, 0, 0, '', '024543-064022', 701, 'Owned', 'Predator 2', '', '', 'United States', '1990', '2003-02-04', 108, 'Keep Case', 0, 'USD', '14.95', 'This electrifying action sequel unleashes the deadly invisible ''Predator'' in another jungle - the urban jungle of Los Angeles. Danny Glover stars as a lieutenant who mistakenly concludes that mangled bodies found by the police are the work of feuding gangs. Instead, he finds himself confronting a savage alien who has come from a distant world to hunt humans for sport. Gary Busey and Ruben Blades co-star in this suspense-packed, high-tech thriller.', '', 'USD', '14.95', '2009-10-25', '2016-11-15 00:00:00', NULL),
(75, 75, 'United States', 1, 0, 0, '', '024543-072331', 126, 'Owned', 'Just Married', '', '', '', '2003', '2003-06-17', 95, 'Keep Case', 0, 'USD', '14.99', 'It was the perfect honeymoon... Until it began. \n\nAshton Kutcher and Brittany Murphy take the cake in this outrageous comedy hit that proves love and laughter are the perfect match!\n\nSarah (Murphy) is a happy-go-lucky rich girl whose meddling family is as snobbish as it is wealthy. Tom (Kutcher) is a hope-I-get-lucky party guy who prefers sports bars over fancy cars. But opposites attract sidesplitting fun when these two young newlyweds embark on their perfectly-planned European honeymoon with disastrous - and hilarious - results!', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(76, 76, 'United States', 1, 0, 0, '', '024543-092063', 503, 'Owned', 'X2:  X-Men United', '', '', '', '2003', '2003-11-25', 133, 'Keep Case', 0, 'USD', '29.98', 'The time has come for those who are different to stand united.\n\nAlready living in a society that mistrusts them, the mutants are faced with even more discrimination after an unforeseen enemy - who may be a mutant with extraordinary powers - launches a devastating attack. The news of the assault causes a public outcry against the mutants, including renewed support for the Mutant Registration Act, and William Stryker, a military leader rumored to have experimented on mutants (possibly including Wolverine), is among the most vocal supporters of the legislation. Stryker puts into motion a plan to eradicate the mutants and begins an offensive on the X-Men mansion and school. Magneto, having escaped from his plastic prison, forms an unlikely alliance with Professor Xavier to stop Stryker. Meanwhile, Wolverine heads north to investigate his past.', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
