(78, 78, 'United States', 1, 0, 0, '', '024543-098508', 515, 'Owned', 'Alien', '', '', 'United States', '1979', '2003-12-02', 117, 'Digipak', 1, 'USD', '26.98', 'When the crew of the space-tug Nostromo answers a distress signal from a desolate planet, they discover a deadly life form that breeds within a human host. And so the horror begins - a horror which will end the lives of six crewmembers and alter the life of the seventh forever. Sigourney Weaver stars as Ellen Ripley in one of the most suspenseful and powerful science fiction films of all time.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(79, 79, 'United States', 1, 0, 0, '', '024543-098584', 513, 'Owned', 'Alien', '', '', 'United States', '1992', '2003-12-02', 145, 'Digipak', 0, 'USD', '26.98', 'The Terror Returns in the Third Chapter of the Alien sci-fi saga!\n\nContains the original 1992 theatrical version and the all-new 2003 special edition with 30 minutes of never before seen footage!\n\nRipley is the sole survivor after her escape pad crash-lands on Fiorina 161, a bleak planet inhabited by former inmates of a maximum-security facility. When she realizes an alien was also aboard her craft, she is shocked to learn the inmates possess no advanced technology or modern weapons. Yet no weapon can help Ripley after she learns that the alien terror has taken on a frightening and new personal dimension.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(80, 80, 'United States', 1, 0, 0, '', '024543-098621', 512, 'Owned', 'Alien Resurrection', '', '', 'United States', '1997', '2003-12-02', 116, 'Digipak', 0, 'USD', '26.98', 'The stunning conclusion to the Alien Sci-Fi Saga!\n\nContains the original 1997 theatrical version and the all-new 2003 Special Edition with an alternate opening and ending!\n\nTwo hundred years have passed since Ripley made the ultimate sacrifice on Fiorina 161. But over the years, and after seven horrific failures, scientists have finally cloned a perfect replica of Ripley, which includes the alien Queen growing inside her at the time of her death. But this new breed of alien is far more intelligent than its predecessors - a fact the scientists don''t realize until after The Betty has arrived with additional human hosts.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(81, 81, 'United States', 1, 0, 0, '', '024543-101901', 504, 'Owned', 'The League of Extraordinary Gentlemen', '', '', '', '2003', '2003-12-16', 120, 'Keep Case', 0, 'USD', '27.98', 'Prepare for the Extraordinary.\n\nA hunter, a scientist, a vampire, an invisible man, an immortal, a spy, a beast....when a masked madman known as "The Fantom" threatens to launch global Armageddon, legendary adventurer Allan Quatermain commands (Sean Connery) a legion of superheroes, the likes of which mankind has never seen. Now, despite fighting their own personal demons - and each other - they must join forces to save the world.', '', 'USD', '27.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(82, 82, 'United States', 1, 0, 0, '', '024543-114307', 595, 'Owned', 'Master And Commander: The Far Side Of The World', '', '', '', '2003', '2004-04-20', 138, 'Keep Case', 0, 'USD', '29.95', 'Based on author Patrick OBrians series of Aubrey/Maturin novels, the movie is set during the Napoleonic Wars. Crowe is Captain "Lucky" Jack Aubrey, renowned as a fighting captain in the British Navy, and Paul Bettany is ships doctor Stephen Maturin. Their ship, the H.M.S. Surprise, is suddenly attacked by a superior enemy. With the Surprise badly damaged and much of his crew injured, Aubrey is torn between duty and friendship as he pursues a high-stakes chase across two oceans, to intercept and capture his foe. Its a mission that can make his reputation  or destroy Lucky Jack and his crew.', '', 'USD', '29.95', '2005-09-17', '2016-11-15 00:00:00', NULL),
(83, 83, 'United States', 1, 0, 0, '', '024543-135593', 621, 'Owned', 'The Day After Tomorrow', 'Full Screen Edition', '', 'United States', '2004', '2004-10-12', 123, 'Keep Case', 1, 'USD', '29.98', 'In this pulse-pounding action-thriller, global warming triggers the onset of a new Ice Age. As tornadoes flatten Los Angeles and a tidal wave engulfs New York City, the entire Northern Hemisphere begins to freeze solid. Now, climatologist Jack Hall (Dennis Quaid), his son Sam (Jake Gyllenhaal) and a small band of survivors must ride out the growing superstorm and stay alive.', '', 'USD', '29.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
