(86, 86, 'United States', 1, 0, 0, '', '024543-157175', 702, 'Owned', 'AVP: Alien Vs. Predator', '', '', '', '2004', '2004-01-25', 100, 'Keep Case', 0, 'USD', '29.98', 'It may be our planet, but it''s their war!  The deadliest creatures from the scariest sci-fi movies ever made face off for the first time on film.\nThe incredible adventure begins when the discovery of an ancient pyramid buried in Antartica sends a team of scientists and adventurers to the frozen continent.  There, they make an even more terrifying discovery: two alien races engaged in the ultimate battle.  Whoever wins...we lose.', '', 'USD', '29.98', '2009-10-25', '2016-11-15 00:00:00', NULL),
(87, 87, 'United States', 1, 0, 0, '', '024543-160526', 10, 'Owned', 'First Daughter', '', '', '', '2004', '2005-01-25', 104, 'Keep Case', 0, 'USD', '27.95', 'Once Upon A Time there lived a lovely girl named Samantha. She had everything she could possibly wish for, and lived in a beautiful white house. The White House \n\nKatie Holmes stars as First Daughter Samantha Mackenzie  a sheltered young woman who just wants a normal school experience, away from the influence of her parents. Only trouble is, her dad (Michael Keaton) is the President of the United States! But nothing will stop Samantha, so, under Secret Service surveillance and a nonstop media glare, she meets  and falls hard for  a handsome student who has a secret existence of his own.', '', 'USD', '27.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
