(89, 89, 'United States', 1, 0, 0, '', '024543-174530', 612, 'Owned', 'Flight of the Phoenix', 'Widescreen Edition', '', 'United States', '2004', '2005-03-01', 113, 'Keep Case', 0, 'USD', '29.95', 'Dennis Quaid (''The Day After Tomorrow'') pilots an outstanding ensemble cast in this "adrenaline-pumping...sure-fire audience pleaser" (''The Orange County Register'') that delivers white-knuckle tension, high-soaring action and full-throttle excitement!\n\nA cargo plane on a routine flight suddenly hits a high-turbulence storm, forcing a crash landing hundreds of miles off course in the barren Gobi desert. Among the survivors, one eccentric passenger leads the crew to build a new plane -- against all odds, against all hope, and sometimes...against each other.', '', 'USD', '29.95', '2008-05-27', '2016-11-15 00:00:00', NULL),
