(92, 92, 'United States', 1, 0, 0, '', '024543-193845', 324, 'Owned', 'Robots', 'Full Screen', '', '', '2005', '2005-09-27', 89, 'Keep Case', 0, 'USD', '29.98', 'Fasten your seat bolts and gear up for a hilarious, heartwarming comedy that''s "fun for the whole family!" (Clay Smith, Access Hollywood)\nWith the help of his misfit mechanical friends, a small town robot named Rodney embarks on the adventure of a lifetime as he heads for the big city to pursue his dreams-- and ultimately proves that anyone can shine no matter what they are made of.\nFeaturing an all-star voice cast and a groundbreaking visual style that pushes the boundaries of animated filmaking, Robots is a dazzling, fun-filled feast for the eyes and a riveting good time for all ages!', '', 'USD', '29.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(93, 93, 'United States', 1, 0, 0, '', '024543-203162', 43, 'Owned', 'Star Wars: Episode III Revenge of the Sith', '', '', 'United States', '2005', '2005-11-01', 140, 'Keep Case', 0, 'USD', '24.95', 'Star Wars: Episode III - Revenge of the Sith (2005)\nIt has been three long years since the Clone Wars have first begun, and Jedi Knights Obi-Wan Kenobi (Ewan McGregor) and Anakin Skywalker (Hayden Christensen) have fought as hard as they possibly could. When the capital planet of Coruscant becomes under attack by the Separatist droid armies and Supreme Chancellor Palpatine (Ian McDiarmid) is kidnapped by the army leader, General Grievous (voiced by Matthew Wood), Anakin personal problems begin to develop, including his anger at the Jedi Council for not giving him the rank of Master, though he is on the council, and his plagued visions of his secret wife, Padme Amidala (Natalie Portman), dying in childbirth. He is determined to do anything to save her, no matter the cost. While Obi-Wan is sent to kill General Grievous on Utapau, Anakin is taken under Palpatine''s wing, being subtly seduced by the Dark Side of the Force and convince that the Dark Side is power than can save his wife from death. Soon enough, a new, darker, ominous figure that would eventually be feared by the entire galaxy is formed: Lord Darth Vader. Obi-Wan, discovering Anakin''s betrayal, sees no choice but to face his own apprentice in an attempt to bring back the young, loyal Jedi that had been like his own son, brother, and friend.', '', 'USD', '24.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(94, 94, 'United States', 0, 0, 0, 'Digital', '024543-203667', 944, 'Owned', 'The Transporter', 'Special Delivery Edition', '', 'France', '2002', '2005-08-30', 92, 'Keep Case', 1, 'USD', '19.95', 'Buckle up for the fist-flying, gun-blazing, action-packed ride of your life with the Special Delivery Edition of <i>The Transporter</i>. Packed with high-octane, never-before-seen extras, this all-new DVD release delivers!\n\nFrank Martin (Jason Statham) is the best at what he does: transporting illegal goods with no questions asked. But his latest shipment, a beautiful young woman kidnapped by slave traders, brings deadly complications to his delivery plans. Now Frank must kick into overdrive to save his cargo  and his life.', '', 'USD', '19.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(95, 95, 'United States', 1, 0, 0, '', '024543-211495', 7, 'Owned', 'Fever Pitch', '', '', '', '2005', '2005-09-13', 103, 'Keep Case', 0, 'USD', '21.95', '"A Grand Slam Comedy!" -- The Today Show\n\nAccording to Red Sox super-fan Ben Wrightman (Jimmy Fallon), finding romance is about as unlikely as his beloved team winning it all. But when Ben scores a beautiful new girlfriend named Lindsey (Drew Barrymore), suddenly anything is possible. That is, until baseball season begins, and Lindsey finds herself competing with an entire baseball team - the Boston Red Sox - for her boyfriend''s heart and soul. Will Ben''s obsession with the Sox put his passion for Lindsey on the bench, or will love win out? And can his team finally break the curse of the Bambino? Hilarious and wildly entertaining, Fever Pitch scoresia home run!', '', 'USD', '21.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
