(97, 97, 'United States', 1, 0, 0, '', '024543-213628', 63, 'Owned', 'Fantastic 4', '', '', '', '2005', '2005-12-06', 106, 'Keep Case', 0, 'USD', '29.98', 'Jessica Alba, Chris Evans and Michael Chiklis head a sexy, star-powered cast in this explosive adventure about a quartet of flawed, ordinary human beings who suddenly find themselves with extraordinary abilities.\n\nAfter exposure to cosmic radiation, four astronauts become the most remarkable, if dysfunctional, superheroes of all time. Unfortunately, the mission''s sponsor has also been transformed - into the world''s most lethal supervillain - setting the stage for a confrontation of epic proportions. Packed with nonstop action, big laughs and awesome special effects, Fantastic Four is exhilarating fun from start to finish!', '', 'USD', '29.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(98, 98, 'United States', 1, 0, 0, '', '024543-213710', 61, 'Owned', 'Mr. & Mrs. Smith', '', '', '', '2005', '2005-11-29', 120, 'Keep Case', 0, 'USD', '29.98', 'Brad Pitt and Angelina Jolie smolder in this sizzling action film from the director of ''The Bourne Identity''.  After five (or six) years of vanilla-wedded bliss, ordinary suburbanities John and Jane Smith (Pitt and Jolie) are stuck in a rut the size of the Grand Canyon -- until the truth comes out! Unbeknownst to each other, they are both coolly lethal, highly paid assassins working for rival organizations. And when they discover they''re each other''s next target, their secret lives collide in a fun, explosive mix of wicked comedy, pent-up passion, nonstop action and high-tech weaponry that gives an all-new meaning to "Till death do us part!"', '', 'USD', '29.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
