(101, 101, 'United States', 1, 0, 0, '', '024543-234555', 142, 'Owned', 'Dr. Dolittle 3', '', '', 'United States', '2006', '2006-04-25', 93, 'Keep Case', 0, 'USD', '21.95', 'Maya Dolittle (Kyla Pratt) just wants to be a normal teenager, but there''s one small problem...she''s inherited her father''s uncanny ability to talk to animals. Her special talent keeps landing her in the doghouse with her parents, and it''s driving her friends completely ape!\n\nAt a summer dude ranch, Maya tries to hide her unique talent so she can fit in, but when her friends are in trouble, she comes to the rescue as only a Dolittle can - enlisting the aid of the ranch''s uproarious and outrageous talking animals. This hilarious third installment of the wildly popular Dr. Dolittle series is more family fun than a barrel of monkeys...and a lot easier to clean up after!', '', 'USD', '21.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(102, 102, 'United States', 0, 0, 0, 'Digital', '024543-244103', 945, 'Owned', 'Transporter 2', '', '', 'France', '2005', '2006-01-10', 87, 'Keep Case', 0, 'USD', '29.95', 'The best in the business is back in the game! Jason Statham returns in his signature role as ex-Special Forces operative Frank Martin aka "The Transporter." Now retired from his chosen profession of moving dangerous goods with no questions asked, he makes a living driving for a wealthy family in Miami, Florida. But when their young son is abducted, Frank must use his battle-tested combat skills to save the boy and thwart the kidnapper''s nefarious master plan. Packed with high-octane car chases and high-flying martial arts action, Transporter 2 delivers nonstop excitement from beginning to end!', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(103, 103, 'United States', 1, 0, 0, '', '024543-244868', 490, 'Owned', 'The Omen', 'Collector''s Edition', '', 'United Kingdom', '1976', '2006-06-20', 111, 'Keep Case', 1, 'USD', '26.98', 'Unleash the dark terror of Damien with this spectacular, two-disc Collector''s Edition of the "taut" (''Variety''), "gripping" (''Los Angeles Herald Examiner'') and Oscar-winning horror classic! Now with over six hours of special features, including audio commentaries, a deleted scene, documentaries, featurettes and much, much more, ''The Omen'' is "just the ticket to scare the devil out of you" (''Family Circle'')!\n\nWhen their child is stillborn in Rome - on the 6th day, of the 6th month at the 6th hour - Robert Thorne, an American diplomat (Academy Award-winner Gregory Peck), and his wife Katherine (Lee Remick) are devastated. In his despair, Thorne exchanges his dead baby for one born at the same time...and unwittingly enters a bargain with the devil that culminates in a series of gruesome ''accidents''...and a child destined to one day destroy the world!', '', 'USD', '26.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(104, 104, 'United States', 1, 0, 0, '', '024543-376521', 269, 'Owned', 'The Devil Wears Prada', '', '', '', '2006', '2006-12-12', 109, 'Keep Case', 0, 'USD', '19.99', 'Based on the hilarious best-selling novel, this sinfully funny movie starring Academy Award winner Meryl Streep and Anne Hathaway is "sensationally entertaining in every way" (Maxim). As assistant to impossibly demanding New York fashion magazine editor Miranda Priestly (Streep), young Andy Sachs (Hathaway) has landed a job that "a million girls would die for." Unfortunately, her heaven-sent appointment as Miranda''s personal whipping girl just might be the death of her!', '', 'USD', '19.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
(105, 105, 'United States', 1, 0, 0, '', '024543-377832', 304, 'Owned', 'Ice Age: The Meltdown', 'Full Screen Edition', '', '', '2006', '2006-11-21', 91, 'Keep Case', 0, 'USD', '29.98', 'Your favorite sub-zero heroes are back for another incredible adventure in the super-cool animated comedy Ice Age: The Meltdown! The action heats up - and so does the temperature - for Manny, Sid, Diego and Scrat. Trying to escape the valley to avoid a flood of trouble, the comical creatures embark on a hilarious journey across the thawing landscape and meet Ellie, a female woolly mammoth who melts Manny''s heart. With its dazzling animation, unforgettable characters and new Scrat short, Ice Age: The Meltdown is laugh-out-loud fun for the whole family!', '', 'USD', '29.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(106, 106, 'United States', 1, 0, 0, '', '024543-380634', 309, 'Owned', 'My Super Ex-Girlfriend', '', '', 'United States', '2006', '2006-12-19', 96, 'Keep Case', 0, 'USD', '29.98', 'SUPERstars Uma Thurman and Luke Wilson deliver unstoppable fun in this hilarious hit comedy directed by Ivan Reitman (''Meatballs'', ''Stripes'').\n\nMatt Saunders (Wilson) thinks he''s found the perfect girlfriend in Jenny Johnson (Thurman), who just happens to be smart, sexy...and a superhero. But when Jenny turns out to be a needy, neurotic mess, Matt wants to call it quits. Jenny is crushed by the news and will stop at nothing to exact sweet revenge.\n\nIt''s an outrageous super-comedy that proves breaking up can be hard to do - and downright dangerous!', '', 'USD', '29.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(107, 107, 'United States', 1, 0, 0, '', '024543-387381', 414, 'Owned', 'Garfield: A Tail of Two Kitties', '', '', 'United States', '2006', '2006-10-10', 84, 'Keep Case', 1, 'USD', '29.98', 'Breckin Meyer, Jennifer Love Hewitt and Bill Murray return in another adventure with America''s favorite fat cat is back, and this time, Garfield''s giving England the royal treatment! It''s a British invasion of a different kind when Garfield (Murray), along with pals Jon (Meyer) and Odie, travels to London and meets his mirror-image in Prince, an aristocratic kitty who has inherited a fabulous castle. The two trade places, and soon Garfield is living large as only he can! There''s just one problem: the dastardly Lord Dargis wants him out of the picture. ''Garfield: A Tail of Two Kitties'' is twice the laughs and double the fun for the whole family. It''s good to be the king!', '', 'USD', '29.98', '2007-08-09', '2016-11-15 00:00:00', NULL),
(108, 108, 'United States', 1, 0, 0, '', '024543-408413', 367, 'Owned', 'The Illusionist', '', '', 'United States', '2006', '2007-01-09', 109, 'Keep Case', 0, 'USD', '29.98', 'Unlock the mysteries of the year''s most spellbinding film from the producers of Crash and Sideways! Oscar nominees Paul Giamatti and Edward Norton lead an all-star cast in this "stunning" film (USA Today) that conjures an exhilarating blend of suspense, romance and mind-bending twists. The acclaimed illusionist Eisenheim (Norton) has not only captured the imaginations of all of Vienna, but also the interest of the ambitious Crown Prince Leopold (Rufus Sewell). But when Leopold''s new fianc (Jessica Biel) rekindles a childhood fascination with Eisenheim, the Prince''s interest evolves into obsession...and suddenly the city''s Chief Inspector (Giamatti) finds himself investigating a shocking crime. But even as the Inspector engages him in a dramatic challenge of wills, Eisenheim prepares for his most impressive illusion yet in this "mesmerizing" (Entertainment Weekly) and "beautifully acted" (Good Morning America) film that "teases you until the very end!" (The New York Times).', '', 'USD', '29.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(109, 109, 'United States', 1, 0, 0, '', '024543-417224', 332, 'Owned', 'Night At The Museum', '', '', 'United States', '2006', '0000-00-00', 110, 'Keep Case', 0, 'USD', '19.99', 'Ben Stiller leads an all-star cast, including Robin Willians in this hilarious blockbuster hit. Whey Larry Daley (Stiller) is hired as Museum night watchman, hes soon discovers that all the exhibits come to life after the sun sets. Can he figure out a way to control the chaos and become a hero in his son''s eyes? Boasting jaw-dropping special effects and big laughs, Night a the Museum is you ticket to non-stop fun!', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(110, 110, 'United States', 0, 0, 0, 'Digital', '024543-444640', 989, 'Owned', 'Sunshine', '', '', 'United States', '2007', '2008-01-08', 108, 'Keep Case', 0, 'USD', '29.98', 'It is the year 2057, the sun is dying and mankind faces extinction. Earth''s last hope rests with a courageous crew of eight men and women on a mission to ignite the fading star with a massive nuclear weapon. Deep into their voyage, out of radio contact with Earth, their mission begins to unravel and they find themselves fighting not only for their lives, but for the future of us all. With twists and turns you won''t see coming, this pulse-pounding journey to the sun is a nonstop thrill ride.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(111, 111, 'United States', 1, 0, 0, '', '024543-469810', 93, 'Owned', '28 Weeks Later', 'Fullscreen', '', 'United Kingdom', '2007', '2007-10-09', 113, 'Custom', 0, 'USD', '39.98', 'The film picks up six months after the Rage virus has spread throughout the city of London. The United States Army has restored order and is repopulating the quarantined city, when a carrier of the Rage virus enters London and unknowingly re-ignites the spread of the deadly infection, wreaking havoc on the entire population. The virus is not yet dead, and this time it''s more dangerous than ever!!', '', 'USD', '39.98', '2008-01-26', '2016-11-15 00:00:00', NULL),
(112, 112, 'United States', 1, 0, 0, '', '024543-470779', 94, 'Owned', 'Fantastic 4: Rise of the Silver Surfer', '', '', 'United States', '2007', '2007-10-02', 92, 'Keep Case', 0, 'USD', '29.98', 'Brace yourself for nonstop action and super-powered fun in this fantastically entertaining smash hit! "Invisible Woman" Sue Storm and "Mr. Fantastic" Dr. Reed Richards are about to be married when a mysterious alien--the Silver Surfer--crashes the proceedings and heralds Earth''s impending destruction. With time running out, the Fantastic Four reluctantly team up with the nefarious Dr. Doom in a thrilling effort to save our planet!', '', 'USD', '29.98', '2008-01-26', '2016-11-15 00:00:00', NULL),
(113, 113, 'United States', 1, 0, 0, '', '024543-476160', 301, 'Owned', 'Live Free or Die Hard', '', '', 'United States', '2007', '2007-11-20', 130, 'Keep Case', 0, 'USD', '29.98', '"The best of the best is back and better than ever" (''WNYW-TV'') in the latestinstallment of the pulse-pounding, thrill-a-minute ''Die Hard'' action films. New York City detective John McClane (Bruce Willis) delivers old-school justice to a new breed of terrorists when a massive computer attack on the U. S. infrastructure threatens to shut down the entire country over Independence Day weekend.\n\nLocked and loaded with real stunts, genuine humor and nonstop excitement, ''Live Free or Die Hard'' is "a slick piece of action entertainment" (''Los Angeles Times''), Yippee ki yay!', '', 'USD', '29.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(114, 114, 'United States', 1, 0, 0, '', '024543-509424', 648, 'Owned', 'AVP: Aliens vs. Predator: Requiem', 'Unrated', '', 'United States', '2007', '2008-04-15', 101, 'Keep Case', 0, 'USD', '29.98', 'Packed with adrenaline-pumping action, heart-stopping suspense, plus seven additional minutes of unrated, blood-soaked footage too shocking for theaters, this unrated version of ''AVP-Requiem'' escalates the war between sci-fi''s scariest movie icons!\n\nAfter a horrifying PredAlien crash-lands near a small Colorado town, killing everyone it encounters and producing countless Alien offspring, a lone Predator arrives to "clean up" the infestation. Soon it''s an all-out battle to the death with no rules, no mercy - and hundreds of innocent people caught in the crossfire. As the creature carnage continues, a handful of human survivors attempt a daring escape, but the U.S. government may be hatching a deadly plan of its own...', '', 'USD', '29.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(115, 115, 'United States', 1, 0, 0, '', '024543-516026', 662, 'Owned', '27 Dresses', 'Full Screen Edition', '', 'United States', '2008', '2008-04-29', 111, 'Keep Case', 0, 'USD', '29.98', '''Katherine Heigl'' (''Knocked Up'', ''TV''s Grey''s Anatomy'') lights up the screen in this charming romantic comedy from the screenwriter of ''The Devil Wears Prada''. Heigl stars as Jane, a romantic, completely selfless woman who''s been a happy, helpful bridesmaid no less than 27 times. But her own fairy-tale wedding seems to be nowhere in sight,  until younger sister Tess (''Malin Akerman'') captures the heart of Jane''s boss (''Edward Burns'') -- with whom she''s secretly in love --- inspiring Jane to change her "always a bridesmaid" destiny.', '', 'USD', '29.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(116, 116, 'United States', 0, 0, 0, 'Digital', '024543-519126', 1028, 'Owned', 'Meet The Spartans', 'Unrated Pit-Of-Death Edition', '', 'United States', '2008', '2008-06-03', 98, 'Keep Case', 0, 'USD', '29.98', 'Prepare to fight... back tears of laughter watching this ferociously funny Unrated "Pit of Death" Special Edition of ''Meet The Spartans'' - with ruder, cruder, footage not shown in theaters and an army of hysterical, historical special features!\n\nThe battle begins when the heroic Leonidas, armed with nothing but leather underwear and a cape, leads a ragtag group of 13 - count''em, 13! - warriors to defend their homeland against the invading Persians, whose ranks include Ghost Rider, Rocky Balboa, the Transformers, and a hunchbacked Paris Hilton!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(117, 117, 'United States', 1, 0, 0, '', '024543-519706', 625, 'Owned', 'Jumper', '', '', 'United States', '2008', '2008-06-10', 88, 'Keep Case', 1, 'USD', '29.98', 'From the director of ''The Bourne Identity'' and ''Mr. & Mrs. Smith'' comes the evolution of extreme  a high-powered shot of adrenaline that stretches the very limits of imagination. Next stop: Anywhere! David Rice is a young man who knows no boundaries  a Jumper, born with the uncanny ability to teleport instantly to any place on Earth. When he discovers others like himself, David is thrust into the midst of an ancient war while being hunted by a bloodthirsty band of zealots sworn to destroy all Jumpers. Now, David''s extraordinary gift may be his only hope for survival!', '', 'USD', '29.98', '2008-08-30', '2016-11-15 00:00:00', NULL);
