(118, 118, 'United States', 0, 0, 0, 'Digital', '024543-526216', 1014, 'Owned', 'Deception', '', '', 'United States', '2008', '2008-09-23', 108, 'Keep Case', 0, 'USD', '27.98', 'Leave your inhibitions at the door as Hugh Jackman (<i>X-Men</i> trilogy) and Michelle Williams (<i>Brokeback Mountain</i>) lure Ewan McGregor (<i>Moulin Rouge!</i>) into a tangled web of lust and lies in this scorching erotic thriller.\n\nLonely, timid accountant Jonathan McQuarry (McGregor) lives only for his work  until a chance meeting with suave, charismatic, corporate lawyer Wyatt Bose (Jackman) introduces him to "The List." Suddenly, the right cell-phone number and the words, "are you free tonight," launch Jonathan on a decadent journey of sexual conquests and self-discovery amidst New York''s power elite. But an affair with a ravishing and mysterious stranger (Williams) will expose him to yet another world he never imagined: one of betrayal, treachery and murder!', '', 'USD', '27.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(119, 119, 'United States', 0, 0, 0, 'Digital', '024543-528722', 1036, 'Owned', 'What Happens in Vegas', '', '', 'United States', '2008', '2008-08-26', 99, 'Keep Case', 0, 'USD', '29.98', 'After the wildest party night of their lives, two mismatched strangers, Jack (Ashton Kutcher) and Joy (Cameron Diaz), wake up in Vegas to discover they not only got Lucky  they got married! The road to annulment takes a hilarious turn after Jack wins a three-million-dolar jackpot while playing Joy''s quarter and a no-nonsense judge (Dennis Miller) sentences them to six months "hard marriage." What follows is an all-out war of the sexes as Jack and Joy go to outrageous lengths to try and cheat each other out of the money. But in the end, they may learn that when you gamble on love, you just might win, against all odds!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(120, 120, 'United States', 0, 0, 0, 'Digital', '024543-532941', 968, 'Owned', 'The Happening', '', '', 'United States', '2008', '2008-10-07', 91, 'Keep Case', 0, 'USD', '29.98', 'In this heart-pounding apocalyptic thriller from M. Night Shyamalan, the writer-director of ''The Sixth Sense'' and ''Signs'', an unstoppable event threatens the world''s population by attacking the most basic human instinct of all - survival. Academy Award Nominee Mark Wahlberg (2006 Best Supporting Actor - ''The Departed'') stars as Elliot Moore, an ordinary man trying to save his family from a terrifying, invisible killer. As Elliot discovers the incredible possibility of what is happening, it is clear that no one - and nowhere - is safe.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(121, 121, 'United States', 0, 0, 0, 'Digital', '024543-533030', 1027, 'Owned', 'Meet Dave', '', '', 'United States', '2008', '2008-11-25', 90, 'Keep Case', 0, 'USD', '29.98', 'Seeking a way to save their doomed world, a crew of tiny, human-looking aliens arrives on earth in the perfect disguise - a spaceship shaped like Eddie Murphy, the ship''s captain. While trying to save their planet, the aliens encounter problems, as their ship becomes smitten with a Earth woman.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(122, 122, 'United States', 0, 0, 0, 'Digital', '024543-543428', 971, 'Owned', 'Mirrors', '', '', 'United States', '2008', '2009-01-13', 112, 'Keep Case', 0, 'USD', '29.98', 'Look deeper into the world of <i>Mirrors</i> with this thrill-packed DVD featuring an unrated cut of the film, plus over an hour of shocking special features, including deleted scenes and an alternate ending you''ve got to see to believe! Attempting to pick up the shattered pieces of his life, a disgraced former cop (Kiefer Sutherland) takes a routine job guarding the charred ruins of a once-famous department store. But the terrifying images he see in the store''s ornate mirrors will send him on a pulse-pounding mission to unravel the secrets of the building''s past... before they destroy his entire life!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(123, 123, 'United States', 0, 0, 0, 'Digital', '024543-543633', 906, 'Owned', 'Babylon A.D.', 'Raw and Uncut', '', 'United States', '2008', '2009-01-06', 90, 'Keep Case', 0, 'USD', '29.98', 'In the darkly futuristic world of <i>Babylon A.D.</i>, the rules are simple: kill or be killed. Hard-hitting action superstar Vin Diesel (<i>The Fast and the Furious</i>, <i>The Chronicles of Riddick</i>), stars as Toorop, a ruthless mercenary hired to smuggle a mysterious young woman from the post-apocalyptic confines of Eastern Europe to the glittering megalopolis of New York City. Hunted at every turn, Toorop spirits his charge across a nightmarish wasteland only to uncover a shocking secret that will bring the entire world to its knees. Eye-popping action and mind-blowing science fiction clash head-on in this hard-edged thriller, where the only rule is survival.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(124, 124, 'United States', 0, 0, 0, 'Digital', '024543-553212', 915, 'Owned', 'The Day the Earth Stood Still', '2-Disc Special Edition', '', 'United States', '1951', '2008-12-02', 92, 'Keep Case', 0, 'USD', '19.98', 'Widely acclaimed as one of the most influential sci-fi films of all time, <i>The Day The Earth Stood Still</i> offers riveting and thought-provoking sci-fi filmmaking at it''s very best! Now this classic story of hope and peace can be experienced to it''s fullest in this special edition DVD complete with 2 audio commentaries, 7 all-new featurettes and more!\n\nA spaceship lands in Washington, D.C., capturing the attention of the world. But the alien emissary (Michael Rennie) it brings refuses to reveal his mission to any single government, leaving the military the politicians, and millions of ordinary people to wait in fear. Soon their distrust turns to calls for violence. But one young woman and her son (Patricia Neal, Billy Gray) befriend him...and soon realize that they may be all that stands between the human race and total destruction.', '', 'USD', '19.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(125, 125, 'United States', 0, 0, 0, 'Digital', '024543-553533', 1024, 'Owned', 'Taken', 'Extended Cut', '', 'United States', '2008', '2009-05-12', 91, 'Keep Case', 0, 'USD', '25.00', 'Prepare to get <b>Taken</b> for the ride of your life! Liam Neeson is an unstoppable force (<i>Premiere)</i> in this action-packed international thriller that will have you on the edge of your seat from start to finish. When his estranged teenage daughter (Maggie Grace) is kidnapped in Paris, a former spy (Neeson) sets out to find her at any cost. Relying on his special skills, he tracks down the ruthless gang that abducted her and launches a one-man war to bring them to justice and rescue his daughter.\n\nPrparez-vous  vivre un <b><i>Enlvement</b></i>  qui vous tiendra en haleine!  Liam Neeson est une force irrsistible  <i>(Premiere)</i>  dans ce suspense daction  saveur internationale qui vous captivera du dbut  la fin. Lorsque sa fille adolescente (Maggie Grace) avec qui il a perdu contact est enleve  Paris, un ancien espion (Neeson) tente de la retrouver  tout prix. Grce  ses habilets particulires, il traque  le gang impitoyable coupable du crime et se lance dans une guerre personnelle pour le traduire en justice et sauver sa fille.', '', 'USD', '25.00', '2009-10-14', '2016-11-15 00:00:00', NULL),
(126, 126, 'United States', 0, 0, 0, 'Digital', '024543-554745', 935, 'Owned', 'Max Payne', 'Unrated', '', 'United States', '2008', '2009-01-20', 103, 'Keep Case', 0, 'USD', '34.98', 'Mark Wahlberg delivers an explosive performance in this action-packed thriller based on the legendary, hard-hitting video game. Max Payne (Wahlberg) is a maverick cop with little regard for rules and nothing left to lose. Hell-bent on revenge, he''s determined to track down those responsible for the brutal murder of his family, but his obsessive investigation takes him on a nightmarish journey where dark fantasy collides with stark reality. As the mystery deepens, Max is forced to battle enemies beyound the natural world...and face an unthinkable betrayal that will drive him to the edge of his own sanity. This edition includes both the theatrical version and harder-hitting unrated extended cut of the film.', '', 'USD', '34.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(127, 127, 'United States', 0, 0, 0, 'Digital', '024543-563396', 1012, 'Owned', 'City of Ember', '', '', 'United States', '2008', '2009-01-20', 95, 'Keep Case', 1, 'USD', '29.98', 'Bill Murray, Tim Robbins and Saoirse Ronan star in this heart-thumping, edge-of-your-seat adventure that comes to light in this exhilarating family film based on the best-selling novel by Jeanne Duprau.\n\nFor centuries, the residents of the underground City of Ember have flourished in an amazing world of glittering lights and quiet contentment. But when the City''s massive power generator begins to fail, the street lamps start to fade - along with the hopes and dreams of the townspeople. Now it''s up to two courageous teenagers to follow a trail of clues left by the ancient Builders and find a way out of Ember before their world is plunged into darkness forever!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(128, 128, 'United States', 0, 0, 0, 'Digital', '024543-564102', 904, 'Owned', '24: Redemption', 'Digital Copy Edition', '', 'United States', '2008', '2008-11-25', 102, 'Keep Case', 0, 'USD', '26.98', '<B>24: Redemption</B> is the unprecedented feature-length even from television''s most provocative and suspenseful series. Wanted by the U.S. government and working as a missionary in Africa, Jack Bauer (Kiefer Sutherland) must stop a ruthless warlord from drafting innocent children into his murderous militia. But first, Bauer must confront his own torturous past and face an impossible decision that will change his life forever.\n\nFilmed on location in Africa, <I>24: Redemption</I> features performances by Oscar Winner Jon Voight* and Robert Carlysle.\n\n*1978, Actor, <I>Coming Home.</I> Oscar is the regeistered trademark and service mark of the Academy of Motion Picture Arts and Sciences.', '', 'USD', '26.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(129, 129, 'United States', 0, 0, 0, 'Digital', '024543-569695', 916, 'Owned', 'The Day the Earth Stood Still', '', '', 'United States', '2008', '2009-04-07', 104, 'Slip Case', 0, 'CAD', '25.00', 'Epic action and mind-blowing effects rock the planet in this thrilling reinvention of the sci-fi classic, THE DAY THE EARTH STOOD STILL. Keanu Reeves portrays Klaatu, an otherworldly being whose arrival on Earth triggers an unstoppable series of events that threaten all of mankind. In a desperate attempt to save humanity, governments and scientists race to unravel the mystery behind the visitor''s appearance. When a woman (Jennifer Connelly) and her young stepson find themselves embroiled in the alien''s plan, they become the world''s only hope to stave off apocalyptic annihilation.', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(130, 130, 'United States', 0, 0, 0, 'Digital', '024543-602859', 951, 'Owned', 'X-Men Origins: Wolverine', '', '', 'United States', '2009', '2009-09-15', 107, 'Keep Case', 0, 'USD', '29.98', 'Heroic Hugh Jackman "breathes the fire into Wolverine" (<i>Miami Herald</i>) - with a vengeance! \n\nThis pulse-pounding action thriller sinks razor-sharp adamantium claws into the mysterious origins of Logan/Wolverine: his epically violent and romantic past, his complex relationship with Victor Creed/Sabretooth (Liev Schreiber), and the ominous Weapon X program that unleashes his primal fury. Along the way, Wolverine also encounters legendary new mutants, including Deadpool (Ryan Reynolds) and Gambit (Taylor Kitsch). You''ll go "berserker" for this deeper, darker, more-spectacular-than-ever chapter of the <i>X-Men</i>  saga!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(131, 131, 'United States', 0, 0, 0, 'Digital', '025192-008337', 924, 'Owned', 'The Incredible Hulk', '3-Disc Futureshop Exclusive Steelbook', '', 'Canada', '2008', '2008-10-21', 114, 'SteelBook', 0, 'CAD', '32.99', 'Academy Award nominee Edward Norton stars as scientist Bruce Banner, a man who has been living in shadows, scouring the planet for an antidote to the unbridled force of rage within him: the Hulk.  But when the military masterminds who dream of exploiting his powers force him back to civilization, he finds himself coming face to face with his most formidable foe: the Abomination - a nightmarish beast of pure aggression whose powers match the Hulk''s own!\n\nAlso starring Liv Tyler, Oscar nominee Tim Roth, and Oscar winner William Hurt, The Incredible Hulk is "steeped in action spectacular special effects" (Claudia Puig, USA TODAY) and delivers a mind-blowing final showdown that can only be summed up with one word... INCREDIBLE!\n\nDisc 1: \n- Deleted Scenes\n- Feature Commentary\n\nDisc 2:\n- All-New Alternate Opening\n- The Making of Incredible\n- Becoming the Abomination\n- From Comic Book to Screen\n- Becoming the Hulk\n- Anatomy of a Hulk-Out\n\nDisc 3:\n- Digital Copy of the Film', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(132, 132, 'United States', 1, 0, 0, '', '025192-014826', 286, 'Owned', 'The Nutty Professor', 'Widescreen', '', 'United States', '1996', '1998-01-20', 96, 'Keep Case', 0, 'USD', '24.98', '''Eddie Murphy'' gives the "performances" of his career playing no less than seven roles in this uproarious, Jekyll-and-Hyde comedy from Imagine Entertainment. Murphy stars as Dr. Sherman Klump, a kind, "calorically challenged" genetics professor who longs to shed his 400-pound frame in order to win the heart of beautiful ''Jada Pinkett''. So, with one swig of his experimental fat-reducing serum, Sherman becomes "Buddy Love," a fast-talking, pumped-up, plumped down Don Juan. Can Sherman stop his buff alter ego before it''s too late, or will Buddy have the last laugh?\n\nBoasting incredible special effects, a super soundtrack, and co-starring ''James Coburn'', ''Larry Miller'', ''Dave Chappelle'', and ''John Ales'', this hilarious hit is worth its weight in fun!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(133, 133, 'United States', 0, 0, 0, 'Digital', '025192-022265', 1026, 'Owned', 'Twilight', '', '', 'United States', '2008', '2009-03-21', 122, 'Keep Case', 0, 'USD', '19.99', 'Bella Swan (Kristen Stewart) doesnt expect much when she moves to the small town of Forks, Washington, until she meets the mysterious and handsome Edward Cullen (Robert Pattinson)a boy whos hiding a dark secret: hes a vampire. As their worlds and hearts collide, Edward must battle the bloodlust raging inside him as well as a coterie of undead that would make Bella their prey. Based on the #1 <i>New York Times</i> best-selling sensation by Stephenie Meyer, <i>Twilight </i>adds a dangerous twist to the classic story of star-crossed lovers.', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(134, 134, 'United States', 1, 0, 0, '', '025192-026225', 494, 'Owned', 'The Jackal', 'Collector''s Edition Widescreen', '', 'United States', '1997', '1998-04-28', 124, 'Keep Case', 0, 'USD', '34.98', '''Bruce Willis'', ''Richard Gere'' and ''Sidney Poitier'' star in this international suspense thriller directed by ''Michael Caton-Jones''.\n\nA ruthless assassin (Willis) has been hired to eliminate someone at the very top of the U.S. government. Constantly changing his identity and location, he is known only as the Jackal. Everything about this hit man, including his sinister timetable, is a secret.\n\nAware of the Jackal''s presence but uncertain of his purpose, the FBI''s Deputy Director (Poitier) faces the biggest challenge of his career. In order to track down this coldblooded killer, he and a by-the-book Russian intelligence officer (Diane Venora) enlist the aid of an imprisoned Irish terrorist (Gere). These unlikely allies enter a global race against the clock to stop the mysterious mercenary before he can complete his deadly assignment.\n\nThe Jackal is based on the screenplay of the 1973 film ''The Day of the Jackal''.', '', 'USD', '34.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(135, 135, 'United States', 1, 0, 0, '', '025192-026522', 123, 'Owned', 'For Richer or Poorer', '', '', '', '1997', '1998-05-05', 116, 'Keep Case', 0, 'USD', '24.98', 'Brad (Tim Allen) and Caroline Sexton (Kirstie Alley) were incredibly rich and incredibly miserable. Until something unbelievable happened...their accountant robbed them dry. Now they''re on the run from the IRS and hiding out in the one place no one will ever look for them...Amish country. While their lawyer sorts things out in New York, they''ve got to do their best to blend in and are failing miserably! Hard work may prove to be more difficult than hard time as the Sextons are learning how to milk cows, plow fields and fall in love all over again.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(136, 136, 'United States', 1, 0, 0, '', '025192-028328', 589, 'Owned', 'Primary Colors', '', '', '', '1998', '1998-09-09', 144, 'Keep Case', 0, 'USD', '24.98', 'Jack Stanton (Travolta) is a virtually unknown Southern governor on a quest for the White House with his strong, savvy and equally ambitious wife, Susan (Thompson).  Running against the odds, the Stantons need all the help they can get from their extremely colorful political team.  Together, they take off on a hilarious, heart-wrenching and ultimately history-making roller coaster ride to the top.', '', 'USD', '24.98', '2005-03-09', '2016-11-15 00:00:00', NULL),
(137, 137, 'United States', 1, 0, 0, '', '025192-031229', 154, 'Owned', 'Doom', 'Unrated Extended Edition', '', '', '2005', '2006-02-07', 113, 'Keep Case', 0, 'USD', '29.98', 'A frantic call for help from a remote research station on Mars sends a team of mercenary Marines into action. Led by The Rock and Karl Urban, they descend into the Olduvai Research Station, where they find a legion of nightmarish creatures, lurking in the darkness, killing at will. Once there, the Marines must use an arsenal of firepower to carry out their mission: nothing gets out alive. Based on the hugely popular video game, ''DOOM'' is an explosive action-packed thrill ride!', '', 'USD', '29.98', '2006-06-19', '2016-11-15 00:00:00', NULL),
(138, 138, 'United States', 0, 0, 0, 'Digital', '025192-031885', 932, 'Owned', 'Knowing', '', '', 'United States', '2009', '2009-07-07', 121, 'Keep Case', 1, 'USD', '26.99', 'Nicolas Cage (<i>National Treasure</i>) stars in this edge of your seat sci-fi thriller as John Koestler, a professor who deciphers a coded message with terrifyingly accurate predictions about every major world disaster. Looking to protect his family and prevent future calamities he enlists the reluctant help of Diana Wayland {Rose Byrne}, daughter of the now-deceased author of the prophecies. His quest to understand the messages and his own family''s involvement in them becomes a heart-pounding race against time as he faces the ultimate disaster.', '', 'USD', '26.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(139, 139, 'United States', 1, 0, 0, '', '025192-041228', 124, 'Owned', 'The Secret Of My Success', '', '', '', '1987', '1998-10-27', 110, 'Keep Case', 0, 'USD', '24.98', 'Can a kid from Kansas come to New York to conquer the business world and maneuver his way from the mailroom to the boardroom in a matter of weeks?  Michael J. Fox proves it can be done in this very funny lampoon of corporate business life.  Fresh out of college, he''s determined to climb New York''s corporate ladder in record time by masquerading as an up-and-coming executive, even though he''s really the new mail boy.  However, Fox''s plans begin to awry when the boss''s wife falls in love with him and he falls in love with a junior executive, who also happens to be the boss''s mistress.', '', 'USD', '24.98', '2006-06-19', '2016-11-15 00:00:00', NULL),
(140, 140, 'United States', 1, 0, 0, '', '025192-044922', 629, 'Owned', 'Mercury Rising', 'Collector''s Edition: Widescreen', '', 'United States', '1998', '1999-03-16', 111, 'Keep Case', 0, 'USD', '34.98', 'Art Jeffries (''Bruce Willlis''), a renegade FBI agent, combats ruthless Federal agents to protect Simon, a nine-year-old autistic boy who has cracked the government''s new "unbreakable" code. He can read MERCURY, the most advanced encryption code, as easily as other kids read English. This ability renders the new billion-dollar secret code vulnerable, especially if enemies of the United States should learn of Simon''s abilities and capture him. Program Chief Nick Kudrow (''Alec Baldwin'') orders the "security threat" eliminated, but Kudrow hasn''t counted on Jeffries getting involved. As they are trailed by deadly assassins, Jeffries quickly realizes that no one can be trusted. Now time is running out and he discovers his only hope of survival is using Simon''s special ability to bring their adversaries to justice.', '', 'USD', '34.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(141, 141, 'United States', 1, 0, 0, '', '025192-045820', 195, 'Owned', 'Liar Liar', 'DTS', '', '', '1997', '1999-01-12', 87, 'Keep Case', 0, 'USD', '24.98', 'Trust Me\n\nFletcher Reid is a fast talking attorney and habitual liar. When his son Max blows out the candles on his fifth birthday cake, he has only one wish, ''that his dad would stop lying for 24 hours''. When Max''s wish miraculously comes true, Fletcher discovers that his biggest asset (his mouth) has suddenly become his biggest liability. Legal and emotional havoc ensue as Fletcher tries to keep his practice afloat and his ex-wife Audrey from taking their son and moving to Boston.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(142, 142, 'United States', 1, 0, 0, '', '025192-052125', 614, 'Owned', 'Bride of Chucky', 'Widescreen', '', 'United States', '1998', '1999-03-16', 89, 'Keep Case', 0, 'USD', '24.98', 'For ten years, the tortured soul of serial killer Charles Lee Ray has been imprisoned inside a child''s doll.  "Chucky" is reborn when his old flame, Tiffany (''Jennifer Tilly''),  rescues his battered doll parts from a police impound. But Chucky wants his new playmate cut down to size, so he transforms his blushing bride into a stunning little terror.  Chucky and Tiffany can''t wait to start their own homicidal honey-moon. When this demonic duo hits the road and hooks up with a pair of unsuspecting newlyweds, they leave a trail of murder and mayhem behind them. Chucky''s back!', '', 'USD', '24.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(143, 143, 'United States', 1, 0, 0, '', '025192-052224', 613, 'Owned', 'Child''s Play 2', '', '', 'United States', '1990', '1999-03-16', 84, 'Keep Case', 0, 'USD', '24.98', 'Chucky''s back! The notorious killer doll with the satanic smile comes back to life in this new chapter depicting the terrifying struggle between young Andy Barclay ("Alex Vincent") and the demonic doll attempting to possess his soul.\n\nDespite being roasted to a crisp in his last escapade, Chucky rises from the ashes after being reconstructed by a toy factory to dispel the negative publicity surrounding the doll.\n\nBack in one piece, Chucky tracks his prey to a foster home where the chase begins again in this fiendishly clever sequel to the enormously popular original.', '', 'USD', '24.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(144, 144, 'United States', 1, 0, 0, '', '025192-053122', 468, 'Owned', 'Meet Joe Black', 'Widescreen', '', 'United States', '1998', '1999-04-06', 180, 'Keep Case', 0, 'USD', '26.98', 'Bill Parrish (Anthony Hopkins) has it all - success, wealth and power. Days before his 65th birthday he receives a visit from a mysterious stranger, Joe Black (Brad Pitt), who soon reveals himself as Death. In exchange for extra time, Bill agrees to serve as Joe''s earthly guide. But will he regret his choice when Joe unexpectedly falls in love with Bill''s beautiful daughter Susan (Claire Forlani).', '', 'USD', '26.98', '2008-01-21', '2016-11-15 00:00:00', NULL),
(145, 145, 'United States', 1, 0, 0, '', '025192-063329', 583, 'Owned', 'American Pie', '', '', '', '1999', '1999-12-21', 96, 'Keep Case', 0, 'USD', '26.98', 'You''ll never look at warm apple pie the same way again!  American Pie takes a hysterical look at the goal of four "unlucky in love" high school friends who make the ultimate pact:  lose their virginity by prom night.  As they try to manipulate their way into the...hearts of some of their classmates, their plans often backfire with hilarity.  One fails to score with the sexy foreign exchange student and then makes a last ditch effort with a band member who has an interesting way with her flute, while another is so desperate he actually hires someone to give him a "reputation."\n\nFollow the reging hormones of four teenage boys and their girls as they gear up for the most important night of their lives...the prom?  Sit back and enjoy a piece of America''s #1 comedy hit!', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(146, 146, 'United States', 1, 0, 0, '', '025192-064227', 703, 'Owned', 'Virus', 'DTS', '', 'United States', '1998', '1999-07-20', 99, 'Keep Case', 0, 'USD', '29.98', 'Jamie Lee Curtis (''Halloween'', ''True Lies'') faces a new, unstoppable terror in this science fiction chiller from the producer of ''Aliens'', ''Terminator 2'', and ''Tremors''.\n\nCurtis plays the navigator of a tugboat crew which loses its cargo during a hurricane.  In the calm eye of the storm, they come across a Russian research ship floating dead on the water.  Boarding the vessel, they initially believe it to be deserted - but they soon realize they''re not alone.  First, they discover a terrified survivor (Joanna Pacula, ''Tombstone''), and then they find that the ship has been taken over by a ruthless alien intelligence.  Now, the small band must fight for their lives against a force that has come to claim Earth for its own, and creates bio-mechanical monstrosities with one goal: eliminating the virus called humans.\n\nDonald Sutherland (''Invasion of the Body Snatchers'') and William Baldwin (''Backdraft'') also star in a film featuring horrific special effects by the artists behind the ''Jurassic Park'' films, ''Species'' and ''Starship Troopers''!', '', 'USD', '29.98', '2009-10-25', '2016-11-15 00:00:00', NULL),
(147, 147, 'United States', 1, 0, 0, '', '025192-067822', 27, 'Owned', 'The Mummy', 'Collector''s Edition', '', '', '1999', '1999-09-28', 125, 'Keep Case', 0, 'USD', '20.95', 'Deep in the Egyptian desert, a handful of people searching for a long-lost treasure have just unearthed a 3,000 year old legacy of terror. Combining the thrills of a rousing adventure with the suspense of Universal''s legendary 1932 horror classic, THE MUMMY, starring Brendan Fraser, is a true nonstop action epic, filled with dazzling visual effects, top-notch talent and superb storytelling.', '', 'USD', '20.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(148, 148, 'United States', 1, 0, 0, '', '025192-072123', 704, 'Owned', 'End of Days', 'Collector''s Edition: Widescreen', '', 'United States', '1999', '2000-04-18', 122, 'Keep Case', 0, 'USD', '26.98', 'All hell breaks loose when Arnold Schwarzenegger battles the ultimate evil in this chilling supernatural action thriller. When a burned-out former New York City cop named Jericho (Schwarzenegger) is assigned to security detail for a mysterious and foreboding stranger (Gabriel Byrne), Jericho thwarts an incredible assassination attempt. During the ensuing investigation, he and his partner (Kevin Pollak) save the life of the beautiful and terrified Christine York (Robin Tunney), whose destiny involves death, the devil and the fate of mankind. Now it''s up to Jericho to save the girl, the world and his own soul as he comes face to face with his most powerful enemy ever!', '', 'USD', '26.98', '2009-10-25', '2016-11-15 00:00:00', NULL),
(149, 149, 'United States', 1, 0, 0, '', '025192-078323', 281, 'Owned', 'Erin Brockovich', '', '', '', '2000', '2000-08-15', 132, 'Keep Case', 0, 'USD', '26.98', 'A real woman. A real story. A real triumph. Julia Roberts stars as Erin Brockovich, a feisty young mother who fought for justice any way she knew how. Desperate for a job to support herself and her three children, she convinces attorney Ed Masry (Albert Finney) to hire her, and promptly stumbles upon a monumental law case against a giant corporation. Now, Erin''s determined to take on this powerful adversary even though no law firm has dared to do it before. And while Ed doesn''t want anything to do with the case, Erin won''t take "no" for an answer. So the two begin an incredible and sometimes hilarious fight that will bring a small town to its feet and a huge company to its knees.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(150, 150, 'United States', 1, 0, 0, '', '025192-094125', 32, 'Owned', 'The Family Man', 'Collector''s Edition', '', '', '2000', '2001-07-17', 126, 'Keep Case', 0, 'USD', '26.98', 'Jack Campbell (Academy Award winner Nicolas Cage) is a single, wealthy Wall Street trader living the high life in New York City. All that magically changes one morning when he wakes up in a suburban New Jersey bedroom with a wife (Tea Leoni) he never married and two kids he never had - the life he would have led if he had made different choices as a younger man. Find out what it takes for a single-minded businessman to become The Family Man in this wonderful comedy about second thoughts and second chances.', '', 'USD', '26.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(151, 151, 'United States', 1, 0, 0, '', '025192-096020', 167, 'Owned', 'Bring It On', 'Collector''s Edition', '', '', '2000', '2001-02-13', 99, 'Keep Case', 0, 'USD', '26.98', 'The Toro cheerleading squad has spirit, spunk, sass and a killer routine that''s sure to land them the national championship trophy for the sixth year in a row. But for newly-elected team captain, Torrance (Kirsten Dunst), the Toros'' road to cheer glory stumbles when she discovers their perfectly choreographed routines were stolen from a hot hip-hop squad across town. Now the squad must scramble to find a new routine to compete in this year''s competition.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(152, 152, 'United States', 1, 0, 0, '', '025192-127526', 53, 'Owned', 'Dr. Seuss'' How The Grinch Stole Christmas', 'Collector''s Edition', '', 'United States', '2000', '2001-11-20', 105, 'Keep Case', 0, 'USD', '26.98', 'The classic celebration of the spirit of the holidays comes home.  Acclaimed director ''Ron Howard,'' his longtime partner and producer ''Brian Glazer,'' plus ''Jim Carrey'' (as the Grinch) bring Dr. Seuss'' beloved tale to life in this adventure "that can make your heart grow three sizes - if you''re not laughing too hard!" (Steve Murray, ''Atlanta Journal-Constitution'').\n\nWith dazzling scenery and special effects, narration by Oscar-winner ''Anthony Hopkins'' and Jim Carrey''s own rendition of "You''re a Mean One, Mr. Grinch," this gift from the heart is a "holiday package that kids will embrace and parents adore" (Philip Wuntch, ''Dallas Morning News'').', '', 'USD', '26.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(153, 153, 'United States', 1, 0, 0, '', '025192-137921', 28, 'Owned', 'The Mummy Returns', 'Collector''s Edition', '', '', '2001', '2001-10-02', 130, 'Keep Case', 0, 'USD', '26.98', 'Set in 1935, ten years after the events in the first film, Rick O''Connell (Brendan Fraser) is married to Evelyn (Rachel Weisz) and the couple has settled in London raising their 9-year-old son Alex (Freddie Boath).\n\nWhen a chain of events finds the corpse of Imhotep (Arnold Vosloo) resurrected in the British Museum, Imhotep walks the earth determined to fulfill his quest for immortality. But another force has also been set looseone born of the darkest rituals of ancient Egyptian mysticism and more powerful than Imhotep. When these forces clash, the fate of the world will hang in the balance, sending the OConnells on a mission to save the world and their son before it is too late.', '', 'USD', '26.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(154, 154, 'United States', 1, 0, 0, '', '025192-138225', 613, 'Owned', 'Child''s Play 3', '', '', 'United States', '1991', '2003-10-07', 90, 'Keep Case', 0, 'USD', '14.98', 'One of filmdom''s most notorious killers is back to wreak more mayhem as Chucky continues his quest to possess the body of a human child.\n\nEight years after seemingly destroying the killer doll, Andy Barclay (''Justin Whalin'') turns 16 and is placed in a military school. Meanwhile, the greedy president of Play Pals Toy Company decides to resurrect the popular Good Guys doll line, confident that all the bad publicity is forgotten. As the assembly line recreates the first doll from a mass of melted plastic, the spirit of Chucky returns to renew his quest and seek revenge on Andy.\n\nOnce again it''s up to Andy to stop the unrelenting killer in this fact-paced thriller.', '', 'USD', '14.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(155, 155, 'United States', 1, 0, 0, '', '025192-147623', 186, 'Owned', 'The Cat in the Hat', 'Widescreen', '', '', '2003', '2004-03-16', 82, 'Keep Case', 0, 'USD', '26.98', 'Grab a place on the couch, or go find a seat\nFor you''re in for a wonderful Dr. Seuss treat!\nThe Cat in the hat who goes by that name\nIs played by Mike Myers of comedy fame!\nIt starts with two kids on a cold, cold, wet day\nTheir mom is at work, and they''ve no games to play!\nThen in walks the fun in the form of a Cat\nWho pulls out the laughs from the brim of his hat.\nThings really get wild when the cat and his crew\n(Who go by the names of Thing One and Thing Two)\nTake over the house of Conrad and Sally\nIn this fine family film that''s right up your alley!', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(156, 156, 'United States', 1, 0, 0, '', '025192-148927', 584, 'Owned', 'American Pie 2', '', '', '', '2001', '2002-01-15', 104, 'Keep Case', 0, 'USD', '26.98', 'The characters you love are back, in ''American Pie 2'' - the comedy hit that''s even more hilariously outrageous than the original!\n\nOne year after the prom-night misadventures immortalized in ''American Pie,'' the entire gang has reunited for the summer.  Now, an innocent-looking beach house will be transformed into the ultimate party central.  Five guys will discover the powerful bonds of friendship...and Super Glue.  Five girls will explore the mysteries of love...and the Rule of Three.  And from late-night band camp encounters to some very accomodating next-door neighbors, this will be one summer vacation none of them will ever forget!', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(157, 157, 'United States', 1, 0, 0, '', '025192-155321', 493, 'Owned', 'K-PAX', 'Collector''s Edition', '', 'United States', '2001', '2002-03-26', 120, 'Keep Case', 0, 'USD', '26.98', 'Two-time Academy Award winner Kevin Spacey and Academy Award nominee Jeff Bridges star in this spellbinding, often humorous story of a mysterious stranger who defies convention, puzzles the experts and leaves everyone searching for the truth.\n\nA stranger who calls himself Prot (Spacey) seemingly appears out of nowhere following a disturbance at New York''s Grand Central Station. Claiming to come from the distant planet K-PAX, Prot draws the attention of jaded Dr. Powell (Bridges), whose initial skepticism soon turns to fascination and amazement. Even a team of leading scientists are at a loss to explain Prot''s detailed knowledge of the star system he calls home. But with Prot''s return to K-PAX fast approaching, the search for answers intensifies and the mystery takes on pulse-quickening proportions.\n\nFeaturing unforgettable performances and surprising turns, it''s a thrilling story that "Keeps you guessing right to the end!" (''ABC Radio'')', '', 'USD', '26.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(158, 158, 'United States', 1, 0, 0, '', '025192-180224', 164, 'Owned', 'Love on the Side', '', '', '', '2004', '2006-03-28', 102, 'Keep Case', 0, 'USD', '27.98', 'When a big-city blonde bombshell rolls into the small town of Squamish, she throws the entire male population into an uproar. By unexpectedly making Eve, a waitress in a local diner, the center of attention, this sexy stranger will disrupt her plans to win the heart of the most eligible bachelor in town. This charming comedy is full of lust and laughs with a little Love on the Side.', '', 'USD', '27.98', '2006-10-08', '2016-11-15 00:00:00', NULL),
(159, 159, 'United States', 1, 0, 0, '', '025192-197529', 210, 'Owned', 'Big Fat Liar', '', '', '', '2002', '2002-09-24', 88, 'Keep Case', 0, 'USD', '26.98', 'Two friends are about to cut one Hollywood big shot down to size. \n\nFourteen-year-old Jason Sheppard (Frankie Muniz) has a reputation for stretching the truth. So, when big-time Hollywood producer Marty Wolf (Paul Giamatti) steals his class paper and turns it into a smash hit movie, no one believes Jason''s latest tall tale! On a cross-country adventure to set the record straight, Jason and best friend, Kaylee (Amanda Bynes), devise a high-tech plan to squeeze the truth out of Marty Wolf through a series of outrageous pranks, crazy stunts and big laughs. It''s pay back - big time!', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(160, 160, 'United States', 1, 0, 0, '', '025192-240126', 562, 'Owned', 'The Scorpion King', 'Collector''s Edition', '', '', '2002', '2002-10-01', 92, 'Keep Case', 0, 'USD', '26.98', 'Warrior. Legend. King. \n\nIn the notorious city of Gomorrah, evil warlord Memnon is determined to lay to waste all the nomadic peoples of the desert. Because the few remaining tribes are virtually powerless against him, they decide to hire a skilled assassin, Mathayus, to eliminate Memnon''s most prized asset: the sorceress Cassandra, who lies at the root of Memnon''s power. Mathayus''s plan, however, is to kidnap Cassandra rather than kill her. He knows if he takes her deep into the desert badlands as his hostage, Memmon and his henchman will stop at nothing to rescue her and bring her back.', '', 'USD', '26.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(161, 161, 'United States', 1, 0, 0, '', '025192-248924', 406, 'Owned', 'Hulk', '2-Disc Special Edition: Widescreen', '', 'United States', '2003', '2003-10-28', 138, 'Keep Case', 0, 'USD', '26.98', 'The larger-than-life Marvel Super Hero the HULK explodes onto the big screen! After a freak lab accident unleashes a genetically enhanced, impossibly strong creature, a terrified world must marshal its forces to stop a being with abilities beyond imagination.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(162, 162, 'United States', 1, 0, 0, '', '025192-266720', 209, 'Owned', 'The Borrowers', '', '', '', '1997', '1998-08-18', 86, 'Keep Case', 0, 'USD', '29.98', 'Have you ever misplaced a sock? Some jewelry? Do you think you know where you left a pen or a spool of thread only to find that it isn''t there? This perturbing state of affairs has a very simple explanation...The Borrowers. John Goodman stars in this action-packed, special effects-filled adventure based on Mary Norton''s beloved novels.', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(163, 163, 'United States', 1, 0, 0, '', '025192-282324', 49, 'Owned', 'Bruce Almighty', 'Widescreen', '', '', '2003', '2003-11-25', 101, 'Keep Case', 0, 'USD', '26.98', 'Comic genius Jim Carrey stars with Jennifer Aniston and Morgan Freeman in the entertaining comedy hit of the year that critics are applauding as a "laugh a minute" (Jim Ferguson, FOX-TV). Bruce Nolan (Carrey) is a TV reporter who believes the entire universe is stacked against him. In a life-altering encounter, the Big Guy Upstairs (Freeman) endows Bruce with all of His divine powers and challenges Bruce to take on the big job to see if he can do it any better. Bruce Almighty is the wildly funny comedy featuring "Jim Carrey at his best!" (Leonard Maltin, Hot Ticket)', '', 'USD', '26.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(164, 164, 'United States', 1, 0, 0, '', '025192-307225', 204, 'Owned', 'Peter Pan', '', '', '', '2003', '2004-05-04', 114, 'Keep Case', 0, 'USD', '26.98', 'The magic, the excitement, the wonder of the true Peter Pan comes to life for the first time in this spellbinding fantasy that critics proclaim "a fun and fantastic tale!" (Daily Herald) Brimming with spectacular special effects and non-stop action, this all-new adventure is sure to be a family favorite for years to come! "One of the finest films of the year!" (Daily Gazette)', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(165, 165, 'United States', 1, 0, 0, '', '025192-315626', 394, 'Owned', 'The Breakfast Club', 'High School Reunion Collection', '', 'United States', '1985', '2003-09-02', 97, 'Keep Case', 0, 'USD', '19.98', 'They were five students with nothing in common, faced with spending a Saturday detention together in their high school library. At 7 a.m., they had nothing to say, but by 4 p.m. they had bared their souls to each other and become good friends. John Hughes, creator of the critically acclaimed ''Sixteen Candles'', wrote, directed and produced this hilarious and often touching comedy starring Emilio Estevez, Anthony Michael Hall, Judd Nelson, Molly Ringwald and Ally Sheedy. To the outside world they were simply the Jock, the Brain, the Criminal, the Princess and the Kook, but to each other, they would always be ''The Breakfast Club''.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(166, 166, 'United States', 1, 0, 0, '', '025192-329029', 153, 'Owned', 'The Rundown', 'Widescreen', '', '', '2003', '2004-03-23', 104, 'Keep Case', 0, 'USD', '26.95', 'The Rock teams up with Seann William Scott for a wildly entertaining action-adventure that ''Good Morning Americas'' Joel Siegel raves is one of the years biggest, most fun movies! Beck (The Rock) is a bounty hunter sent into the treacherous jungles of the Amazon to bring the rebellious Travis (Seann William Scott) back to the States. When Beck and Travis reluctantly join forces to hunt down a priceless treasure this unlikely team embarks on a pulse-pounding, non-stop thrill-ride.', '', 'USD', '26.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(167, 167, 'United States', 1, 0, 0, '', '025192-347429', 585, 'Owned', 'American Wedding', 'Widescreen', '', '', '2003', '2004-01-02', 97, 'Keep Case', 0, 'USD', '39.98', 'You''re on the guest list -- for this uproarious comedy hit packed with exclusive PIE-style features!  The AMERICAN PIE gang returns to wreak havoc with a new rite of passage when Jim (Jason Biggs) and Michelle (Alyson Hannigan) decide to get married!  Of course, Stifler (Seann Williams Scott) will be there (bridesmaids!) and, more importantly, will throw the ulimate bachelor party (strippers!).  So RSVP for the ultimate AMERICAN WEDDING experience, in this hilariously hot, frantically funny final chapter of the unforgettable AMERICAN PIE saga!', '', 'USD', '39.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(168, 168, 'United States', 1, 0, 0, '', '025192-431227', 372, 'Owned', 'Intolerable Cruelty', '', '', '', '2003', '2004-02-10', 100, 'Keep Case', 0, 'USD', '26.95', 'It''s comic gold as two of Hollywood''s most dazzling stars - George Clooney and Academy Award-winner Catherine Zeta-Jones - light up the screen in ''Intolerable Cruelty'', a hilarious romantic comedy about men, women and everything that can go wrong between them. Sparks fly when brilliant divorce attorney Mike Massey (Clooney) meets his match in the beautiful but ruthless Marylin Rexroth (Zeta-Jones). From Academy Award-winning directors Joel Coen and Ethan Coen (''Fargo''; ''O Brother, Where Art Thou?''), ''Intolerable Cruelty'' also stars multi-talented Billy Bob Thornton and outrageous Cedric The Entertainer.', '', 'USD', '26.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(169, 169, 'United States', 1, 0, 0, '', '025192-472220', 564, 'Owned', 'Pitch Black', 'Director''s Cut', '', '', '2003', '2004-06-01', 112, 'Keep Case', 0, 'USD', '26.98', 'When their ship crash-lands on a remote planet, the marooned passengers soon learn that escaped convict Riddick (Vin Diesel) isn''t the only thing they have to fear. Deadly creatures lurk in the shadows, waiting to attack in the dark, and the planet is rapidly plunging into the utter blackness of a total eclipse. With the body count rising, the doomed survivors are forced to turn to Riddick with his eerie eyes to guide them through the darkness to safety. With time running out, there''s only one rule: Stay in the light.\nPitchBlack is the original sci-fi hit that introduced the world to the character of Riddick, the ultimate anti-hero. Take a ride on the pulse-pounding adrenaline rush that USA Today calls "the best excuse to root for the bad guy since Arnold in the original Terminator."', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(170, 170, 'United States', 1, 0, 0, '', '025192-499425', 449, 'Owned', 'The Bourne Supremacy', '', '', 'United States', '2004', '2004-12-07', 109, 'Keep Case', 0, 'USD', '29.98', '''The Bourne Supremacy'' re-enters the shadowy world of expert assassin Jason Bourne (Damon), who continues to find himself plagued by the splintered nightmares from his former life. The stakes are now even higher for the agent as he coolly maneuvers through the dangerous waters of international espionage-replete with CIA plots, turncoat agents and ever-shifting covert alliances-all the while hoping to find the truth behind his haunted memories and answers to his own fragmented past.', '', 'USD', '29.98', '2005-09-17', '2016-11-15 00:00:00', NULL),
(171, 171, 'United States', 1, 0, 0, '', '025192-545023', 447, 'Owned', 'Billy Madison', 'Widescreen Special Ed-ition', '', 'United States', '1995', '2004-11-30', 90, 'Keep Case', 0, 'USD', '14.99', 'He''s the heir to the Madison Hotel millions, but in order to win his father''s respect, and his Fortune 500 company, grown-up goof-off Billy must repeat all 12 grades of school - in just 24 weeks! Comedy superstar Adam Sandler stars in this laugh-a-minute hit. Now available in this new special edition with never-before-seen bonus features.', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(172, 172, 'United States', 1, 0, 0, '', '025192-545221', 628, 'Owned', '12 Monkeys', 'Special Edition', '', 'United States', '1995', '2005-05-10', 130, 'Keep Case', 0, 'USD', '14.98', 'In this science fiction masterpiece, Cole (''Bruce Willis'') is sent back in time to save the human race from a deadly virus that has forced mankind into dank underground communities in the future.  Along his travels, he encounters a psychiatrist (''Madeleine Stowe'') and a mental patient, brilliantly portrayed by ''Brad Pitt'', who may hold the key to the mysterious rogue group, The Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.  Believing he can obtain a pure virus sample in order to find a cure in the future, he is met with one riddle after another that puts him in a race for time.', '', 'USD', '14.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(173, 173, 'United States', 1, 0, 0, '', '025192-545825', 573, 'Owned', 'The Bourne Identity', 'Explosive Extended Editio', '', '', '2002', '2004-07-13', 119, 'Keep Case', 0, 'USD', '29.98', 'Academy Award Winner Matt Damon stars in this explosive, action-packed hit filled with incredible fight sequences. Found with two bullets in his back, Jason Bourne discovers he has the skills of a very dangerous man and no memory of his violent past. Racing to unlock the secret of his own identity, he discovers the deadly truth: he''s an elite government agent, a 30 million dollar weapon the government no longer trusts. Now this top operative is the government''s number one target in this super-charged, thrill-a-minute spectacular loaded with "Non-stop action!" (Bill Zwecker, FOX-TV)', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(174, 174, 'United States', 1, 0, 0, '', '025192-545924', 388, 'Owned', 'Meet the Parents', 'Bonus Edition', '', 'United States', '2000', '2004-12-14', 108, 'Keep Case', 0, 'USD', '29.98', 'Male nurse Greg Focker (Ben Stiller) is all set to propose to his girlfriend, Pam (Teri Polo), during a weekend at her parents'' home. But there''s a catch: Jack Byrnes (Robert De Niro), Pam''s intimidating, cat-loving, ex-CIA father, takes an immediate dislike to his daughter''s truth-bending beau. Soon, a hilarious string of outrageous mishaps turns Greg into master of relative disaster. Meet the Parents is an uproarious comedy smash about true love conquering all, against all odds!', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL);
