(175, 175, 'United States', 1, 0, 0, '', '025192-582424', 42, 'Owned', 'Meet the Fockers', '', '', '', '2004', '2005-04-19', 116, 'Keep Case', 0, 'USD', '29.98', 'Domestic disaster looms for male nurse Greg Focker (Stiller) when his straight-laced, ex-CIA father-in-law (De Niro) asks to meet his wildly unconventional mom and dad (Streisand and Hoffman). Its family bonding gone hysterically haywire, in the must-see comedy critics are calling "A laugh riot!" (Larry King)', '', 'USD', '29.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(176, 176, 'United States', 1, 0, 0, '', '025192-583926', 52, 'Owned', 'Cinderella Man', 'Fullscreen', '', '', '2005', '2005-12-06', 145, 'Keep Case', 0, 'USD', '29.98', 'In this true-life story, Crowe plays boxer Jim Braddock, a champion boxer in the 1920s who lost everything in the Crash of ''29, lived in poverty with his wife and children, and attempted a comeback in the ring against all the odds.', '', 'USD', '29.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(177, 177, 'United States', 1, 0, 0, '', '025192-586125', 450, 'Owned', 'Van Helsing', 'Full Screen', '', '', '2004', '2004-10-19', 132, 'Keep Case', 0, 'USD', '29.98', 'Legendary monster hunter Van Helsing (Hugh Jackman) is summoned to mysterious Transylvania on a mission that will thrust him into a sweeping battle against the forces of darkness! With non-stop action and electrifying special effects, VAN HELSING is an adrenaline-powered motion picture event Roger Ebert calls "Spectacular!"', '', 'USD', '29.98', '2005-09-17', '2016-11-15 00:00:00', NULL),
(178, 178, 'United States', 1, 0, 0, '', '025192-616020', 223, 'Owned', 'Curious George', '', '', '', '2005', '2006-09-25', 0, 'Keep Case', 0, 'USD', '19.99', '', '', 'USD', '19.99', '2006-10-08', '2016-11-15 00:00:00', NULL),
(179, 179, 'United States', 1, 0, 0, '', '025192-631023', 146, 'Owned', 'Nanny McPhee', 'Fullscreen', '', '', '2005', '2006-05-09', 99, 'Keep Case', 0, 'USD', '29.98', 'Thompson stars in and adapted this family comedy-fantasy based on Christianna Brand''s "Nurse Matilda" books about a magical, literally warts-and-all nanny who comes to work for a widowed funeral director... and with each lesson learned by the children, she begins a transformation.\n\nIn this wickedly charming talke, Emma Thompson portrays a mysterious woman with special powers who enters the household of the recently widowed Mr. Brown (Colin Firth) and attempts to tame his seven very naughty children. The children have managed to drive away 17 previous nannies, but as Nanny McPhee takes control, they begin to notice that their misbehaving has magical and startling consequences. "A magical, fantasic and wonderful fable that will capture the heart of the whole family!" (Maria Salas, NBC-TV)', '', 'USD', '29.98', '2006-06-19', '2016-11-15 00:00:00', NULL),
(180, 180, 'United States', 1, 0, 0, '', '025192-632822', 155, 'Owned', 'Serenity', '', '', '', '2005', '2005-12-20', 119, 'Keep Case', 0, 'USD', '29.98', 'A passenger with a deadly secret. Six rebels on the run. An assassin in pursuit. When the renegade crew of Serenity agrees to hide a fugitive on their ship, they find themselves in an action-packed battle between the relentless military might of a totalitarian regime who will destroy anything - or anyone - to get the girl back and the bloodthirsty creatures who roam the uncharted areas of space. But, the greatest danger of all may be on their ship. From the mind of Joss Whedon (''Buffy the Vampire Slayer'', ''Angel'') comes a new edge-of-your-seat adventure loaded with explosive battles, gripping special effects and fantastic new worlds!', '', 'USD', '29.98', '2006-06-19', '2016-11-15 00:00:00', NULL),
(181, 181, 'United States', 1, 0, 0, '', '025192-672026', 5, 'Owned', 'Bridget Jones: The Edge of Reason', '', '', '', '2004', '2005-03-22', 108, 'Keep Case', 0, 'USD', '29.95', 'Rene Zellweger is back as everyones favorite witty heroine in Bridget Jones: The Edge of Reason. Not that Bridgets counting, but its been six wonderful weeks, four fabulous days, and seven precious hours with one flawless boyfriend, Mark Darcy (Colin Firth). But when mischievous and devilishly charming Daniel Cleaver (Hugh Grant) arrives on the scene claiming to be a reformed man, can Bridget find a way to make true love last forever? Its the absolutely hilarious (Jim Ferguson, ABC-TV) romantic comedy that proves theres nothing like love to send you over the edge.', '', 'USD', '29.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(182, 182, 'United States', 1, 0, 0, '', '025192-722028', 663, 'Owned', 'The Wedding Date', 'Widescreen', '', 'United States', '2005', '2005-08-16', 89, 'Keep Case', 0, 'USD', '29.95', 'Debra Messing (TV''s <i>Will & Grace</i>) shines in this hilarious romantic comedy about the surprising road to finding true love. Kat Ellis (Messing) is determined to attend her younger sister''s wedding with a date. Rather than face the ridicule of her family and in order to show up her ex-fianc, she resorts to the Yellow Pages to find a last-minute escort, Nick (Dermot Mulroney, <i>My Best Friend''s Wedding</i>). His dashing good looks and quick-witted charm may win over her family. But will they win over Kat? Filled with unexpected twists and endless laughs, <i>The Wedding Date</i> is the one date that you''ll want to keep!', '', 'USD', '29.95', '2009-09-27', '2016-11-15 00:00:00', NULL),
(183, 183, 'United States', 1, 0, 0, '', '025192-745225', 614, 'Owned', 'Seed of Chucky', 'Unrated and Fully Extended', '', 'United States', '2004', '2005-06-07', 87, 'Keep Case', 0, 'USD', '29.95', 'In this outrageous, unrated and fully extended version of ''Seed of Chucky'', everyone''s favorite killer doll returns - and he''s bringing the entire family!  This time around, Chucky (voiced again by Brad Dourif) and his homicidal honey, Tiffany, are brought back to life by their orphan offspring, Glen.  Then, the horror goes Hollywood as Chucky unleashes his own brand of murderous mayhem!  Featuring Academy Award nominee Jennifer Tilly (as herself and the voice of Tiffany) and hip-hop star Redman, it''s more gore, more gags, and much more Chucky doing his dirtiest deeds yet!', '', 'USD', '29.95', '2008-05-27', '2016-11-15 00:00:00', NULL),
(184, 184, 'United States', 1, 0, 0, '', '025192-818028', 415, 'Owned', 'Jaws', '30th Anniversary', '', '', '1975', '2005-06-14', 124, 'Slip Case', 0, 'USD', '26.98', 'This Special 30th Anniversary Collector''s Edition is digitally mastered and contains exclusive footage, interviews, and behind-the-scenes material.\n\nSteven Spielberg directed this classic film that became one of the most enduring action-suspense films of all time.\n\n"Jaws" was an instant blockbuster, a phenomenon, and today it is still among the highest grossing films in motion picture history, acclaimed by critics and audiences alike.\n\nRediscover the timeless film that continues to make entire generations afraid to go in the water.', '', 'USD', '26.98', '2007-08-12', '2016-11-15 00:00:00', NULL),
(185, 185, 'United States', 0, 0, 0, 'Digital', '025193-226822', 993, 'Owned', 'I Now Pronounce You Chuck & Larry', 'Widescreen', '', 'United States', '2007', '2007-11-06', 110, 'Keep Case', 0, 'USD', '29.98', 'Adam Sandler and Kevin James star as best friends and fellow firefighters Chuck and Larry, the pride of their Brooklyn fire station. Chuck owes Larry for saving his life. Larry calls in that favor big-time by asking Chuck to pose as his "domestic partner" so his kids will get his pension. But when a fact-checking bureaucrat becomes suspicious, the two straight guys are forced to improvise as love-struck newlyweds. Jessica Biel, Ving Rhames and Dan Aykroyd co-star in this hilarious comedy.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(186, 186, 'United States', 1, 0, 0, '', '025193-227522', 486, 'Owned', 'The Bourne Ultimatum', 'Fullscreen', '', 'United States', '2007', '2007-12-11', 116, 'Keep Case', 0, 'USD', '29.98', 'Matt Damon returns as highly trained assassin Jason Bourne, who is on the hunt for the agents who stole his memory and true identity. With a new generation of skilled CIA operatives tracking his every move, Bourne is in a non-stop race around the globe as he finally learns the truth behind his mysterious past. Loaded with incredible fight and chase sequences, it''s the exhilarating movie with "mind-blowing action" (Roger Ebert, ''Chicago Sun-Times'') that you can''t afford to miss!', '', 'USD', '29.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(187, 187, 'United States', 1, 0, 0, '', '025193-232724', 306, 'Owned', 'Man of the Year', 'Full Screen', '', '', '2006', '2007-02-20', 115, 'Keep Case', 0, 'USD', '29.98', 'Comedy superstar Robin Williams (''RV,'' ''The Birdcage,'' ''Mrs. Doubtfire'') plays Tom Dobbs, a comedian who made it to the top by telling it like it is. When he decides to run for president to unleash his trademark comic rants on the powers that be -- he wins! From the director of ''Good Morning, Vietnam'' and ''Wag the Dog'' comes an irreverent comedy hit with a hilarious all-star cast that is sure to win your vote for best comedy of the year!', '', 'USD', '29.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(188, 188, 'United States', 1, 0, 0, '', '025193-321824', 308, 'Owned', 'Hot Fuzz', 'Widescreen', '', 'United Kingdom', '2007', '2007-07-31', 121, 'Keep Case', 0, 'USD', '29.98', 'Get ready for a gut-busting, outrageous comedy from the guys that created ''Shaun of the Dead''. Nicholas Angel (Simon Pegg) is a big-city cop who can''t be stopped - but he''s making everyone else on the force look bad. When he is reassigned to a small, quiet town, he struggles with this new, seemingly idyllic world and his bumbling partner (Nick Frost). But their dull existence is interrupted by several grisly and suspicious accidents, and the crime-fighting duo turn up the heat and hand out high-octane, car-chasing, gun-fighting, big-city justice in this hilarious hit critics are calling "Outrageous! Uproariously funny!" (Thelma Adams, ''US WEEKLY'').', '', 'USD', '29.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(189, 189, 'United States', 0, 0, 0, 'Digital', '025193-330222', 988, 'Owned', 'The Strangers', 'Unrated', '', 'United States', '2008', '2008-10-21', 88, 'Keep Case', 1, 'USD', '29.98', 'Explore your worst fears imaginable with this shocking suspense thriller inspired by disturbing true events.\n\nAfter a 4 a.m. knock at the door and a haunting voice,  Kristen McKay (Liv Tyler) and James Hoyt''s (Scott Speedman) remote getaway becomes a psychological night of terror as three masked strangers invade.  Now they must go far beyond what they thought themselves capable of if they hope to survive.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(190, 190, 'United States', 0, 0, 0, 'Digital', '025195-001861', 922, 'Owned', 'Hellboy II: The Golden Army', 'Widescreen', '', 'United States', '2008', '2008-11-11', 120, 'Keep Case', 0, 'USD', '29.98', 'The fate of mankind hangs in the balance when a ruthless prince awakens an unstoppable army of creatures and wages war with the human world. It''s up to Hellboy and his team of paranormal outcasts to face off with the forces of darkness in the ultimate battle of good versus evil!\n\nFrom the visionary director of <i>Pan''s Labyrinth, Hellboy II: The Golden Army</i> takes you into fantastical worlds with imaginative creatures and thrilling fight sequences unlike anything you''ve ever seen before!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(191, 191, 'United States', 0, 0, 0, 'Digital', '025195-004848', 1011, 'Owned', 'Charlie Wilson''s War', 'Widescreen', '', 'United States', '2007', '2008-04-22', 102, 'Keep Case', 0, 'USD', '29.98', 'Academy Award winners Tom Hanks, Julia Roberts and Philip Seymour Hoffman star in this compelling and witty film from Oscar-winning director Mike Nichols and Primetime Emmy-winning writer Aaron Sorkin (<i>The West Wing</i>). Based on the outrageous true story, <i>Charlie Wilson''s War</i> shows how one congressman who loved a good time, one Houston socialite who loved a good cause and one renegade CIA agent who loved a good fight conspired to bring about the largest covert operation in history.\n\n Tom Hanks: 1993 Best Actor, <i>Philadelphia</i> and 1994 Best Actor, <i>Forrest Gump</i>, Julia Roberts: 2000 Best Actress, <i>Erin Brockovich</i>. Philip Seymour Hoffman: 2005 Best Actor, <i>Capote</i>.\n\n 1967 Best Director, <i>The Graduate</i>.\n\n 2003 Outstanding Drama Series, <i>The West Wing</i>.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(192, 192, 'United States', 1, 0, 0, '', '025195-005920', 643, 'Owned', 'The Kingdom', 'Widescreen', '', 'United States', '2007', '2007-12-23', 110, 'Keep Case', 0, 'USD', '29.98', 'Oscar winners* Jamie Foxx (''Collateral'') and Chris Cooper (''Breach'') and Golden Globe winners** Jennifer Garner (''Daredevil'') and Jason Bateman (''Smokin'' Aces'') ignite the screen in this high-intensity thriller about a team of elite FBI agents sent to Saudi Arabia to solve a brutal mass murder and find a killer before he strikes again. Out of their element and under heavy fire, the team must join forces with their Saudi counterparts. As these unlikely allies begin to unlock the secrets of the crime scene, the team is led into a heart-stopping, do-or-die confrontation.', '', 'USD', '29.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(193, 193, 'United States', 0, 0, 0, 'Digital', '025195-012935', 995, 'Owned', 'Leatherheads', 'Widescreen', '', 'United States', '2008', '2008-09-23', 114, 'Keep Case', 0, 'USD', '29.98', 'Academy Award winners George Clooney and Rene Zellweger team up in this fun-filled comedy set against the beginnings of pro football. Dodge Connelly (Clooney), captain of a struggling squad of barroom brawlers, has only one hope to save his team: recruit college superstar Carter Rutherford (John Krasinski, <i>The Office</i>). But when a feisty reporter (Zellweger) starts snooping around, she turns the two teammates into instant rivals and kicks off a wild competition filled with hilarious screwball antics! Critics are cheering <i>Leatherheads</i> as "a real winner" (Claudia Puig, <i>USA Today</i>).\n\n George Clooney: 2005 Best Supporting Actor, <i>Syriana</i>. Rene Zellweger: 2003 Best Supporting Actress, <i>Cold Mountain</i>.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(194, 194, 'United States', 0, 0, 0, 'Digital', '025195-014410', 994, 'Owned', 'Knocked Up', '', '', 'United States', '2007', '2007-09-25', 129, 'Keep Case', 0, 'USD', '29.98', 'The writer and director of ''The 40-Year-Old Virgin'' delivers a hilarious hit comedy that the New York Post calls "BRILLIANT."\n\nThey say that opposites attract. Well, for slacker Ben (Seth Rogen) and career girl Alison (Katherine Heigl), thats certainly the case - at least for one intoxicating evening. Two months and several pregnancy tests later, Ben and Alison go through a hysterically funny, anxious and heartwarming journey that The New York Times calls "AN INSTANT CLASSIC"', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(195, 195, 'United States', 0, 0, 0, 'Digital', '025195-015899', 962, 'Owned', 'Doomsday', 'Unrated', '', 'United States', '2008', '2008-07-29', 113, 'Keep Case', 1, 'USD', '29.98', 'From the director of <i>The Descent</i> comes an action-packed thrill ride through the beating heart of hell! To save humanity from an epidemic, an elite fighting unit must battle to find a cure in a post-apocalyptic zone controlled by a society of murderous renegades. Loaded with ferocious fights and high-octane chases, <i>Doomsday</i> grabs you right from the start and doesn''t let go till its explosive end!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(196, 196, 'United States', 0, 0, 0, 'Digital', '025195-016490', 1008, 'Owned', 'Burn After Reading', 'Spotlight Series', '', 'United States', '2008', '2008-12-23', 96, 'Keep Case', 0, 'USD', '29.98', 'An all-star cast, including George Clooney, Brad Pitt, Frances McDormand, Tilda Swinton and John Malkovich, come together in this outrageous spy comedy about murder, blackmail, sex addiction and physical fitness!\n\nWhen a disc filled with some of the CIA''s most irrelevant secrets gets in the hands of two determined, but dim-witted, gym employees, the duo are intent on exploiting their find.  But since blackmail is a trade better left for the experts, events soon spiral out of everyone''s and anyone''s control, resulting in a non-stop series of hilarious encounters!\n\nFrom Joel and Ethan Coen, the Academy Award-winning* directors of <i>No Country For Old Men</i> and <i>The Big Lebowski</i>, comes this brilliantly clever and endlessly entertaining movie that critics are calling, smart, funny, and original (Ben Lyons, <i>E!</i>).\n\n*2007 Best Picture  No Country for Old Men, 2007 Best Adapted Screenplay  No Country for Old Men, 2007 Best Director  No Country for Old Men, 1996 Best Original Screenplay  Fargo', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(197, 197, 'United States', 0, 0, 0, 'Digital', '025195-016650', 1017, 'Owned', 'Forgetting Sarah Marshall', 'Unrated', '', 'United States', '2008', '2008-09-30', 118, 'Keep Case', 0, 'USD', '29.98', 'Peter (Jason Segel) is a struggling musician who finds his world turned upside down when his TV celebrity girlfriend, Sarah Marshall (Kristen Bell), dumps him for a tragically hip rock star. It''s the hysterically funny look at how far one man will go to forget a girl  and all the fun he finds along the way!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(198, 198, 'United States', 0, 0, 0, 'Digital', '025195-016902', 1009, 'Owned', 'Changeling', '', '', 'United States', '2008', '2009-02-17', 142, 'Keep Case', 0, 'USD', '24.98', 'Clint Eastwood directs Oscar winner Angelina Jolie and Oscar nominee John Malkovich in a riveting and unforgettable true story.\n\nLos Angeles, 1928. When single mother Christine Collins (Jolie) leaves for work, her son vanishes without a trace. Five months later, the police reunite mother and son; but he isnt her boy. Driven by one womans relentless quest for the truth, the case exposes a world of corruption, captivates the public and changes Los Angeles forever.\n\nThis emotionally gripping story illustrates the profound power of a mothers love in "a mesmerizing film that burns in the memory" (Peter Travers, <i>Rolling Stone</i>).\n\nAngelina Jolie, Best Supporting Actress, 1999 <i>Girl, Interrupted</i>\nJohn Malkovich, Best Supporting Actor, 1984 <i>Places in the Heart</i>, 1992 <i>In the Line of Fire', '', 'USD', '24.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(199, 199, 'United States', 0, 0, 0, 'Digital', '025195-017008', 1032, 'Owned', 'Role Models', 'Unrated Edition', '', 'United States', '2008', '2009-03-10', 101, 'Keep Case', 0, 'USD', '29.98', 'Prepare yourself for the most irreverent and funny comedy that brings new meaning to juvenile delinquency!\n \nAs the worlds least-likely mentors, Danny (PAUL RUDD) & Wheeler (SEANN WILLIAM SCOTT) must put aside their selfish, sarcastic and party-driven ways to order to give two odd, foul-mouthed kids invaluable wisdom about life, love and heavy metal.\n \nWith a supporting cast of comic all-stars including Elizabeth Banks, Jane Lynch, Christopher Mintz-Plasse and Bobbe J. Thompson, <i>ROLE MODELS</i> is "a surprisingly clever comedy" (Claudia Pulg, <i>USA Today</i>}.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
