(201, 201, 'United States', 1, 0, 0, '', '025195-021395', 655, 'Owned', 'Sydney White', 'Full Frame', '', 'United States', '2007', '2008-01-22', 108, 'Keep Case', 0, 'USD', '29.98', 'Pledging her late mom''s sorority, Sydney White (Amanda Bynes) comes up against the vain and villainous Rachel (Sara Paxton). Sydney gets banished to an unpopular house where she meets seven dwarves - that is, dorks, or more generously, outcasts - that she befriends before falling for a handsome prince - that is, young man (Matt Long) - with her best interests at heart. Sassy update of the Snow White tale co-stars John Schneider, Crystal Hunt.', '', 'USD', '29.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(202, 202, 'United States', 1, 0, 0, '', '025195-029191', 634, 'Owned', 'The Andromeda Strain Pt.1', '', '', 'United States', '2008', '2008-06-03', 177, 'Keep Case', 1, 'USD', '26.98', 'Based on the best-selling novel by Michael Crichton, the A&E mini-series event ''The Andromeda Strain'' arrives on DVD in this special 2-disc collection! Two-time Academy Award nominee* Mikael Saloman (''Band of Brothers'') directs a powerhouse cast, including Benjamin Bratt (''Law & Order''), Christa Miller (''Scrubs''), Eric McCormack (''Will & Grace''), Ricky Schroder (''NYPD Blue''), Andre Braugher (''City of Angels''), Viola Davis (''Disturbia''), and Daniel Dae Kim (''Lost'') in this thrilling sci-fi adventure. When a mysterious virus is brought to earth by a returning satellite, an elite and dedicated squad of scientists assembles to search for the truth and stop the mutating killer before it ends life on earth. Presented by three-time Academy Award nominee** Ridley Scott (''American Gangster'') and Primetime Emmy award winner Tony Scott (''Numb3rs''), ''The Andromeda Strain'' includes all 4 televised hours, exclusive bonus materials and features Dolby 5.1 Surround Sound. Own the action-packed epic today!\n\n* 1989 Best Cinematography, ''The Abyss''; 1991 Best Visual Effects, ''Backdraft''\n** 1991 Best Director, ''Thelma & Louise; 2000 Best Director, ''Gladiator''; 2001 Best Director, ''Black Hawk Down''\n 2002 Outstanding Made for Television Movie, ''The Gathering Storm''', '', 'USD', '26.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
