(204, 204, 'United States', 1, 0, 0, '', '025195-041997', 674, 'Owned', 'Baby Mama', '', '', 'United States', '2008', '2008-09-09', 99, 'Keep Case', 0, 'USD', '29.98', 'Comedic geniuses Tina Fey (<i>30 Rock, Saturday Night Live</i>) and Amy Poehler (<i>Saturday Night Live</i>) team up to celebrate a modern twist on motherhood!\n\nKate (Fey) is a single, successful career woman who wants something more: a baby. But she gets more than she bargained for when she hires Angie (Poehler), a free spirit from South Philly, to be her surrogate in a hysterical mama match-up. From birth class to baby-proofing, they''re the ultimate odd couple that critics are calling "the best female comedy duo since Lucy and Ethel" (Claudia Puig, <i>USA Today</i>).\n\nWith hilarious performances from an all-star cast featuring Greg Kinnear, Dax Shepard, and Sigourney Weaver, <i>Baby Mama</i> is as full of laughs as it is heart!', '', 'USD', '29.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(205, 205, 'United States', 0, 0, 0, 'Digital', '025195-043229', 936, 'Owned', 'Never Back Down', '', '', '', '2008', '2008-07-29', 113, 'Keep Case', 0, 'USD', '26.99', 'nJake (Sean Faris) is the new kid in school. When a beautiful girl (Amber Heard) befriends him, Jake thinks he''s set. But instead, her fight-club boyfriend, Ryan (Cam Gigandet), smacks Jake a bloody, black-eyed welcome. Humiliated, Jake then turns to a mixed martial arts (MMA) master (Djimon Hounsou), who teaches him how to fight...and how to walk away. But it becomes obvious that a brutal re-match is inevitable if Jake wants to stop Ryan and his bullying, once and for all.', '', 'USD', '26.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(206, 206, 'United States', 0, 0, 0, 'Digital', '025195-054645', 990, 'Owned', 'The Unborn', '', '', 'United States', '2009', '2009-07-07', 88, 'Keep Case', 0, 'USD', '29.98', 'Enter a world of unrelenting evil as terror finds a new form in The Unborn. From the producers of The Texas Chainsaw Massacre and the co-writer of The Dark Knight comes this shocking supernatural thriller about a young woman (Odette Yustman) plagued by chilling dreams and tortured by a demonic ghost that haunts her waking hours. Her only hope to break the debilitating paranormal curse is in an exorcism with spiritual advisor Sendak (Gary Oldman). See what lies beyond the doorway of our world in this non-stop nightmare of the undead', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(207, 207, 'United States', 0, 0, 0, 'Digital', '025195-056601', 917, 'Owned', 'Death Race', 'Unrated', '', 'United States', '2008', '2008-12-21', 111, 'Keep Case', 1, 'USD', '29.98', 'Welcome to the Death Race, where hardened convicts and smoking-hot navigators race tricked-out cars in the most twisted spectator sport on Earth! Sentenced to the world''s most dangerous prison for a murder he did not commit, Jensen Ames (Jason Statham) has only one chance to get out alive - win the ultimate race to the death. Also starring Tyrese Gibson, <i>Death Race</i>, is a "supercharged, sick and satisfying" (Nathan Lee, <i>The New York Times</i>) ride that will keep you pinned to your seat all the way to its insane, metal-crushing end!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(208, 208, 'United States', 1, 0, 0, '', '025195-056632', 667, 'Owned', 'Mamma Mia! The Movie', '', '', 'United States', '2008', '0000-00-00', 100, 'Keep Case', 0, 'USD', '19.99', 'Sophie has just one wish to make her wedding perfect: to have her father walk her down the aisle.  Now she just has to find out who he is...\nJoin the music, laughter and fun of the irresistibly charming <i>Mamma Mia! The Movie</i>. Academy Award winner Meryl Streep leads an all-star cast, including Pierce Brosnan and Colin Firth - as well as up-and-comers Amanda Seyfried and Dominic Cooper, in this musical celebration of mothers, daughters and fathers, and true loves lost and new ones found.  Based on the Broadway smash-hit and filled with the ABBA songs you know and love, it''s the feel good experience that will have you singing and dancing over and over again', '', 'USD', '19.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(209, 209, 'United States', 0, 0, 0, 'Digital', '027616-085313', 987, 'Owned', 'Species: The Awakening', 'Unrated', '', 'United States', '2007', '2007-10-02', 103, 'Keep Case', 0, 'USD', '26.98', 'She may be beautiful on the outside...but inside, she''s carrying a deadly secret! Prepare yourself for the fourth terrifying installment in the legendary Species series, which rachets up thrill-factor to the highest possible level of action,horror and mayhem!\n\nWhen brilliant college professor Miranda Hollander suffers a mysterious blackout, and awakens amid the bloody aftermath of a mass slaughter, she turns to her uncle for answers. But when he reveals the shocking truth...that she''s only half human, a clone from a hybrid of human and alien DNA, they must flee to Mexico to locate the scientist who created her. Soon they find themselves locked in battle with a horde of rampaging, unstoppable hybrids...and time is running out before Miranda will inevitably surrender to the killer instinct that lurks inside her own body!', '', 'USD', '26.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(210, 210, 'United States', 1, 0, 0, '', '027616-603692', 267, 'Owned', 'Get Shorty', '', '', '', '1995', '1997-03-25', 105, 'Keep Case', 0, 'USD', '24.98', 'Drug Smuggling.  Racketeering.  Loan Sharking.  Welcome to Hollywood!  Golden Globe winner* John Travolta leads an all-star cast in "the most flat-out enjoyable movie of the year" (''NY Newsday'') - a hysterical comedy that insists it doesn''t take much to make it in the movies... just a background witht the mob.\n\nLoanshark Chili Palmer (Travolta) has done his time as a gangster. So when "business" takes him to Los Angeles to collect a debt from down-and-out filmmaker Harry Zimm (Gene Hackman), Chili talks tough and then pitches Harry a script idea. Immediately, Chili is swept into the Hollywood scene: he schmoozes film star Martin Weir (DeVito), romances "B" movie queen Karen Flores (Rene Russo) and even gets reservations at the hottest restaurants in town. In fact, all would be  smooth for this cool new producer, if it weren''t for the drug smugglers and an angry mobster who won''t leave him alone. But hey, this is Hollywood and no one said it would be easy!\n\n*1995 Best Actor (Comedy)', '', 'USD', '24.98', '2007-08-09', '2016-11-15 00:00:00', NULL),
(211, 211, 'United States', 0, 0, 0, 'Digital', '027616-603999', 973, 'Owned', 'Poltergeist', '', '', 'United States', '1982', '1997-04-08', 114, 'Snapper', 0, 'USD', '24.98', 'Director Tobe Hooper joins forces with Oscar winner Steven Spielberg* and special effects master George Lucas (<i>Star Wars</i>) to create an extraordinary, ultra-fantastic excursion into the supernatural. A high-voltage spectacle boasting "dazzling special effects" (Leonard Maltin) and "impeccable technology" (Roger Ebert), <i>Poltergeist</i> is a must-see horror classic and a "superior, spectacular ghost story" (<i>Newsweek</i>). \n\nLife is very pleasant for the close-knit Freeling family until a host of otherworldy forces invades their peaceful suburban home. It starts with just an odd occurence or two, but soon their house is transformed into a swirling supernatural sideshow. The forces at work are anything but friendly, and if the luck-less Freelings don''t clear out soon, they''ll all be swept off into nightmarish chaos!\n\nStarring Craig T. Nelson ("Coach") and JoBeth Williams (<i>The Big Chill</i>), <i>Poltergeist</i> is astounding and absorbing, yet laced with humor and warmth. It is "a work of art...full of spine-snapping chills!" (<i>Time</i>).\n\n*Irving G. Thalberg Memorial Award (1986); Best Director, <i>Schindler''s List </i>(1993); Best Picture (Producer), <i>Schindler''s List </i>(1993)', '', 'USD', '24.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(212, 212, 'United States', 1, 0, 0, '', '027616-644220', 431, 'Owned', 'GoldenEye', 'Special Edition', '', 'United Kingdom', '1995', '1999-10-19', 130, 'Keep Case', 0, 'USD', '34.98', 'Pierce Brosnan ignites the screen in his first adventure as the unstoppable James Bond.  When a powerful satellite system falls into the hands of a former ally-turned-enemy, only 007 can save the world from an awesome space weapon that -- in one short pulse -- could destroy the earth!', '', 'USD', '34.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(213, 213, 'United States', 1, 0, 0, '', '027616-656629', 101, 'Owned', 'Overboard', '', '', '', '1987', '1999-01-19', 112, 'Keep Case', 0, 'USD', '24.98', 'It''s the craziest mix-up ever! Goldie Hawn and Kurt Russell dazzle the screen in this buoyant and screwball comedy of memory-making and memory-faking. One of Hollywood''s most dynamic screen pairs, Hawn and Russell make the most of every hilarious situation in this delightful riches to rags romance that''s perfect entertainment for anyone who appreciates a great practical joke.\n\nHawn is Joanna Stayton, the pampered wife of a pretentious, yacht-owning socialite. When their boat gets stuck for repairs, Joanna employs carpenter Dean Profitt (Russell) to improve her closet space. But when Dean asks to be paid, he''s blatantly turned down by the "nothing is ever good enough for me" Joanna. So when Joanna falls overboard and gets a bad case of amnesia, Dean takes advantage of the situation and, in a stroke of retributive genius, tells her that she''s his wife and the mother of his four unruly children!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(214, 214, 'United States', 1, 0, 0, '', '027616-672629', 432, 'Owned', 'Goldfinger', '', '', 'United Kingdom', '1964', '1998-11-19', 110, 'Snapper', 0, 'USD', '24.98', 'From "shocking" prologue to exhilarating mid-air climax, Goldfinger is a lightning-paced James Bond adventure that pits 007 against one of his most formidable opponents.  Sean Connery is Agent 007 in this fourteen-karat  thriller brimming with non-stop action, humor and almost unbearable excitement.  \n\nThe powerful tycoon Auric Goldfinger (Gert Frobe) has initiated "Operation Grand Slam", a cataclysmic scheme to raid Fort Knox and obliterate the world economy.  James Bond, armed with his specially equipped Aston Martin (its accessory package includes built-in machine guns, a smoke screen and an ejector seat), must stop the plan by overcoming several outrageous adversaries.  First there''s Oddjob (Harold Sakata), the mute servant who kills at the toss of a lethal hat; next, the beautiful Jill Masterson (Shirley Eaton), who gives new meaning to the phrase "golden girl"; and finally, sexy pilot Pussy Galore (Honor Blackman), whose romantic feelings for Bond complicate her involvement in Goldfinger''s high-flying scheme.\n\n With style, wit and wildly imaginative stunt sequences, this adrenaline-charged adventure ranks as one of the all-time great action films.  It''s an electrifying thrill ride that will captivate viewers from beginning to end.', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(215, 215, 'United States', 1, 0, 0, '', '027616-702524', 433, 'Owned', 'Tomorrow Never Dies', '', '', 'United States', '1997', '1998-05-12', 117, 'Keep Case', 0, 'USD', '34.98', 'Pierce Brosnan leaps into action as Agent 007 in this spectacular thrill ride of death-defying stunts and amazing high-tech gadgetry. In the most electrifying Bond film yet, the unstoppable action hero must prevent a tremendous global disaster ripped from tomorrow''s headlines. Boasting stunning special effects, powerhouse action sequences - including a wild motorcycle pursuit through (and over!) Saigon - and exceptional supporting performances by Jonathan Pryce, Terri Hatcher and inetrnational martial arts superstar Michelle Yeoh, ''Tomorrow Never Dies'' is a thrilling action-adventure "that roars from start to finish with the throttle wide open" (Gene Shalit, NBC-TV)!', '', 'USD', '34.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(216, 216, 'United States', 1, 0, 0, '', '027616-703620', 632, 'Owned', 'Species II', '', '', 'United States', '1998', '1998-10-20', 93, 'Keep Case', 0, 'USD', '24.98', 'Having just returned from a mission to Mars, Commander Ross (Justin Lazard) isn''t exactly himself. He''s slowly becoming a terrifying alien entity with a one-track mind--to procreate with human women!\n\nWhen countless women suffer gruesome deaths after bearing half-alien offspring, scientist Laura Baker (Marg Helgenberger) and hired assassin Press Lennox (Michael Madsen) use Eve (Henstridge) , a more tempered alien clone, to find Ross and his virulent brood. But they underestimate Eve''s maternal drive, and before long she escapes to mate with Ross in order to create a purer and unstoppable race that could spell doom for mankind.\n\nAs time is running out, the ultimate battle of human brain over alien takes place in a chilling climax that puts Darwin''s theory to the ultimate test...and only the strongest species will survive.', '', 'USD', '24.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(217, 217, 'United States', 1, 0, 0, '', '027616-703729', 382, 'Owned', 'The Secret of NIMH', '', '', 'United States', '1982', '1998-11-17', 82, 'Keep Case', 0, 'USD', '24.99', 'Get ready to meet some runaway rodents with an earth-shattering secret! Suspenseful and heartwarming, this beautifully animated odyssey stars Mrs. Brisby, a mild-mannered mother mouse with a plan to move Heaven and Earth (or at least her house and home) to save her family from Farmer Fitzgibbon''s plow!  \n\nAlong the way she gets some help from a loverlorn Crow, a busybody neighbor mouse and a fearsome Great Owl. Unfortunately, Mrs. Brisby will need an engineering miracle to hoist her home, and for that she must face a mysterious rat, fend off a ferocious cat and claim a magic amulet! But when Mrs. Brisby discovers the astounding ''Secret of NIMH''... it could change her life forever!\n\nThis timeless tale of love, courage and determination will transport the whole family into an enchanting world - where the bravest hearts live in the meekest of mice.', '', 'USD', '24.99', '2006-10-08', '2016-11-15 00:00:00', NULL),
(218, 218, 'United States', 1, 0, 0, '', '027616-770820', 535, 'Owned', 'Licence to Kill', 'Special Edition', '', 'United Kingdom', '1989', '1999-10-19', 133, 'Keep Case', 0, 'USD', '34.98', 'James Bond (Timothy Dalton) takes on his most daring adventure ever when he turns renegade and goes head to head with one of the international drug cartels most brutal and powerful leaders. This time, hes fighting not for country, not for justicebut for revenge!', '', 'USD', '34.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(219, 219, 'United States', 1, 0, 0, '', '027616-806420', 44, 'Owned', 'The Princess Bride', '', '', '', '1987', '2000-07-18', 98, 'Keep Case', 0, 'USD', '19.98', 'A fantastical escape into a world of swashbuckling swordsmen and gallant heroes, The Princess Bride is extraordinary entertainment for the whole family. Filled with "romanticism, adventure and a liberal shot of humor" (People), this innovative film from producer/director Rob Reiner and Academy Award-winning screenwriter William Goldman stars Cary Elwes, Robin Wright and Mandy Patinkin. Featuring brilliant cameo appearances by Peter Falk, Billy Crystal and more, and boasting "wonderful scenes and character vignettes" (Leonard Maltin), this lovable film is a fantasy everyone will adore!\n\nWhen Westley (Elwes) leaves to seek his fortune, his true love, Buttercup (Wright), is captured by an evil prince. Will Westley return in time to save her? Can he battle the wizards, warriors and pirates set in his way? You''ll find out in this "wonderfully inventive" (Los Angeles Times) film for all ages!', '', 'USD', '19.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(220, 220, 'United States', 1, 0, 0, '', '027616-809421', 11, 'Owned', 'Honeymoon In Vegas', '', '', '', '1992', '2000-04-25', 97, 'Keep Case', 0, 'USD', '14.98', 'James Cann (The Godfather), Nicolas Cage (Face/Off) and Sarah Jessica Parker (Sex In The City) are three sides of a deliriously funny triangle in this "refreshing blast of comic lunacy" (WCBS-TV) that gambles with an offbeat premise, and hits the jackpot with big laughs!\n\nJack Singer (Cage) is terrified of commitment....but even more terrified of losing his beautiful schoolteacher fiancee Betsy (Parker). So as an act of faith, he takes the plunge and agrees to tie the knot in a quickie Vegas ceremony.  But when he makes a bad $60,000 bet with mobster Tommy Korman (Cann), the marriage "knot" -- and all of Jack''s dreams -- start unraveling fast.  The only way that Korman will forgive the debt, he says, is if Jack will loan him Betsy for the rest of the weekend!  It''s yet another sucker bet for Jack though -- because Korman plans to win Betsy away for good!', '', 'USD', '14.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(221, 221, 'United States', 1, 0, 0, '', '027616-810021', 524, 'Owned', 'Spaceballs', '', '', '', '1987', '2000-04-25', 96, 'Keep Case', 0, 'USD', '24.98', 'May the farce be with you in this hysterically funny space oddity, created by comic genius Mel Brooks, that will send you into hyperspace with fits of laughter! Lampooning everything from ''Star Wars'' to ''Star Trek'', this outrageous send-up of epic sci-fi movies is full of cosmic crazies who score eight trillion on the laugh-meter (Gene Shalit, NBC-TV)!\n\nFearless  and clueless  space heroes Lone Starr (Bill Pullman) and his half man/half dog sidekick Barf (John Candy) wage interstellar warfare to free Princess Vespa (Daphne Zuniga) from the evil clutches of Dark Helmet (Rick Moranis). On the way to the rescue  in their Winnebago  they confront the huge, gooey Pizza The Hutt (voice of Dom De Luise), sassy robot Dot Matrix (voice of Joan Rivers) and a wise little creature named Yogurt (Mel Brooks), who teaches them the mystical power of The Schwartz in order to bring peace  and merchandising rights  to the entire galaxy!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(222, 222, 'United States', 1, 0, 0, '', '027616-812322', 430, 'Owned', 'Dr. No', 'Special Edition', '', 'United Kingdom', '1962', '2000-05-16', 110, 'Keep Case', 0, 'USD', '34.95', 'In the film that launched the James Bond saga, Agent 007 (Sean Connery) battles the mysterious Dr. No, a scientific genius bent on destroying the U.S. space program. As the countdown to disaster begins, Bond must travel to Jamaica where he encounters the beautiful  Honey Ryder (Ursula Andress) and confronts the megalomaniacal villain in his massive island headquarters.', '', 'USD', '34.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(223, 223, 'United States', 1, 0, 0, '', '027616-812421', 429, 'Owned', 'The Man with the Golden Gun', 'Special Edition', '', 'United Kingdom', '1974', '2000-05-16', 125, 'Keep Case', 0, 'USD', '34.98', 'James Bond (Roger Moore) may have met his match in Francisco Scaramanga (Christopher Lee), a world-renowned assassin whose weapon of choice is a distinctive gold pistol.  When Scaramanga seizes the priceless Solex Agitator energy converter, Agent 007 must recover the device and confront the trained killer in a heart-stopping duel to the death!', '', 'USD', '34.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(224, 224, 'United States', 1, 0, 0, '', '027616-812926', 534, 'Owned', 'The Spy Who Loved Me', '', '', 'United Kingdom', '1977', '2000-05-16', 125, 'Keep Case', 0, 'USD', '34.95', 'James Bond (Roger Moore) and the beautiful Soviet Agent Anya Amasova (Barbara Bach) team up to investigate missing Allied and Russian atomic submarines, following a deadly trail that leads to billionaire shipping magnate Karl Stromberg (Curt Jurgens).  Soon Bond and Anya are the world''s only hope as they discover a nightmarish scheme of global nuclear Armageddon!', '', 'USD', '34.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(225, 225, 'United States', 1, 0, 0, '', '027616-853417', 329, 'Owned', 'Return to Me', '', '', '', '2000', '2000-10-31', 116, 'Keep Case', 0, 'USD', '26.98', 'Who knew that when he ordered the special, he''d get the dish of his life? David Duchovny ("The ''X''-Files") and Minnie Driver (''Good Will Hunting'') ignite sparks in this "warm-hearted winner"  (Jeff Craig, ''Sixty Second Preview'') about a widower and a waitress who meet and fall in love. Featuring an incredible all-star cast, this hilarious romantic comedy delivers a lot of laughs, tears and joys that will make your spirits soar.\n\nIt took a lot of coaxing to get Bob (Duchovny), a recently widowed architect, to go on a blind date at a quirky Irish-Italian eatery. Once there, he''s smitten instantly...not with his date, but with the sharp-witted waitress, Grace (Driver). With unsolicited help from Grace''s match-making Grandfather (Carroll O''Connor), Bob asks her out. And as their relationship blossoms, everything seems to be going great, until an unbelievable truth is revealed...one that could easily break both of their hearts for good.', '', 'USD', '26.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(226, 226, 'United States', 1, 0, 0, '', '027616-858580', 228, 'Owned', 'Baby Boom', '', '', '', '1987', '2001-02-06', 110, 'Keep Case', 0, 'USD', '14.98', 'Academy Award winner Diane Keaton "is smashing" (Pauline Kael) as a high-powered career woman who inherits a baby -- and discovers a side of herself she never knew she hada maternal one! Co-starring Sam Shepard and James Spader, this "sophisticated, screwball comedy" (Rex Reed, "At the Movies") about the pitfalls and payoffs of instant parenthood will put a smile on your face again and again.\n\nJ.C. Wiatt (Keaton) thinks she has it all together. Beautiful and talented, she''s on the road to certain success. So when an adorable baby girl comes into her life by way of a distant cousin''s will, it''s J.C. who breaks out in a rash! Juggling power lunches and powdered formula, she is soon forced off the fast track by a conniving colleague and a bigoted boss. But this lady won''t stay down for long. She''ll prove to the world that a woman can have it all -- and on her own terms too!', '', 'USD', '14.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(227, 227, 'United States', 1, 0, 0, '', '027616-868268', 148, 'Owned', 'Legally Blonde', 'Special Edition', '', '', '2001', '2001-11-06', 96, 'Keep Case', 0, 'USD', '26.95', 'She''s a California sorority girl who''ll do anything to keep her man. Even if it means going all the way to law school! Reese Witherspoon (Election) stars with Luke Wilson (Charlie''s Angels), Selma Blair (Cruel Intentions), Matthew Davis (Pearl Harbor) and Victor Garber (Titanic) in a knock-out comedy with a heart of gold - and hair to match!\n\nElle Woods (Witherspoon) is a California blonde with couture clothes, fabulous friends and the hottest boyfriend on campus. So when Warner Huntington III (Davis) suddenly dumps her and heads for Harvard Law School, Elle takes matters into her own perfectly manicured hands. She enrolls too! Now getting Warner back should be a snap, right? Wrong! Elle''s about to begin the toughest fight of her life - for love, honor, justice and respect for blondes everywhere!', '', 'USD', '26.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(228, 228, 'United States', 1, 0, 0, '', '027616-869449', 290, 'Owned', 'Mannequin', '', '', '', '1987', '2001-12-26', 90, 'Keep Case', 0, 'USD', '14.95', 'A charming romantic comedy starring Andrew McCarthy (''Pretty in Pink''), Kim Cattrall ("Sex and the City"), Meshach Taylor ("Designing Women"), Estelle Getty ("The Golden Girls") and James Spader (''Stargate''), ''Mannequin'' is more than the sum of its fiberglass body parts it''s all heart!\n\nJonathan Switcher (McCarthy) has certainly been living up to his name.  A frustrated artist, he switches from one dead-end job to another, never managing to hold on to any of them.  But all of that changes when a mannequin he created for a department store window comes magically to life! Gorgeous and statuesque, this fiberglass femme fatale (Cattrall) helps Jonathan turn his career around, inspiring him to be the best window dresser in town.  But she soon discovers that the real world isn''t so easy, when they run into competitors who want to put them out of the business - for good!', '', 'USD', '14.95', '2007-08-09', '2016-11-15 00:00:00', NULL);
INSERT INTO `details` (`id`, `film_id`, `locality`, `media_dvd`, `media_hddvd`, `media_bluray`, `media_custom`, `upc`, `collectionnumber`, `collectiontype`, `title`, `disttrait`, `originaltitle`, `origin`, `prodyear`, `released`, `runningtime`, `casetype`, `slipcover`, `srpid`, `srp`, `overview`, `easteregg`, `purchcurrencyid`, `purchprice`, `purchdate`, `created_at`, `updated_at`) VALUES
(229, 229, 'United States', 1, 0, 0, '', '027616-876652', 527, 'Owned', 'UHF', '', '', '', '1989', '2002-06-04', 97, 'Keep Case', 0, 'USD', '19.95', '''Weird Al'' Yankovic, Kevin McCarthy (''Innerspace''), Michael Richards (''Seinfeld''), David Bowe (''The Cable Guy''), Victoria Jackson (''Saturday Night Live'') and Fran Drescher (''The Nanny'') star in this inspired comedy about an offbeat guy who turns a deadbeat TV station into a raging success! Broadcasting Weird Al''s unique brand of humor, ''UHF'' is a place you''ll want to visit - with increasing frequency!\n\nGeorge Newman (Weird Al) is a daydreamer whose hyperactive imagination keeps him from holding a steady job... until his uncle hires him to manage Channel 62, a station that''s losing money and viewers fast. But when George replaces the station''s reruns with bizarre programs like ''Wheel Of Fish'' and ''Raul''s Wild Kingdom'' (where poodles fly from third-story windows), ratings begin to soar! Can George find the money he needs to stay on the air? Stay tuned!', '', 'USD', '19.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(230, 230, 'United States', 1, 0, 0, '', '027616-880567', 230, 'Owned', 'The Crocodile Hunter: Collision Course', 'Special Edition', '', 'United States', '2002', '2002-12-17', 89, 'Keep Case', 0, 'USD', '26.98', 'Steve Irwin makes his big-screen debut with his most perilous adventure yet! To save a very large crocodile from poachers, Steve and his wife Terri set out on a death-defying journey through the outback to nab the big fella and relocate him to a safe river. But what they don''t know is that the angry reptile has swallowed a top-secret U.S. satellite beacon, making them ''all'' targets of American special agents. Crikey!', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(231, 231, 'United States', 1, 0, 0, '', '027616-884169', 664, 'Owned', 'Rain Man', 'Special Edition', '', 'United States', '1988', '2004-02-03', 134, 'Keep Case', 1, 'USD', '19.98', 'Charlie Babbitt (Cruise) has just discovered he has an autistic brother named Raymond (Hoffman) and is now taking him on the ride of his life. Or is it the other way around? From his refusal to drive on major highways to a "four minutes to Wapner" meltdown at an Oklahoma farmhouse, Raymond first pushes hot-headed Charlie to the limits of his patience...and then pulls him completely out of his self-centered world! But what begins as an unsentimental journey for the Babbitt brothers becomes much more than the distance between two places - it''s a connection between two vastly different people...and "a poignant, profound and powerful film" (Joel Siegel, ABC-TV)!', '', 'USD', '19.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(232, 232, 'United States', 1, 0, 0, '', '027616-884282', 533, 'Owned', 'Die Another Day', 'Special Edition', '', '', '2002', '2003-06-03', 132, 'Keep Case', 0, 'USD', '29.95', 'When his top-secret mission is sabotaged, James Bond (Pierce Brosnan) finds himself captured by the enemy, abandoned by M16 and stripped of his 00-license. Determined to get revenge, Bond goes head-to-head with a sultry spy (Oscar  winner Halle Barry), a frosty agent (Rosamund Pike) and a shadowy billionaire (Toby Stephens) whose business is diamonds...but whose secret is a diabolical weapon that could bring the world to its knees! Bristling with excitement and bursting with explosive special effects, Die Another Day is an adrenaline-pumping thrill-ride with "stunts and nonstop action [that] will astonish you" (Jeffrey Lyons, WNBC-TV)!', '', 'USD', '29.95', '2006-02-03', '2016-11-15 00:00:00', NULL),
(233, 233, 'United States', 1, 0, 0, '', '027616-888655', 55, 'Owned', 'The Cutting Edge', '', '', '', '1992', '2001-01-09', 102, 'Keep Case', 0, 'USD', '14.95', 'Moira Kelly (Dangerous Beauty, "The West Wing") and D. B. Sweeney (Roommates, Memphis Belle) star as polar opposites who unite on the ice for a shot at Olympic gold in this inspirational romantic comedy from acclaimed director Paul M. Glaser (The Running Man). Brimming with wit, charm and plenty of breathtaking sports action, The Cutting Edge is a real winner!\n     She''s a rich and refined pairs figure skater whose prima donna attitude has her skating solo. He''s a brash, blue-collar hockey champion with a new injury and no future. With nothing in common but their dream of reaching the Olympics, Kate and Doug are each other''s last resort. Reluctantly, they join forces, but its not long before the barbs - and sparks - start flying as the unlikely pair skate towards the opportunity of a lifetime: a chance at a medal...and a chance at love.', '', 'USD', '14.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(234, 234, 'United States', 1, 0, 0, '', '027616-901224', 226, 'Owned', 'Uptown Girls', 'Special Edition', '', '', '2003', '2004-01-06', 92, 'Keep Case', 0, 'USD', '26.98', 'Brittany Murphy (Don''t Say A Word) and Dakota Fanning (I Am Sam) shine brighter than all the lights of Manhattan in this delightful New York fairy tale. Co-starring Marley Shelton (Never Been Kissed), Donald Faison ("Scrubs") and Heather Locklear ("Spin City"), Uptown Girls will make you laugh, cry... and laugh again!\n\nMolly (Murphy) is a partying rock ''n'' roll princess whose money just ran out. Ray (Fanning) is a fussy nine-year-old whose last nanny just ran out. Only Ray''s way-too-busy mom (Locklear) could think that hiring Molly would be the perfect setup for both girls. But as this unlikely pair faces everything from control issues (Ray''s, of course) to tempter tantrums (Molly''s, of course), they discover that sometimes, your best friend can come from the place you least expect!', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(235, 235, 'United States', 1, 0, 0, '', '027616-905734', 194, 'Owned', 'Dances with Wolves', '', '', '', '1990', '2004-05-25', 181, 'Keep Case', 0, 'USD', '14.95', 'Sent to protect a U.S. outpost on the desolate frontier, Lt. John Dunbar (Kevin Costner) finds himself alone in the vast wilderness. Befriending the very people he''s sent to protect the outpost from, the Sioux Indians, Dunbar slowly comes to revere those he once feared. But when the encroaching U.S. Army threatens to overrun the Sioux, he is forced to make a choice - one that will forever change his destiny and that of a proud and defiant nation.', '', 'USD', '14.95', '2008-05-27', '2016-11-15 00:00:00', NULL),
(236, 236, 'United States', 1, 0, 0, '', '027616-911971', 631, 'Owned', 'Species', '', '', '', '1995', '2004-10-19', 108, 'Keep Case', 0, 'USD', '14.95', 'Charged with pulse-pounding suspense, ingenious special effects from Academy Award winner Richard Edlund and a first-rate cast including Oscar winner Ben Kingsley, Michael Madsen, Alfred Molina, Forest Whitaker, Marg Helgenberger and Natasha Henstridge, ''Species'' is an adrenaline-charged thrill-ride you''ll never forget! \n\nWhen a beautiful human-alien hybrid (Henstridge) escapes from observation, scientist Xavier Fitch (Kingsley) dispatches a crew of experts to find her before she is able to fulfill her horrific purpose: to mate with unsuspecting men and produce offspring that could destroy mankind. As her deadly biological clock ticks rapidly, Fitch and his team are hurled into a desperate battle in which the fate of humanity itself hangs in the balance!', '', 'USD', '14.95', '2008-08-30', '2016-11-15 00:00:00', NULL),
(237, 237, 'United States', 1, 0, 0, '', '027616-919991', 633, 'Owned', 'Species III', 'Unrated Edition', '', 'United States', '2004', '2004-12-07', 112, 'Keep Case', 0, 'USD', '25.98', 'The war between two species heats up in this thrilling third installment of the ''Species'' franchise...and this exclusive unrated edition boasts additional footage that''s likely to cause a meltdown!. Featuring a sex young cast led by newcomer Sunny Mabrey, this riveting film is the most jarring, action-packed chapter in the sci-fi series yet!\n\nIn the ongoing fight  for supremacy between mankind and human-alien hybrids, a fatal hybrid weakness has given humans the advantage, until now. When Sara (Mabrey), the daughter of Eve (Natasha Henstridge), is born, she develops into the most genetically perfect alien form yet! Seeking to repopulate Earth with her kind, this dangerously beautiful femme fatale heeds an overwhelming drive to mate...while a crack military team trails her in an attempt to end the war between the two species forever!', '', 'USD', '25.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(238, 238, 'United States', 1, 0, 0, '', '027616-927200', 268, 'Owned', 'Be Cool', '', '', '', '2005', '2005-06-07', 120, '', 0, 'USD', '19.99', '', '', 'USD', '19.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
(239, 239, 'United States', 0, 0, 0, 'Digital', '031398-100027', 1023, 'Owned', 'Restraint', '', '', 'Australia', '2008', '2008-08-19', 91, 'Keep Case', 0, 'USD', '26.98', 'Two fugitives on the run take a hostage with a dark past of his own. Dale (Teresa Palmer) and Ron (Travis Fimmel) find themselves inferior participants in a game of survival. Andrew (the hostage) takes a perverse liking to his new found companions.', '', 'USD', '26.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(240, 240, 'United States', 0, 0, 0, 'Digital', '031398-101109', 920, 'Owned', 'The Forbidden Kingdom', '2-Disc Special Edition', '', 'United States', '2008', '2008-09-09', 104, 'Keep Case', 0, 'USD', '34.98', 'Individually, they''ve starred in the most adrenaline-pumping martial-arts adventures ever. Together for the first time, JET LI and JACKIE CHAN join forces to create the greatest epic of them all - ''The Forbidden Kingdom''. As ancient Chinese warriors, they must train and mentor a 21st century kung-fu fanatic who''s been summoned to fight a centuries-old battle and free the imprisoned Monkey King. If you''re a fighting fan, the wait is over. The team is ready. The Kingdom has arrived.', '', 'USD', '34.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(241, 241, 'United States', 0, 0, 0, 'Digital', '031398-104391', 914, 'Owned', 'Disaster Movie', 'Cataclysmic Edition', '', 'United States', '2008', '2009-01-06', 88, 'Keep Case', 1, 'USD', '29.95', 'Prepare for earthshaking hilarity as the raunchy and outrageous team behind Date Movie, Epic Movie, and Meet The Spartans puts the world''s very survival in the hands of three buxom non-brainiacs. This twisted send-up pulverizes everyone''s favorite disaster flicks, pop culture icons and public figures with no-holds-barred humor that will have you quaking with laughter.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(242, 242, 'United States', 0, 0, 0, 'Digital', '031398-104469', 907, 'Owned', 'Bangkok Dangerous', '', '', 'United States', '2008', '2009-01-06', 100, 'Keep Case', 1, 'USD', '29.95', 'As a hired assassin, Joe (Nicolas Cage) is the best in the business, but the years of stone-cold murder have taken their toll. Joe''s plan to make this current assignment in Bangkok his last takes a wild turn when he violates one of the most important rules of the game. Now the hunter is the hunted in this hard-driving, action-packed thriller.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(243, 243, 'United States', 0, 0, 0, 'Digital', '031398-104711', 984, 'Owned', 'Saw V', 'Unrated Director''s Cut', '', 'United States', '2008', '2009-01-20', 95, 'Keep Case', 0, 'USD', '29.95', 'Detective Hoffman is seemingly the last person alive to carry on the Jigsaw legacy. But when his secret is threatened, he must go on the hunt to eliminate all loose end', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(244, 244, 'United States', 0, 0, 0, 'Digital', '031398-107217', 946, 'Owned', 'Transporter 3', '', '', '', '2008', '2009-03-10', 100, 'Keep Case', 0, 'USD', '29.95', '<b>Jason Statham is back as Frank Martin, the Transporter, </b>in this explosive third installment of the action-adventure series. \nThis time, Frank is presented an offer he cant refuse and ends up with a mysterious passenger and a dangerous destination - calling for a new machine and new rules. The stakes are bigger, the enemy is deadlier, and the action has never been hotter.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(245, 245, 'United States', 0, 0, 0, 'Digital', '031398-165439', 980, 'Owned', 'Saw', '', '', '', '2004', '2005-02-15', 100, 'Keep Case', 0, 'USD', '28.98', 'Obsessed with teaching his victims the value of life, a deranged, sadistic serial killer is abducting morally wayward people and forcing them to play horrific games for their own survival. Faced with impossible choices, each victim must struggle to win back his or her life, or else die trying...', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(246, 246, 'United States', 1, 0, 0, '', '031398-169659', 495, 'Owned', 'The Final Cut', 'Widescreen', '', 'United States', '2004', '2005-03-22', 105, 'Keep Case', 0, 'USD', '27.98', 'Welcome to the not-too-distant future, where implanted microchips record every single moment of a person''s life. Upon death, it becomes the job of a "cutter" like Alan Hakman (Oscar-winner Robin Williams**) to edit down the deceased''s entire lifetime into a fitting memorial film. For years, he has used his god-like power of final cut to absolve the dead of a multitude of sins. But when, on his latest assignment, he views a terrible secret that can''t be erased, Hakman finds his own life in jeopardy in this riveting science fiction thriller.', '', 'USD', '27.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(247, 247, 'United States', 0, 0, 0, 'Digital', '031398-203537', 981, 'Owned', 'Saw II', 'Special Edition', '', 'United States', '2005', '2006-10-24', 95, 'Keep Case', 1, 'USD', '26.98', 'Jigsaw is back. The brilliant, disturbed mastermind returns for another round of horrifying life-or-death games. When a new murder victim is discovered with all the signs of Jigsaw''s hand, Detective Eric Matthews begins a full investigation and apprehends Jigsaw with little effort. But for Jigsaw, getting caught is just another part of his plan. Eight more of his victims are already fighting for their lives and now it''s time for Matthews to join the game...', '', 'USD', '26.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(248, 248, 'United States', 0, 0, 0, 'Digital', '031398-207115', 918, 'Owned', 'Employee of the Month', '', '', '', '2006', '2007-01-16', 108, 'Keep Case', 0, 'USD', '28.98', 'For years Zack Bradley (Dane Cook) has been working hard at hardly working at the local Super Club. That''s until a hottie named Amy (Jessica Simpson) becomes the new cashier. After discovering she''s willing to date the next guy to become "Employee of the Month", Zack takes on current titleholder (Dax Shepard) in a super-smackdown to see who will win the honor - and Amy''s heart - in this outrageous comedy that proves you can''t succeed at life and love till you get your shift together.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(249, 249, 'United States', 0, 0, 0, 'Digital', '031398-221869', 1007, 'Owned', '3:10 To Yuma', 'Full Screen', '', 'United States', '2007', '2008-01-08', 122, 'Keep Case', 1, 'USD', '28.95', 'Infamous outlaw Ben Wade (Crowe) and his vicious gang of thieves and murderers have plagued the Southern Railroad. When Wade is captured, Civil War veteran Dan Evans (Bale), struggling to survive on his drought-plagued ranch, volunteers to deliver him alive to the "3:10 to Yuma", a train that will take the killer to trial. On the trail, Evans and Wade, each from very different worlds, begin to earn each other''s respect. But with Wade''s outfit on their trail - and dangers at every turn - the mission soon becomes a violent, impossible journey toward each man''s destiny.', '', 'USD', '28.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(250, 250, 'United States', 0, 0, 0, 'Digital', '031398-221906', 992, 'Owned', 'Good Luck Chuck', 'Chucked Up! Unrated Edition: Widescreen', '', 'United States', '2007', '2008-01-15', 101, 'Keep Case', 1, 'USD', '29.95', 'Dane Cook stars in this hilarious comedy about the luckiest guy on earth. Meet Charlie Logan (Cook), he''s a good luck charm and women are <b>guaranteed</b> to find true love after they sleep with him. But what seems like a blessing feels like a curse when he meets Cam (Jessica Alba), the girl of his dreams. Chuck will do anything  and anyone  to break the curse and get the girl in this raunchy, outrageous story.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(251, 251, 'United States', 0, 0, 0, 'Digital', '031398-221975', 983, 'Owned', 'Saw IV', 'Widescreen Unrated Director''s Cut', '', 'United States', '2007', '2008-01-22', 96, 'Keep Case', 1, 'USD', '29.95', 'When SWAT Commander Rigg is abducted and thrust into a game, the last officer untouched by Jigsaw has but ninety minutes to overcome a series of demented traps and save an old friend...or face the deadly consequences.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(252, 252, 'United States', 0, 0, 0, 'Digital', '031398-224594', 910, 'Owned', 'Chaos', '', '', 'United States', '2005', '2008-02-19', 106, 'Keep Case', 0, 'USD', '19.98', 'After a deadly bank heist, Detectives Quentin Conners (Jason Statham) and Shane Dekker (Ryan Phillippe) are drawn into a mysterious case where nothing is what it seems. Pulling the strings is a criminal mastermind (Wesley Snipes) who seems to kill without warning or reason. Abound with random acts of violence and deception, the only hope for survival is finding an order to the chaos.', '', 'USD', '19.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(253, 253, 'United States', 1, 0, 0, '', '031398-232506', 588, 'Owned', 'Drop Zone / Hard Rain', 'Double Feature 2-DVD Set', '', 'United States', '1994', '2008-03-18', 197, 'Keep Case', 0, 'USD', '7.50', 'DROP ZONE\n\nWesley Snipes stars as U.S. Marshall Pete Nessip, whose career is threatened when a prisoner he''s transporting escapes, parachuting out of a 747. Now, Nessip leaps into action, determined to stop the fugitive and his band of techno terrorists at any cost - even if it means skydiving from 30,000 feet in the air!\n\n\n\nHARD RAIN\n\nGet swept up in the action as an armored car driver tries to elude a gang of thieves while a flood ravages the countryside.', '', 'USD', '7.50', '2009-10-15', '2016-11-15 00:00:00', NULL),
(254, 254, 'United States', 0, 0, 0, 'Digital', '031398-232964', 928, 'Owned', 'Rambo', 'Widescreen', '', 'United States', '2008', '2008-05-27', 91, 'Keep Case', 0, 'USD', '29.95', 'The ultimate American action hero returns  with a vengeance! After spending several years in Northern Thailand operating a longboat on the Salween river, John Rambo (Sylvester Stallone) reluctantly agrees to carry a group of Christian missionaries into war-torn Burma. But when the aid workers are captured by ruthless Nationalist Army soldiers, Rambo leads a group of battle-scarred, combat-hardened mercenaries on an epic, last ditch mission to rescue the prisoners  at all costs.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(255, 255, 'United States', 0, 0, 0, 'Digital', '031398-236146', 908, 'Owned', 'The Bank Job', '2-Disc Special Edition', '', 'United States', '2008', '2008-07-15', 112, 'HD Slim', 0, 'USD', '39.99', 'Terry Leather <b>(JASON STATHAM)</b> and his dodgy friends aren''t London''s great criminals. But when they''re approached by the beautiful Martine Love <b>(SAFFRON BURROWS)</b> and asked to plunder a local bank''s priceless safe deposit vault, the small time hoods see the job as a chance of a lifetime. But what they don''t know about the true purpose of the robbery may kill them as they quickly find themselves embroiled in a scheme involving a Black Power leader, the MI-5, corrupt detectives, a local porn king and even the Royal Family in this pulse pounding crime drama, based on the greatest heist in British history.', '', 'USD', '39.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(256, 256, 'United States', 1, 0, 0, '', '031398-240822', 624, 'Owned', 'Witless Protection', 'Widescreen', '', 'United States', '2007', '2008-06-10', 97, 'Keep Case', 0, 'USD', '29.95', 'Larry the Cable Guy returns for another comic misadventure as a small town sheriff who unwittingly gets involved in a high profile FBI case. Larry single-handedly "rescues" a sophisticated woman from the men who are actually protecting her. The hilariously mismatched duo must grapple with angry FBI agents, quack doctors and Chicago high society in his funniest, most unpredictable adventure yet.', '', 'USD', '29.95', '2008-08-30', '2016-11-15 00:00:00', NULL),
(257, 257, 'United States', 1, 0, 0, '', '031398-242369', 654, 'Owned', 'The Eye', '', '', 'United States', '2008', '2008-06-03', 97, 'Keep Case', 0, 'USD', '29.95', 'Sydney Wells is blind and has been so since a childhood tragedy. After undergoing surgery to restore her sight she learns to see again. But soon after, unexplainable shadowy and frightening images start to haunt her. Not knowing if they are an aftermath of surgery, her mind adjusting to sight, her imagination, or something horrifyingly real, Sydney is soon convinced that her anonymous eye donor has somehow opened the door to a terrifying world only she can now see.', '', 'USD', '29.95', '2009-09-27', '2016-11-15 00:00:00', NULL),
(258, 258, 'United States', 1, 0, 0, '', '031398-703532', 522, 'Owned', 'Storm of the Century', '', '', '', '1999', '1999-06-22', 256, 'Keep Case', 0, 'USD', '29.99', 'From Stephen King, the best-selling novelist of all time, comes the terrifying tale of a town besieged by evil. The inhabitants of a picturesque, sleepy little town on a small island off the coast of Maine find themselves completely cut off from the world when they are hit by the worst storm of the century.\n\nAs snow steadily buries everything familiar, terror arrives in the form of an evil stranger. As streets disappear and an eerie darkness envelops the town, a series of bizarre murders creates a nightmare of fear. With no help coming from the outside world and no end to the storm in sight, the townspeople are forced to take drastic action before it''s too late.', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(259, 259, 'United States', 0, 0, 0, 'Digital', '032429-025241', 943, 'Owned', 'Transformers', 'Two-Disc Decepticon Steelbook', '', '', '2007', '2007-10-16', 0, '', 0, 'USD', '19.99', '', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(260, 260, 'United States', 1, 0, 0, '', '043396-001879', 568, 'Owned', 'Men In Black II', 'Special Edition', '', '', '2002', '2002-11-26', 88, 'Keep Case', 0, 'USD', '28.96', 'SAME PLANET, NEW SCUM.\n\nTommy Lee Jones and Will Smith are back in black as the scum-fighting super-agents Kay and Jay - regulators of all things alien on planet earth. Their latest mission: to save the world from a total intergalactic disaster! When a renegade Kylothian monster disguised as a lingerie model threatens the survival of the human race, the boys of the MIB get the call to step up and get busy. With their headquarters under siege and time running out, Agents Kay and Jay enlist the help of Frank the Pug and a posse of hard-living worms to help them kick some seriously sexy alien butt!', '', 'USD', '28.96', '2005-02-27', '2016-11-15 00:00:00', NULL),
(261, 261, 'United States', 1, 0, 0, '', '043396-009547', 229, 'Owned', 'Maid in Manhattan', '', '', '', '2002', '2003-03-25', 105, 'Keep Case', 0, 'USD', '27.95', 'Marisa Ventura (Jennifer Lopez) is a struggling single mom who works at a posh Manhattan hotel and dreams of a better life for her and her young son (Tyler Posey). One fateful day, hotel guest and senatorial candidate Christopher Marshall (Ralph Fiennes) meets Marisa and mistakes her for a wealthy socialite. After an enchanting evening, the two fall madly in love. But when Marisas true identity is reveled, issues of class and social status threaten to separate them. Can two people from very different worlds overcome their differences and live happily ever after?\n\nFrom acclaimed director Wayne Wang (Anywhere But Here) and co-starring Natasha Richardson, Stanly Tucci and Bob Hoskins, MAID IN MANHATTEN is Romantic! Funny! Uplifting! (Neil Rosen, NY1).', '', 'USD', '27.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(262, 262, 'United States', 1, 0, 0, '', '043396-013025', 184, 'Owned', 'Something''s Gotta Give', '', '', '', '2003', '2004-03-30', 128, 'Keep Case', 0, 'USD', '28.95', 'Harry Sanborn is a perennial playboy with a libido much younger than his years. During what was to have been a romantic weekend with his latest infatuation, Marin, at her mother''s Hamptons beach house, Harry develops chest pains. He winds up being nursed by Marin''s reluctant mother, Erica Barry - a successful, divorced New York playwright. In the process, Harry develops more heart pangs - the romantic kind - for Erica, an age appropriate woman whom he finds beguiling.\n\nHowever, some habits die hard. When Harry hesitates, his charming thirty-something doctor steps in and starts to pursue Erica. And Harry, who has always had the world on a string, finds his life unraveling.', '', 'USD', '28.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(263, 263, 'United States', 0, 0, 0, 'Digital', '043396-013537', 999, 'Owned', 'Matilda', 'Special Edition', '', '', '1996', '2005-06-07', 98, 'Keep Case', 0, 'USD', '19.94', 'See the world from a kid''s-eye view with Matilda, a modern fairy tale that mixes hilarious humor with the magical message of love.\n\nMrs. Doubtfire''s Mara Wilson stars as Matilda, a super-smart little girl who''s woefully misunderstood by her parents (Danny DeVito and Rhea Perlman), her brother, and an evil school principal.  But with the help of a brave best friend and a wonderful teacher, Matilda discovers she doesn''t have to get mad to get even.  Filled with a subversive sense of wit and whimsy, Matilda is a "great comedy with a great message.  The adults laugh as much, if not more, than the kids." -Elaine Blythe, FILM ADVISORY BOARD', '', 'USD', '19.94', '2009-10-14', '2016-11-15 00:00:00', NULL),
(264, 264, 'United States', 1, 0, 0, '', '043396-014213', 234, 'Owned', '13 Going on 30', '', '', 'United States', '2004', '2004-08-03', 98, 'Keep Case', 0, 'USD', '28.95', 'Jennifer Garner (''Daredevil'', TV''s "Alias") and Mark Ruffalo (''Eternal Sunshine of the Spotless Mind'') star in this hilarious flash-forward romance about a pre-teen girl who goes from geek to glamorous.\n\nWith the help of some magic wishing dust, 13 year-old Jenna Rink (Garner) becomes 30 and gorgeous overnight, with everything she ever wanted, except for her best friend Matt (Ruffalo). Now, this grown woman must create some magic of her own to help the little girl inside find the true love she left behind.', '', 'USD', '28.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(265, 265, 'United States', 1, 0, 0, '', '043396-014909', 264, 'Owned', 'Anger Management', '', '', 'United States', '2003', '2003-04-11', 106, 'Keep Case', 0, 'USD', '19.99', 'Feel the Love.\n\nAfter a misunderstanding aboard an airplane that escalates out of control, the mild-mannered Dave Buznik is ordered by Judge Daniels to attend anger management sessions run by Doctor Buddy Rydell, which are filled with highly eccentric and volatile men and women. Buddy''s unorthodox approach to therapy is confrontational and abrasive and Dave is bewildered by it. Then, after yet another mishap, Judge Daniels orders Dave to step up his therapy or wind up in jail. So, Buddy moves in with Dave to help him battle his inner demons. Buddy himself has no inner demons since he acts out at every opportunity and that includes making lewd comments about Dave''s girlfriend Linda and goading Dave into confronting every slight, past or present, head-on. But Buddy finally goes too far and Dave must decide whether to crawl back into his shell or stand up for himself. Could it be that Buddy''s confounding and contradictory treatment is just what the doctor ordered?', '', 'USD', '19.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
(266, 266, 'United States', 1, 0, 0, '', '043396-026575', 288, 'Owned', 'Just One of the Guys', '', '', '', '1985', '2004-02-24', 100, 'Keep Case', 0, 'USD', '24.96', 'Terry (Joyce Hyser, TV''s "L.A. Law") blames sexism when her journalism teacher refuses to enter her article in a competition to win a summer internship at the local newspaper. With the help of her kid brother, Buddy (Billy Jacoby), she masquerades as a guy at a rival school and enters the contest there. During her charade, "Terry the Boy" tangles with a vicious bully, Greg (William Zabka, ''The Karate Kid''), and fends off an amorous classmate, Sandy (Sherilyn Fenn, TV''s "Twin Peaks"). But when she falls for a handsome loner, Rick (Clayton Rohner, TV''s "Murder One"), our hero/ heroine must find a way to convince him that she''s not ''Just One of the Guys.''', '', 'USD', '24.96', '2007-08-09', '2016-11-15 00:00:00', NULL),
(267, 267, 'United States', 1, 0, 0, '', '043396-028517', 412, 'Owned', 'The Deep End of the Ocean', '', '', 'United States', '1999', '1999-08-10', 109, 'Keep Case', 0, 'USD', '24.95', 'Michelle Pfeiffer (''One Fine Day'', ''Up Close and Personal'', ''Wolf'') delivers a most powerful performance as a wife and mother faced with rebuilding her life, and her family, after they''ve been shockingly torn apart. Based on Jacquelyn Mitchard''s best-selling novel, THE DEEP END OF THE OCEAN is both riveting and moving. When their son suddenly disappears, the pain of a lost child ravages the cappadora family for nearly a decade. But it is upon his sudden return that the entire family must come to grips with a painful reunion of their own. Treat Williams (''Deep Rising'', ''The Devil''s Own'', ''The Phantom'') is masterful as Michelle Pfeiffer''s hard-working and forgiving husband. Whoopi Goldberg (''How Stella Got Her Groove Back'', ''Ghost'', ''Sister Act'') shines in her dramatic role as Detective Candy Bliss.', '', 'USD', '24.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(268, 268, 'United States', 1, 0, 0, '', '043396-028524', 46, 'Owned', 'Stepmom', '', '', '', '1998', '1999-04-28', 125, 'Keep Case', 0, 'USD', '19.95', 'Jackie (Susan Sarandon) is a divorced mother of two. \nIsabel (Julia Roberts) is the career minded girlfriend of Jackies ex-husband Luke (Ed Harris), forced into the role of unwelcome stepmother to their children. It is the universal dilemma of the non-traditional family, they all love the children but the complex interplay between parents, step-parents, step-children, ex-spouses and significant others is decidedly tricky. \n\nBut when Jackie discovers she is ill, both women realise they must put aside their differences to find a common ground and celebrate life to the fullest, while they have the chance.', '', 'USD', '19.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(269, 269, 'United States', 0, 0, 0, 'Digital', '043396-031524', 952, 'Owned', 'Underworld', 'Widescreen Special Edition', '', 'United States', '2003', '2004-01-06', 121, 'Keep Case', 0, 'USD', '28.95', 'In the Underworld, Vampires are a secret clan of modern aristocratic sophisticates whose mortal enemies are the Lycans (Werewolves), a shrewd gang of street thugs who prowl the city''s underbelly.  No one knows the origin of their bitter blood feud, but the balance of power between them turns even bloodier when a beautiful young Vampire warrior and a newly-turned Lycan with a mysterious past fall in love.  Kate Beckinsale and Scott Speedman star in this modern-day, action-packed tale of ruthless intrigue and forbidden passion  all set against the dazzling backdrop of a timeless, Gothic metropolis.', '', 'USD', '28.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(270, 270, 'United States', 1, 0, 0, '', '043396-037953', 610, 'Owned', 'Resident Evil: Apocalypse', 'Special Edition', '', 'United States', '2004', '2004-12-28', 94, 'Keep Case', 1, 'USD', '39.95', 'After narrowly escaping the horrors of the underground Hive facility, Alice (Milla Jovovich) is quickly thrust back into a war raging above ground between the living and the Undead.  As the city is locked down under quarantine, Alice joins a small band of elite soldiers, led by Valentine (Sienna Guillory, ''Love, Actually'') and Carlos (Oded Fehr, ''The Mummy Returns'') enlisted to rescue the missing daughter of Dr. Ashford, the creator of the mutating T-virus.  It''s a heart-pounding race against time as the group faces off against hordes of blood-thirsty zombies, stealthy Lickers, mutant canines and the most sinister foe yet.\n\nWritten and produced by the visionary director of ''Resident Evil'', Paul W. S. Andersons (''Alien Vs. Predator'') and directed by Alexander Witt, ''RESIDENT EVIL: Apocalypse'' is a superior sci-fi suspense sequel.', '', 'USD', '39.95', '2008-05-27', '2016-11-15 00:00:00', NULL),
(271, 271, 'United States', 1, 0, 0, '', '043396-039223', 469, 'Owned', 'Big Daddy', '', '', 'United States', '1999', '1999-11-02', 93, 'Keep Case', 0, 'USD', '24.95', 'Thirty-two-year-old Sonny Koufax (ADAM SANDLER) has spent his whole life avoiding responsibility. But when his girlfriend dumps him for an older man, hes got to find a way to prove hes ready to grow up. In a desperate last-ditch effort, Sonny adopts five-year-old Julian (COLE SPROUSE, DYLAN SPROUSE) to impress her. Shes not impressed... and he cant return the kid. Uh-oh for Sonny!', '', 'USD', '24.95', '2008-01-21', '2016-11-15 00:00:00', NULL),
(272, 272, 'United States', 1, 0, 0, '', '043396-039308', 284, 'Owned', 'Hook', '', '', '', '1991', '2000-03-21', 142, 'Keep Case', 0, 'USD', '19.95', 'A high-flying adventure from the magic of Steven Spielberg, ''Hook'' stars Robin Williams as a grown-up Peter Pan and Dustin Hoffman as the infamous Captain Hook.\n\nJoining the fun is Julia Roberts as Tinkerbell, Bob Hoskins as the pirate Smee, and Maggie Smith as Granny Wendy Darling, who must convince the middle-aged lawyer Peter Banning that he was once the legendary Peter Pan. And so the adventure begins anew, with Peter off to Neverland to save his two children from Captain Hook. Along the way, he rediscovers the power of imagination, friendship, and magic. A classic tale updated for children of all ages, ''Hook'', nominated for five 1991 Academy Awards including Best Visual Effects, is "a 10. A film that will entertain generations, generations from now." (Gary Franklin KABC-TV)', '', 'USD', '19.95', '2006-02-03', '2016-11-15 00:00:00', NULL),
(273, 273, 'United States', 1, 0, 0, '', '043396-039346', 422, 'Owned', 'Universal Soldier: The Return', '', '', 'United States', '1999', '1999-12-28', 83, 'Keep Case', 0, 'USD', '24.95', 'Luc Deveraux (Jean-Claude Van Damme), the heroic former Universal Soldier, is about to be thrown into action once again. When Seth (Michael Jai White), the supercomputer controlled ultra-warrior, decides to take revenge and destroy its creators, only Luc can stop it. All hell breaks loose as Luc battles Seth and a deadly team of perfect soldiers in a struggle that pits man against machine and good against evil.', '', 'USD', '24.95', '2008-01-16', '2016-11-15 00:00:00', NULL),
(274, 274, 'United States', 1, 0, 0, '', '043396-040588', 171, 'Owned', 'Sleepless in Seattle', '', '', 'United States', '1993', '1999-09-28', 105, 'Keep Case', 0, 'USD', '27.95', 'Tom Hanks and Meg Ryan star in Nora Ephron''s wonderfully romantic comedy about two people drawn together by destiny.\n\nHanks stars as Sam Baldwin, a widowed father who, thanks to the wiles of his worried son, becomes a reluctant guest on a radio call-in show. He''s an instant hit with thousands of female listeners, who deluge his Seattle home with letters of comfort. Meanwhile, inspired in equal parts by Sam''s story and by classic Hollywood romance, writer Annie Reed (Ryan) becomes convinced that it''s her destiny to meet Sam. There are just two problems: Annie''s engaged to someone else, and Sam doesnt know - yet - that they''re made for each other. Co-starring Rosie O''Donnell, Rita Wilson and Rob Reiner, SLEEPLESS IN SEATTLE is "absolutely enchanting...one of the year''s most completely enjoyable motion pictures" Michael Medved, ''Sneak Previews''.', '', 'USD', '27.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(275, 275, 'United States', 1, 0, 0, '', '043396-042254', 434, 'Owned', 'Cirque du Soleil: Quidam', '', '', 'Canada (Quebec)', '1999', '1999-11-09', 94, 'Keep Case', 0, 'USD', '24.95', 'Cirque du Soleil takes its unique, award-winning show from under the big top and brings it into your home to enjoy forever! This collector''s item features one of their most popular shows, Quidam, which was recorded live in Amsterdam following a successful three-year tour across North America. Known throughout the world as masters of awe-inspiring performance art, Cirque du Soleil continues to thrill with the most amazing acrobatics ever seen!', '', 'USD', '24.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(276, 276, 'United States', 1, 0, 0, '', '043396-045545', 282, 'Owned', 'Love Stinks', '', '', '', '1999', '2002-02-01', 93, 'Keep Case', 0, 'USD', '14.95', 'Sometimes the best sex in the world...just isn''t worth it.\n\nLove is a many splintered thing, or so Seth Winnick (3rd Rock from the Sun''''s, French Stewart) soon learns when he gets involved with the beautiful Chelsea Turner (Bridgette Wilson). She seems like the perfect woman: sexy, fun and willing to please him any way she can. But Chelsea''s biological clock is on overdrive and she aims to trap Seth into marriage. When their tumultuous relationship gets downright psychotic, it''s clear that the pair will never walk down the aisle, or will they? The battle of the sexes that ensues will leave you guessing, but either way it''ll be a fight to the finish. With hilarious over-the-top performances, including supermodel Tyra Banks and MTV''s Bill Bellamy as the couple''s happily married friends, this un-romantic comedy makes Fatal Attraction seem like Bambi.', '', 'USD', '14.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(277, 277, 'United States', 0, 0, 0, 'Digital', '043396-047464', 1018, 'Owned', 'Girl, Interrupted', '', '', 'United States', '1999', '2000-06-06', 127, 'Keep Case', 0, 'USD', '24.95', 'Two time Oscar-nominee Winona Ryder stars in the fascinating true story of a young woman''s life-altering stay at a famous psychiatric hospital in the turbulent late 1960s.\n\nQuestionably diagnosed with Borderline Personality Disorder, Susanna (<i>WINONA RYDER</i>) rebels against the head nurse (<i>WHOOPI GOLDBERG</i>) and top psychiatrist (<i>VANESSA REDGRAVE</i>), choosing instead to befriend the resident "loonies"  a group of troubled women including the seductively charismatic sociopath Lisa (<i>ANGELINA JOLIE</i>).\n\nBut Susanna quickly learns if she wants her freedom, she''ll have to face the person who terrifies her most of all: herself.', '', 'USD', '24.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(278, 278, 'United States', 1, 0, 0, '', '043396-050747', 251, 'Owned', 'The 6th Day', '', '', '', '2000', '2001-03-27', 123, 'Keep Case', 0, 'USD', '26.98', 'Superstar Arnold Schwarzenegger is Adam, an ace pilot in the very near future who is having a serious identity crisis. An evil corporation illegally cloned him, and now they''re trying to kill him to hide the evidence. Torn from his beloved family and faced with a shocking exact duplicate of himself, Adam races against time to reclaim his life and save the world from the underground cloning movement.\n\nFrom the director of ''Tomorrow Never Dies'', THE 6TH DAY also stars powerhouse actors Robert Duvall (''Gone in 60 Seconds'', ''Deep Impact'') and Michael Rapaport (''Deep Blue Sea'', ''Cop Land''). Prepare for a high-tech sci-fi blast with twice the Arnold and twice the action!', '', 'USD', '26.98', '2007-08-09', '2016-11-15 00:00:00', NULL),
(279, 279, 'United States', 1, 0, 0, '', '043396-052703', 254, 'Owned', 'The Craft', 'Special Edition', '', '', '1996', '2000-09-12', 101, 'Keep Case', 0, 'USD', '24.95', 'Sarah has always been different.  So as the newcomer at St. Benedict''s Academy, she immediately falls in with the high school outsiders.  But these girls won''t settle for being a group of powerless misfits.  They have discovered THE CRAFT, and they are going to use it.\n\nCritics are spellbound, calling THE CRAFT "slick, shrewd, touching, funny and most appropriately, downright mean." - Arthur Salm, ''San Diego Union-Tribune''', '', 'USD', '24.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(280, 280, 'United States', 1, 0, 0, '', '043396-056077', 592, 'Owned', 'Spider-Man 2', 'Full Screen Special Edition', '', '', '2004', '2004-11-30', 127, 'Keep Case', 0, 'USD', '29.95', 'Two years have passed since the mild-mannered Peter Parker (Tobey Maguire) walked away from his longtime love Mary Jane Watson (Kirsten Dunst) and decided to take the road to responsibility as Spider-Man. Peter must face new challenges as he struggles to cope with "the gift and the curse" of his powers while balancing his dual identities as the elusive superhero Spider-Man and life as a college student. The relationships Peter holds most dear are now in danger of unraveling as he clashes with the powerful, multi-tentacled villain Doctor Octopus aka "Doc Ock" (Alfred Molina). \n\nPeter''s life-long yearning for M.J. becomes even stronger as he fights the impulse to abandon his secret life and declare his love. In the meantime, M.J. has moved on with her life. She has embarked on an acting career and has a new man in her life. Peter''s relationship with his best friend Harry Osborn (James Franco) has been overshadowed by Harry''s growing vendetta against Spider-Man, whom he holds responsible for his father''s death. \n\nPeter''s life becomes even more complicated when he is pitted against the powerful new nemesis, "Doc Ock." Peter must now learn to accept his fate and harness all his superhero talents in order to stop this diabolical madman in his octagonal tracks.', '', 'USD', '29.95', '2005-09-17', '2016-11-15 00:00:00', NULL),
(281, 281, 'United States', 1, 0, 0, '', '043396-057319', 594, 'Owned', 'The Patriot', 'Special Edition', '', '', '2000', '2000-10-24', 165, 'Keep Case', 0, 'USD', '27.95', 'In the emotionally-charged adventure ''The Patriot'', Academy Award-winner Mel Gibson stars as Benjamin Martin, a reluctant hero who is swept into the American Revolution when the war reaches his home and threatens his family.\n\nA hero of the fierce French and Indian conflict, Martin had renounced fighting forever to raise his family in peace.  But when the British arrive at his South Carolina home and endanger what he holds most dear, Martin takes up arms alongside his idealistic patriot son, Gabriel (Heath Ledger of ''10 Things I Hate About You''), and leads a brave rebel Militia into battle against a relentless and overwhelming English army.  In the process, he discovers that the only way to protect his family is to fight for a young nation''s freedom.', '', 'USD', '27.95', '2005-09-17', '2016-11-15 00:00:00', NULL),
(282, 282, 'United States', 1, 0, 0, '', '043396-060500', 4, 'Owned', '50 First Dates', '', '', 'United States', '2004', '2004-06-15', 99, 'Keep Case', 0, 'USD', '28.95', 'Adam Sandler and Drew Barrymore star together for the first time since ''The Wedding Singer'' in one of the funniest romantic comedies in years.\n\nHenry Roth (Sandler) lives an enviable life in a Hawaiian paradise, spending every night with a beautiful tourist in search of an island fling. It''s a sweet life with no strings attached...until he meets Lucy (Barrymore). He and Lucy hit it off from the get-go, but the next day she acts like she doesn''t know him. Has his karma came around to kick him in the butt or what? Actually, Lucy has short-term memory loss, so every night all memory of her day is erased. But a man in love will go to any lengths to win over the girl of his dreams, and if that means having to find imaginative ways of doing it over again every day, then Henry''s up for the challenge.\n\nRob Schneider (''Big Daddy'') and Sean Astin (''The Lord of the Rings trilogy'') co-star in'' 50 FIRST DATES'', which will win you over every time you watch it!', '', 'USD', '28.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(283, 283, 'United States', 1, 0, 0, '', '043396-061057', 555, 'Owned', 'Cirque du Soleil: Dralion', '', '', 'Canada (Quebec)', '2000', '2001-02-06', 89, 'Keep Case', 0, 'USD', '24.95', '"DRALION is spectacular, exuberant, and downright delightful." - Daily Variety\n\nCIRQUE DU SOLEIL, the world-renowned avant-garde troupe that has revolutionized and reinvented the circus arts, takes you on another awe-inspiring journey of the senses with its latest acclaimed production DRALION. An imaginative fusion of ancient Chinese circus tradition with the CIRQUE''S own unique performance artistry, the show that has been seen by an audience of nearly 3 million worldwide is now available for the first time in this special DVD edition. Besides featuring the breathtaking acrobatics, delightful humor, hypnotic music and enchanting costumes of the original production, this version also includes a rare behind-the-scenes segment on the making of this memorable show. An unforgettable masterpiece of timeless magic destined to delight viewers of all ages!\n\nIncludes a first-of-its-kind behind-the-scenes featurette detailing the creation and rehearsals of this outstanding show.', '', 'USD', '24.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(284, 284, 'United States', 1, 0, 0, '', '043396-061576', 675, 'Owned', 'The Wedding Planner', '', '', 'United States', '2001', '2001-07-03', 104, 'Keep Case', 0, 'USD', '24.95', 'Mary Fiore (<b>Jennifer Lopez</b>) is the wedding planner. She''s ambitious, hard-working, extremely organized, and she knows exactly what to do and say to make any wedding a spectacular event. But when Mary falls (literally) for a handsome doctor (<b>Matthew McConaughey</b>), her busy yet uncomplicated life is turned upside down - he''s the groom in the biggest wedding of her career! Will she help him walk down the aisle with his internet tycoon girlfriend (<b>Bridgette Wilson-Sampras</b>), or will Mary finally get to be the bride herself? As this sweet romantic comedy proves, when it comes to love, you can never plan what''s going to happen.', '', 'USD', '24.95', '2009-09-27', '2016-11-15 00:00:00', NULL),
(285, 285, 'United States', 1, 0, 0, '', '043396-063938', 109, 'Owned', 'America''s Sweethearts', '', '', 'United States', '2001', '2001-11-13', 103, 'Keep Case', 0, 'USD', '27.96', 'Gwen (Catherine Zeta-Jones) and Eddie (John Cusack) are ''America''s Sweethearts''  the country''s favorite couple, on-screen and off. But when their very public romance turns into a very private breakup, only veteran press agent Lee (Billy Crystal) and Gwen''s assistant Kiki (Julia Roberts) can help Gwen and Eddie show some love while they promote their last film together. But the press junket is in a resort hotel miles from anywhere, and while Lee and Kiki frantically try to keep the media away from the real story  and keep Gwen and Eddie from revealing their secret  Kiki finds something entirely unexpected in this romantic comedy about true love, happily ever after and other Hollywood endings.', '', 'USD', '27.96', '2005-02-28', '2016-11-15 00:00:00', NULL),
(286, 286, 'United States', 1, 0, 0, '', '043396-066724', 445, 'Owned', 'Starship Troopers', 'Special Edition', '', 'United States', '1997', '2002-05-28', 129, 'Digipak', 0, 'USD', '28.95', 'From the bridge of the Fleet Battlestation Ticonderoga, with its sweeping galactic views, to the desolate terrain of planet Klendathu, teeming with shrieking, fire-spitting, brain-sucking special effects creatures, acclaimed director PAUL VERHOEVEN crafts a dazzling epic based on Robert A. Heinlein''s classic sci-fi adventure. CASPER VAN DIEN, DINA MEYER, DENISE RICHARDS, JAKE BUSEY, NEIL PATRICK HARRIS, PATRICK MULDOON, and MICHAEL IRONSIDE star as the courageous soldiers who travel to the distant and desolate Klendathu system for the ultimate showdown between the species.', '', 'USD', '28.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(287, 287, 'United States', 1, 0, 0, '', '043396-067660', 489, 'Owned', 'Black Hawk Down', '', '', 'United States', '2001', '2002-06-11', 144, 'Keep Case', 0, 'USD', '27.95', 'From acclaimed director Ridley Scott (GLADIATOR, HANNIBAL) and renowned producer Jerry Bruckheimer (PEARL HARBOR, ARMAGEDDON) comes a gripping true story about bravery, camaraderie and the complex reality of war. BLACK HAWK DOWN stars an exceptional cast including Josh Hartnett (PEARL HARBOR), Eric Bana (CHOPPER), Ewan McGregor (MOULIN ROUGE), Tom Sizemore (SAVING PRIVATE RYAN), William Fichtner (THE PERFECT STORM), Ewen Bremmer (SNATCH) and Sam Shepard (ALL THE PRETTY HORSES).\n\nIn 1993, an elite group of American Rangers and Delta Force soldiers are sent to Somalia on a critical mission to capture a violent warlord whose corrupt regime has lead to starvation of hundreds of thousands of Somalis. When the mission goes quickly and terribly wrong, the men find themselves outnumbered and literally fighting for their lives.', '', 'USD', '27.95', '2008-05-27', '2016-11-15 00:00:00', NULL);
INSERT INTO `details` (`id`, `film_id`, `locality`, `media_dvd`, `media_hddvd`, `media_bluray`, `media_custom`, `upc`, `collectionnumber`, `collectiontype`, `title`, `disttrait`, `originaltitle`, `origin`, `prodyear`, `released`, `runningtime`, `casetype`, `slipcover`, `srpid`, `srp`, `overview`, `easteregg`, `purchcurrencyid`, `purchprice`, `purchdate`, `created_at`, `updated_at`) VALUES
(288, 288, 'United States', 1, 0, 0, '', '043396-070691', 554, 'Owned', 'Cirque du Soleil: Journey Of Man', '', '', '', '2001', '2001-10-09', 39, 'Keep Case', 0, 'USD', '24.95', 'A breathtaking odyssey that follows the stages of human development from birth to maturity, with each stage presented by a Cirque du Soleil act. The signature Cirque du Soleil celebration of color, light, music and costume combine with a backdrop of various natural and historical landmarks around the world, creating a triumph of artistry beyond compare.\n\nFrom the opening explosion of light and sound that represents the universe''s formation, Cirque leads us through the birth of the Universal Child as it travels from childhood, through adolescence and manhood, on to maturity. An awe-inspiring feast for the senses, incomparable artistry and stylish elegance make this an adventure of a lifetime.', '', 'USD', '24.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(289, 289, 'United States', 1, 0, 0, '', '043396-074385', 601, 'Owned', 'The Fifth Element', 'Ultimate Edition', '', 'France', '1997', '2005-01-11', 126, 'Keep Case', 1, 'USD', '24.96', 'New York cab driver Korben Dallas didn''t mean to be a hero, but he just picked up the kind of fare that only comes along once every five thousand years: a perfect beauty, a perfect being, a perfect weapon. Now, together, they must save the world. Bruce Willis, Gary Oldman and Milla Jovovich star in acclaimed director Luc Besson''s outrageous sci-fi adventure, an extravagantly styled tale of good against evil set in an unbelievable twenty-third century world.', '', 'USD', '24.96', '2008-05-27', '2016-11-15 00:00:00', NULL),
(290, 290, 'United States', 1, 0, 0, '', '043396-077423', 313, 'Owned', 'Mrs. Winterbourne', '', '', '', '1996', '2002-02-12', 106, 'Keep Case', 0, 'USD', '24.95', 'Academy Award-winner Shirley MacLaine (Terms of Endearment, 1984), Ricki Lake and Brendan Fraser star in this whirlwind romantic comedy about a girl caught between true love and mistaken identity. Through a twist of fate and a quirk of character, 18-year-old Connie Doyle is mistaken for the widow of a millionaire''s son. Homeless, penniless and pregnant, Connie reluctantly accepts the generosity of the dead man''s grieving mother, and finds herself falling in love with "her" late husband''s twin brother. "MacLaine is at her all-time best as the unpredictable fairy godmother at the center of this comic Cinderella story. An absolute delight that''s simply sensational." (Ron Brewington, American Urban Radio Networks)', '', 'USD', '24.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(291, 291, 'United States', 1, 0, 0, '', '043396-085398', 113, 'Owned', 'Roxanne', '', '', '', '1987', '1998-12-22', 107, 'Keep Case', 0, 'USD', '27.95', 'Comic genius Steve Martin delivers an incredible performance as an engaging small-town fire chief who has only one tiny flaw - no, make that one HUGE flaw - his astonishingly long nose. Although he considers it no laughing matter, the hilarity never stops as C.D. Bales (Martin) contends with jerky nose jokes, a bumbling crew of firemen and his secret love for gorgeous astronomy student Roxanne (Hannah). Unfortunately, she is attracted to fireman Chris (Rossovich), who''s tall on looks and short on conversation. And when C.D. agrees to coach the dumbstruck Chris in his pursuit of the fair maiden, this ticklish triangle dissolves into a hilarious series of rib-tickling romantic misadventures. A contemporary love story of mistaken identity and unrequited live, ''Roxanne'' is an unforgettable comedy that Siskel & Ebert call "a romantic masterpiece."', '', 'USD', '27.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(292, 292, 'United States', 1, 0, 0, '', '043396-085596', 206, 'Owned', 'Glory Daze', '', '', '', '1996', '2002-02-14', 100, 'Snapper', 0, 'USD', '19.95', 'It''s two days before graduation, and Jack is having serious doubts about the future. The old gang is breaking up - Rob is moving to L.A. with his girlfriend; Dennis is finishing his third degree and going to grad school in Michigan; Slosh has dropped out of school and stays drunk all the time; and Mickey, who still has a year of school to go, seems tired of the scene and wishes he had the guts to tell his friend Chelsea how he feels about her. As Jack looks out at his four years in Santa Cruz, he wonders if this isn''t the best time of his life, and he wonders whether it might be a mistake to let it all go just because of graduation. As his pals also get glimpses of life after college, he decides he''s not going to leave, that he''s going to live his glory days a little longer.', '', 'USD', '19.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(293, 293, 'United States', 1, 0, 0, '', '043396-087712', 567, 'Owned', 'Men in Black', 'Deluxe Edition', '', 'United States', '1997', '2002-05-21', 98, 'Keep Case', 1, 'USD', '19.99', 'Agent Jay (Will Smith) and Agent Kay (Tommy Lee Jones) are turning up the heat on alien terrorists and delivering hot new technology at the same time.  Experience the galaxy''s biggest sci-fi hit with a universe of exclusive special features, including 3 scene editing workshops, technical commentary and more!', '', 'USD', '19.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(294, 294, 'United States', 1, 0, 0, '', '043396-097452', 451, 'Owned', 'Basic', '', '', 'United States', '2003', '2003-07-08', 99, 'Keep Case', 0, 'USD', '27.94', 'Academy Award nominees John Travolta (Best Actor in a Leading Role, ''Pulp Fiction'', 1994) and Samuel L. Jackson (Best Actor in a Supporting Role, ''Pulp Fiction'', 1994) team up with action director John McTiernan (''Die Hard'', ''The Hunt for Red October'', ''Predator'') in a white-knuckle "thrill-ride with a twist you won''t believe!"  (MairiAnna Bachynsky, ATV/CTV ENTERTAINMENT). Also starring Connie Nielsen (''The Hunted'', ''Gladiator''), Giovanni Ribisi (''Gone In Sixty Seconds''), Brian Van Holt (''Black Hawk down''), Taye Diggs (''Chicago'') and Roselyn Sanchez (''Rush Hour 2'').\n\nA DEA officer (Travolta) is recruited to investigate the mysterious disappearance of a famed U.S. Army drill instructor (Jackson) and a group of cadets on a routine military exercise in the jungles of Panama. But the journey to uncover the truth leads to some dangerous and unexpected places when two rescued survivors tell dramatically different versions of what transpired.  "Totally mesmerizing." (Lisa Petrillo, WFOR/CBS (Miami)/EXTRA)', '', 'USD', '27.94', '2005-09-17', '2016-11-15 00:00:00', NULL),
(295, 295, 'United States', 1, 0, 0, '', '043396-100756', 182, 'Owned', 'Mona Lisa Smile', '', '', '', '2003', '2004-03-09', 120, 'Keep Case', 0, 'USD', '29.98', 'In 1953, a time when women''s roles were rigidly defined, novice art history professor Katherine Watson begins teaching at the prestigious all-female Wellesley College, which despite its academic reputation is an environment where success is measured by how well the students marry. Encouraging these women to strive for a more enlightened future, Watson challenges the administration and inspires her students to look beyond the image of what is, and consider the possibilities of what could be.\n\nAn uplifting and poignant drama about one woman''s desire to enrich the lives of her students.', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(296, 296, 'United States', 1, 0, 0, '', '043396-102125', 6, 'Owned', 'Bewitched', 'Special Edition', '', '', '2005', '2005-10-25', 102, 'Keep Case', 0, 'USD', '28.95', 'Oscar-winner Nicole Kidman (Best Actress in a leading role, The Hours, 2002) and wickedly funny Will Ferrell star as actors playing Darrin and Samantha on a remake of the television show "Bewitched" in this cleverly crafty comedy from director Nora Ephron (Sleeplessiin Seattle, You''ve Got Mail).\n\nEgomaniacal star Jack Wyatt (Ferrell) casts unknown Isabel (Kidman) as his co-star in order to monopolize the limelight and regain his top spot on Hollywood''s A-list. When Isabel, a real witch, discovers Jack''s self-centered scheme, she conjures a sidesplitting spell the mere mortal will never forget!', '', 'USD', '28.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(297, 297, 'United States', 1, 0, 0, '', '043396-112360', 12, 'Owned', 'Hitch', '', '', '', '2005', '2005-06-14', 120, 'Keep Case', 0, 'USD', '28.95', 'Meet Hitch (Will Smith), New York City''s greatest matchmaker. Love is his job and he''ll get you the girl of your dreams in just three easy dates, guaranteed! And that''s exactly what happens when Albert Brennaman (TV''s Kevin James, "The King of Queens") wins the heart of gorgeous society heiress Allegra Cole (supermodel Amber Valletta). So, when tabloid columnist Sara Melas (Eva Mendes, Stuck On You, Once Upon a Time in Mexico) decides to uncover the secret behind the tubby schlub''s success, she''s shocked to discover that Alex Hitchens, the charming young man she''s been seeing, is the legendary date doctor himself. Exposed in a front-page scoop, it''s now up to Alex to try to save Albert and Allegra''s relationship as well as his own. Which only goes to show that just when you think you''ve found true love, there''s always a HITCH.', '', 'USD', '28.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(298, 298, 'United States', 1, 0, 0, '', '043396-117426', 370, 'Owned', 'Jumanji', 'Collector''s Series', '', 'United States', '1995', '2000-01-25', 104, 'Keep Case', 0, 'USD', '27.95', 'When young Alan Parrish discovers a mysterious board game, he doesn''t realize its unimaginable powers, until he is magically transported before the eyes of his friend, Sarah, into the untamed jungles of JUMANJI!  26 years later he is freed from the game''s spell by two unsuspecting children.  Alan (''ROBIN WILLIAMS'') reunites with Sarah (''BONNIE HUNT'') and together with Judy (''KIRSTEN DUNST'', ''Little Women'') and Peter (''BRADLEY PIERCE'') tries to outwit the game''s powerful forces in this imaginative adventure that combines breathtaking special effects with an enchanting mixture of comedy, magic and thrills.', '', 'USD', '27.95', '2008-01-17', '2016-11-15 00:00:00', NULL),
(299, 299, 'United States', 1, 0, 0, '', '043396-117907', 150, 'Owned', 'The Pink Panther', '', '', '', '2005', '2006-06-13', 92, 'Keep Case', 0, 'USD', '28.95', 'A world-famous soccer coach has been murdered and his priceless, legendary ring with the stunning diamond known as the "Pink Panther" has been stolen. The Pink Panther follows bumbling Inspector Clouseau (Steve Martin) as he tries to solve the crime and recover the gem.\n\nOne by one, Clouseau narrows his search and tracks down the most likely suspects. They include a stunning pop star (Beyonce Knowles), a spurned soccer player, a millionaire casino owner and a flirtatious publicist.\n\nClouseau and his partner, Ponton (Jean Reno), must unmask the murderer and keep their boss, Dreyfus (Kline), from taking credit for the victory, all without bringing the French legal system to a screeching halt.', '', 'USD', '28.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(300, 300, 'United States', 1, 0, 0, '', '043396-125575', 193, 'Owned', '8MM 2', '', '', 'United States', '2005', '2005-11-22', 106, 'Keep Case', 0, 'USD', '24.96', 'Entering a seamy underground world of peep shows, nude clubs and live Internet sex is David Huxley (Johnathon Schaech, ''Hush''), an aspiring politician who has everything to lose. Secretly filmed in a steamy three-way with his fiance Tish (Lori Heuring, ''Mulholland Dr.'') and a gorgeous young model (Zita Grg, ''Underworld''), David is desperate to find the extortionist who''s demanding an exorbitant amount of money for the negatives. But when the blackmail trail ends in murder and David is kidnapped, Tish must come up with a $5 million ransom or her fianc''s once-promising career, and life, may come to a dead end.', '', 'USD', '24.96', '2008-05-27', '2016-11-15 00:00:00', NULL),
(301, 301, 'United States', 1, 0, 0, '', '043396-130517', 192, 'Owned', '8MM: Eight Millimeter', '', '', 'United States', '1999', '1999-07-20', 123, 'Keep Case', 0, 'USD', '24.95', 'Academy Award-winner Nicolas Cage (Best Actor, ''Leaving Las Vegas'', 1995) stars with Joaquin Phoenix and Catherine Keener in an electrifying thriller from the writer of ''Se7en''. Directed by Joel Schumacher (''Phone Booth, Batman Forever, The Phantom of the Opera''), this dramatic story follows one man''s obsessive search for the truth about a six-year-old crime - and his ultimate discovery of the truth about himself.', '', 'USD', '24.95', '2008-05-27', '2016-11-15 00:00:00', NULL),
(302, 302, 'United States', 0, 0, 0, 'Digital', '043396-144408', 953, 'Owned', 'Underworld: Evolution', 'Widescreen Special Edition', '', 'United States', '2005', '2006-06-06', 106, 'Keep Case', 0, 'USD', '28.95', 'The saga continues as the battle rages on between the aristocratic Death Dealers (vampires) and the barbaric Lycans (werewolves). This film traces the beginnings of the ancient feud between the two tribes as the beautiful vampire heroine Selene (Kate Beckinsale) discovers that she has been betrayed by her own kind and must seek revenge. The fast-paced, modern-day tale of deadly action, ruthless intrigue and forbidden love takes her into the battle to end all wars as the immortals must finally face their retribution.', '', 'USD', '28.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(303, 303, 'United States', 1, 0, 0, '', '043396-145030', 644, 'Owned', 'Ultraviolet', 'Theatrical Cut', '', 'United States', '2006', '2006-06-27', 87, 'Keep Case', 0, 'USD', '28.95', 'Milla Jovovich (Resident Evil, The Fifth Element), Cameron Bright (X-Men 3), Nick Chinlund (The Legend of Zorro) and William Fichtner (The Longest Yard) star in this theatrical set in the late 21st century, a subculture of humans have emerged who have been modified genetically by a vampire-like disease (Hemophagia), giving them enhanced speed, incredible stamina and acute intelligence, and as they are set apart from "normal" and "healthy" humans, the world is pushed to the brink of worldwide civil war (a war between humans and hemophages) aimed at the destruction of the "diseased" population. In the middle of this crossed-fire is - an infected woman - Ultraviolet, who finds herself protecting a nine-year-old boy who has been marked for death by the human government as he is believed to be a threat to humans.', '', 'USD', '28.95', '2008-08-30', '2016-11-15 00:00:00', NULL),
(304, 304, 'United States', 1, 0, 0, '', '043396-145436', 455, 'Owned', 'Hollow Man 2', '', '', 'United States', '2006', '2006-05-23', 91, 'Keep Case', 1, 'USD', '24.95', 'Experience nonstop thrills as Christian Slater (Interview With The Vampire, True Romance) plays Michael Griffin, an invisible assassin turned insane murderer, the result of an experimental invisibility serum which is driving him mad as it brings him a slow, painful death. Maggie Dalton (Laura Regan - Unbreakable), a beautiful, brilliant research biologist, is the only person who can keep him alive - but when the government uses her as bait to trap Griffin, she must turn to Frank Turner (Peter Facinelli - The Scorpion King), a Seattle homicide detective, for protection. As Griffin becomes increasingly deadly and out-of-control, Turner''s left with one choice to keep Maggie alive: he must take the invisibility serum and become a Hollow Man himself. Twice the action, twice the thrills and twice the terror - as the two Hollow Men face one another in their spectacular final battle.', '', 'USD', '24.95', '2008-01-21', '2016-11-15 00:00:00', NULL),
(305, 305, 'United States', 1, 0, 0, '', '043396-148093', 669, 'Owned', 'The Plague', '', '', 'United States', '2006', '2006-09-12', 88, 'Keep Case', 0, 'USD', '24.96', 'Horror master Clive Barker presents THE PLAGUE, starring James Van Der Beek ("Dawson''s Creek") and Ivana Milicevic. \n\nFor ten years, the children of the world lay comatose, struck down by an eerie plague. And now, they''re finally awakened to carry out a common mission: the complete annihilation of the adult human race. Viciously killing anyone over twenty, the zombie-like children spare no one, not even their parents. And as the few surviving adults run for their lives, the question still remains: who - or what - is behind THE PLAGUE?', '', 'USD', '24.96', '2009-09-27', '2016-11-15 00:00:00', NULL),
(306, 306, 'United States', 1, 0, 0, '', '043396-150386', 488, 'Owned', 'The Davinci Code-2 Disc Fullscreen Edition', 'Special Edition', '', 'United States', '2006', '0000-00-00', 0, '', 0, 'USD', '19.99', '', '', 'USD', '19.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(307, 307, 'United States', 1, 0, 0, '', '043396-153660', 274, 'Owned', 'RV', 'Full Screen', '', '', '2006', '2006-08-15', 99, 'Keep Case', 0, 'USD', '28.95', 'Robin Williams is in top form as an overworked husband and father trying to keep it all together in RV, an outrageous family comedy that everyone can relate to.\n\nThe Munro family is really looking forward to their vacation in Hawaii, so when dad''s boss says he must attend a meeting in Colorado or lose his job, he is desperate for an alternate plan. He drags his reluctant family on the road trip with the promise that they will bond during their quality time together. Right from the get-go it''s obvious it''s going to be a bumpy and hilarious ride!', '', 'USD', '28.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(308, 308, 'United States', 1, 0, 0, '', '043396-157705', 413, 'Owned', 'Monster House', '', '', 'United States', '2006', '2006-10-24', 91, 'Keep Case', 0, 'USD', '28.95', 'Young DJ always knew there was something strange about the old Nebbercracker house across the street. When the house becomes a living, breathing monster, DJ enlists his pals Chowder and Jenny to learn the secret that keeps the house alive. Suddenly, they find themselves in a hair-raising battle with an unstoppable entity and must save the neighborhood from total devastation. Robert Zemeckis (''The Polar Express'', ''Back to the Future Trilogy'') and Steven Spielberg (''ET'', ''Jurassic Park'', ''Indiana Jones Trilogy'') present ''MONSTER HOUSE'' - the movie ''FOX-TV''s'' Shawn Edwards hails as "The best animated feature of the year! It''s so much fun you''ll want to watch it again and again * * * * * "', '', 'USD', '28.95', '2008-01-26', '2016-11-15 00:00:00', NULL),
(309, 309, 'United States', 1, 0, 0, '', '043396-159280', 95, 'Owned', 'Spider-Man 3', '', '', 'United States', '2007', '2007-10-30', 139, 'Keep Case', 1, 'USD', '28.98', 'Peter Parker (Tobey Maguire) finally has the girl of his dreams, Mary Jane Watson (Kirsten Dunst), and New York City is in the throes of Spider-mania! But when a strange alien symbiote turns Spider-Man''s suit black, his darkest demons come to light - changing Spider-Man inside as well as out. Spider-Man is in for the fight of his life against a lethal mix of villians - the deadly Sandman (Thomas Haden Church), Venom (Topher Grace), and the New Goblin (James Franco) - as well as the enemy within himself.', '', 'USD', '28.98', '2008-01-26', '2016-11-15 00:00:00', NULL),
(310, 310, 'United States', 1, 0, 0, '', '043396-165694', 302, 'Owned', 'Open Season', '', '', '', '2006', '2007-01-30', 86, 'Keep Case', 0, 'USD', '28.95', 'Boog (Martin Lawrence), a domesticated grizzly bear with no survival skills, has his perfect world turned upside down when he meets Elliot (Ashton Kutcher) a scrawny, fast-talking mule deer. They join forces to unite the woodland creatures and take the forest back into nature''s control! It''s a film for the whole family that Shawn Edwards (Fox-TV) calls, "a fun story loaded with lovable characters!"', '', 'USD', '28.95', '2008-01-16', '2016-11-15 00:00:00', NULL),
(311, 311, 'United States', 1, 0, 0, '', '043396-173828', 363, 'Owned', 'The Holiday', '', '', 'United States', '2006', '2007-03-20', 138, 'Keep Case', 0, 'USD', '28.95', 'In Nancy Meyers'' ''The Holiday'', a romantic comedy from the director of ''Something''s Gotta Give'' and ''What Women Want'', two women trade homes only to find that a change of address can change their lives.\n\nIris (Winslet) is in love with a man who is about to marry another woman. Across the globe, Amanda (Diaz), realizes the man she lives with has been unfaithful. Two women who have never met and live 6000 miles apart, find themselves in the exact same place. They meet online at a home exchange website and impulsively switch homes for the holiday. Iris moves into Amanda''s L.A. house in sunny California as Amanda arrives in the snow covered English countryside. Shortly after arriving at their destinations, both women find the last thing either wants or expects: a new romance. Amanda is charmed by Iris'' handsome brother Graham (Law) and Iris, with inspiration provided by legendary screenwriter Arthur (Wallach), mends her heart when she meets film composer Miles (Black).', '', 'USD', '28.95', '2008-01-16', '2016-11-15 00:00:00', NULL),
(312, 312, 'United States', 0, 0, 0, 'Digital', '043396-179998', 1020, 'Owned', 'Memoirs of a Geisha', '', '', '', '2005', '2007-05-15', 146, 'Keep Case', 0, 'USD', '14.95', '"... a visually stunning adaptation of Arthur Golden''s best-selling novel..."  (Barry Caine, OAKLAND TRIBUNE)\nThe director of ''Chicago'', Rob Marshall, transports us into a mysterious and exotic world that casts a potent spell.  A Cinderella story like no other, MEMOIRS OF A GEISHA stars Ziyi Zhang, Ken Watanabe, Michelle Yeoh and Gong Li.  "Gorgeously photographed, meticulously directed and hypnotically acted.  MEMOIRS OF A GEISHA is luxurious, ethereal and intoxicating.  It will leave you breathless."  (Rex Reed, NEW YORK OBSERVER)', '', 'USD', '14.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(313, 313, 'United States', 0, 0, 0, 'Digital', '043396-182905', 991, 'Owned', 'Vacancy', '', '', 'United States', '2007', '2007-08-14', 85, 'Keep Case', 0, 'USD', '28.95', 'When David (Luke Wilson) and Amy Fox''s (Kate Beckinsale) car breaks down in the middle of nowhere, they are forced to spend the night at the only motel around, with only the TV to entertain them - until they discover that the low-budget slasher videos they find in their room were all filmed in the very room in which they''re sitting. With hidden cameras now aimed at them - trapping them in rooms, crawlspaces, underground tunnels - and filming their every move, David and Amy must struggle to get out alive before they end up the next victims on tape.', '', 'USD', '28.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(314, 314, 'United States', 0, 0, 0, 'Digital', '043396-194755', 1033, 'Owned', 'Superbad', 'Unrated Extended Edition', '', 'United States', '2007', '2007-12-04', 119, 'Keep Case', 1, 'USD', '34.95', 'From the guys who brought you ''Knocked Up'' and ''The 40-Year-Old Virgin'' comes ''SUPERBAD''. Seth (Jonah Hill) and Evan (Michael Cera) want nothing more than to hook up with the girls they like before heading off to college. \nTo do that, though, they need to get liquor for the big party that night. With the help of their friend Fogell, a.k.a. McLovin (Christopher Mintz-Plasse), and his fake I.D., the three of them go on a chase for that elusive booze, dodging incompetent cops (''Knocked Up''''s Seth Rogen and "Saturday Night Live''s" Bill Hader) while attempting to reverse a lifelong losing streak in one hilarious night.', '', 'USD', '34.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(315, 315, 'United States', 1, 0, 0, '', '043396-195851', 351, 'Owned', 'Ghost Rider', '', '', 'United States', '2007', '0000-00-00', 123, 'Keep Case', 0, 'USD', '28.95', '', '', 'USD', '28.95', '2008-01-16', '2016-11-15 00:00:00', NULL),
(316, 316, 'United States', 1, 0, 0, '', '043396-216167', 623, 'Owned', 'Vantage Point', 'Widescreen Edition', '', 'United States', '2008', '2008-07-01', 90, 'Keep Case', 0, 'USD', '28.96', 'During an historic counter-terrorism summit in Spain, the President of the United States is struck down by an assassin''s bullet. Eight strangers have a perfect view of the kill, but what did they really see? As the minutes leading up to the fatal shot are replayed through the eyes of each eyewitness, the reality of the assassination takes shape. But just when you think you know the answer, the shattering final truth is revealed. ''Vantage Point'' is a mindbending political action-thriller starring Dennis Quaid, Matthew Fox, Academy Award Winner Forest Whitaker (Best Actor 2006, ''The Last King Of Scotland''), with Sigourney Weaver and Academy Award winner William Hurt (Best Actor 1985, ''Kiss Of The Spider Woman'').', '', 'USD', '28.96', '2008-08-30', '2016-11-15 00:00:00', NULL),
(317, 317, 'United States', 1, 0, 0, '', '043396-217096', 526, 'Owned', 'As Good As It Gets', '', '', '', '1997', '1998-05-19', 139, 'Keep Case', 0, 'USD', '29.95', 'Jack Nicholson, Helen Hunt, Greg Kinnear, and Cuba Gooding, Jr., star in James L. Brooks'' hit comedy, ''As Good As It Gets''. \n\nNicholson gives a show-stopping performance as Melvin Udall, an obsessive-compulsive novelist with Manhattan''s meanest mouth. But when his neighbor Simon is hospitalized, Melvin is forced to baby-sit Simon''s dog. And that unexpected act of kindness - along with waitress Carol Connelly - helps put Melvin back in the human race. "Magically written, directed and acted, ''As Good As It Gets'' is the best and funniest romantic comedy of the year." - Kenneth Turan, LOS ANGELES TIMES', '', 'USD', '29.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(318, 318, 'United States', 1, 0, 0, '', '043396-231290', 484, 'Owned', 'Godzilla', 'Deluxe Widescreen Presentation', '', 'United States', '1998', '1998-11-02', 139, 'Keep Case', 0, 'USD', '24.98', '"GODZILLA is back, bigger and much better then ever... its size defies comprehension... an expertly designed theme park ride of a movie that packs nonstop thrills... one jaw-dropping scene after another, the film never loses either momentum or its human scale." - ''Kevin Thomas, LOS ANGELES TIMES''', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(319, 319, 'United States', 0, 0, 0, 'Digital', '043396-235786', 1004, 'Owned', '88 Minutes', '', '', 'United States', '2007', '2008-09-16', 107, 'Keep Case', 1, 'USD', '28.96', 'Al Pacino stars in this riveting thriller about a forensic psychologist who receives a phone call threatening that he has only 88 minutes to live. As the clock ticks away, tension mounts, suspicions rise and blood flows. With a serial killer he helped convict awaiting execution and a copycat killer on the loose, Jack Gramm has 88 minutes to solve the biggest murder of his career: his own.', '', 'USD', '28.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(320, 320, 'United States', 1, 0, 0, '', '043396-238183', 642, 'Owned', 'Dragon Wars: D-War', '', 'D-War', 'South Korea', '2007', '2008-01-08', 90, 'Keep Case', 1, 'USD', '28.95', 'Meet Buraki, the vicious, 200-meter-long Imoogi serpent from ancient Korea. His army includes giant lizards with missile launchers, flying dragons, soldiers bred for evil and mega-intelligent dinosaurs. Together, they will destroy our cities unless reincarnated warriors Ethan and Sarah can outrun them and resurrect the Good Imoogi, Buraki''s ancient nemesis. DRAGON WARS reveals every last detail of Earth''s greatest battle - a war you''ll only believe when you see it for yourself.', '', 'USD', '28.95', '2008-08-30', '2016-11-15 00:00:00', NULL),
(321, 321, 'United States', 0, 0, 0, 'Digital', '043396-243552', 921, 'Owned', 'Hancock', '1-Disc Theatrical Edition', '', 'United States', '2008', '2008-11-25', 92, 'Keep Case', 0, 'USD', '28.96', 'Academy Award nominee Will Smith (Best Actor, <i>The Pursuit of Happyness </i>, <i>2006</i>) stars in this action-packed comedy as Hancock, a sarcastic, hard-living and misunderstood superhero who has fallen out of favor with the public.\n\nWhen Hancock grudgingly agrees to an extreme makeover from idealistic publicist Ray Embrey (Jason Bateman, <i>Juno </i>), his life and reputation rise from the ashes and all seems right again  until he meets a woman (2003 Academy Award winner Charlize Theron, Best Actress, <i>Monster</i>) with similar powers to his and the key to his secret past.', '', 'USD', '28.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(322, 322, 'United States', 1, 0, 0, '', '043396-243668', 673, 'Owned', 'Made of Honor', '', '', 'United States', '2008', '2008-09-16', 101, 'Keep Case', 1, 'USD', '28.96', 'Tom loves his life, until he realizes he also loves his best friend Hannah. But when Hannah gets engaged to a dashing Scotsman and asks Tom to be her maid of honor, Tom faces hostile bridesmaids, bridal showers, and bad hair days, all in an effort to pull off the perfect wedding and steal the bride. He''s maid of honor with a plan.', '', 'USD', '28.96', '2009-09-27', '2016-11-15 00:00:00', NULL),
(323, 323, 'United States', 0, 0, 0, 'Digital', '043396-243705', 1005, 'Owned', 'Angels & Demons', '', '', 'United States', '2009', '2009-11-24', 139, 'Keep Case', 0, 'USD', '28.96', 'In Ron Howard''s thrilling follow-up to The Da Vinci Code, expert symbologist Robert Langdon (Tom Hanks) follows ancient clues on a heart-racing hunt through Rome to find the four Cardinals kidnapped by the deadly secret society, the Illuminati. With the Cardinals'' lives on the line, and the Camerlengo (Ewan McGregor) desperate for help, Langdon embarks on a nonstop, action-packed race through sealed crypts, dangerous catacombs, and the most secretive vault on Earth!', '', 'USD', '28.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(324, 324, 'United States', 0, 0, 0, 'Digital', '043396-243767', 941, 'Owned', 'Starship Troopers 3: Marauder', '', '', 'United States', '2008', '2008-08-05', 105, 'Keep Case', 1, 'USD', '27.96', '<b><i>STARSHIP TROOPERS 3: MARAUDER </b></i>explodes with mind-blowing man-on-bug combat! Col. Johnny Rico (Casper Van Dien) is back to lead his team on a secret mission to rescue a small crew of troopers stranded on the remote planet of OM-1. Battling bugs, both new and old, the new "Marauder" advanced weapons technology may be their only hope against a treasonous element operating within the Federation itself. As Captain Lola Beck (Jolene Blalock) and the rest of the starship crew fight to survive in the harsh conditions, it begins to dawn on them that something on OM-1 is very, very wrong. This time the bugs have a secret weapon that could destroy humanity. Join the Mobile Infantry in this intergalactic action-packed adventure.', '', 'USD', '27.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(325, 325, 'United States', 1, 0, 0, '', '043396-247703', 310, 'Owned', 'Resident Evil: Extinction', 'Exclusive 2-Disc Limited Edition', '', 'United States', '2007', '2008-01-01', 94, 'Keep Case', 1, 'USD', '28.95', 'Milla Jovovich is back in the third chapter of the hugely successful Resident Evil franchise! This action-packed horror film is set in the Nevada desert and filled with intense special effects and more zombie terror!\n\nLas Vegas means fun in the sun. Well... atleast the sun is still there. Execpt for a few rusting landmarks, it looks pretty much like the rest of the desert - or the whole country, for that matter. The crowds are now flesh-eating zombies: the mass undead, the oozing, terrifying sludge of what remains. Here, the newly upgraded Alice, along with her crew (Oded Fehr, Mike Epps, Ali Larter, Ashanti) will make a final stand against evil - with one goal: to turn the undead... dead again.', '', 'USD', '28.95', '2008-01-16', '2016-11-15 00:00:00', NULL),
(326, 326, 'United States', 0, 0, 0, 'Digital', '043396-250857', 923, 'Owned', 'Impact Point', '', '', 'United States', '2008', '2008-07-08', 85, 'Keep Case', 1, 'USD', '24.96', 'The only thing that Kelly Reyes has ever thought about was playing beach volleyball. Until one day when a mysterious reporter named Holden comes into her life and strange events start to happen to her, as well as the people around her. As Kelly becomes skeptical of Holden, she must maintain focus on what has always been essential to her and play beach volleyball at her highest level. Is she being paranoid, or is there something darker to this mystery man?', '', 'USD', '24.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(327, 327, 'United States', 1, 0, 0, '', '043396-253674', 694, 'Owned', 'Quarantine', '', '', 'United States', '2008', '2009-02-17', 89, 'Keep Case', 0, 'USD', '28.96', 'When a news team decides to trail a brave fire-fighting team, they never suspect that the first call for help they respond to that night may be their last. Now theyre trapped in an apartment complex sealed off by the government. With no way of escape, they find themselves surrounded by frightened residents who are infected with a deadly mutant virus. What happens next is only known because of the footage they left behind.', '', 'USD', '28.96', '2009-10-15', '2016-11-15 00:00:00', NULL),
(328, 328, 'United States', 0, 0, 0, 'Digital', '043396-256385', 1030, 'Owned', 'Paul Blart: Mall Cop', '', '', 'United States', '2009', '2009-05-19', 91, 'Keep Case', 0, 'USD', '28.96', 'With a heart that won''t quit, a stomach that won''t stop gurgling, and a self-sworn oath to protect his turf, he''s <i>Paul Blart: Mall Cop</i>.\n\nMild-mannered Paul Blart (<i>Kevin James</i>, "The King of Queens") has always had huge dreams of becoming a State Trooper.  Until then, he patrols the local mall as a security guard.  With his closely cropped mustache, personal transporter and gung-ho attitude, only Blart seems to take his job seriously.  All that changes when a team of thugs raids the mall and takes hostages.  Untrained, unarmed and a super-size target, Blart has to become a real cop to save the day.', '', 'USD', '28.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(329, 329, 'United States', 0, 0, 0, 'Digital', '043396-261761', 1016, 'Owned', 'Felon', '', '', 'United States', '2008', '2008-08-12', 104, 'Keep Case', 1, 'USD', '24.96', 'A loving family man with a promising future, Wade Porter (Stephen Dorff) suddenly loses everything when he accidentally kills the burglar who broke into his home. Convicted of involuntary manslaughter, Wade is sentenced to spend the next three years inside a maximum security facility where the rules of society no longer apply. Forced to share a cell with a notorious mass murderer (Val Kilmer) and subjected to brutal beatings orchestrated by the sadistic head prison guard (Harold Perrineau), Wade soon realizes he''s in for the fight of his life and must become the toughest FELON of them all if he''s to survive the block. For what doesn''t kill you only makes you stronger. And in state prison, only the strongest will survive.', '', 'USD', '24.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(330, 330, 'United States', 0, 0, 0, 'Digital', '043396-265608', 1015, 'Owned', 'The Fall', '', '', 'United States', '2006', '2008-09-09', 117, 'Keep Case', 1, 'USD', '24.96', 'Filmed over a period of 4 years in 18 different countries, Tarsem''s <i>The Fall </i>is an unforgettable movie experience. In 1920s Los Angeles, Alexandria (Catinca Untaru), a 5-year-old girl hospitalized from a fall, strikes up an unlikely friendship with Roy (Lee Pace, TV''s "Pushing Daisies"), a Hollywood stuntman shattered by a near-fatal movie set accident and his lover''s betrayal. To pass the time, he tells Alexandria the epic story of Governor Odious and the 5 remarkable heroes determined to defeat him  a dazzling world of magic and myth. Only when the line between reality and fantasy begins to dissolve does Alexandria realize how much is truly at stake. Presented by David Fincher (<i>Fight Club</i>) and Spike Jonze (<i>Adaptation</i>), <i>The Fall</i> is an awe-inspiring, cinematic tour de force.', '', 'USD', '24.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(331, 331, 'United States', 1, 0, 0, '', '043396-267497', 622, 'Owned', '21', '', '', 'United States', '2008', '2008-07-22', 123, 'Keep Case', 0, 'USD', '28.96', 'Inspired by the true story of MIT students who mastered the art of card counting and took Vegas casinos for millions in winnings. Looking for a way to pay for tuition, Ben Campbell (Jim Sturgess) finds himself quietly recruited by MIT''s most gifted students in a daring plot to break Vegas. With the help of a brilliant statistics professor (Kevin Spacey) and armed with fake IDs, intelligence and a complicated system of counting cards, Ben and his friends succeed in breaking the impenetrable casinos. Now, his challenge is keeping the numbers straight and staying one step ahead of the casinos before it all spirals out of control.', '', 'USD', '28.96', '2008-08-30', '2016-11-15 00:00:00', NULL),
(332, 332, 'United States', 0, 0, 0, 'Digital', '043396-269217', 940, 'Owned', 'Starship Troopers 2: Hero of the Federation', 'Bonus Digital Copy', '', 'United States', '2004', '2008-08-05', 92, 'Keep Case', 0, 'USD', '24.95', 'In this rapid-fire sequel to the cult favorite, the Federation''s best Mobile Infantry unit goes back into action against the Bug horde. But this time, the Bugs are waiting for them. Trapped on a remote outpost light years from the nearest reinforcements, a small group of soldiers fights an enemy smarter and more cunning than any they''ve ever faced. Now they must join forces with an infamous traitor to the Federation if they are to have any hope. And it''s not just their lives at stake, it''s the survival of the human race. If they want to live, they''ll have to use their heads before the Bugs do!\n\nAcademy Award winner Phil Tippett (1993, Best Visual Effects for ''Jurassic Park''), one of the greatest special effects wizards in movie history, makes his directorial debut.', '', 'USD', '24.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(333, 333, 'United States', 0, 0, 0, 'Digital', '043396-272897', 954, 'Owned', 'Underworld: Rise of the Lycans', '', '', 'United States', '2009', '2009-05-12', 92, 'Keep Case', 0, 'USD', '28.96', 'The prequel story traces the origins of the centuries-old blood feud between the aristocratic vampires known as Death Dealers and their onetime slaves, the Lycans. In the Dark Ages, a young Lycan named Lucian (Michael Sheen) emerges as a powerful leader who rallies the werewolves to rise up against Viktor (Bill Nighy), the cruel vampire king who has enslaved them. Lucian is joined by his secret lover, Sonja (Rhona Mitra), in his battle against the Death Dealer army and his struggle for Lycan freedom.', '', 'USD', '28.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(334, 334, 'United States', 1, 0, 0, '', '043396-279391', 353, 'Owned', 'Last Action Hero', '', '', 'United States', '1993', '1997-10-07', 130, 'Keep Case', 0, 'USD', '29.95', 'Action-adventure superstar Schwarzenegger bursts through the screen as a bigger-than-life movie hero in this non-stop adventure from acclaimed director John McTiernan (Predator, Die Hard).', '', 'USD', '29.95', '2008-01-16', '2016-11-15 00:00:00', NULL),
(335, 335, 'United States', 0, 0, 0, 'Digital', '043396-279544', 1038, 'Owned', 'You Don''t Mess with the Zohan', '1-Disc Extended Version', '', 'United States', '2008', '2008-10-07', 117, 'Keep Case', 0, 'USD', '28.96', 'Comedy superstar Adam Sandler is back - and funnier than ever - as The Zohan, the finest counterterrorist agent the Israeli army has. That is, until he fakes his death and travels to Manhattan to live his dream...as a hairdresser. Now this skilled fighting machine who used to clip bad guys is out to prove he can make the cut as a top stylist. All goes silky smooth until his cover is blown when he''s recognized by a Palestinian cab driver (Rob Schneider). Now, The Zohan must fight to live a peaceful new life in New York in this razor-sharp action-packed comedy from Adam Sandler, Robert Smigel, Judd Apatow and Dennis Dugan.', '', 'USD', '28.96', '2009-10-14', '2016-11-15 00:00:00', NULL),
(336, 336, 'United States', 1, 0, 0, '', '043396-501492', 407, 'Owned', 'The Adventures of Milo and Otis', '', 'Koneko monogatari', 'Japan', '1986', '1999-08-31', 76, 'Keep Case', 0, 'USD', '24.95', 'A curious kitten named Milo and his inseparable friend, a pug-nosed puppy named Otis, tumble through one exciting escapade after another in The Adventures Of Milo And Otis, a heartwarming live-action film.\n\nMilo and Otis start life together on a farm and spend their days exploring the barnyard and the surrounding countryside. One day, the little feline is swept down a rushing river and Otis takes off in pursuit to rescue his friend, thus beginning a series of adventures. The Adventures Of Milo And Otis, which took four years to complete, is a film that will delight both the young and young at heart.', '', 'USD', '24.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(337, 337, 'United States', 1, 0, 0, '', '043396-502192', 241, 'Owned', 'Revenge', '', '', '', '1990', '1998-12-01', 123, 'Keep Case', 0, 'USD', '24.95', 'Kevin Costner and Madeleine Stowe ignite the screen in this deeply erotic and suspenseful thriller from the director of ''Top Gun'' and ''Crimson Tide''.\n\nCostner stars as Michael J. Cochran, a former fighter pilot who is irresistibly drawn to the beautiful wife of an old friend. Anthony Quinn, in a powerful performance, co-stars as the husband who reacts with uncontrollable rage to the double betrayal. His brutal attack on the adulterous lovers sets into motion a terrifying cycle of retribution that cannot be stopped, making ''Revenge'' "an instant classic...mammoth, spectacular, in your face entertainment."', '', 'USD', '24.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(338, 338, 'United States', 1, 0, 0, '', '043396-514195', 463, 'Owned', 'Bram Stoker''s Dracula', '', '', 'United States', '1992', '1997-10-07', 130, 'Keep Case', 0, 'USD', '27.95', 'Gary Oldman, Winona Ryder and Anthony Hopkins star in director Francis Ford Coppola''s visually stunning, passionately seductive version of the classic Dracula legend.\n\nIn ''BRAM STOKER''S DRACULA'', Coppola returns to the original source of the Dracula myth, and from that gothic romance, he creates a modern masterpiece. Gary Oldman''s metamorphosis as Dracula - who grows from old to young, from man to beast - is nothing short of amazing. Winona Ryder brings equal intensity to the role of a young beauty who becomes the object of Dracula''s devastating desire. Anthony Hopkins co-stars as the famed doctor who dares to believe in Dracula, and then dares to confront him. Opulent, dazzling and utterly irresistible, this is Dracula as you''ve never seen him. And once you''ve seen ''BRAM STOKER''S DRACULA'', you''ll never forget it.', '', 'USD', '27.95', '2008-01-21', '2016-11-15 00:00:00', NULL),
(339, 339, 'United States', 1, 0, 0, '', '043396-522992', 328, 'Owned', 'Groundhog Day', '', '', 'United States', '1993', '1998-01-20', 101, 'Keep Case', 0, 'USD', '27.95', 'Bill Murray is at his wry, wisecracking best in this riotous romantic comedy about a weatherman caught in a personal time warp on the worst day of his life.', '', 'USD', '27.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(340, 340, 'United States', 1, 0, 0, '', '043396-701595', 384, 'Owned', 'Chances Are', '', '', 'United States', '1989', '1998-04-14', 108, 'Keep Case', 0, 'USD', '27.95', 'In CHANCES ARE, the irresistable romantic comedy of two lifetimes, Cybill Shepard stars as Corinne Jeffries, a beautiful young woman whose picture-perfect life comes to a shattering halt when her husband Louie dies unexpectantly. Fortunately, Louie gets a second shot at life when he agrees to be "recycled" back to Earth as the newborn Alex Finch. But fate crosses Alex''s path twenty-three years later when he meets Corinne''s daughter Miranda, and is suddenly flooded with a wealth of memories that all belong to Louie! Now, as Alex''s former existance slowly comes to life, he must confront a wife who thinks he is dead, a daughter who could be his girlfriend and a best friend who''s in love with Corinne. From "Dirty Dancing" director Emile Ardolino comes this heartwarming comedy that gives romance an unforgettable second chance.', '', 'USD', '27.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(341, 341, 'United States', 1, 0, 0, '', '043396-702479', 213, 'Owned', 'Steel Magnolias', 'Special Edition', '', '', '1989', '2000-07-25', 119, 'Keep Case', 0, 'USD', '24.95', 'Six divas of the silver screen come together as bosom buddies in this hilarious and heartwarming story of love, life, and loss in a small Louisiana Parish. At the center of the group is Shelby Eatenton (Julia Roberts), newly married and joyfully pregnant, despite the fact that her diabetes could make childbirth life-threatening. Terrified and angry at the possibility of losing her only daughter, M''Lynn Eatenton (Salley Field) looks to her four closest friends for strength and laughter as she battles her deepest fears of death in order to join Shelby in celebrating the miracle of new life.', '', 'USD', '24.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(342, 342, 'United States', 0, 0, 0, 'Digital', '043396-717190', 939, 'Owned', 'Starship Troopers', '', '', 'United States', '1997', '1998-05-19', 129, 'Keep Case', 0, 'USD', '27.95', 'From the bridge of the Fleet Battlestation Ticonderoga, with its sweeping galactic views, to the desolate terrain of planet Klendathu, teeming with shrieking, fire-spitting brain-sucking special effects creatures, acclaimed director PAUL VERHOVEN crafts a dazzling epic based on Robert A. Heinlein''s classic sci-fi adventure.\nCASPER VAN DIEN, DINA MEYER, DENISE RICHARDS, JAKE BUSEY, NEIL PATRICK HARRIS, PATRICK MULDOON, and MICHAEL IRONSIDE star as the courageous soldiers who travel to the distant and desolate Klendathu system for the ultimate showdown between the species.', '', 'USD', '27.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(343, 343, 'United States', 1, 0, 0, '', '043396-718890', 507, 'Owned', 'Air Force One', '', '', '', '1997', '1998-02-10', 124, 'Keep Case', 0, 'USD', '24.95', 'Harrison Ford, Gary Oldman and Glenn Close star in two-time Oscar-nominee Wolfgang Petersen''s gripping thriller about a steadfast U.S. President who has just told the world he will not negotiate with terrorists. Now, Russian neo-nationalists have hijacked Air Force One, and the President is faced with a nearly impossible decision -- give in to terrorist demands or sacrifice not only the country''s dignity, but the lives of his wife and daughter.', '', 'USD', '24.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(344, 344, 'United States', 1, 0, 0, '', '043396-728196', 205, 'Owned', 'It Could Happen to You', '', '', '', '1994', '1998-08-25', 101, 'Keep Case', 0, 'USD', '27.95', 'Nicolas Cage, Bridget Fonda and Rosie Perez star in this irrepressible romantic comedy inspired by the true story of a humble cop who leaves a $2 million tip to a hard-luck waitress.\n\nCharlie Lang (Cage) is a neighborhood cop with a heart of gold - and a money-hungy wife Muriel (Perez) who''s always looking for a way to cash in.  When she asks Charlie to buy a Lottery ticket, he agrees, then impulsively promises half the winnings to a waitress, Yvonne (Fonda).  When their numbers hit, the real fun begins, as Muriel learns to live large while Charlie and Yvonne learn to love again.  A captivating comedy laced with whirlwind romance, "''It Could Happen To You'' should happen to everyone!" -Joel Siegel, Good Morning America', '', 'USD', '27.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(345, 345, 'United States', 1, 0, 0, '', '043396-818491', 168, 'Owned', 'Peggy Sue Got Married', '', '', '', '1986', '1998-08-11', 103, 'Keep Case', 0, 'USD', '27.98', 'If you could live your life over again would you change anything? Kathleen Turner, portraying Peggy Sue, gets the chance to answer this tantalizing question this comedy. Co-starring Joan Allen, Nicolas Cage, Helen Hunt and Jim Carrey, Peggy Sue Got Married is a humorous, heartfelt fantasy about the golden opportunity almost everyone has longed for at least once.', '', 'USD', '27.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(346, 346, 'United States', 1, 0, 0, '', '043396-827295', 314, 'Owned', 'My Best Friend''s Wedding', '', '', 'United States', '1997', '1997-12-09', 105, 'Keep Case', 0, 'USD', '27.95', 'Julia Roberts, Dermot Mulroney, Cameron Diaz and Rupert Everett star in "My Best Friend''s Wedding", a high-spirited romantic comedy that serves up something wild, something new, something touching and something truly hilarious\n\nWhen a woman''s long-time friend says he''s engaged, she realizes she loves him herself... and sets out to get him, with only days before the wedding.', '', 'USD', '27.95', '2008-01-17', '2016-11-15 00:00:00', NULL);
INSERT INTO `details` (`id`, `film_id`, `locality`, `media_dvd`, `media_hddvd`, `media_bluray`, `media_custom`, `upc`, `collectionnumber`, `collectiontype`, `title`, `disttrait`, `originaltitle`, `origin`, `prodyear`, `released`, `runningtime`, `casetype`, `slipcover`, `srpid`, `srp`, `overview`, `easteregg`, `purchcurrencyid`, `purchprice`, `purchdate`, `created_at`, `updated_at`) VALUES
(347, 347, 'United States', 1, 0, 0, '', '044004-691321', 641, 'Owned', 'Bean: The Movie', '', '', 'United Kingdom', '1997', '1998-03-01', 91, 'Keep Case', 0, 'USD', '29.98', 'Call him hilarious.  Call him laugh-out-loud funny.  But whatever you do, call him ''BEAN''.  In the comedy that rocked America, Rowan Atkinson is the outrageous Mr. Bean, sent on a mission to California to escort the world famous painting of "Whistler''s Mother" to its new home in The Grierson Gallery.  What the galley owner, one of the richest men in America, and his curator David Langley believe, is that Mr. Bean is Dr. Bean, a renowned art expert.  In fact, he is just a sleepy-headed, wildly eccentric museum guard.\n\nHe''s also the clumsiest, craziest, wackiest, wildest, most bizzare character they have ever come across, and certainly not someone you''d entrust one of the world''s most valuable paintings to.  But they have --- and now wreaking havoc in the Grierson Gallery and wrecking Langley''s marriage is just the beginning.  With only hours to go before the official unveiling by the museum''s benefactor, General Newton, something terrible has happened to "Whister''s Mother" and only one man has the power to put it right.  The only problem is...that man is ''BEAN''.', '', 'USD', '29.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(348, 348, 'United States', 1, 0, 0, '', '053939-255027', 2, 'Owned', 'The American President', '', '', '', '1995', '1999-08-31', 115, 'Snapper', 0, 'USD', '19.98', 'Boy meets girl - and the press tracks their every move, rivals fire broadsides and a Presidency with 63% popularity rating plunges to 41% in seven weeks. When you''re the President everyone knows where you live. Michael Douglas portrays the widower Chief Executive who falls for a lobbyist (Annette Bening), then freefalls in the polls in this winning romantic comedy directed by Rob Reiner. Bustling staff members (Martin Sheen, Michael J. Fox, David Paymer, Anna Devere Smith), a sneering opponent (Richard Dreyfuss), state dinners, formal protocol, informal moments, global crises - all come into focus as Reiner and his stars explore the balance between private romance and public Presidency.', '', 'USD', '19.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(349, 349, 'United States', 1, 0, 0, '', '053939-257922', 441, 'Owned', 'The Green Mile', '', '', 'United States', '1999', '2000-06-13', 188, 'Snapper', 0, 'USD', '24.98', 'Miracles happen in unexpected places, even in the death-row cellblock at Cold Mountain Penitentiary. There John Coffey, a gentle giant of a prisoner with supernatural powers, brings a sense of spirit and humanity to his guards and fellow inmates.\n\nTom Hanks leads a stellar ensemble (including Michael Clarke Duncan as Coffey) in this emotional, uplifting story of guards and captives; husbands and wives; prisoners and a remarkable mouse named Mr. Jingles; and, on another level, of a moviemaker and his source. That filmmaker is Frank Darabont, who returns after his 1994 directorial debut ''The Shawshank Redemption'' to adapt another tale by Stephen King into a stirring, crowd-pleasing entertainment nominated for 4 Academy Awards, including Best Picture.', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(350, 350, 'United States', 1, 0, 0, '', '053939-643428', 525, 'Owned', 'Fallen', '', '', 'United States', '1998', '1998-06-16', 124, 'Snapper', 0, 'USD', '24.99', 'Homicide detective John Hobbes (Denzel Washington) pursues a killer down a bustling sidewalk. There she is: a small, middle-aged woman. No, wait: the killer is the timid man beside her. Now it''s someone else. It''s all and none of them. Because the murderer Hobbes seeks is a demon passing from one human host to another with a brush of an overcoat or touch of a hand.\n\nHobbes stalks a seemingly immortal foe in <i>Fallen</i>, an intense thriller co-starring John Goodman and Donald Sutherland, written by Nicholas Kazan (<i>Reversal of Fortune</i>) and directed by Gregory Hoblit (<i>Primal Fear</i>). An ages-old evil faces a shattering showdown with one clever, tenacious man.', '', 'USD', '24.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(351, 351, 'United States', 0, 0, 0, 'Digital', '057373-177730', 982, 'Owned', 'Saw III', 'Director''s Cut', '', 'Canada', '2006', '2007-10-23', 120, 'Keep Case', 1, 'USD', '26.98', 'Go inside the mind of one of the most terrifying villains in horror film history with ''Saw III: Director''s Cut''. Featuring even more gut-wrenching footage, this new interactive Director''s Cut lets you experience Jigsaw''s world with new bonus materials.\n\nJigsaw has disappeared. With his new apprentice Amanda (Shawnee Smith), the puppet-master behind the cruel, intricate games that have terrified a community and baffled police has once again eluded capture and vanished. While city detectives scramble to locate him, Doctor Lynn Denlon (Bahar Soomekh) and Jeff (Angus Macfadyen) are unaware that they are about to become the latest pawns on his vicious chessboard.', '', 'USD', '26.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(352, 352, 'United States', 1, 0, 0, '', '065935-141143', 84, 'Owned', 'Traffic', 'The Criterion Collection', '', 'United States', '2000', '2002-05-28', 147, 'Keep Case', 0, 'USD', '39.95', '''Traffic'' examines the effect of drugs as politics, business, and lifestyle. Acting as his own director of photography, Steven Soderbergh employs an innovative, color-coded cinematic treatment to distinguish the interwoven stories of a newly appointed DEA chief and his family, a West Coast kingpins wife, a key informant, and cops on both sides of the U.S./Mexican border. Rarely has a film so energetic and suspenseful presented a more complex and nuanced view of an issue of such international importance. Instantly recognized as a classic, Traffic appeared on more than 200 critics ten-best lists, and earned 5 Academy Award nominations.', '', 'USD', '39.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(353, 353, 'United States', 0, 0, 0, 'Digital', '065935-147640', 964, 'Owned', 'Final Destination 2', 'Infinifilm Edition', '', 'United States', '2003', '2003-07-22', 90, 'Keep Case', 0, 'USD', '19.99', 'It''s a matter of life and death when eight strangers narrowly escape a catastrophic freeway accident.  Only a young girl''s premonition saved them all from a grisly end.  But now that they have put a rift in death''s design, there is a price to pay - and it''s going to be painful.\n\nPacked with cutting-edge special effects, state-of-the-art gore and enough scares to send your heartbeat into overdrive, Final Destination 2 is a killer sequel to the smash-hit original.\n\nFasten your seatbelts and prepare yourself for one horrifying ride ... it may be your last!', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(354, 354, 'United States', 1, 0, 0, '', '065935-206729', 292, 'Owned', 'Bridget Jones''s Diary', 'Collector''s Edition', '', '', '2001', '2004-11-09', 98, 'Keep Case', 0, 'USD', '29.95', 'Academy Award winner Renee Zellweger (Best Supporting Actress, Cold Mountain, 2003; Chicago) and Hugh Grant (Love Actually, Two Weeks Notice) star in a delightful comedy about the ups and downs of modern romance. Bridget (Zellweger), a busy career woman, decides to turn over a new page in her life by channeling her thoughts, opinions and insecurities into a journal that becomesia hilarious chronicle of her adventures. Soon she becomes the center of attention between a guy who''s too good to be true (Grant) and another who''s so wrong for her, he could be just right (Colin Firth - Love Actually)! Based on the best-selling book, Bridget Jones''s Diary is another acclaimed crowd-pleaser from the hitmakers of Four Weddings And A Funeral and Notting Hill.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(355, 355, 'United States', 0, 0, 0, 'Digital', '065935-220770', 986, 'Owned', 'Sin City', 'Recut & Extended', 'Frank Miller''s Sin City', 'United States', '2005', '2005-12-13', 147, '', 0, 'USD', '39.99', 'This Recut & Extended Edition is the ultimate ''Sin City'' DVD Collection and features a new never-before-seen re-edited version of the original motion picture, the original theatrical release and extensive brand-new bonus material.\nThe acclaimed hit from director Robert Rodriguez delivers explosive stories straight from the pages of Frank Miller''s hip series of Sin City graphic novels... and stars Bruce Willis, Jessica Alba, Mickey Rourke, Jaime King, Clive Owen, Brittany Murphy, Rosario Dawson, Devon Aoki, Alexis Bledel, Benicio Del Toro, Elijah Wood, Nick Stahl, Michael Madsen, Carla Gugino and Michael Clarke Duncan.', '', 'USD', '39.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(356, 356, 'United States', 0, 0, 0, 'Digital', '065935-812975', 938, 'Owned', 'Shoot ''Em Up', '', '', 'United States', '2007', '2008-01-01', 86, 'Keep Case', 0, 'USD', '28.98', 'Dive into the most thrilling blast of action excitement ever put to film! Intense, gritty and undeniably fun, this pulse-pounding adrenaline rush is so shamelessly over-the-top, it "would make even John Woo jealous" (<i>Variety</i>)! When the man known only as Smith (Cliver Owen), a gorgeous streetwalker (Monica Bellucci) and a maniacal hitman (Paul Giamatti) get swept up in a deadly game of cat-and-mouse, it sets off an explosion of armed thugs, flying bullets and nonstop action so big, it''ll blow you away!', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(357, 357, 'United States', 0, 0, 0, 'Digital', '065935-815761', 972, 'Owned', 'The Mist', 'Two-Disc Collector''s Edition', '', 'United States', '2007', '2008-03-25', 126, 'Keep Case', 1, 'CAD', '39.99', 'FROM LEGENDARY FRIGHTMASTER STEPHEN KING and Academy Award nominated director ''Frank Darabont'' (''The Shawshank Redemption, The Green Mile'') comes one of the most tense and terrifying films since ''The Shining''. After a mysterious mist envelops a small New England town, a group of locals trapped in a supermarket must battle a siege of otherworldly creatures... and the fears that threaten to tear them apart. Starring ''Thomas Jane'' (''The Punisher'') and Oscar winner ''Marcia Gay Harden'' (''Mystic River'') in one of the year''s most talked-about performances, ''The Mist'' "is not only one of the best movies of 2007, it''s one of the best horror movies ever made. Period." (Maryann Johanson, ''The Flick Filosopher'')', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(358, 358, 'United States', 1, 0, 0, '', '07806-22650', 483, 'Owned', 'Lost in Space', 'Platinum Series', '', '', '1998', '1998-10-06', 130, 'Snapper', 0, 'USD', '24.99', 'The year is 2058. With Earth''s resources dwindling, human survival depends on the Robinson Family - launched into space to colonize Alpha Prime, the only other inhabitable planet in the galaxy. But when a stowaway sabotages the mission, the Robinsons find themselves hurtling through uncharted space and non-stop adventure!', '', 'USD', '24.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(359, 359, 'United States', 1, 0, 0, '', '07888-18104', 565, 'Owned', '13th Warrior', '', '', '', '1999', '2000-01-18', 103, 'Keep Case', 0, 'USD', '29.99', 'An Ordinary ManAn Extraordinary Journey!\n\nAntonio Banderas (The Mask of Zorro) brings huge star power to an immensely thrilling action-adventure from the hit-making director of Die Hard and The Thomas Crown Affair! An exiled ambassador far from his homeland, Ahmed (Banderas) comes across a fierce band of warriors who are being attacked by ferocious creatures legendary for devouring all living things in their path! And when an old fortune-teller warns the combatants that they are doomed to failure without a 13th Warrior, Ahmed is given no choice but to join their battle and help conquer the mysterious enemy! Suspenseful and endlessly exciting, this exhilarating hit is sure to thrill anyone who enjoys action on an epic scale!', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(360, 360, 'United States', 1, 0, 0, '', '07907-40060', 385, 'Owned', 'Practical Magic', 'Special Edition', '', '', '1998', '1999-02-16', 104, 'Snapper', 0, 'USD', '24.98', 'Fun and excitement abound in the Owens family of wily witches. One problem, though: the men the Owens women fall in love with are doomed to an untimely death.  Sandra Bullock and Nicole Kidman play Sally and Gillian Owens, sisters hexed by a centuries-old curseand coping with a witches brew of events involving a possible love match for one, a zombie for the other and a need to resume the age-old witchcraft taught by two doting Ownes aunts.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(361, 361, 'United States', 1, 0, 0, '', '085391-112808', 364, 'Owned', 'Music and Lyrics', 'Full-screen Edition', 'Music And Lyrics By...', 'United States', '2006', '2007-05-08', 0, 'Keep Case', 0, 'USD', '19.99', 'First you''re hot, then you''re not...and then you''re Alex Fletcher, So when the sizzlingest tween quees on the charts asks the has-been ''80s pop sensation to write her a song, he grabs for another chance at stardom.  Problem: Alex can say it with music, but he sure can''t say it with words.  Enter Sophie Fisher, his beguiling if quirky plant lady, who has an unexpected green thumb for lyrics.  Together, they go after songwriting success - and discover that if you want to write the perfect love song, it helps to fall in love.\nWith Hugh Grant and Drew Barrymore at the keyboard and Marc Lawrence (Two Weeks Notice) directing, ''Music and Lyrics'' is a witty, wacky romantic comedy that faces the music... and laughs!', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(362, 362, 'United States', 1, 0, 0, '', '085391-118121', 532, 'Owned', 'The Road Warrior', '', '', '', '1981', '1997-04-01', 95, 'Snapper', 0, 'USD', '24.98', 'In the annals of action movies few can compare with ''The Road Warrior'', a full-throttle epic of speed and carnage that rockets you into a dreamlike landscape where the post-nuclear future meets the mythological past. More simply, it''s also one of the most mind-blowing stunt movies ever made.\n\nBefore he took aim in three ''Lethal Weapons'' and starred in 1994''s ''Maverick'', Mel Gibson had already made his mark on movie history as Max, the heroic loner who drives the roads of outback Australia in an unending search for gasoline. Arrayed against him and the other scraggly defenders of a fuel-depot encampment are the bizarre warriors commanded by The Humungus, notorious for never taking prisoners when they can pulverize them instead.\n\nWhen the battle is joined, the results are savage, spectacular and "a smashing good time at the movies" (Sheila Benson, Los Angeles Times). With ''The Road Warrior'' on your side screen action doesn''t get any better.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(363, 363, 'United States', 1, 0, 0, '', '085391-120889', 305, 'Owned', 'Happy Feet', '', '', '', '2006', '2007-03-27', 109, '', 0, 'USD', '19.99', '', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(364, 364, 'United States', 1, 0, 0, '', '085391-139072', 672, 'Owned', 'No Reservations', '', '', 'United States', '2007', '2008-02-12', 104, 'Keep Case', 0, 'USD', '28.98', 'Want a perfectly prepared dish of tender quail in truffle sauce? Kate (Catherine Zeta-Jones), a workaholic master chef, can do that.  But dont ask her what to do about the free-spirited, opera-loving sous chef (Aaron Eckhart) who joins the staff of her upscale Manhattan restaurant.  Or what to do about the orphaned niece (Abigail Breslin), more partial to fish sticks than foie gras, who comes to live with her.  "I wish there was a cookbook for life, with recipes telling us exactly what to do," Kate tells her therapist (Bob Balaban).\n\nA love of life (and of great food!) spices up this warm-hearted and funny tale about a woman discovering a world bigger than her kitchen. Something new and different is cooking at Kates place.', '', 'USD', '28.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(365, 365, 'United States', 0, 0, 0, 'Digital', '085391-139249', 1010, 'Owned', 'Chaos Theory', '', '', 'United States', '2007', '2008-06-17', 87, 'Keep Case', 0, 'USD', '27.95', 'Efficiency expert Frank Allen makes lists. And lists of lists. He has time scheduled, planned, parsed and pigeonholed. Then one day he''s 10 minutes late (not due to any inefficiency on his own part, of course). And that sparks a comic chain reaction that puts Frank in bed with a hottie, in the maternity ward with a ''very'' expectant mother and in trouble with his wife, who doesn''t buy his innocent explanations. His orderly life is out of control  and, wow, is chaos fun! Ryan Reynolds (''Definitely, Maybe''), Emily Mortimer (''Lars and the Real Girl'') and Stuart Townsend (''Queen of the Damned'') star in this alternately funny and touching fable that  when it''s all scheduled, planned, parsed and pigeonholed  measures happiness not in the hours we spend, but in the people we love.', '', 'USD', '27.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(366, 366, 'United States', 1, 0, 0, '', '085391-143420', 130, 'Owned', 'Protocol', '', '', '', '1984', '1998-10-13', 95, 'Snapper', 0, 'USD', '14.99', 'Will the corridors of power in our nation''s capitol ever be the same? Not after Sunny Davis (Goldie Hawn) arrives.  The ditzy  D. C. cocktail waitress goes from serving drinks to serving her country after saving an Arabian dignitary from an assassination attempt. What Sunny thinks, she says.  And what she says and does is hugely funny, thanks to work by writer Buck Henry (The Graduate), director Herbert Ross (The Goodbye Girl) and Academy Award winner Hawn, charmingly back in her country''s service after cheery stints in Private Benjamin and Swing Shift and putting her politics where her heart is -- and as well her Protocol.', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(367, 367, 'United States', 1, 0, 0, '', '085391-147428', 375, 'Owned', 'The Goonies', '', '', 'United States', '1985', '2001-08-21', 114, 'Snapper', 0, 'USD', '24.98', 'From the imagination of Steven Spielberg, ''The Goonies'' plunges a band of small heroes into a swashbuckling, surprise-around-every-corner quest beyond their wildest dreams! Following a mysterious treasure map into a spectacular underground realm of twisting passages, outrageous booby-traps and a long-lost pirate ship full of golden doubloons, the kids race to stay one step ahead of a family of bumbling bad guys and a mild-mannered monster with a face only a mother could love. A family adventure classic from start to buccaneering finish, ''The Goonies'' is a cinematic treasure trove of breathtaking action, dazzling effects and shiver-yer-timbers thrills!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(368, 368, 'United States', 1, 0, 0, '', '085391-151920', 531, 'Owned', 'Mad Max Beyond Thunderdome', '', '', '', '1985', '1997-08-01', 107, 'Snapper', 0, 'USD', '24.99', 'Two men enter.  One man leaves.  That''s the law in Bartertown''s Thunderdome arena.  But lawmaker Aunty Entity will soon add another: Don''t get Max mad!\n\nMad Max Beyond Thunderdome stars Mel Gibson (Lethal Weapon, Maverick) for his third go-round as the title hero who takes on the barbarians of the post-nuclear future - and this time becomes the savior of a tribe of lost children.  Music superstar Tina Turner steals what''s left of the screen as Aunty Entity, a power-mad dominatrix determined to use Max to tighten her stranglehold on Bartertown.\n\nDirectors George Miller and George Ogilvie deliver another rousing final apocalypse-on-wheels and one of the best movie fight scenes ever, as Max and the gladiatorial Blaster face off with maces, chainsaws and anything not nailed down inside Thunderdome.  Mad Max Beyond Thunderdome: watch and you''ll agree with the soundtrack song that "We Don''t Need Another Hero."', '', 'USD', '24.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(369, 369, 'United States', 0, 0, 0, 'Digital', '085391-167266', 905, 'Owned', '300', 'Exclusive Two-Disc Limited Edition', '', 'United States', '2007', '2007-07-31', 116, 'Custom', 1, 'USD', '49.99', 'The Epic Graphic Novel\nBy Frank Miller (Sin City) assaults the screen with the blood, thunder and awe of its ferocious visual style faithfully recreated in an intense blend of live-action and CGI animation. Retellin the ancient Battle of Thermopylae, it depicts the titanic clash in which King Leonidas (Gerard Butler) and 300 Spartans fought to the death against Xerxes (Rodrigo Santoro) and His Massive Persian Army. Experience History at swordpoint. And moviemaking with a cutting edge.', '', 'USD', '49.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(370, 370, 'United States', 1, 0, 0, '', '085391-170921', 544, 'Owned', 'Lethal Weapon', '', '', '', '1987', '1997-03-25', 110, 'Snapper', 0, 'USD', '24.99', '"This movie thrilled me from beginning to end."\n - Roger Ebert\n\n"A pistol-packing, snap-crackling thinking-man''s thriller."\n - Rita Kempley, The Washington Post\n\nMartin Riggs (Mel Gibson) is no ordinary cop. He''s a Mad Max gone maniacal, a man whose killing expertise and suicidal recklessness make him a Lethal Weapon to anyone he works against. Or with.\n\nRoger Murtaugh (Danny Glover) is an easygoing homicide detective with a loving family, a big house and a pension he doesn''t want to lose. Imagine Murtaugh''s shock when he learns his new partner is a guy with nothing left to lose: wild-eyed, burnt-out Martin Riggs.\n\nLethal Weapon is the thrill-packed story of two Vietnam-vets-turned-cops who have just one other thing in common: both hate to work with partners. But their partnership becomes the key to survival when a routine murder investigation leads to all-out, take-no-prisoners, martial-arts-and-machine-guns war with an international heroin ring.  Director Richard Donner moves that war at two speeds: fast and faster.  Hot L.A. days and nights explode in one show-topping scene after another, culminating in a no-holds-barred battle between Riggs and his Angel-of-Death nemesis (Gary Busey) - an electrifying sequence incorporating three martial arts styles and requiring four full nights to film.  Fierce, fast and frequently funny, Lethal Weapon fires off round after round of can''t-miss entertainment.', '', 'USD', '24.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(371, 371, 'United States', 1, 0, 0, '', '085391-174127', 421, 'Owned', 'The Witches of Eastwick', '', '', 'United States', '1987', '1997-08-22', 118, 'Snapper', 0, 'USD', '19.99', 'Only two casting choices exist to play the Devil: Old Scratch himself...and Jack Nicholson. ''The Witches of Eastwick'' took the better actor and this slyest, sexiest supernatural comedy thriller ever earned New York and Los Angeles Film Critics Best Actor Awards for the two-time Oscar winner.\n\nThree modern-day "witches" (Cher, Susan Sarandon and Michelle Pfeiffer) yearn for Mr. Right in a New England town. Is the arrival of wealthy and irresistible Daryl Van Horne(Nicholson) a coincidence - or the women''s unconscious sorcery at work? Based on John Updike''s bestseller, ''The Witches of Eastwick'' is a star-bright otherworldly delight.', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(372, 372, 'United States', 0, 0, 0, 'Digital', '085391-176428', 913, 'Owned', 'The Dark Knight', 'Widescreen Edition', '', 'United States', '2008', '2008-12-09', 153, 'Keep Case', 0, 'USD', '28.98', 'The follow-up to <i>Batman Begins</i>, <b><i>The Dark Knight</i> </b>reunites director Christopher Nolan and star Christian Bale, who reprises the role of <b>Batman/Bruce Wayne</b> in his continuing war on crime. With the help of <b>Lt. Jim Gordon</b> and District Attorney <b>Harvey Dent</b>, Batman sets out to destroy organized crime in <b>Gotham</b> for good. The triumvirate proves effective. But soon the three find themselves prey to a rising criminal mastermind known as <b>The Joker</b>, who thrusts Gotham into anarchy and forces Batman closer to crossing the fine line bewtween hero and vigilante. Heath Ledger stars as archvillian The Joker, and Aaron Eckhart plays Dent. Maggie Gyllenhall joins the cast as <b>Rachel Dawes</b>. Returning from <i>Batman Begins</i> are Gary Oldman as Gordon, Michael Caine as Alfred and Morgan Freeman as <b>Lucius Fox</b>.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(373, 373, 'United States', 0, 0, 0, 'Digital', '085391-176527', 931, 'Owned', 'Get Smart', 'Two-Disc Special Edition', '', 'United States', '2008', '2008-11-04', 110, 'Keep Case', 1, 'USD', '34.99', 'Steve Carell is in CONTROL as Maxwell Smart, the novice agent often out of his depth but never out of options in this action comedy pitting him against the nuclear scheme of the evil spy group KAOS. Anne Hathaway partners with Max as ever-capable Agent 99. And director Peter Segal (''The Longest Yard'') guides his stars (including Dwayne Johnson and Alan Arkin) through dangerous realm of molar radios, multifunction pocketknives, exploding dental floss and more. "''Get Smart'' works as an action film and it''s funny." (Richard Roaper, ''At the Movies with Ebert & Roeper'').', '', 'USD', '34.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(374, 374, 'United States', 1, 0, 0, '', '085391-178521', 224, 'Owned', 'Beetlejuice', '', '', '', '1988', '1997-06-24', 92, 'Snapper', 0, 'USD', '24.98', 'What''s a yuppie ghost couple to do when their quaint New England home is overrun by trendy New Yorkers?  They hire a freelance "bio-exorcist" to spook the intruders.  And everyone gets more than he, she or it bargained for!\n\nDirector Tim Burton (Batman, Mars Attacks!) teams with Michael Keaton (Night Shift, Batman).  The result?  "Keaton''s Beetlejuice is one of the biggest, baddest wolves a ghost movie has ever unleashed, a polter-gas" (The Village Voice).  He''s a juggernaut of jokes, jolts, and jive who hurls one-liners, spins into grotesque forms, gobbles insects and can''t leave ladies (living or dead) alone.  Keaton''s wild work in this and Clean and Sober won him 1988''s National Society of Film Critics Best Actor Award.\n\nAlec Baldwin, Geena Davis, Winona Ryder and Sylvia Sidney share starring honors with the movie''s wondrous production design, Harry Belafonte soundtrack tunes and Academy Award-winning Best Makeup.  So exorcise your right to fun.  Say the "B" word three times and have a wonderful Day-O!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(375, 375, 'United States', 1, 0, 0, '', '085391-187622', 543, 'Owned', 'Lethal Weapon 2', '', '', '', '1989', '1997-07-29', 114, 'Snapper', 0, 'USD', '24.99', '"Pure dynamite. Enough humor, excitement and action for two movies."\n - Rex Reed\n\nBuddy-cops Martin Riggs and Murtaugh are back, trying to keep a key witness-and themselves-alive in Lethal Weapon 2. \n\nMurtaigh is still the rock-solid family mabn. Riggs is still the reckless daredevil, but now he counts his odds before bucking them. He cracks more jokes too. "I thought in this film I could take Riggs in a slightly different direction and maybe have some fun," Gibson says.\n\nFun it is. And exciting, from its breathless opening chase through L.A. streets to its raging gun-battle finale. In between, there''s a six-story plummet from a window, a booby-trapped toilet, a Houdini-like underwater escape and the incredible destruction of a chic hillside stilt house. "With Mel and Danny, Joe is the third stooge," director Richard Donner says. That makes three drop-dead funny guys. And one of them is lethal.', '', 'USD', '24.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(376, 376, 'United States', 0, 0, 0, 'Digital', '085391-189947', 909, 'Owned', 'Body of Lies', 'Widescreen Edition', '', 'United States', '2008', '2009-02-17', 128, 'Keep Case', 0, 'USD', '28.98', 'The CIA''s hunt is on for the mastermind of a wave of terrorist attacks. Roger Ferris is the agency''s man on the ground, moving from place to place, scrambling to stay ahead of ever-shifting events. An eye in the sky - a satellite link - watches Ferris. At the other end of that real-time link is the CIA''s Ed Hoffman, strategizing events from thousands of miles away. And as Ferris nears the target, he discovers trust can be just as dangerous as it is necessary for survival. \n\nLeonardo DiCaprio (as Ferris) and Russell Crowe (as Hoffman) star in <i>Body of Lies</i>, adapted by William Monahan (<i>The Departed</i>) from the David Ignatius novel. Ridley Scott (<i>American Gangster, Black Hawk Down</i>) directs this impactful tale, orchestrating exciting action sequences and plunging viewers into a bold spy thriller for our time.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(377, 377, 'United States', 1, 0, 0, '', '085391-200024', 190, 'Owned', 'Batman', '', '', 'United States', '1989', '1997-03-25', 126, 'Snapper', 0, 'USD', '19.98', 'After a young boy witnesses his parents'' murder on the streets of Gotham City, he grows up to become Batman, a mysterious figure in the eyes of Gotham''s citizens, who takes crime-fighting into his own hands. He first emerges out of the shadows when the Joker appears - a horribly disfigured individual who is out for revenge on his former employer and generally likes to have a good time, but the identity of the "bat" is unknown. Perhaps millionaire Bruce Wayne and photographer Vicki Vale have a good chance of finding out?', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(378, 378, 'United States', 1, 0, 0, '', '085391-221722', 602, 'Owned', 'The Last Boy Scout', '', '', 'United States', '1991', '1998-05-26', 105, 'Snapper', 0, 'USD', '19.98', 'Written by Shane Black (''Lethal Weapon'') and directed by Tony Scott (''Top Gun''), ''The Last Boy Scout'' is the Super Bowl of action movies, a flat-out blitz of excitement, blow-you-away special effects and hilarious gimme-five humor set against the world of pro football.\n\nBruce Willis and Damon Wayans star as a seedy detective and a disgraced quarterback, teaming to dodge ambushes, fire off one-liners and bust chops. When the going gets tough, they get tougher. And funnier. They came to play. And to settle a score in this raging fireball where bigger is better, hits are harder and bad guys end up deader.', '', 'USD', '19.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(379, 379, 'United States', 1, 0, 0, '', '085391-222224', 325, 'Owned', 'Doc Hollywood', '', '', 'United States', '1991', '1998-10-06', 103, 'Snapper', 0, 'USD', '14.98', '"Beverly Hills. The most beautiful women in the world. Plastic surgery.  What do these three things have in common?" Dr. Ben Stone (Michael J. Fox) asks. "Me, in less than a week!" It turns out to be an eye-opening week.\n\nAnd ''Doc Hollywood'' turns out to be a witty charmer. Stone is a newly-minted MD whose medical fast lane cruise takes a small-town detour. Grady, South Carolina, Squash Capital of the South, is home to salt-of-the-earth folks (Julie Warner, Woody Harrelson, Bridget Fonda, David Ogden Stiers, Barnard Hughes) who give the West Coast-bound hotshot the seasoning he lacks.\n\n''Doc Hollywood'' is a surefire prescription for comedy cheer!', '', 'USD', '14.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(380, 380, 'United States', 1, 0, 0, '', '085391-247524', 542, 'Owned', 'Lethal Weapon 3', '', '', '', '1992', '1997-12-23', 118, 'Snapper', 0, 'USD', '24.99', '"The best ''Weapon'' yet. A big winner."\n - Pat Collins, WWOR-TV\n\nThey''re back in their most successful, most explosive, most hilarious smash hit yet. They come, they see, they kick butt in a caper that has LA police detectives Riggs (Gibson) and Murtaugh (Glover) ripping into a vicious crime ring dealing guns to the streets. \n\nJoe Pesci returns as shady ex-mob accountant Leo Getz, and Rene Russo ads a lethal kick as Internal Affairs investigator Lorna Cole, like Riggs a born risktaker. Risks are everywhere: a high-rise explodes into dust, a housing tract goes up like matchsticks, Riggs takes an 80-foot plunge on a motorcycle. Lethal Weapon 3 isn''t just more of everything. It''s the most!', '', 'USD', '24.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(381, 381, 'United States', 1, 0, 0, '', '085391-298823', 170, 'Owned', 'Mr. Wonderful', '', '', '', '1993', '1999-11-23', 98, 'Snapper', 0, 'USD', '19.98', 'How''s this for nice? After divorcing his wife a man searches high and low to find her the perfect man toElectrician Gus gets the chance to fulfill a childhood dream by buying an old bowling-alley with some of his friends. Unfortunately, due to the alimony payments he has to make to his ex-wife Leonora, the bank refuses to loan him the down payment. Knowing that when she marries again she loses her alimony rights, Gus tries to speed things up by bringing Leonora together with all the potential husbands he can find. Although this approach isn''t very successful, it awakens feelings in both of them they didn''t know they still had.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(382, 382, 'United States', 1, 0, 0, '', '085391-363224', 630, 'Owned', 'Outbreak', '', '', 'United States', '1995', '1997-05-20', 128, 'Snapper', 0, 'USD', '19.98', 'Your heart is racing. You shiver with fear. You''ve caught what''s going around. You''ve got the fever, the frenzy and all the thrills. You''re watching ''Outbreak''.\n\nBig-name stars join director Wolfgang Petersen (''In the Line of Fire'') for big excitement in this breathless technothriller. Two-time Academy Award winner Dustin Hoffman plays Sam Daniels, a take-charge army virologist trying to stave off global biological meltdown. A rare killer virus from the jungles of Zaire has taken hold in a California community. It knows no boundaries. Its mortality rate is 100%. And some say the only way to stop its spread is to firebomb the town and everyone in it. Rene Russo, Morgan Freeman, Donald Sutherland and more superb talents join Hoffman in this shocking, nail-biting tale of the day that could become doomsday.', '', 'USD', '19.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(383, 383, 'United States', 1, 0, 0, '', '085391-400028', 523, 'Owned', 'Robin Hood: Prince of Thieves', '', '', '', '1991', '1997-09-30', 144, 'Snapper', 0, 'USD', '26.95', 'Academy Award winner Kevin Costner triumphs as the legendary Sherwood Forest outlaw leader in this epic adventure bringing a 12th-century medieval world to spectacular screen life. Enhancing the sheer fun of this audience rouser are 12 added minutes of footage not seen in theatres, especially more of the juicy malevolence and sinister background of Robin Hood''s archenemy, the Sheriff of Nottingham (Alan Rickman). Morgan Freeman, Christian Slater and Mary Elizabeth Mastrantonio also star in this lavish production lensed in Britain and France, where historic structures, majestic forests and vividly realistic recreations of Olde England combine to create a world at once ancient and ageless.', '', 'USD', '26.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(384, 384, 'United States', 1, 0, 0, '', '085391-421726', 262, 'Owned', 'Something to Talk About', '', '', '', '1995', '1999-12-14', 106, 'Snapper', 0, 'USD', '19.99', 'Grace has a picture-perfect life. And it goes dizzyingly out of focus the day she discovers her husband Eddie has been unfaithful.\n\nIn one of her best-ever roles, Julia Robets is Grace, whose reaction to the infidelities of Eddie (Dennis Quaid) turns the lives and loves of the people around her into something like falling dominoes. Robert Duvall, Gena Rowlands, Kyra Sedgwick and others in "the year''s best ensemble of characters" (Jack Matthews, ''Newsday'') co-star in this juicy,  truthful story written by Callie Khouri (''Thelma and Louise'') and directed by Lasse Hallstrom (''What''s Eating Gilbert Grape?''). Folks are talking about Grace. You owe it to yourself to see why\nthis is my favorite Julia Roberts movie.  It is just too funny!!!', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(385, 385, 'United States', 1, 0, 0, '', '085391-500025', 335, 'Owned', 'Batman Returns', '', '', 'United States', '1992', '1997-04-29', 126, 'Snapper', 0, 'USD', '19.98', 'Gotham City faces two monstrous criminal menaces: the bizarre, sinister Penguin (Danny DeVito) and the slinky, mysterious Catwoman (Michelle Pfieffer).  Can Batman (Michael Keaton) battle two formidable foes at once?  Especially when one wants to be the mayor and the other is romantically attracted to Gotham''s hero?  Like the Academy Award-winning 1989 original, ''Batman Returns'' is directed by moviemaking wizard Tim Burton.  And like the first blockbuster, it''s a dazzling adventure that leaves you breathless.', '', 'USD', '19.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(386, 386, 'United States', 1, 0, 0, '', '085391-510024', 347, 'Owned', 'Batman Forever', '', '', 'United States', '1995', '1997-05-20', 122, 'Snapper', 0, 'USD', '24.98', 'Riddle me this, riddle me that, you''ll find adventure on the wings of a bat! Brace for excitement as Val Kilmer (Batman), Tommy Lee Jones (Two-Face), Jim Carrey (the Riddler), Nicole Kidman (Dr. Chase Meridian) and Chris O''Donnell (Robin) star in the third spectacular film in Warner Bros.'' ''Batman'' series. Joel Schumacher (''The Client'') directs and Tim Burton co-produces this thrill-ride of a movie that thunders along on Batmobile, Batwing, Batboat, Batsub and bold heroics. Hang on!', '', 'USD', '24.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(387, 387, 'United States', 1, 0, 0, '', '085391-516927', 386, 'Owned', 'Home Fries', '', '', 'United States', '1998', '1999-03-30', 93, 'Snapper', 0, 'USD', '19.98', 'Dorian Lever wants to romance unwed mother-to-be Sally Jackson.  His brother Angus wants to kill her.  So...you want fries with that?\n\nWearing her Burger-Matic headset like a Cinderella crown, Drew Barrymore is sunny, levelheaded Sally, the local drive-thru order taker who''s caught up in the darkly funny family brouhaha that, unknown to Sally, is largely orchestrated by the Levers'' manipulative, saccharine-smiling mom. Catherine O''Hara, Luke Wilson, Jake Busey, Shelley Duvall and others in a talented cast join Barrymore in serving up this devilishly offbeat romantic comedy.  For entertainment that''s "wickedly funny with superb performances" (Jeffrey Lyons, NBC-TV), you''ll want a large order of ''Home Fries''.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(388, 388, 'United States', 1, 0, 0, '', '085391-562528', 448, 'Owned', 'U.S. Marshals', 'Special Edition', '', 'United States', '1998', '1998-07-21', 131, 'Snapper', 0, 'USD', '19.99', 'We are initiating a hard-target search for a fugitive in an ever-widening perimeter. We will navigate swamps, prowl Manhatten streets, search every house and doghouse. And since Marshal Sam Gerard leads the hunt, we will experience suspense, action and daring twists every step of the way.\n\nReturning to his Oscar-winning role from ''The Fugitive'', Tommy Lee Jones joins Wesley Snipes and Robert Downey Jr. in delivering adrenaline-rush excitement. The chase is highlighted by an out-of-control 727, a death match in a ship''s cargo hold, a 12-story plunge onto a moving train and more heart-pounding sequences. Sign up with the ''U.S. Marshals!''', '', 'USD', '19.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(389, 389, 'United States', 1, 0, 0, '', '085391-607526', 541, 'Owned', 'Lethal Weapon 4', 'Premiere Collection', '', '', '1998', '1998-12-15', 127, 'Snapper', 0, 'USD', '24.98', 'Pure dynamite! The ''Lethal Weapon'' team has done it again, putting the match to the fuse and putting the WOW! back on screen for ''Lethal Weapon 4''.\n\nMel Gibson and Danny Glover return as buddy cops Riggs and Murtaugh, with Joe Pesci riding comedy shotgun as chatterbox Leo.  Murtaugh is still the family man.  Riggs is still the gonzo loose cannon and - what''s this? - family man.  His will he/won''t he marriage to Cole (Rene Russo) is one of the new wrinkles in this powerhouse crowd-pleaser that also stars comedy favorite Chris Rock and international action star Jet Li.  Wedding bells, ammo shells, explosive laughter - this one''s fully loaded!', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(390, 390, 'United States', 0, 0, 0, 'Digital', '085391-617624', 1000, 'Owned', 'The Exorcist', '25th Anniversary', '', 'United States', '1973', '1998-12-01', 124, 'Snapper', 0, 'USD', '24.98', 'The belief in evil  and that evil can be cast out. From these two strands of faith, author William Peter Blatty and director William Friedkin wove <i>The Exorcist</i>, the frightening and realistic story of an innocent girl inhabited by a malevolent entity.\n\nAcademy Award winner Friedkin, who introduces the film and supervised this new video transfer from restored picture and audio elements, gets effective performances from Linda Blair, Ellen Burnstyn, Jason Miller, Max von Sydow and Lee J. Cobb. Winner of 1973 Oscars for Best Adapted Screenplay (by Blatty) and Sound, <i>The Exorcist</i> remains 25 years later one of the most shocking and gripping movies ever made.', '', 'USD', '24.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(391, 391, 'United States', 1, 0, 0, '', '085391-632023', 62, 'Owned', 'City of Angels', 'Special Edition', '', '', '1998', '1998-09-29', 114, 'Snapper', 0, 'USD', '24.98', 'What if angels walked among us, and one of them fell in love with one of us?\n\nTwo of the brightest stars in the Hollywood constellation spark the biggest romance under the heavens in ''City Of Angels'', "a lyrical, unabashedly romantic film that earns its wings". Nicolas Cage is Seth, an angel who must decide if he''ll forsake his immortality and become human - on the chance that the woman of his dreams might love him. That woman is Maggie, a pragmatic heart surgeon who doesn''t believe in angels... until she meets Seth. Will love be their mutual destiny? The choice is theirs to make. The movie is yours to see, share and sweep you away.', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(392, 392, 'United States', 1, 0, 0, '', '085391-650027', 81, 'Owned', 'Batman & Robin', '', '', 'United States', '1997', '1997-10-21', 125, 'Snapper', 0, 'USD', '24.98', 'Chills and Thrills: Will Gotham City be put on ice?  George Clooney is Batman as the Dark Knight  battles his greatest threat yet: cold-hearted Mr. Freeze (Arnold Schwarzenegger) and venomous Poison Ivy (Uma Thurman).  Batman has more than Gotham City to protect: the youthful eagerness of crimefighting comrades Robin (Chris O''Donnell) and Batgirl (Alicia Silverstone) puts them frequently in harm''s way.  New ''very'' special effects include a wild sky-surfing sequence and Freeze''s outrageous ice-blasting arsenal.  It''s state-of-the-art excitement from our Batfamily to yours!', '', 'USD', '24.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(393, 393, 'United States', 1, 0, 0, '', '085391-688525', 587, 'Owned', 'Spies Like Us', '', '', 'United States', '1985', '1998-11-10', 102, 'Snapper', 0, 'USD', '14.98', 'They''re double agents without a sneaking suspicion of their assignment. But if it has anything to do with comedy, it''s sure to be "mission accomplished" for <i>Saturday Night Live</i> alumni Chevy Chase and Dan Aykroyd, romping through their first movie together: <i>Spies Like Us</i>.\n\nAs two government desk jockeys who cheat their way through a civil-service entry exam and (incredibly) become globetrotting undercover operatives, Aykroyd and Chase generate the verve and spontaneity of a Bob Hope/Bing Crosby road movie. (Indeed, Hope turns up in a cameo, golf club in hand.) Top secret. Eyes only. And laughter assured.', '', 'USD', '14.98', '2009-10-15', '2016-11-15 00:00:00', NULL),
(394, 394, 'United States', 1, 0, 0, '', '085391-695424', 31, 'Owned', 'You''ve Got Mail', '', '', '', '1998', '1999-05-04', 120, 'Snapper', 0, 'USD', '24.98', 'You''ve Got Mail delivers all the wit, charm and warmth you''d expect from a reunion of the stars (Tom Hanks, Meg Ryan) and director (Nora Ephron) of Sleepless In Seattle. Greg Kinnear, Parker Posey, Jean Stapleton and more talented co-stars add perfect support to this valentine to modern - to modem - romance in which superstore book chain magnate Hanks and cozy children''s bookshop owner Ryan are anonymous email cyberpals who fall head-over-laptops in love, unaware they are combative business rivals. You''ve got rare Hollywood magic when You''ve Got Mail.', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(395, 395, 'United States', 1, 0, 0, '', '085391-722724', 244, 'Owned', 'Jack Frost', '', '', '', '1998', '1999-11-02', 102, 'Snapper', 0, 'USD', '24.98', 'Michael Keaton is a rock ''n'' roll dad who gets one last chance to fine-tune his life - and proves that ice guys finish first - in this wild fantasy-adventure frosted with a blizzard of special effects!\n\nOn the verge of making it big, long-struggling musician Jack Frost realizes hes missing something vital: time with his wife and young son Charlie. But before Jack can make up for lost time, he swerves off an icy mountain road. Then, one cold winters night, Jack magically returns...as a snowman! He embarks on a riotous, snowball-chucking, snowboard-cruising quest to show Charlie that when it comes to being totally cool, theres no dad...like a snowdad!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(396, 396, 'United States', 0, 0, 0, 'Digital', '085391-748823', 1002, 'Owned', 'The Exorcist III', '', '', 'United States', '1990', '1999-12-28', 110, 'Snapper', 0, 'USD', '19.98', 'A woman crawls by unnoticed  on the ceiling lika a fly. A long-dead killer claims victim after victim. Flames erupt, snakes slither, the ground opens and reveals a writhing pit of the damned. The evil is back. \n\nAlso back is the creative force whose novel and Oscar -winning screenplay shaped the trailblazing <i>The Exorcist</i>. Adapting his novel <i>Legion</i>, William Peter Blatty writes and directs <i>The Exorcist III</i>, a jolting foray into terror that begins where the first film ended. George C. Scott plays police Lt. Kinderman, investigating mysterious murders. Kinderman doesn''t believe in demons and possession. Not yet. Jason Miller reprises his priestly role from the original. And look for Samuel L. Jackson, pro basketball''s Patrick Ewing and more bit-role surprises.', '', 'USD', '19.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(397, 397, 'United States', 1, 0, 0, '', '085391-828624', 173, 'Owned', 'My Dog Skip', '', '', '', '2000', '2000-07-11', 95, 'Snapper', 0, 'USD', '24.98', 'Who says best friends have to be human? Not Willie Morris (Frankie Muniz), who receives a talented terrier named Skip for his birthday. With Skip''s remarkable and unconventional help, Willie and Skip turn bullies into friends, tangle with hapless moonshiners, and even win the affections of the prettiest girl in school. Shining with warmth and humor, My Dog Skip unleashes a story that will have the entire family sitting up and begging for more!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(398, 398, 'United States', 1, 0, 0, '', '085391-831327', 581, 'Owned', 'Interview with the Vampire: The Vampire Chronicles', '', '', 'United States', '1994', '2000-06-06', 122, 'Snapper', 0, 'USD', '24.98', 'The undead are among us and livelier than ever when Tom Cruise, Brad Pitt and a talented group of youngbloods star in ''Interview with the Vampire'', the spellbinding screen adaptation of Anne Rice''s bestseller. Box-office favorite Cruise stylishly plays the supremely evil, charismatic vampire Lestat. Pitt is Louis, lured by Lestat into the immortality of the dammed, then tormented by an unalterable fact of vampire life: to survive, he must kill. Stephen Rea, Antonio Banderas, Christian Slater and Kirsten Dunst also star.\n\nHypnotically directed by Neil Jordan (''The Crying Game'') from a screen play by Rice, ''Interview with the Vampire'' offers enough thrills, shocks and fiendish fun to last a lifetime and beyond.', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(399, 399, 'United States', 1, 0, 0, '', '085391-832126', 333, 'Owned', 'Twister', 'DTS', '', 'United States', '1996', '2000-06-06', 113, 'Snapper', 0, 'USD', '24.98', 'The house rips apart piece by piece. A bellowing cow spins through the air. Tractors fall like rain. A 15,000-pound gasoline tanker becomes an airborne bomb. A mile-wide, 300 miles-per-hour force of total devastation is coming at you. ''Twister'' is hitting home. In this adventure swirling with cliffhanging excitement and awesome special effects, Helen Hunt and Bill Paxton play scientists pursuing the most destructive weather front to sweep through mid-America''s Tornado Alley in 50 years. By launching electronic sensors into the funnel, the storm chasers hope to obtain enough data to create an improved warning system. But to do so, they must intercept the twisters'' deadly path. The chase is on!', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL);
INSERT INTO `details` (`id`, `film_id`, `locality`, `media_dvd`, `media_hddvd`, `media_bluray`, `media_custom`, `upc`, `collectionnumber`, `collectiontype`, `title`, `disttrait`, `originaltitle`, `origin`, `prodyear`, `released`, `runningtime`, `casetype`, `slipcover`, `srpid`, `srp`, `overview`, `easteregg`, `purchcurrencyid`, `purchprice`, `purchdate`, `created_at`, `updated_at`) VALUES
(400, 400, 'United States', 1, 0, 0, '', '085391-838128', 129, 'Owned', 'The Whole Nine Yards', '', '', '', '2000', '2000-07-18', 99, 'Snapper', 0, 'USD', '24.99', 'There goes the neighborhood -- in a pine box. When hit man Jimmy "The Tulip" Tudeski moves into a comfy suburb, everyone''s suddenly in danger of pushing up daisies. And it''s not all Jimmy''s doing, either.\n\nJonathan Lynn (''My Cousin Vinny'') directs and a top cast packs heat in this manic comedy about life, love and plenty of ammo. Bruce Willis is Jimmy, whose arrival sparks a chain reaction in which just about everybody wants to clip somebody else. Matthew Perry plays a hapless dentist who finds a way to get on the Tulip''s good and bad sides. And Rosanna Arquette, Michael Clarke Duncan, Natasha Henstridge, Amanda Peet and Kevin Pollak add to the wacky and whacked fun of "a laugh riot" (Larry King, ''USA Today'').', '', 'USD', '24.99', '2006-02-03', '2016-11-15 00:00:00', NULL),
(401, 401, 'United States', 1, 0, 0, '', '085392-112227', 511, 'Owned', 'The Fugitive', '', '', '', '1993', '2001-06-05', 131, 'Snapper', 0, 'USD', '24.98', 'Harrison Ford and Tommy Lee Jones race through this breathless manhunt movie inspired by one classic TV series and which in turn inspired yet another. Ford is prison escapee Dr. Richard Kimble, a Chicago surgeon falsely convicted of killing his wife and determined to prove his innocence by leading his pursuers to the one-armed man who committed the crime. Jones (1993 Academy Award, Golden Globe and Los Angeles Film Critics Award winner as Best Supporting Actor) is Sam Gerard, an unrelenting bloodhound of a U.S. marshal. They are hunted and hunter. And as directed by Andrew Davis (Under Siege), their nonstop chase has one exhilarating speed: all-out.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(402, 402, 'United States', 1, 0, 0, '', '085392-125029', 211, 'Owned', 'See Spot Run', '', '', 'United States', '2001', '2001-08-28', 97, 'Snapper', 0, 'USD', '24.98', 'Offbeat mailman Gordon Smith has never met a dog he couldn''t handle, but when he offers to baby-sit James, the young son of his beautiful neighbor Stephanie, he dog skills are put to the test! When a crime-fighting superdog hiding from the Mob befriends James, he drives our "dog-loving" mailman up a tree, dodges the Mob and wins the hearts of the good guys along the way. ''See Spot Run'' straight into the hearts of families everywhere!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(403, 403, 'United States', 1, 0, 0, '', '085392-132225', 255, 'Owned', 'Swordfish', '', '', '', '2001', '2001-10-30', 99, 'Snapper', 0, 'USD', '24.98', 'Use a computer, go to jail. The terms of Stanley Jobson''s parole are clear. Yet a $10-million payday awaits the superhacker if he takes on a job masterminded by a charismatic covert agent - the daring electronic theft of a government slush fund codenamed ''Swordfish''.\n\nJohn Travolta is the mastermind, Hugh Jackman is the hacker and Halle Berry and Don Cheadle co-star in this volatile high-tech thriller directed by Dominic Sena (''Gone in 60 Seconds'') and produced by Joel Silver (''The Matrix'') and Jonathan D. Krane (''Face/Off''). Log on, tap in, kick back for cyber-edge action and suspense. Your password for excitement is ''Swordfish''.', '', 'USD', '24.98', '2007-08-09', '2016-11-15 00:00:00', NULL),
(404, 404, 'United States', 1, 0, 0, '', '085392-149827', 87, 'Owned', 'Scooby-Doo', '', '', '', '2002', '2002-11-25', 83, 'Keep Case', 0, 'USD', '19.98', 'Throughout The Ages, One Hero Has Cowered Above The Rest. \n\nMystery Inc. (Daphne, Fred, Velma, Shaggy, and Scooby Doo) has broken up; on the grounds of who has been solving their cases. After two years seperated, they are mysteriously joined together to solve a case on Spooky Island. A theme park owned by a man named, Mondavarious. He needs their help, figuring out why the vacationers are leaving mellow and sober. But it seems they are brought back as one for more than just solving a case.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(405, 405, 'United States', 1, 0, 0, '', '085392-246724', 65, 'Owned', 'Harry Potter and the Sorcerer''s Stone', 'Special Widescreen Edition', '', 'United Kingdom', '2001', '2002-05-28', 152, 'Digipak', 1, 'USD', '26.99', 'The Delightful Film Adaptation of J.K. Rowling''s Bestseller\n\nHarry Potter learns on his 11th birthday that he is the orphaned son of two powerful wizards and possesses magical powers of his own. At Hogwarts School of Witchcraft and Wizardry, Harry embarks on the adventure of a lifetime, discovering a world of magic and fantasy where he is destined to live.', '', 'USD', '26.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(406, 406, 'United States', 1, 0, 0, '', '085392-263424', 221, 'Owned', 'Ocean''s Eleven', '', '', '', '2001', '2002-05-07', 116, 'Snapper', 0, 'USD', '26.98', 'The plan is set. The rules are clear. If all goes right for Danny Ocean''s grifters, the payoff is $150 million. Divided by 11. You do the math.\n\nThe skill of Academy Award-winning director Steven Soderbergh combines with enough starpower to light up the Las Vegas strip in this classy caper. George Clooney plays Danny, defying the odds in a split-second heist of three Vegas casinos- all owned by a magnate (Andy Garcia) who is dating Danny''s ex-wife (Julia Roberts). A fixer (Brad Pitt), a pickpocket (Matt Damon), a blackjack dealer (Bernie Mac), a flimflammer (Carl Reiner) and others in well-defined roles are with Danny. Are you in or out?', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(407, 407, 'United States', 1, 0, 0, '', '085392-330126', 110, 'Owned', 'Two Weeks Notice', '', '', '', '2002', '2003-04-29', 102, 'Snapper', 0, 'USD', '27.98', 'Over. Done. Finished. A comedy about love at last glance.\n\nAttorney Lucy Kelson wants to save the world. Instead, she''s choosing ties and interviewing prospective girlfriends for her handsome and hapless billionaire boss George Wade. Is this why she got a Harvard Law degree? Lucy''s fed up, so she submits her notice. But Wade-with an assist from Cupid-has other plans.', '', 'USD', '27.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(408, 408, 'United States', 1, 0, 0, '', '085392-330423', 582, 'Owned', 'Queen of the Damned', 'Widescreen Edition', '', '', '2002', '2002-08-27', 101, 'Snapper', 0, 'USD', '26.98', 'It''s her time. Her place. The wickedly regal Mother of All Vampires is ready again to rule!  Aaliyah plays the title role in this stylish shocker based on Anne Rice''s ''The Vampire Chronicles''. Stuart Townsend portrays Lestat, the undead antihero previously seen in the movie version of Anne Rice''s ''Interview with the Vampire''. This time, Lestat finds acceptance in a tattooed and pierced world. He''s a rock star. And his intoxicating Goth-riffed sound rekindles the desires of all-powerful Akasha.', '', 'USD', '26.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(409, 409, 'United States', 1, 0, 0, '', '085392-359226', 348, 'Owned', 'Harry Potter and the Chamber of Secrets', 'Widescreen Edition', '', 'United Kingdom', '2002', '2003-04-11', 161, 'Digipak', 1, 'USD', '29.95', 'Cars fly, trees fight back and a mysterious elf comes to warn Harry Potter at the start of the second year of his amazing journey into the world of wizardry. This year at Hogwarts, spiders talk, letters scold and Harry''s own unsettling ability to speak to snakes turns his friends against him. From dueling clubs to rogue Bludgers, it''s a year of adventure and danger when bloody writing on a wall announces: The Chamber of Secrets has been opened. To save Hogwarts will require all of Harry, Ron and Herione''s magical abilities and courage in this spellbinding adaptation of J.K. Rowling''s second book. Get ready to be amused and petrified as Harry Potter shows he''s more than a wizard, he''s a hero!', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(410, 410, 'United States', 1, 0, 0, '', '085392-394524', 575, 'Owned', 'The Last Samurai', '', '', '', '2003', '2004-05-04', 154, 'Keep Case', 0, 'USD', '29.95', 'Tom Cruise plays Civil War hero Capt. Nathan Algren, who comes to Japan to fight the Samurai and ends up pledging himself to their cause. Ken Watanabe (Academy Award nominee) plays Katsumoto, a Samurai leader facing a vanishing way of life, whose destiny becomes intertwined with that of the American Captain.  Edward Zwick (winner of the National Board of Review''s Best Director Award) directs this sweeping and emotional epic tale of the birth of modern Japan.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(411, 411, 'United States', 0, 0, 0, 'Digital', '085392-467426', 1003, 'Owned', 'Exorcist: The Beginning', 'Widescreen Edition', '', 'United States', '2004', '2005-03-01', 113, 'Keep Case', 0, 'USD', '27.95', 'Having abandoned his faith in God, Father Merrin (Stellan Skarsgrd) joins a British archaeological excavation in Kenya, where an inexplicably pristine Christian Byzantine church has been unearthed - looking as if it had been buried on the day it was completed.  But beneath the church, something much older sleeps, waiting to be awoken.  As madness swiftly descends upon the villagers and British soldiers, Merrin watches helplessly as atrocities are committed against an innocent village - atrocities he had seen before and prayed never to see again.  The blood of innocents flows freely on the East African plain, and the horror has only just begun.  In the place where Evil was born, Merrin will finally see its true face.', '', 'USD', '27.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(412, 412, 'United States', 1, 0, 0, '', '085392-839827', 24, 'Owned', 'Scooby-Doo 2: Monsters Unleashed', '', '', 'United States', '2004', '2004-09-14', 93, 'Keep Case', 0, 'USD', '27.95', 'They came. They saw. They ran! \n\nJunkies! Theyre the most monsters ever gathered! Mix those creepazoids with Scooby-Doo and the rest of the Mystery Inc. gang and you have the recipe for family fun!\n\nA masked villain wreaks mayhem on the city of Coolville with a monster machine that creates real-life versions of Mystery Inc.s former foes like the 10,000-volt ghost, the Cotton Candy Glob, The Skelemen and the Pterodactyl Ghost. Fred, Daphne, Shaggy, Velma and Scooby-Doo launch an investigation into the monster outbreak that leaves Shaggy and Scooby questioning their roles in Mystery Inc. Eager to prove their detective skills, the ever-ravenous duo come up with a secret plan to resolve the mystery all by themselves. Can the gang unravel their most challenging case? Seth Green, Alicia Silverstone and Peter Boyle join the cast for some zoinked-out monster madness. Doo see it!', '', 'USD', '27.95', '2008-01-17', '2016-11-15 00:00:00', NULL),
(413, 413, 'United States', 1, 0, 0, '', '085392-844722', 405, 'Owned', 'Harry Potter and the Prisoner of Azkaban', '', '', '', '2004', '2004-11-23', 142, 'Keep Case', 0, 'USD', '29.95', 'In Harry Potter And The Prisoner Of Azkaban, Harry Potter and his friends Ron and Hermione return as teenagers to Hogwarts School of Witchcraft and Wizardry for their third year of study, where they delve into the mystery surrounding an escaped prisoner who seems to pose a dangerous threat to Harry.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(414, 414, 'United States', 1, 0, 0, '', '085392-874712', 509, 'Owned', 'The Matrix Reloaded', '', '', '', '2003', '2003-10-14', 138, 'Keep Case', 0, 'USD', '29.95', 'The Matrix Reloaded er den lnge ventede fortsttelse p den 4-dobbelte Oscar-vinder The Matrix. I rollerne ses Keanu Reeves, Laurence Fishburne, Carrie-Anne Moss og Hugo Weaving, der alle medvirkede i den frste Matrix-film. Blandt nye navne kan nvnes Monica Bellucci og Jada Pinkett Smith. \n\nNeo (Keanu Reeves) og hans oprrsgruppe opdager, at der er prcis 72 timer til, at deres by Zion bliver opdaget og delagt, og indbyggerne udslettes. \nSamtidig skal Neo n at finde ud af, hvordan han redder Trinity (Carrie-Anne Moss) fra den forfrdelige skbne, som han i sine drmme har forudset, at hun vil f.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(415, 415, 'United States', 1, 0, 0, '', '085393-145026', 605, 'Owned', 'Catwoman', 'Widescreen Edition', '', 'United States', '2004', '2005-01-18', 104, 'Keep Case', 1, 'USD', '27.95', 'Patience Philips is dead  and more alive than ever. Murdered after she learns the secret behind a cosmetic firm''s anti-aging cream, she''s revived and empowered by mystical felines. Now she''s on the slinky prowl for adventure and revenge. She''s ''Catwoman''.\n\nAcademy Award winner* Halle Berry plays the sleek, whip-cracking feline fatale, Benjamin Bratt is a cop torn between romance and duty, and Sharon Stone is an ice-blooded supermodel with something to hide in a kicky and stylish ''Catwoman''. With catlike grace, a knack for landing on her feet, a passion for sushi and a loathing for dogs, Berry is a perfect force to reckon with. She''s action. With attitude.\n\n*2001: Best Actress for ''Monster''s Ball''.', '', 'USD', '27.95', '2008-05-27', '2016-11-15 00:00:00', NULL),
(416, 416, 'United States', 1, 0, 0, '', '085393-165925', 482, 'Owned', 'Terminator 3: Rise of the Machines', '', '', '', '2003', '2003-11-11', 109, 'Keep Case', 0, 'USD', '29.95', 'A decade has passed since John Connor (Nick Stahl) helped prevent Judgment Day and save mankind from mass destruction. Now 25, Connor lives "off the grid" - no home, no credit cards, no cell phone and no job. No record of his existence. No way he can be traced by Skynet - the highly developed network of machines that once tried to kill him and wage war on humanity.\n\nBut, out of the shadows of the future steps T-X (Kristanna Loken), Skynet''s most sophisticated cyborg killing machine yet. Sent back through time to complete the job left unfinished by her predecessor, the T-100, this machine is as relentless as her human guise is beautiful. Now Connor''s only hope for survival is theTerminator (Arnold Schwarzenegger), his mysterious former assassin. Together, they must triumph over the technologically superior T-X and forestall the looming threat of Judgment Day or face the apocalypse and the fall of civilization as we know it.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(417, 417, 'United States', 1, 0, 0, '', '085393-320928', 508, 'Owned', 'The Matrix Revolutions', '', '', '', '2003', '2004-04-06', 129, 'Keep Case', 0, 'USD', '29.95', 'Neo. Trinity. Morpheus. They and other heroes stand on the brink of victory or annihilation in the epic war against the Machines in the stunning final chapter of the Matrix trilogy. For Neo, that means going where no human has dared - into the heart of Machine City and into a cataclysmic showdown with the exponentially more powerful renegade program Smith. For writer-directors the Wachowski Brothers and producer Joel Silver, that means soaring beyond the amazing visual inventiveness of the first two films. The revolution is now: The Matrix Revolutions.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(418, 418, 'United States', 1, 0, 0, '', '085393-497224', 174, 'Owned', 'Looney Tunes: Back In Action', '', '', '', '2003', '2004-03-02', 92, 'Snapper', 0, 'USD', '27.95', 'Live Action Adventure Comedy. Set in a live-action world in which Warner Bros.'' beloved assortment of irreverent animated entertainers interact with human characters for maximum effect, the story unfolds on the Studio backlot and careens all over the map in time-honored Looney Tunes style. Our celluloid heroes embark on a hilarious adventure that takes them from Hollywood to Las Vegas, Paris and the jungles of Africa in search of Fraser''s character''s missing father and the mythical Blue Monkey Diamond.', '', 'USD', '27.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(419, 419, 'United States', 0, 0, 0, 'Digital', '085393-894221', 911, 'Owned', 'Constantine', 'Widescreen Edition', '', 'United States', '2005', '2005-07-19', 121, 'Keep Case', 0, 'USD', '28.98', '<i>John Constantine</i> sees demons walk the earth, and he aims to do something about it: send them back to hell!\n\nAs Constantine, <i>The Matrix</i>''s Keanu Reeves fights a new otherworld foe in this eye-popping supernatural thriller based on characters from the DC Comics/Vertigo <i>Hellblazer</i> Graphic Novels and set in a City of the Angels where spirit-world bounds have been broken...and all hell is breaking loose.\n\nHoly water. A dragon''s-breath flamethrower. A shotgun crafted from a crucifix. Armed with these and assisted by an intrepid cop (Rachel Weisz), <i>John Constantine</i> is a spiritual warrior gone to apocalyptic war. Be glad he''s on your side.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(420, 420, 'United States', 0, 0, 0, 'Digital', '085396-641921', 1021, 'Owned', 'The Passion of the Christ', 'Widescreen Edition', '', '', '2004', '2004-08-31', 126, 'Keep Case', 0, 'USD', '29.98', 'From Academy Award-Winning director Mel Gibson comes a profound story of courage and sacrifice depicting the final twelve hours in the life of Jesus Christ.\n\nFeaturing stunning cinematography and an inspired performance by Jim Caviezel, <i>The Passion of the Christ</i> is a triumphant and uncompromising filmmaking achievement.', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(421, 421, 'United States', 1, 0, 0, '', '086162-001598', 246, 'Owned', 'Home Alone', '', '', '', '1990', '1999-10-05', 103, 'Keep Case', 0, 'USD', '19.98', 'When Kevins family left for vacation, they forgot one minor detail: Kevin!\nEight-year-old Kevin McCallister (Macaulay Culkin) has become the man of the house, overnight!  Accidentally left behind when his family rushes off on a Christmas vacation, Kevin gets busy decorating the house for the holidays.  But hes not decking the halls with tinsel and holly.  Two bumbling burglars are trying to break in, and Kevins rigging a bewildering battery of booby traps to welcome them!\n\nWritten and produced by John Hughes (101 Dalmatians), this madcap slapstick adventure features an all-star supporting cast including Catherine OHara and John Heard as Kevins parents, Joe Pesci and Daniel Stem as the burglars, and John Candy (Planes, Trains and Automobiles) as the Polka King of the Midwest.', '', 'USD', '19.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(422, 422, 'United States', 1, 0, 0, '', '086162-090639', 227, 'Owned', 'Hope Floats', '', '', '', '1998', '1998-11-03', 114, 'Keep Case', 0, 'USD', '34.98', 'Sandra Bullock gives her most critically acclaimed performance in this touching and heartwarming story about following your heart and finding yourself. Birdee Puritt (Bullock) has a life most people would envy. But when  her cheating husband reveals his infidelity to her on a national TV talk show, her perfect life comes crashing down. Devastated, Birdee and her young daughter head home to the small town she left behind. As mother and daughter struggle to adjust to their new lives, Birdee slowly gains the strength to open her heart and find hope again.', '', 'USD', '34.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(423, 423, 'United States', 1, 0, 0, '', '086162-103995', 66, 'Owned', 'Die Hard', '', '', '', '1988', '1999-03-09', 131, 'Keep Case', 0, 'USD', '29.98', 'High above the city of L.A. a team of terrorists has seized a building, taken hostages, and declared war.  But one man has managed to escape detection...an off-duty cop.  He''s alone...tired...and the only chance anyone has. \n\nBruce Willis stars as New Yourk City Detective John McClane, newly arrived in Los Angeles to spend the Christmas holiday with his estranged wife (Bonnie Bedelia).  But as McClane waits for his wife''s office party to break-up, terrorists seize control of the building.  While the henchman (Alan Rickman) and his savage henchman (Alexander Godunov) round up hostages, McClane slips away unnoticed.  Armed with only a service revolver and his cunning, McClane launches his own one-man war.  A crackling thriller from beginning to end, Die Hard explodes with heartstopping suspense.', '', 'USD', '29.98', '2006-02-03', '2016-11-15 00:00:00', NULL),
(424, 424, 'United States', 1, 0, 0, '', '086162-104121', 69, 'Owned', 'Die Hard 2: Die Harder', '', 'Die Hard 2', 'United States', '1990', '1999-03-09', 123, 'Keep Case', 0, 'USD', '29.99', 'On a snowy Christmas Eve in the nation''s capital, a team of terrorists has seized a major international airport and now holds thousands of holiday travelers hostage. The terrorists, a renegade band of crack military commandos led by a murderous rogue officer (William Sadler), have come to rescue a drug lord from justice. They''ve prepared for every contingency except one: John McClane, an off-duty cop gripped with a feeling of deadly dj vu.\n\nBruce Willis returns as the heroic cop who battles not only terrorists, but also an incompetent airport police chief (Dennis Franz), the hard-headed commander (John Amos) of the Army''s anti-terrorist squad and a deadly winter snowstorm. The runways are littered with death and destruction, and McClane is in a race against time. His wife (Bonnie Bedelia) is trapped on one of the planes circling overhead, which is desperately low on fuel.\n\nIt''s all-out war, a heart-stopping jet-propelled journey filled with excitement and terror. Fasten your seat belts!', '', 'USD', '29.99', '2006-01-17', '2016-11-15 00:00:00', NULL),
(425, 425, 'United States', 1, 0, 0, '', '086162-104176', 70, 'Owned', 'Die Hard with a Vengeance', '', '', 'United States', '1995', '1999-03-09', 131, 'Keep Case', 0, 'USD', '29.99', 'The third installment of the hugely successful Die Hard series reteams Bruce Willis and director John McTiernan in a new action/adventure extravaganza of special effects, unexpected comedy and nonstop thrills.\n\nThis time, New York cop John McClane (Willis) is the personal target of the mysterious Simon (Jeremy Irons), a terrorist determined to blow up the entire city if he doesn''t get what he wants. Accompanied by an unwilling civilian partner (Samuel L. Jackson), McClane careens wildly from one end of New York City to the other as he struggles to keep up with Simon''s deadly game. It''s a battle of wits between a psychopathic genius and a heroic cop who once again finds himself having a really bad day.', '', 'USD', '29.99', '2006-01-17', '2016-11-15 00:00:00', NULL),
(426, 426, 'United States', 1, 0, 0, '', '086162-104312', 514, 'Owned', 'Aliens', '', '', 'United States', '1986', '1999-06-01', 154, 'Keep Case', 0, 'USD', '29.99', 'In this action-packed sequel to ''Alien'', Sigourney Weaver returns as Ripley, the only survivor from mankind''s first encounter with the monstrous Alien. Her account of the Alien and the fate of her crew are received with skepticism - until the mysterious disappearance of colonists on LV-426 lead her to join a team of high-tech colonial marines sent in to investigate. Personally supervised by director James Cameron, this special edition includes scenes eliminated prior to the film''s 1986 release which broaden the narrative scope and enrich the emotional impact of the film.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(427, 427, 'United States', 1, 0, 0, '', '086162-123085', 141, 'Owned', 'A Midsummer Night''s Dream', '', '', '', '1999', '1999-11-13', 120, 'Keep Case', 0, 'USD', '34.98', 'A stellar cast, headed by Michelle Pfeiffer and Kevin Kline, bring Shakespeare''s most romantic comendy to life. When two pairs of star-crossed lovers, a troop of inept amateur actors, a feuding pair of supernatural sprites and a love potion gone awry all come together in an enchanted moonlit forest, the result is an unequalled mixture of merriment and magic. Also starring Calista Flockhart, Stanley Tucci and Ruper Everett.', '', 'USD', '34.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(428, 428, 'United States', 1, 0, 0, '', '086162-162688', 461, 'Owned', 'True Lies', '', '', 'United States', '1994', '1999-05-25', 141, 'Keep Case', 0, 'USD', '29.99', 'Arnold Schwarzenegger is special agent Harry Tasker -although to his wife Helen (JAMIE LEE CURTIS), he''s just a boring computer salesman. When Harry''s two lives unexpectedly collide, both he and Helen find themselves in the clutches of international terrorists fighting to save not only their marriage, but their lives.Directed by James Cameron and crammed with incredible special effects, TRUE LIES is an exhilarating mix of non-stop action and romantic comedy.', '', 'USD', '29.99', '2008-01-21', '2016-11-15 00:00:00', NULL),
(429, 429, 'United States', 1, 0, 0, '', '096009-420796', 685, 'Owned', '10.5 Apocalypse: The Complete Miniseries', 'Widescreen', '', 'United States', '2006', '2006-08-01', 169, 'Keep Case', 0, 'USD', '24.99', 'Another massive 10.5 quake tears apart the West Coast, threatening to turn the American landscape into a hellish wasteland. Seismologist Samantha Hill (Emmy winner <b>Kim Delaney</b>, TV''s <i>CSI: Miami</i>) sees an even greater threat: an ever-widening fault line that''s heading straight for the country''s two largest nuclear reactors. If a meltdown occurs, millions will die. Samantha and the American president (Emmy and Golden Globe winner <b>Beau Bridges</b>, TV''s <i>Stargate SG-1</i>) agree only one man can help themthe scientist who predicted this terrifying natural disaster years beforeSamantha''s own father, Dr. Earl Hill (Golden Globe nominee <b>Frank Langella</b>, <i>Good Night, and Good Luck.</i>), now counted as a possible casualty of a massive Las Vegas quake. Together with a crack rescue team including Brad (<b>Dean Cain</b>, <i>Mayday</i>) and Will (<b>Oliver Hudson</b>, <i>The Out-of-Towners</i>), Samantha must find her father and stop the fault from slicing uncontrollably toward millions of people and the ultimate nuclear apocalypse.', '', 'USD', '24.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(430, 430, 'United States', 1, 0, 0, '', '096009-420994', 687, 'Owned', 'Merlin''s Apprentice', 'Full Screen', '', 'United States', '2005', '2006-03-07', 184, 'Keep Case', 0, 'USD', '24.99', 'The great sorcerer Merlin has returned to Camelot, a kingdom now vulnerable to ill fates and war since the theft of the Holy Grail, its greatest gift and protection. With the help of Jack, an irascible young beggar-thief imbued with his own unruly magic, the fight against unknown dangers begins -- to find the Grail, restore it to its rightful place, and bring Camelot back to its glory days.', '', 'USD', '24.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(431, 431, 'United States', 1, 0, 0, '', '096009-441692', 688, 'Owned', 'Blackbeard: The Complete Miniseries', 'Widescreen', '', 'United States', '2005', '2006-07-11', 170, 'Keep Case', 0, 'USD', '24.99', 'In the Golden Age of Piracy, at the dawn of the 18th century, Blackbeard stood out among the lawless rogues as the most fearsome and notorious seafarer of them all. He killed for the reputation, and his reputation has become legend. Now, for the first time, comes the true story of pirate Edward Teach, the man who terrorized the seas.', '', 'USD', '24.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(432, 432, 'United States', 1, 0, 0, '', '096009-443399', 686, 'Owned', 'Category 7: The End of the World', 'Widescreen', '', 'United States', '2005', '2006-04-04', 172, 'Keep Case', 0, 'USD', '24.99', 'In this hair-raising sequel to <i>Category Six: Day of Destruction</i>, mankind''s survival against the elements is pushed to the limits...\n\nAll across the globe, an unprecedented Category 6 storm descends with greater force than could have ever been imagined. The Eiffel Tower is shredded by violent windsthe Great Pyramids reduced to piles of rubble as twisting, black funnels snake across the desert. For years scientists have been expounding theoriesand warningsof global warming trends. Now these warnings are coming true with a frightening ferocity. But though it may have created regions of volatile and extreme weather, global warming isn''t what triggered the terrible tempest. The cause is unknown.\n\nAs various regions of the Earth succumb to the increasingly powerful super storm, beautiful but discredited scientist Faith Clavell (<b>Shannen Doherty</b>, TV''s <i>Charmed</i>) teams up with storm chaser Tommy Tornado (Emmy Award nominee <b>Randy Quaid</b>, <i>Elvis</i>) and head of FEMA Judith Carr (<b>Gina Gershon</b>, <i>Face/Off</i>), to determine the trigger and eliminate itand that means infiltrating the storm itself.\n\nCompounding the chaos, a terrorist organization is threatening to make the situation worse. Now, it''s not only man against nature, but man against man as the newly-intensified Category 7 approachesand possibly, the end of the world.', '', 'USD', '24.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(433, 433, 'United States', 1, 0, 0, '', '096009-443498', 687, 'Owned', 'The Curse of King Tut''s Tomb: The Complete Miniseries', 'Widescreen', 'The Curse of King Tut', 'United States', '2005', '2006-08-08', 170, 'Keep Case', 0, 'USD', '24.99', 'Thousands of years ago, the great Child King Tutankhamen ruled.  Few know the details of his life -- no one knows the secrets of his death.  All that is about to change.\n\nFree-spirited archaeologist Danny Fremont (<b>Casper Van Dien</b>, <i>Sleepy Hollow</i>) is certain that if found, King Tut''s Emerald Tablet would hold the power to control the world.  Unfortunately, the only one who believes Fremont is his nemesis archaeologist Morgan Sinclair (<b>Jonathan Hyde</b>, <i>Titanic</i>), a member of a secret society who wants the tablet to harness unspeakable evil on the world and will stop at nothing to get it.\n\nWith the help of a crackerjack team that includes the doubting Egyptologist Dr. Barakat (<b>Leonor Varela</b>, <i>Cleopatra</i>), Fremont ventures into the Valley of the Kings, toward Tut''s tomb, nearer the portal to another world, and closer to the truth behind a mystery that will change the world forever -- or end it.\n\nDirected by action movie veteran <b>Russell Mulcahy</b> (<i>Highlander</i>) and co-starring Golden Globe nominee <b>Malcolm McDowell</b> (<i>A Clockwork Orange</i>) and <b>Simon Callow</b> (<i>The Phantom of the Opera</i>).', '', 'USD', '24.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(434, 434, 'United States', 1, 0, 0, '', '096009-622091', 684, 'Owned', 'Supernova/Final Days of Planet Earth', 'Double Feature', '', 'United States', '2005', '0000-00-00', 342, 'Keep Case', 0, 'USD', '19.99', '<b>Daryl Hanah</b>, <b>Gil Bellows</b>, and <b>Campbell Scott</b> star in this riveting end-of-days action thriller about Lloyd Walker, an anti-heroic archaeologist who, after stumbling upon an alien conspiracy, becomes enmeshed in an against-all-odds battle to save the human race. From the enigmatic Room 86 to the doomed Pericles space mission, Walker puzzles together clues to reveal the dark purpose behind strange events ocurring around San Francisco. Now, the "keeper of dead civilizations" must rescue mankind from slavery at the hands of some very big, very terrifying insect-aliens... Charged with intense suspense and electrifying special effects, this is one adrenaline-packed thrill ride!', '', 'USD', '19.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(435, 435, 'United States', 1, 0, 0, '', '096009-666392', 683, 'Owned', 'The Black Hole/The Last Sentinal', '', '', 'United States', '2005', '0000-00-00', 184, 'Keep Case', 0, 'USD', '19.99', 'The Black Hole\n\nIt''s 2 A.M. in St. louis when a routine scientific experiment goes horribly wrong, unkeashing a destructive, alien force, and triggering a massive black hole over the city.  Mass chaos reigns as scientist Eric Bryce scambles to find a way to obliterate the aien-and the colossal black hole-before mankind is annihilated.  Starring <b>Judd Nelson, Kristy Swanson</b> and <b>David Selby.\n</b>\nThe Last Sentinel\n\nNo emotion. No fear. No pain. They were the perfect soldiers to protect civilization-until the drone police became the perfect enemy. When a rebel beauty (<b>Katee Sackhoff</b>) is rescued by an electronically enhanced soldier (<b>Don Wilson</b>), she will learn to fight and think like a machine for the final battle to save the human race.', '', 'USD', '19.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(436, 436, 'United States', 1, 0, 0, '', '097360-016437', 548, 'Owned', 'Indiana Jones and the Temple Of Doom', '', '', 'United States', '1984', '2003-10-21', 118, 'Keep Case', 0, 'USD', '19.99', 'Indiana Jones (Harrison Ford) brings his darkest and most chilling adventure to DVD like never before thanks to the wonders of frame-by-frame digital restoration and remastering and immersive 5.1 digital surround sound. Follow the legendary hero from one cliffhanger to another in "Indiana Jones and the Temple of Doom." After barely escaping a raging Shanghai nightclub brawl, Indy crash-lands into the wilds of India where he uncovers a sinister scheme that has enslaved a remote village''s children in a fortress-like mine. Indy must save the children and avoid becoming a slave himself to the evil Thuggee cult. Along for the raucus rescue attempt is Indy''s pint-sized sidekick, Short Round (Ke Huy Quan) as well as a reluctant nightclub songbird, Willie Scott (Kate Capshaw). Join Indy as he outwits bloodthirsty villains and experiences the spectacular twists and turns of a thrilling mine car chase in the ultimate roller-coaster adventure on DVD.', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(437, 437, 'United States', 1, 0, 0, '', '097360-117141', 107, 'Owned', 'Popeye', 'Widescreen Collection', '', 'United States', '1980', '2003-06-24', 114, 'Keep Case', 0, 'USD', '19.99', 'The legendary, beloved anvil-armed sailor of the seven seas comes magically to life in this delightful musical, starring Oscar-winner Robin Williams as Popeye, who meets all challenges with the unshakable philosophy, "I yam what I yam and that''s all that I yam." Shelley Duvall is Popeye''s devoted long-limbed sweetie, Olive Oyl, one of the familiar and loveable characters who joins Popeye in his adventures in the harbor town of Sweethaven. Meet Wimpy and Bluto and all the other cartoon favorites in this happy, tuneful, fun-for-the-whole-family movie!', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(438, 438, 'United States', 1, 0, 0, '', '097360-118025', 342, 'Owned', 'Star Trek II: The Wrath of Khan', '', '', '', '1982', '2000-07-11', 112, 'Keep Case', 0, 'USD', '29.99', 'It is the 23rd century. The Federation starship U.S.S. Enterprise is on routine training maneuvers, and Admiral James T. Kirk (William Shatner) seems resigned to the fact that this inspection may well be the last space mission of his career. But Khan is back. Aided by his exiled band of genetic supermen, Khan (Ricardo Montalban) - brilliant renegade of 20th century Earth - has raided Space Station Regula One, stolen a top secret device called Project Genesis, wrested control of another Federation starship, and now schemes to set a most deadly trap for his old enemy Kirk... with the threat of a universal Armageddon!\nCo-starring Kirstie Alley (Cheers) in her stunning motion picture debut.', '', 'USD', '29.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(439, 439, 'United States', 1, 0, 0, '', '097360-119381', 389, 'Owned', 'Grease 2', '', '', '', '1982', '2003-06-01', 114, 'Keep Case', 0, 'USD', '19.99', '', '', 'USD', '19.99', '2006-10-08', '2016-11-15 00:00:00', NULL),
(440, 440, 'United States', 1, 0, 0, '', '097360-179743', 344, 'Owned', 'Star Trek IV: The Voyage Home', 'Widescreen Collection', '', 'United States', '1986', '1999-11-09', 119, 'Keep Case', 0, 'USD', '29.99', 'William Shatner, Leonard Nimoy and the rest of the U.S.S. ''Enterprise'' crew take to the skies in one of the most acclaimed and intriguing ''Star Trek'' adventures ever.\n\nIt''s the 23rd century and a mysterious alien power is threatening Earth by evaporating the oceans and destroying the atmosphere. In a frantic attempt to save mankind, Kirk and his crew must time travel back to 1986 San Francisco where they find a world of punk, pizza and exact-change buses that are as alien as anything they''ve ever encountered in the far reaches of the galaxy. A thrilling, action-packed mission for the Starship ''Enterprise''!', '', 'USD', '29.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(441, 441, 'United States', 1, 0, 0, '', '097360-189025', 9, 'Owned', 'Ferris Bueller''s Day Off', '', '', '', '1986', '1999-10-19', 102, 'Keep Case', 0, 'USD', '19.99', 'Ferris Bueller. Larger than life. Blessed with a magical sense of serendipity. Hes a model for all those who take themselves too seriously. A guy who knows the value of a day off. \n\nFerris Buellers Day Off chronicles the events in the day of a rather magical young man, Ferris (Matthew Broderick). One spring day, toward the end of his senior year, Ferris gives in to an overwhelming urge to cut school and head for downtown Chicago with his girl (Mia Sara) and his best friend (Alan Ruck), to see the sights, experience a day of freedom and show that with a little ingenuity, a bit of courage and a red Ferrari, life at 17 can be a joy!', '', 'USD', '19.99', '2006-01-11', '2016-11-15 00:00:00', NULL),
(442, 442, 'United States', 1, 0, 0, '', '097360-533743', 467, 'Owned', 'Deep Impact', 'Special Collector''s Edition', '', 'United States', '1998', '2004-10-05', 121, 'Keep Case', 0, 'USD', '19.99', 'What would you do if you knew that in a handful of days an enormous comet would collide with Earth and all humanity could be annihilated? \n\nThe countdown to doomsday is underway in this "gut-wrenching, eye-opening blast of a movie experience" (Jeff Craig, ''Sixty Second Preview''). Mimi Leder (''The Peacemaker'') directs, guiding an all-star cast featuring Robert Duvall, Ta Leoni, Elijah Wood, Vanessa Redgrave, Maximilian Schell and Morgan Freeman. With the film''s dynamic fusion of large-scale excitement and touching, human-scale storylines, ''Deep Impact'' makes its impact felt in a big and unforgettable way.', '', 'USD', '19.99', '2008-01-21', '2016-11-15 00:00:00', NULL),
(443, 443, 'United States', 1, 0, 0, '', '097360-533866', 15, 'Owned', 'Lemony Snicket''s A Series Of Unfortunate Events', '', '', '', '2004', '2005-04-26', 107, 'Keep Case', 0, 'USD', '19.99', 'This comedic saga revolves around the travails of the three Baudelaire orphans, Sunny, Klaus and Violet who find themselves fobbed off on a series of odd people, including the narrator Lemony Snicket. The recurring bad guy is a distant family relative named Count Olaf, who initially takes in the kids but clearly is trying to separate them from a family inheritance.', '', 'USD', '19.99', '2006-01-11', '2016-11-15 00:00:00', NULL),
(444, 444, 'United States', 1, 0, 0, '', '097360-538038', 446, 'Owned', 'Paycheck', 'Special Collector''s Edition', '', '', '2003', '2004-05-18', 118, 'Keep Case', 0, 'USD', '29.99', 'From director John Woo (''M:I-2'' and ''Face/Off'') comes this futuristic thriller that combines spectacular action sequences with a spellbinding mystery that will keep you guessing from beginning to breathtaking end. \n\nMichael Jennings (Ben Affleck) is a brilliant computer engineer hired for top-secret projects. After each job, Jennings'' short-term memory is erased so he cannot recount any project information. Emerging from his latest assignment, a three-year contract with an eight-figure paycheck given to him by his longtime friend (Aaron Eckhart), Jennings is jolted when he is told that during the end of his assignment, he agreed to forfeit all payment. \n\nJennings has no recourse - until he receives a mysterious envelope containing clues to his forgotten past. With the help of a beautiful scientist (Uma Thurman) he once loved but now cannot remember, Jennings races to solve the puzzle of his past... while a terrifying discovery waits in his future.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(445, 445, 'United States', 1, 0, 0, '', '097360-612516', 546, 'Owned', 'Indiana Jones and the Raiders of the Lost Ark', '', '', '', '1981', '2003-10-21', 115, 'Keep Case', 0, 'USD', '19.99', '', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(446, 446, 'United States', 1, 0, 0, '', '097360-625523', 343, 'Owned', 'Star Trek III: The Search For Spock', 'Special Collector''s Edition', '', 'United States', '1984', '2002-10-22', 105, 'Keep Case', 0, 'USD', '29.95', 'Admiral Kirk''s defeat of Khan and the creation of the Genesis planet are empty victories. Spock is dead and McCoy is inexplicably being driven insane. Then a surprise visit from Sarek, Spock''s father, provides a startling revelation: McCoy is harboring Spock''s living essence.\n\nWith one friend alive and one not, but both in pain, Kirk attempts to help his friends by stealing the USS ENTERPRISE and defying Starfleet''s Genesis planet quarantine. But the Klingons have also learned of Genesis and race to meet Kirk in a deadly rendezvous.', '', 'USD', '29.95', '2005-03-05', '2016-11-15 00:00:00', NULL),
(447, 447, 'United States', 1, 0, 0, '', '097360-677225', 345, 'Owned', 'Star Trek V: The Final Frontier', 'Special Collector''s Edition', '', '', '1989', '2003-10-14', 106, 'Keep Case', 0, 'USD', '24.99', 'It''s Stardate 8454.13 and a vacationing Captain Kirk faces two challenges: Climbing Yosemite''s El Capitan and teaching campfire songs to Spock. But vacations are cut short when a renegade Vulcan hijacks the U.S.S. Enterprise, and pilots it on a journey to uncover the universe''s innermost secrets. The Star Trek stars are back for one of their most astonishing voyages ever, with all the fun and excitement fans have come to love. So buckle up for a thrilling leap into the unknown that''s "as much a spiritual odyssey as a space adventure, and it''s all the richer for it" (Kevin Thomas, L.A. Times).', '', 'USD', '24.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(448, 448, 'United States', 1, 0, 0, '', '097360-677348', 346, 'Owned', 'Star Trek VI: The Undiscovered Country', 'Special Collector''s Edition', '', 'United States', '1991', '2004-01-27', 113, 'Keep Case', 0, 'USD', '19.99', 'The ''Enterprise'' leads a battle for peace in a spectacular ''Star Trek'' adventure that''s "impossible to resist" (James Veniere, ''Boston Herald''). The Federation and the Klingon empire prepare for a peace summit after years of war, but the prospect of harmony with sworn enemies is an alarming one to Admiral Kirk (William Shatner). And when a Klingon ship is attacked and the ''Enterprise'' is held accountable, both worlds brace for what may be their final, deadly encounter. Directed by Nicholas Meyer (''Star Trek II: The Wrath of Khan'') and co-starring Christopher Plummer, this action-filled epic soars with warp-speed thrills and excitement! This Special Collector''s Edition includes two scene revisions by Nicholas Meyer.', '', 'USD', '19.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(449, 449, 'United States', 1, 0, 0, '', '097360-822045', 289, 'Owned', 'She''s the Man', 'Full Screen', '', 'United States', '2006', '2006-07-18', 105, 'Keep Case', 0, 'USD', '29.95', 'Amanda Bynes proves that girls can do anything guys can do in She''s The Man. The laughs are non-stop when Viola (Bynes), disguised as her twin brother Sebastian (James Kirk), joins the high school boys'' soccer team and helps win the big game while unexpectedly falling for Duke (Channing Tatum), the hot star forward. Viola discovers that dealing with high school politics and twisted love triangles is a major challenge when you''re a guy who''s really a girl! She''s The Man features an ensemble cast of up-and-coming stars and hit songs. So kick back and get ready to laugh out loud!', '', 'USD', '29.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(450, 450, 'United States', 1, 0, 0, '', '097360-885828', 341, 'Owned', 'Star Trek: The Motion Picture', 'Director''s Cut', '', '', '1979', '2001-11-06', 136, 'Keep Case', 0, 'CAD', '29.99', 'The U.S.S. Enterprise proudly soars again in this new, beautifully restored Director''s Edition of the original Star Trek movie classic.  This new Director''s Cut features enhanced visual effects and a new sound mix, supervised by legendary director Robert Wise.  When an unidentified alien destroys three powerful Klingon cruisers, Captain James T. Kirk (William Shatner) returns to the newly transformed U.S.S. Enterprise to take command.  Leonard Nimoy, DeForest Kelly, and the cast from the acclaimed original Star Trek television series mobilize at warp speed to stop the alien intruder from its relentless flight toward Earth.', '', 'USD', '19.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(451, 451, 'United States', 1, 0, 0, '', '097361-176741', 275, 'Owned', 'Over the Hedge', 'Widescreen', '', '', '2006', '2006-10-17', 85, 'Keep Case', 0, 'USD', '29.99', 'In DreamWorks'' smash-hit comedy, these hungry critters go over the hedge to take a bite out of Suburbia. Plus, check out the All-New Mini-Movie ''HAMMY''s BOOMERANG ADVENTURES...'' It''s the funniest, furriest four minutes you''ll see this year.', '', 'USD', '29.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
(452, 452, 'United States', 1, 0, 0, '', '097361-176864', 83, 'Owned', 'Flushed  Away', '', '', '', '2006', '2007-02-20', 84, 'Keep Case', 0, 'USD', '19.99', 'In one of the year''s best-reviewed films, pampered pet mouse Roddy St.James thinks he''s got it made... until he''s literally flushed away to a bustling underground world of ninja frogs, hench-rats and singing slugs.  "More fun than Cars" (Neil Rosen, NY-1) and "Better than Ice Age 2" (BillBregoli, Westwood ONe), this outrageously inventive comedy-adventure is a flood of fun for both kids and grown-ups', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(453, 453, 'United States', 1, 0, 0, '', '097361-179247', 303, 'Owned', 'Shrek the Third', '', '', 'United States', '2007', '2007-11-13', 93, 'Keep Case', 1, 'USD', '29.99', 'Get ready for Thirds - the greatest fairy tale never told continues with a whole new hilarious comedy of royal proportions. When his frog-in-law suddenly croaks, Shrek embarks on another whirlwind adventure with Donkey and Puss in Boots to find the rightful heir to the throne. Everyone''s favorite cast of characters is back, along with a magical misguided Merlin, an awkward Arthur, a powerful posse of princesses, and a bundle of unexpected arrivals. Only Shrek can tell a tale where everyone lives happily ever laughter!', '', 'USD', '29.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(454, 454, 'United States', 1, 0, 0, '', '097361-181042', 162, 'Owned', 'Failure To Launch', 'Full Screen', '', '', '2006', '2006-06-27', 96, 'Keep Case', 0, 'USD', '27.95', 'Matthew McConaughey is Tripp, a 35 year old who still lives with his parents. And who can blame him? It''s free, he''s got a great room, and mom (Kathy Bates) does the laundry. Desperate to get him out of the house, his parents hire a gorgeous woman, Paula (Sarah Jessica Parker), to give him a little...push. They just didn''t expect Tripp would push back! Zooey Deschanel, Terry Bradshaw, and Alias'' Bradley Cooper co-star in this romantic battle of wills that proves there''s no place like home.', '', 'USD', '27.95', '2006-10-08', '2016-11-15 00:00:00', NULL),
(455, 455, 'Canada', 1, 0, 0, '', '097361-181141', 266, 'Owned', 'The Addams Family and Addams Family Values', '', '', '', '1991', '2006-08-08', 194, 'Keep Case', 0, 'CAD', '15.99', 'Looking for something CREEPY...SPOOKY...KOOKY...and altogether OOKY?\n\nCome join the Addams Family for twice the frights and gags and ghouls galore with the screamingly funny comedies ''The Addams Family'' and ''Addams Family Values''!\n\nGomez (Raul Julia), Morticia (Anjelica Huston), Fester (Christopher Lloyd), Wednesday (Christina Ricci) and the rest of the most totally twisted family in history are serving up a banquest of tempting tricks and treats with two killer comedies that will leave you laughing your head off!', '', 'USD', '19.99', '2007-08-09', '2016-11-15 00:00:00', NULL);
