(456, 456, 'United States', 1, 0, 0, '', '097361-229744', 682, 'Owned', '48 Hrs./ Another 48 Hrs.', 'Double feature', '', 'United States', '1982', '2007-04-24', 191, 'Keep Case', 1, 'USD', '14.98', '48 HRS. (1982)\nJack Cates (Nick Nolte, ''Hotel Rwanda'', ''Cape Fear'') and Reggie Hammond (Eddie Murphy, ''Shrek'', ''Dr. Dolittle'') would never be friends...but they''re about to be partners.  Cates is a hard-nosed cop out to avenge the deaths of two fellow officers.  Hammond is a smart-aleck felon, out to retrieve the stash of cash still hidden from his last job.  In order to bring the killers to justice, Cates has to find their ex-partner - Reggie.  The catch?  Hammond is in the slammer.  Now, Cates must use his pull to get Reggie a 48-hour parole...and make him his temporary partner.\n\nDirector Walter Hill sends Nolte and Murphy on a wild ride, setting the standard for the ultimate buddy-cop thriller.  As the boys race the clock, they discover they have only one thing in common: they''d both kill to find the bad guys...if they don''t kill each other first!\n\nANOTHER 48 HRS. (1990)\nTimes may change...but these guys don''t!  Eddie Murphy (''Shrek'', ''Dr. Dolittle'') and Nick Nolte (''Hotel Rwanda'', ''Cape Fear'') are back on the streets in this smash sequel.  Ex-con Reggie Hammond (Murphy) has just been released from prison, and he''s having his worst day ever...he''s got no money, his beloved Porsche was blown to bits and someone wants him dead.  Hard-nosed cop Jack Cates (Nolte) isn''t having any better luck...he''s accused of manslaughter in a drug bust gone wrong, and may lose his badge.  Fate has pushed these unlikely partners back together...one to fight for his job, and the other for his life.\n\nIt''s another car-chasing, fist-flying, shoot-''em-up 48 hours in the city streets of San Francisco.  And once again, Murphy and Nolte are in rare form as they team up to take the bad guys down!', '', 'USD', '14.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(457, 457, 'United States', 1, 0, 0, '', '097361-310640', 368, 'Owned', 'Blades of Glory', 'Widescreen', '', 'United States', '2007', '2007-08-28', 93, 'Keep Case', 0, 'USD', '29.99', '"Blades of Glory is pure hilarity, a gold medal comedy winner" starring comic superstar Will Ferrell (''Talledega Nights'') and Jon Heder (''Napolean Dynamite''). Bitter figure skating rivals Chazz Michael Michaels (Ferrell) and Jimmy MacElroy (Heder) brawl after tying for the gold medal at the world championships. Banned for life from mens competition, these archrivals beat the system thanks to a loophole that allows them to skate again - in pairs competition! Co-starring Craig T. Nelson, Will Arnett, Amy Poehler and Jenna Fischer.', '', 'USD', '29.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(458, 458, 'United States', 1, 0, 0, '', '097361-385846', 668, 'Owned', 'The Ruins', 'Unrated', '', 'United States', '2008', '2008-07-08', 93, 'Keep Case', 0, 'USD', '29.99', 'When a group of tight-knit college friends visit the site of an undisturbed Mayan ruin, they stumble into an ancient trap. An unspoken evil waiting to drag its victims into an endless nightmare. As fear and paranoia eat away at their sanity, their only chance at escape is to commit the unthinkable. Experience <i>The Ruins</i>, Unrated with shocking new scenes too intense for theaters, and a disturbing climax you will never forget.', '', 'USD', '29.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(459, 459, 'United States', 1, 0, 0, '', '097361-557465', 89, 'Owned', 'Grease', '', '', '', '1978', '2002-09-24', 110, 'Digipak', 0, 'USD', '24.98', '''Grease'' is definitely the word! John Travolta became the world''s box office king with his unforgettable performance as Danny Zuko in this film version of the smash hit Broadway musical about the fabulous ''50s. Olivia Newton-John rocketed to stardom in her American film debut as the adorable and sexy Sandy who''s determined to win Zuko''s heart.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(460, 460, 'United States', 0, 0, 0, 'Digital', '097361-564449', 930, 'Owned', 'Forrest Gump', 'Special Collector''s Edition', '', 'United States', '1994', '2001-08-28', 142, 'Keep Case', 0, 'USD', '29.99', '<b>Forrest Gump</b> is the movie triumph that became a phenomenon. Tom Hanks gives an astonishing performance as Forrest, an everyman whose simple innocence comes to embody a generation. The winner of six Academy Awards, including Best Picture, Best Director (Robert Zemeckis) and Best Actor (Tom Hanks).', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(461, 461, 'United States', 1, 0, 0, '', '097363-200420', 330, 'Owned', 'Ghost', '', '', '', '1990', '2001-04-24', 127, 'Keep Case', 0, 'USD', '14.99', 'Think of the most touching love story you ever saw.  Think, too, of the brightest comedy, the most astonishing supernatural tale and a sleek mystery-thriller.  Did you come up with four separate films?  Or are you among the millions of fans and critics who''ve discovered ''Ghost,'' the #1 film of 1990?  ''Ghost'' will surprise you, delight you, make you believe.  Patrick Swayze plays a ghost who teams with a psychic (Academy-Award winner Whoopi Goldberg) to uncover the truth behind his murder - and to rescue his sweetheart (Demi Moore) from a similar fate.  "The word of mouth is that ''Ghost'' is a ''must-see'' romance," says Entertainment Weekly.  Ditto to that!', '', 'USD', '14.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(462, 462, 'United States', 1, 0, 0, '', '097363-205425', 235, 'Owned', 'Scrooged', '', '', '', '1988', '1999-11-09', 100, 'Keep Case', 0, 'USD', '24.99', 'High-spirited high jinks on Christmas Eve put Frank Cross (Bill Murray) in a ghostly time warp in this hilarious take-off of Charles Dickens A Christmas Carol. Cross, who has made the meteoric rise from the depths of the mailroom to TV network president, is mean, nasty, uncaring, unforgiving and has a sadistic sense of humor - perfect qualities for a modern-day Scrooge.\n\nBefore the night is over, hell be visited by a maniacal New York cab driver from the past, a present-day fairy whos into pratfalls and, finally, a ghoulish, seven-foot headless messenger from the future.', '', 'USD', '24.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(463, 463, 'United States', 1, 0, 0, '', '097363-238478', 30, 'Owned', 'Runaway Bride', '', '', '', '1999', '2000-01-25', 116, 'Keep Case', 0, 'USD', '29.99', '"Roberts and Gere confirm their status as an eternal screen team" (Mike Cidoni, ABC-TV) in this delightful laugh-filled romantic comedy. Roberts plays small-town girl Maggie Carpenter, whose marches down the aisle become a series of near Mrs. when she bolts before saying "I do." Gere is Ike Graham, a cynical, big-city newspaper columnist eager to write a tell-all story about Maggie. But the more Ike finds out about skittish Maggie, the more he finds he''s falling in love.', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(464, 464, 'United States', 1, 0, 0, '', '097363-261278', 104, 'Owned', 'The First Wives Club', 'Widescreen Collection', '', 'United States', '1996', '1998-12-01', 102, 'Keep Case', 0, 'USD', '29.99', 'Join the club -- ''The First Wives Club'', the good-time battle-of-the-sexes satire sparked by snappy one-liners, great physical-comedy gags and three unforgettable stars in top form. Bette Midler, Goldie Hawn and Diane Keaton portray mid-life Manhattanites who have more than a longtime friendship in common.\n\nAfter years of helping their hubbies climb the ladder of success, each has been dumped for a newer, curvier model. But the trio is determined to turn their pain into gain. They come up with a cleverly devious plan to hit their exes where it really hurts -- in the wallet! Sit back and watch the sparks fly as The Wives get mad, get even and get it all. Justice has seldom been so sweet. Or so much fun.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(465, 465, 'United States', 1, 0, 0, '', '097363-287445', 505, 'Owned', 'Coneheads', '', '', '', '1993', '2001-04-17', 86, 'Keep Case', 0, 'USD', '29.99', 'One look and you know they''re from a very strange place. They''re from New Jersey, by way of "France," by way of far-off, far-out Remulak. They''re Coneheads. And their comedy antics are heads above the crowd!\n\nLampooning our Bluntheaded civilization as only Coneheads can, Dan Aykroyd and Jane Curtin star as mega-domed Beldar and Prymaat. Newcomer Michelle Burke plays the teen daughter at odds with her parental units. Michael McKean (as an INS agent who-mebs!-wants to deport illegal alien Beldar) and many more comedy favorites add to the fun of this all-out laugh attack-from Remulak!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(466, 466, 'United States', 1, 0, 0, '', '097363-290346', 295, 'Owned', 'The General''s Daughter', '', '', '', '1999', '1999-12-14', 116, 'Keep Case', 0, 'USD', '29.99', 'There''s the right way, the wrong way, and the Army way.  But there''s no way military investigator Paul Brenner (John Travolta) is going to participate in a cover-up when Fort MacCallum officials try to hide the motive behind the murder of a beautiful female officer.\n\nTravolta''s magnetic performance sparks this riveting thriller from the director of Con Air and the producer of The Hunt For Red October. \n\nMadeline Stowe plays Brenner''s co-investigator and former flame.  And James Cromwell, Timothy Hutton, Clarence Williams III and James Woods are among the suspects in this "steamy game of cat and mouse that will keep you guessing until the surprising, explosive ending." - Sandie Newton, CBS-TV', '', 'USD', '29.99', '2005-04-18', '2016-11-15 00:00:00', NULL),
(467, 467, 'United States', 1, 0, 0, '', '097363-298878', 390, 'Owned', 'Star Trek: Generations', 'Widescreen Collection', '', 'United States', '1994', '1998-11-17', 118, 'Keep Case', 0, 'USD', '29.99', 'Stardate: the 23rd Century. Retired Starfleet officers James T. Kirk (William Shatner), Montgomery Scott (James Doohan) and Pavel Checkov (Walter Koenig) are guests of honor aboard the newly christened ''Enterprise''-B. A test run takes an unexpected turn, however when the starship encounters two vessels trapped inside the Nexus, a mysterious energy ribbon. During a perilous rescue attempt, Kirk is swept out into space.\n\nSeven decades later, Captain Jean-Luc Picard (Patrick Stewart) and the crew of ''Enterprise''-D rescue an El Aurian physicist named Soran (Malcolm McDowell). Unbeknownst to Picard, Soran harbors a deadly plan that includes the destruction of the ''Enterprise'' and millions of lives. Now Picard''s only hope for a future rests within the Nexus...and a legendary captain from the past.\n\nJonathan Frakes, Brent Spinder, LeVar Burton, Michael Dorn, Marina Sirtis and Gates McFadden costar in this "cosmic hit that all generations will love." (Pat Collins, ''WWOR-TV'')', '', 'USD', '29.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(468, 468, 'United States', 1, 0, 0, '', '097363-321743', 464, 'Owned', 'Rules of Engagement', 'Widescreen Collection', '', 'United States', '2000', '2000-10-10', 127, 'Keep Case', 0, 'USD', '29.99', 'Tommy Lee Jones and Samuel L. Jackson deliver electrifying performances in this "tense, superbly-directed and top drawer drama"* about what happens when the rules that command a soldier become the rules that condemn him.\n\nColonel Terry Childers (Jackson) is a patriot and war hero.  But when a peacekeeping mission he leads in Yemen goes terribly wrong, he finds himself facing a court martial.  Accused of breaking the rules of engagement by killing unarmed civilians, Childers'' only hope of vindication rests with comrade-in-arms Hays Hodges (Tommy Lee Jones), a military lawyer of questionable abilities.  Together, they face the battle of their lives.\n\nDirected by Oscar -winning director William Friedkin and co-starring Guy Pearce, Bruce Greenwood, Ann Archer and Academy Award -winner Ben Kingsley, Rules of Engagement is "a magnificent movie you must see"**\n\n*Jeffrey Lyons, NBC-TV\n**Larry King, USA Today', '', 'USD', '29.99', '2008-01-21', '2016-11-15 00:00:00', NULL),
(469, 469, 'United States', 1, 0, 0, '', '097363-331544', 472, 'Owned', 'Double Jeopardy', 'Widescreen Collection', '', 'Germany', '1999', '2000-02-22', 105, 'Keep Case', 0, 'USD', '29.99', 'The chase is on! Ashley Judd shines in this unstoppable, untoppable box-office smash that co-stars Tommy Lee Jones in his "best performance since ''The Fugitive''."\n\nJudd plays Libby Parsons, who discovers that the husband she''s convicted of murdering staged his own "death" and framed her for the crime. Released on parole, she skips town to find him - and that puts parole officer Travis Lehman (Jones) on her trail. Packed with more crowd-pleasing excitement than several movies put together, ''Double Jeopardy'' delivers "lots of action and spine-tingling suspense from start to finish."', '', 'USD', '29.99', '2008-01-21', '2016-11-15 00:00:00', NULL),
(470, 470, 'United States', 0, 0, 0, 'Digital', '097363-346746', 912, 'Owned', 'The Core', 'Widescreen Collection', '', 'United States', '2003', '2003-09-09', 135, 'Keep Case', 0, 'USD', '29.99', 'Academy Award winner* Hilary Swank (<i>Boys Don''t Cry</i>) leads an all-star cast in this electrifying journey that puts you in the middle of the most spectacular film adventure.\n\nGeophysicist Dr. Josh Keyes (Aaron Eckhart, <i>Erin Brockovich</i>) has made a terrifying discovery: the Earth''s inner core has stopped rotating. Now the planet''s electromagnetic field is deteriorating and within months, Earth will be destroyed.\n\nOne hope exists: to send Keyes and an elite team of scientists in a subterranean vessel to the center of the Earth. As mankind''s fate hangs in the balance, the scientists and the ship''s crew must do the unthinkable  detonate a nuclear device to reactivate the Earth''s core.\n\nCo-starring Delroy Lindo (<i>Ransom</i>), Emmy Award winner** Stanley Tucci and Academy Award nominee*** Alfre Woodard.\n\n*1999 Best Actress, <i>Boys Don''t Cry</i>\n**1998 Outstanding Lead Actor in a Mini Series or Movie, <i>Winchell</i>\n***1983 Best Supporting Actress, <i>Cross Creek', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(471, 471, 'United States', 1, 0, 0, '', '097363-358879', 392, 'Owned', 'Star Trek: Insurrection', 'Widescreen Collection', '', 'United States', '1998', '1999-05-11', 103, 'Keep Case', 0, 'USD', '29.99', 'Engage! Captain Jean-Luc Picard (Patrick Stewart) and his Next Generation crew are back and so is the excitement and fun in this "polished film that shines like a crown jewel in the ''Star Trek'' firmament" (George Powell, ''San Francisco Examiner'').\n\nFrom the beginning of the Federation, the Prime Directive was clear: no Starfleet expedition may interfere with the natural development of other civilizations. But now Picard is confronted with orders that undermine that decree. If he obeys, 600 peaceful residents of Baku will be forcibly removed from their remarkable world, all for the reportedly greater good of millions who will benefit from Bakus Fountain of Youth-like powers. If he disobeys, he will risk his Starship, his career, his life. But for Picard, theres really only one choice. He must rebel against Starfleet ... and lead the insurrection to preserve Paradise.', '', 'USD', '29.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(472, 472, 'United States', 1, 0, 0, '', '097363-367543', 465, 'Owned', 'Lara Croft: Tomb Raider', 'Special Collector''s Edition', '', 'United States', '2001', '2001-11-13', 100, 'Keep Case', 0, 'USD', '29.99', '''LARA CROFT'', the world''s most famous video-game heroine, bursts onto the big screen in "...the most stylish and entertaining action-adventure movie in years!"*\n\nExploring lost empires, finding priceless treasures, punishing villains in mortal combat... it''s all in a day''s work for adventurer Lara Croft (''Angelina Jolie''). But a secret from her father''s (''Jon Voight'') past is about to lead Lara to her greatest challenge: the Triangle of Light, a legendary artifact with the power to alter space and time. Lara must find the Triangle before it falls into the clutches of the Illuminati, a secret society bent on world domination. To stop the Illuminati, Lara will have to survive a cross-continental chase filled with unimaginable danger. But for the Tomb Raider, danger is the name of the game.\n\nWith eye-popping action and electrifying thrills, ''TOMB RAIDER'' "will have you screaming, laughing and cheering from beginning to end!"**\n\n* Shawn Edwards, FOX-TV\n** Earl Dittman, Wireless Magazines', '', 'USD', '29.99', '2008-01-21', '2016-11-15 00:00:00', NULL),
(473, 473, 'United States', 1, 0, 0, '', '097363-369622', 88, 'Owned', 'How to Lose a Guy in 10 Days', 'Widescreen', '', 'United States', '2003', '2003-07-01', 115, 'Keep Case', 0, 'USD', '29.95', 'Andie needs to prove she can dump a guy in 10 days. Ben needs to prove he can win a girl in 10 days. Now, the clock is ticking - and the year''s most wildly entertaining comedy smash is off and running in this irresistible tale of sex, lies and outrageous romantic fireworks!', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(474, 474, 'United States', 1, 0, 0, '', '097363-372226', 561, 'Owned', 'The Sum of All Fears', 'Collector''s Edition', '', '', '2002', '2002-10-29', 123, 'Keep Case', 0, 'USD', '29.99', 'When the president of Russia suddenly dies and is succeeded by a man about whom little is known, tension increases as old fears ignite new paranoia. Director of Central Intelligence Bill Cabot (Morgan Freeman) recruits a young analyst from the Russia desk, Jack Ryan (Ben Affleck), to supply insight and advice. Then the unthinkable happens: the capital of Chechnya is leveled by a nuclear bomb. America is quick to blame the Russians and mistrust escalates despite Ryan''s certainty that other players are at work. He is right. A gourp of terrorists is trying to provoke a war between the two nations by manufacturing and escalating the conflict. When they successfully detonate a second bomb outside Baltimore during the Super Bowl, the world is pushed inexorably towards war... unless Ryan can supply the needed proof to stem the tide of disaster in time', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(475, 475, 'United States', 1, 0, 0, '', '097363-380146', 653, 'Owned', 'The Stepford Wives', 'Widescreen Special Collector''s Edition', '', 'United States', '2004', '2004-11-09', 93, 'Keep Case', 0, 'USD', '29.98', 'Oscar winner Nicole Kidman heads an all-star cast in this dark comedy thriller. After moving with her husband (Matthew Broderick) and children to the well-manicured community of Stepford, Connecticut, former New York television executive Joanna Eberhard (Kidman) is beginning to realize that Stepford is more than just the "perfect" place to live... it''s a little too perfect.', '', 'USD', '29.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(476, 476, 'United States', 1, 0, 0, '', '097363-383826', 85, 'Owned', 'What Women Want', '', '', '', '2000', '2001-05-08', 126, 'Keep Case', 0, 'USD', '29.99', 'Mel Gibson and Helen Hunt light up the screen in this winning romantic comedy about a man who thinks he''s Gods gift to women -- until he hears what they''re really thinking.\n	Gibson plays Nick Marshall, a swinging bachelor scaling the corporate ladder of one of Chicago''s hottest ad agencies.  But Nick''s fast-track success is derailed when the agency overlooks him and hires beautiful Darcy McGuire (Helen Hunt) as the new creative director.  As Nick''s prospects begin to dim, he is jolted by a freak accident that leaves him with an extraordinary ability: he can hear what women think -- and want!\n	Using his newfound gift to his advantage, Nick schemes to undermine Darcy by listening to her thoughts and stealing her ideas until something happens that he didn''t account for -- he hears his own inner voice. . .and realizes he''s in love.  Co-starring marisa Tomei, What Women Want is "a laugh-out-loud celebration of the sexes." (Mark S. Allen, UPN-TV)', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(477, 477, 'United States', 1, 0, 0, '', '097363-389965', 393, 'Owned', 'Star Trek: Nemesis', '', '', '', '2002', '2003-05-20', 116, 'Keep Case', 0, 'USD', '24.99', 'Set a course for a galaxy of unparalled action and adventure as Captain Jean-Luc Picard (Patrick Stewart) and his Starship crew battle a chilling new adversary... that just happens to hold a shocking link to Picard!\nIn the wake of a joyful weddng between Riker (Jonathan Frakes) and Troi (Marina Sirtis)Picard receives another reason to celebrate : the Romulans want peace and the Captain will be the Federation''s Emissary . But as the Enterprise heads toward the Romulan Empire,a brilliant villain awaits-harboring a diabolical plan of destruction and an unimaginable secret that will give Picard his most fearsome challenge.  Costarring Brent Spiner,LeVar Burton,Michael Dorn,Gates McFadden and introducing Tom Hardy as Picard''s deadly foe\n\n Star Trek Nemesis is "Exciting! inventive Twist-plus the unexpected shoot sparks of surprise throughout the picture"  Gene Shalit,Today', '', 'USD', '24.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(478, 478, 'United States', 1, 0, 0, '', '097363-400264', 615, 'Owned', 'We Were Soldiers', '', '', 'United States', '2002', '2002-08-20', 138, 'Keep Case', 0, 'USD', '29.99', 'Mel Gibson stars in this powerful story of real-life heroes who fought in Vietnam for country, love and freedom.\nMel Gibson and Randall Wallace, the star and writer of Braveheart, reunite for this action packed war with North Vietman. LT. Col. Hal Moore [Gibson] is a born leader committed to his troops. As he prepares for one of the most violent battles in U.S. history, he delivers a promise to his soldiers and their families : I will leave no man behind.... We will all come home together...\nA true story of commitment, courage and sacrifice, also starring Madeleine Stowe, Greg Kinnear, Sam Elliott, Chris Klein, Keri Russell and Barry Pepper,  WE WERE SOLDIERS is a must-see film for our time and all time........', '', 'USD', '29.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(479, 479, 'United States', 1, 0, 0, '', '097363-402145', 646, 'Owned', 'K-19: The Widowmaker', 'Widescreen Collection', '', 'United States', '2002', '2002-12-10', 138, 'Keep Case', 0, 'USD', '29.99', 'Harrison Ford delivers one of his most powerful performances in this riveting action-drama inspired by a true story.\n\nAt the height of the 1960s Cold War, Russia launches its flagship nuclear submarine, the K-19. In command is iron-willed Captain Alexei Vostrikov (Ford). Also aboard is the popular executive officer Mikhail Polenin (Liam Neeson), who clashes with Vostrikov but shares his unwavering patriotism. As the K-19 heads toward American waters, a shocking discovery is made: the vessel''s nuclear reactor system is leaking, imperiling the men and the sub''s missiles. With time running out, the fearless Vostrikov and his crew join together as brave countrymen who must decide the true meaning of duty, honor and sacrifice.', '', 'USD', '29.99', '2008-08-30', '2016-11-15 00:00:00', NULL),
(480, 480, 'United States', 0, 0, 0, 'Digital', '097363-418641', 925, 'Owned', 'Indiana Jones and the Kingdom of the Crystal Skull', '', '', 'United States', '2008', '2008-10-14', 122, 'Keep Case', 1, 'USD', '29.99', 'STEVEN SPIELBERG and GEORGE LUCAS bring you the greatest adventurer of all time in "a nonstop thrill ride" (Richard Corliss, <i>TIME</i>) that''s packed with "sensational, awe-inspiring spectacles" (Roger Ebert, <i>CHICAGO SUN-TIMES</i>). <i>Indiana Jones and the Kingdom of the Crystal Skull</i> finds Indy (Harrison Ford) trying to outrace a brilliant and beautiful agent (Cate Blanchett) for the mystical, all-powerful crystal skull of Akator. Teaming up with a rebellious young biker (Shia LaBeouf) and his spirited original love Marion (Karen Allen), Indy takes you on an action-packed adventure in the exciting tradition of the classic <i>Indiana Jones</i> movies!', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(481, 481, 'United States', 1, 0, 0, '', '097363-423041', 163, 'Owned', 'Yours, Mine & Ours', '', '', 'United States', '2005', '2006-02-28', 88, 'Keep Case', 0, 'USD', '29.95', 'Dennis Quaid and Rene Russo are a perfect match in this irresistible comedy about two single parents who get married...only to meet some unexpected homewreckers - their own kids!\n\nAdmiral Frank Beardsley (Quaid), a widower with eight children, runs his family like a tight ship. Frank''s orderly life changes course when he impulsively marries his long-lost high school sweetheart, Helen (Russo), a free-spirited fashion designer with ten kids of her own.\n\nFor Frank and Helen''s wildly different families, it''s fight at first sight. So the kids hatch a plan - sabotage the marriage! What follows is a no-schemes-barred, domestic free-for-all that rocks the house with hilarious moments...and some heartwarming surprises.', '', 'USD', '29.95', '2006-10-08', '2016-11-15 00:00:00', NULL),
(482, 482, 'United States', 1, 0, 0, '', '097363-423843', 112, 'Owned', 'The Prince & Me', 'Special Edition', '', '', '2004', '2004-08-10', 110, 'Keep Case', 0, 'USD', '29.95', 'Paige (Julia Stiles) has her future all mapped out.  A fastidious pre-med student at the University of Wisconsin, she''s vowed nothing will deter her from becoming a doctor.  Until she meets Edvard (Luke Mably), the dashing playboy Crown Prince of Denmark who''s trying to escape a life he never chose.  He''s enrolled incognito at Paige''s school to "find himself" and to take a detour from his destiny as king.\n\nPaige and "Eddie" end up as lab partners and discover there''s more chemistry between them than just the classroom variety.  Will he step away from his place in the Danish monarchy to be with her?  Will she lose sight of her dream to become a doctor?\n\nJulia Stiles ("Mona Lisa Smile") and Luke Mably ("28 Days Later") are an awesome screen team in this sparkling romantic comedy that "is a royal gem of a movie!"', '', 'USD', '29.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(483, 483, 'United States', 1, 0, 0, '', '097363-440628', 626, 'Owned', 'Drillbit Taylor', 'Extended Survival Edition', '', 'United States', '2008', '2008-07-01', 101, 'Keep Case', 0, 'USD', '29.99', 'Owen Wilson gives a hilariously funny performance as a beach bum soldier of fortune who is hired by three high schoolers being tormented by the resident school bullies. It''s nerds get revenge in a big way with sidesplitting deleted scenes not shown in theaters and outrageous outtakes you''ll want to watch over and over. You wont be able to stop laughing as Drillbit (Wilson) trains these kids so they can ultimately turn the tables and exact their revenge!', '', 'USD', '29.99', '2008-08-30', '2016-11-15 00:00:00', NULL),
(484, 484, 'United States', 1, 0, 0, '', '097363-455349', 607, 'Owned', 'Transformers', '', '', 'United States', '2007', '2007-10-16', 143, 'Keep Case', 1, 'USD', '29.99', 'From director Michael Bay and executive producer Steven Spielberg comes a thrilling battle between the heroic Autobots and the evil Decepticons. When their epic struggle comes to Earth, all that stands between the Decepticons and ultimate power is a clue held by young Sam Witwicky (Shia LaBeouf). Unaware that he is mankinds last chance for survival, Sam and Bumblebee, his robot disguised as a car, are in a heart-pounding race against an enemy unlike anything anyone has seen before. Its the incredible, breath-taking film spectacular that USA Today says "will appeal to the kid in all of us."', '', 'USD', '29.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(485, 485, 'United States', 0, 0, 0, 'Digital', '097363-492641', 919, 'Owned', 'Eagle Eye', '', '', 'United States', '2008', '2008-12-28', 117, 'Keep Case', 0, 'USD', '29.99', 'Executive Producer Steven Spielberg delivers the ultimate race-against-time thriller that will keep you on the edge of your seat! Shia LaBeouf <i>(Transformers</i>) and Michelle Monaghan (<i>Mission: Impossible 3</i>) star as strangers ripped from their ordinary lives when they are "activated" as part or a high-tech assassination plot. Through blistering chases and shocking twists they try to escape  <b><i>but where do you go when the enemy is everywhere?', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(486, 486, 'United States', 0, 0, 0, 'Digital', '097363-493662', 949, 'Owned', 'Ghost Town', '', '', 'United States', '2008', '2008-12-28', 102, 'Keep Case', 0, 'USD', '29.99', 'A spirited romantic comedy, <i>Ghost Town</i> is the story of Bertram Pincus (Ricky Gervais), a cranky Manhattan dentist who develops the unwelcome ability to see dead people. Really annoying dead people. But, when a smooth-talking ghost (Greg Kinnear) traps Bertram into a romantic scheme involving his widow Gwen (Ta Leoni), they become entangled in a hilarious predicament between the now and the hereafter!', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(487, 487, 'United States', 0, 0, 0, 'Digital', '097363-501541', 1034, 'Owned', 'Tropic Thunder', '', '', 'United States', '2008', '2008-11-18', 107, 'Keep Case', 0, 'USD', '29.99', 'Ben Stiller, Jack Black and Robert Downey Jr. lead an all-star cast in the outrageous comedy <i>Tropic Thunder</i>. When three of Hollywood''s biggest stars head into the jungles of Vietnam to shoot a war movie, they have no idea how real things can get.\n\nUnexpected and controversial, <i>Tropic Thunder</i> is "A knockout of a comedy that keeps you laughing."  Peter Travers, <i>Rolling Stone', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(488, 488, 'United States', 0, 0, 0, 'Digital', '097363-506560', 926, 'Owned', 'Iron Man', '', '', 'United States', '2008', '2008-09-30', 125, 'Keep Case', 0, 'CAD', '36.99', 'Suit up for action with ROBERT DOWNEY JR. in the ultimate adventure movie you''ve been waiting for, ''Iron Man''!  When jet-setting genius-industrialist Tony Stark is captured in enemy territory, he builds a high-tech suit of armor to escape.  Now, he''s on a mission to save the world as a hero who''s built, not born, to be unlike any other.  Co-starring TERRANCE HOWARD, JEFF BRIDGES and GWYNETH PALTROW, it''s a fantastic, high-flying journey that is "hugely entertaining" (Joe Morgenstern, ''The Wall Street Journal'').', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(489, 489, 'United States', 0, 0, 0, 'Digital', '097363-507048', 996, 'Owned', 'The Love Guru', '', '', 'United States', '2008', '2008-09-16', 87, 'Keep Case', 0, 'USD', '29.99', 'Mike Myers plays the hilarious character The Guru Pitka!\n\nAs The Guru Pitka vies for the title of the world''s best self-help guru, Pitka must help a star hockey player win his wife back from rival athlete Jacques "Le Coq" Grande (Justin Timberlake) and, along with it, the Stanley Cup. Will Pitka''s comic Karmic intervention be enough to turn this losing team into champions?\n\nAlso starring Jessica Alba and Vern Troyer, The Love Guru is "one big laugh from beginning to end!" (Jim Ferguson, KGUN 9 ABC)', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(490, 490, 'United States', 1, 0, 0, '', '097363-516644', 647, 'Owned', 'Next', '', '', 'United States', '2007', '2007-09-25', 96, 'Keep Case', 0, 'USD', '29.99', 'Academy Award winner Nicolas Cage*, Julianne Moore and Jessica Biel join forces to bring you the heart-pounding thriller that is ''Next''. Chris Johnson (Cage) earns his living in a seedy Las Vegas magic act, but his ability to see a few minutes into the future is authentic. Government agent Callie Ferris (Oscar nominee Moore**) knows this, and relentlessly recruits him to help thwart a terrorist group from detonating a nuclear bomb in the heart of Los Angeles. Will the reluctant hero join the desperate race against the clock by daring to see what is ''Next''? Featuring non-stop action, explosive special effects and adrenaline-charged Special Features, this is an exciting adventure you won''t want to miss!\n\n*Best Actor, ''Leaving Las Vegas'', 1995.\n**Best Supporting Actress, ''The Hours'', 1992.', '', 'USD', '29.99', '2008-08-30', '2016-11-15 00:00:00', NULL),
(491, 491, 'United States', 1, 0, 0, '', '097363-520641', 649, 'Owned', 'Cloverfield', '', '', 'United States', '2008', '2008-04-22', 85, 'Keep Case', 0, 'USD', '27.95', 'From visionary producer J.J. Abrams ''(Lost)'' and director Matt Reeves comes the worldwide sensation of nonstop terror and suspense everyone is talking about.', '', 'USD', '27.95', '2008-08-30', '2016-11-15 00:00:00', NULL),
(492, 492, 'United States', 1, 0, 0, '', '097363-532149', 705, 'Owned', 'Transformers: Revenge of the Fallen', '', '', 'United States', '2009', '2009-10-20', 142, 'Keep Case', 1, 'USD', '29.99', 'The battle for Earth continues in this action-packed blockbuster from director Michael Bay and executive producer Steven Spielberg. When college-bound Sam Witwicky (Shia LaBeouf) learns the truth about the ancient origins of the Transformers, he must accept his destiny and join Optimus Prime and Bumblebee in their epic battle against the Decepticons, who have returned stronger than ever with a plan to destroy our world.', '', 'USD', '29.99', '2009-10-25', '2016-11-15 00:00:00', NULL),
(493, 493, 'United States', 1, 0, 0, '', '12304-12540', 391, 'Owned', 'Star Trek: First Contact', '', '', '', '1996', '2005-03-15', 111, 'Keep Case', 0, 'USD', '19.99', 'Captain Jean-Luc Picard (Patrick Stewart) and the Next Generation crew engage in their most thrilling adventure yet - a sci-fi action event that "stands proud and apart" (Richard Corliss, Time).\n\nThey call themselves the Borg - a half-organic, half-machine collective with a sole purpose: to conquer and assimilate all races. Led by their seductive and sadistic queen (Alice Krige), the Borg are headed to Earth with a devious plan to alter history. Picard''s last encounter with the Borg almost killed him. Now, he wants venegance. But how far will he go to get it? Costarring Alfre Woodard and James Cromwell and bursting with spectacular special effects, Star Trek: First Contact is one action film that "has it all! (Jim Ferguson, Prevue Channel).', '', 'USD', '19.99', '2005-03-05', '2016-11-15 00:00:00', NULL),
(494, 494, 'United States', 1, 0, 0, '', '16524-79632', 331, 'Owned', 'When Harry Met Sally', 'Special Edition', '', '', '1989', '2001-01-01', 96, 'Keep Case', 0, 'USD', '24.98', 'Nora Ephron wrote the brisk screenplay for this 1989 romantic comedy, director Rob Reiner made a nicely glossy New York story (very much in a Woody Allen vein) out of it, and Billy Crystal''s unstoppable charm made it something really special. Crystal and Meg Ryan play longtime platonic friends who keep dancing around their deeper feelings for one another, and Bruno Kirby and Carrie Fisher are their respective pals who fall in love and get married. Ryan doesn''t get a lot of funny material, but her performance is typically alive and intuitive, and she more than holds her own with Crystal''s comic motor mouth and sweet sentimentality. Reiner is on comfortable ground, liberated from the burden of making serious statements in the lead-footed manner of subsequent features.', '', 'USD', '24.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(495, 495, 'United States', 1, 0, 0, '', '33960-31708', 181, 'Owned', 'Man of the House', '', '', '', '2005', '2005-07-19', 97, 'Keep Case', 0, 'USD', '29.98', 'Texas Ranger Roland Sharp (Tommy Lee Jones) is assigned to protect the only witnesses to the murder of a key figure in the prosecution of a drug kingpin -- a group of University of Texas cheerleaders. Sharp must now go undercover as an assistant cheerleading coach and move in with the young women!', '', 'USD', '29.98', '2006-10-08', '2016-11-15 00:00:00', NULL),
(496, 496, 'United States', 1, 0, 0, '', '44454-54888', 547, 'Owned', 'Indiana Jones And The Last Crusade', '', '', '', '1989', '2003-10-20', 126, 'Keep Case', 0, 'USD', '19.99', 'If you think keeping up with one Jones is exciting, try keeping up with two of them!\nHarrison Ford dons his rumpled fedora for the third time as Indiane Jones, and Sean Connery joins the thrill-a-minute fun as Indy''s fiesty dad. Filmmakers Steven Spielberg and George Lucas make sure this father-son duo never lack for adventure. The Joneses set out to find the mystically-empowered Holy Grail - and encounter so many spectacular pursuits and narrow escapes that Indiana Jones and the Last Crusade is more than the culmination of Indy''s exploits. It''s "the greatest adventure in film history" (Jack Garner, Gannett New Service)', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(497, 497, 'United States', 1, 0, 0, '', '45431-16080', 187, 'Owned', 'Cheaper By The Dozen', '', '', '', '2003', '2004-04-06', 106, 'Keep Case', 0, 'USD', '14.99', 'Comedy superstar Steve Martin (Bringing Down The House) and TV/film favorite Bonnie Hunt (Jerry Maguire) "couldn''t be more likeable" (Leonard Maltin, Hot Ticket) in this hilarious tale of two loving parents trying to manage careers and a household - amid the chaos of raising twelve rambunctious kids. Withia crowd-pleasing supporting cast, including rising young stars Hilary Duff, Tom Welling and Piper Perabo, this heartwarming hit comedy delivers super-sized fun and laughs byithe dozen!', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(498, 498, 'United States', 1, 0, 0, '', '602341-002899', 366, 'Owned', 'Facing the Giants', 'Collector''s Edition', '', 'United States', '2006', '2007-01-30', 112, 'Keep Case', 0, 'USD', '19.98', 'After six consecutive losing seasons, high school football coach Grant Taylor believes things can''t get any worse.  He''s wrong.  With fear and failure defeating him in football and in life, the downtrodden coach and husband turns to God in desperation.  Trusting that God can somehow do the impossible, Coach Taylor and his Shiloh Christian Eagles soon discover how faith plays out on the field...and off!', '', 'USD', '19.98', '2008-01-16', '2016-11-15 00:00:00', NULL),
(499, 499, 'United States', 1, 0, 0, '', '63286-20092', 510, 'Owned', 'Matrix', 'Limited Edition', '', '', '1999', '1999-11-23', 136, 'Drawer', 0, 'USD', '19.99', 'Reeves is "Neo," a computer hacker who wastes his days at a soul-sucking corporate job so that he may spend nights in his dingy apartment hacking into all sorts of information he shouldn''t be privy to. Without warning, he is drawn into a complex plot by a band of futuristic freedom fighters, led by the philosophical Morpheus (Fishburne), who informs Neo that he may be "The One" who can put an end to the Matrix- a scheme which has pulled the wool over the eyes of the human race. You see, life in 1999 is actually a false front put up by higher, octopus-like beings to cover up the fact that it''s actually hundreds of years in the future and humankind has been enslaved for their evil purposes. But that''s just a surface explanation for this mind-bending, complex yarn from the Wachowski Brothers (BOUND), which combines STAR WARS-like myth making, Hong Kong style kick-n-shoot action, and the latest digital effects to create the left-field hit of 1999.', '', 'USD', '19.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(500, 500, 'United States', 1, 0, 0, '', '667068-000207', 86, 'Owned', 'Charlie''s Angels', 'Collector''s Edition', '', '', '2000', '0000-00-00', 98, 'Keep Case', 0, 'USD', '19.99', 'Based on the popular 70''s TV show, three cute chicks work for the mysterious "Charlie". They are the female ''James Bonds'''' of our time. They get to blow stuff up, kick the cr*p out of people, and wear really tight clothing, all whilst trying to retrieve stolen software and balance in high heels\n\nCharlie''s private investigation company is addressed by programmer Eric Knox, owner of Knox Technologies, whose revolutionary voice-recognition software has been stolen. Charlie''s Angels Natalie, Dylan and Alex are sent to place a bug in the system of bitter rival Roger Corwin, who is under strong suspicion. But after the deed is done, the Angels and their boss Bosley face the fact of a destroyed home base as well as Charlie''s life in immediate danger. But how do you protect someone you never met?', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(501, 501, 'United States', 1, 0, 0, '', '667068-466423', 435, 'Owned', 'Saving Private Ryan', 'DTS Special Limited Edition', '', 'United States', '1998', '1999-11-02', 169, 'Keep Case', 0, 'USD', '34.99', 'Internationally acclaimed by critics and audiences alike, Steven Spielbergs ''Saving Private Ryan'' is an unforgettable film achievement that has had profound and lasting impact throughout the world. Winner of five Academy Awards including Best Director, the film also captured Oscars for Cinematography, Film Editing, Sound and Sound Effects Editing. More than 70 critics (including those at Time magazine, USA Today, The New York Times and Entertainment Weekly) and critics groups in New York, Chicago, Dallas-Ft. Worth and Great Britain named the film Best Picture of the Year, while the Los Angeles, Toronto and Broadcast Film Critics honored it with both Best Picture and Best Director awards. In addition, Spielberg received his third Directors Guild of America Award, the American Legion The Spirit of Normandy Award, a USO Merit Award from the USO of Metropolitan Washington, as well as the highest civilian public service award from the Department of the Army. Selected for more than 160 Top Ten lists, Saving Private Ryans other honors include Golden Globes for Best Picture (Drama) and Best Director, the Producers Guild of America Award and ten nominations from the British Academy Film Awards. ''Saving Private Ryan'' was the top-grossing motion picture of 1998.\n\nSeen through the eyes of a squad of American soldiers, the story begins with World War IIs historic D-Day invasion, then moves beyond the beach as the men embark on a dangerous special mission. Captain John Miller (Tom Hanks) must take his men behind enemy lines to find Private James Ryan, whose three brothers have been killed in combat. Faced with impossible odds, the men question their orders. Why are eight men risking their lives to save just one? Surrounded by the brutal realities of war, each man searches for his own answer - and the strength to triumph over an uncertain future with honor, decency and courage.', '', 'USD', '34.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(502, 502, 'United States', 1, 0, 0, '', '667068-625783', 185, 'Owned', 'Secondhand Lions', 'Platinum Series', '', '', '2003', '2004-02-03', 111, 'Keep Case', 0, 'USD', '24.99', 'For 14-year-old Walter (Haley Joel Osment), the thought of spending summer with his two crazy old great uncles on their farm in rural Texas fills him with dread.  Eccentric and gruff, Hub and Garth McCann (Robert Duvall and Michael Caine) are rumoured to have been bank robbes, mafia hit men and war criminals in their younger days.  However this summer Walter finds the truth of how the two unlikely heroes lived an adventure most people only dream of.', '', 'USD', '24.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(503, 503, 'United States', 1, 0, 0, '', '667068-638622', 442, 'Owned', 'Gladiator', 'Signature Selection: Widescreen', '', '', '2000', '2000-11-21', 155, 'Keep Case', 0, 'USD', '29.99', 'Discover the unparalleled power and glory of GLADIATOR, a dazzling combination of vivid action and extraordinary storytelling that critics called a "stunning, explosive, breathtaking epic!" (Bill Diehl, ABC Radio Network)  Masterfully directed by Ridley Scott (Alien, Blade Runner), GLADIATOR features a riveting performance from Academy Award-nominated star Russell Crowe, hailed by Newsweek as "genuine larger-than-life hero!"', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(504, 504, 'United States', 1, 0, 0, '', '667068-782226', 26, 'Owned', 'The Mexican', '', '', '', '2001', '2001-08-07', 123, 'Keep Case', 0, 'USD', '26.99', 'Together for the first time, superstars Brad Pitt and Julia Roberts take a hilarious, action-packed tour south of the border with James Gandolfini (The Sopranos) in what People Magazine calls "a quirky romantic comedy with plenty of gunplay and intrigue."\n\nBefore reckless Jerry can make amends with Samantha, he has to take one more wild ride down to Mexico to pick up a priceless antique pistol and settle his debts.  As things begin heating up with mob bosses and hit men, the action boils over with surprise twists and turns in the film Roger Ebert gives "Thumbs Up".', '', 'USD', '26.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(505, 505, 'United States', 1, 0, 0, '', '667068-901221', 1, 'Owned', 'Shrek', '', '', 'United States', '2001', '2001-11-02', 90, 'Keep Case', 0, 'USD', '26.99', 'You''ve never met a hero quite like Shrek, the endearing ogre who sparked a motion picture phenomenon and captured the world''s imagination with...the Greatest Fairy Tale Never Told! The critics are calling SHREK "not just a brilliant animated feature, but a superb film on any level" (Larry King, ''USA Today'').\n\nRelive every moment of Shrek''s (Mike Myers) daring quest to rescue feisty Princess Fiona (Cameron Diaz) with the help of his loveable loudmouthed Donkey (Eddie Murphy) and win back the deed to his beloved swamp from scheming Lord Farquaad (John Lithgow). Enchantingly irreverent and "monstrously clever" (Leah Rozen, ''People Magazine''), SHREK is ogre-sized adventure you''ll want to see again and again!', '', 'USD', '26.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(506, 506, 'United States', 1, 0, 0, '', '667068-988529', 462, 'Owned', 'A.I. Artificial Intelligence', 'Two-Disc Special Edition', '', 'United States', '2001', '2002-03-05', 145, 'Keep Case', 0, 'USD', '19.99', 'Director Steven Spielberg''s ''A.I.'' propels you into a future of astounding technology and adventure beyond the human imagination in an extraordinary film the ''New York Observer'' hails as a "masterpiece" and ''Rolling Stone'' applauds as "unmistakably the work of a real filmmaker."\n\nIn a future world of runaway global warming and awe-inspiring scientific advances, humans share every aspect of their lives with sophisticated companion robots called Mechas. But when an advanced prototype robot child named David (Haley Joel Osment) is programmed to show unconditional love, his human family isn''t prepared for the consequences. Suddenly, David is on his own in a strange and dangerous world. Befriended by a streetwise Mecha (Jude Law), David embarks on a spectacular quest to discover the startling secret of his own identity. Celebrated as a film "filled with visual wonders and astonishing special effects..." (Roger Ebert, ''Ebert & Roeper''), ''A.I. Artificial Intelligence'' is a visionary motion picture triumph!', '', 'USD', '19.99', '2008-01-21', '2016-11-15 00:00:00', NULL),
(507, 507, 'United States', 1, 0, 0, '', '667068-997620', 506, 'Owned', 'The Tuxedo', '', '', '', '2002', '2003-02-25', 99, 'Keep Case', 0, 'USD', '26.99', 'International action-comedy star Jackie Chan is tailor-made for The Tuxedo, a roller coaster ride full of laughs and outrageous stunts. Jimmy Tong (Chan) is an ordinary cabbie-turned-chauffeur who slips into a 2 billion-dollar, super-spy suit and inadvertently becomes a dashing secret agent. Fit for trouble, this deluxe tux unwittingly thrusts Chan and his dazzling partner Jennifer Love Hewitt into a dangerous world of international espionage. Slip into The Tuxedo for non-stop fun and action.', '', 'USD', '26.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(508, 508, 'United States', 1, 0, 0, '', '667068-998023', 273, 'Owned', 'The Ring', '', '', '', '2002', '2003-03-04', 115, 'Keep Case', 0, 'USD', '26.99', '''The Ring'' is the critically acclaimed, smash hit thriller David Ansen of Newsweek says "raises some serious goosebumps!" This cinematic thrill ride will keep you on the edge of your seat from the stunning opening to the astonishing conclusion!\n\nIt begins as just another urban legend - the whispered tale of a nightmarish videotape that causes anyone who watches it to die seven days later. But when four teenages all meet with mysterious deaths exactly one week after watching such a tape, investigative reporter Rachel Keller (Naomi Watts) tracks down the video...and watches it. Now, the legend is coming true, the clock is ticking and Rachel has just seven days to unravel the mystery of ''The Ring''.', '', 'USD', '26.99', '2007-08-09', '2016-11-15 00:00:00', NULL);
