(509, 509, 'United States', 1, 0, 0, '', '667068-998221', 115, 'Owned', 'Catch Me If You Can', '', '', '', '2002', '2003-05-06', 141, 'Keep Case', 0, 'USD', '29.99', 'Inspired by the extraordinary true story of a brilliant young master of deception and the FBI agent hot on his trail, "Catch Me If You Can" stars Oscar nominee Leonardo DiCaprio and two-time Academy Award winner Tom Hanks in one of the year''s most acclaimed hits!\n\nFrom three-time Oscar winning director Steven Spielberg, "Catch Me If You Can" follows Frank W. Abagnale, Jr. as he successfully passes himself off as a pilot, a lawyer and a doctor - all before his 21st birthday!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(510, 510, 'United States', 1, 0, 0, '', '667068-998924', 105, 'Owned', 'Minority Report', '', '', '', '2002', '2002-12-17', 146, 'Keep Case', 0, 'USD', '29.98', 'What would you do if you were accused of a murder, you had not committed... yet?\n\nIn the year 2054, in Washington, D.C., murder has been eliminated thanks to Precrime, a program that uses the visions of three psychics, called Pre-Cogs (an abbreviation for precognitive thinkers), to arrest and imprison would-be murderers before they have a chance to kill. Tom Cruise plays John Anderton, a Precrime enforcer who believes in the system for his own personal reasons--years back his young son was abducted, and he has dealt with the loss by becoming a high-strung Precrime officer. The director of Precrime (Max von Sydow) is eager to take the program national, and feels threatened by an ambitious federal agent (Colin Farrell) who is bent on finding a flaw in the system. When Anderton finds himself accused of the future murder of a man he''s never met, his faith in Precrime is instantly shaken. He goes on the run, and is trailed by the relentless Precrime police.', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(511, 511, 'United States', 1, 0, 0, '', '678149-015423', 247, 'Owned', 'Spirit: Stallion of the Cimarron', '', '', '', '2002', '2002-11-19', 83, 'Keep Case', 0, 'USD', '19.99', 'From the studio that brought you SHREK, winner of the first Academy Award for Best Animated film, comes SPIRIT: STALLION OF THE CIMARRON. Critics are applauding this must-see motion picture adventure as "an instant classic" (Clay Smith, ''Access Hollywood'') and "one of the most beautiful and exciting animated features ever made" (Leonard Maltin, ''Hot Ticket''). \n\nJoin Spirit, a wild young mustang, as he sets out on an action-packed quest against impossible odds to regain his freedom and save his homeland. In his courageous and thrilling journey across the majestic wilderness of the American frontier, Spirit forms a remarkable friendship with a young Lakota brave, outwits a relentless squadron of soldiers, and falls for a beautiful paint mare named Rain. SPIRIT: STALLION OF THE CIMARRON is a spectacular tale about discovering the true hero inside of you.', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(512, 512, 'United States', 1, 0, 0, '', '678149-036428', 103, 'Owned', 'Road to Perdition', '', '', '', '2002', '2003-02-25', 117, 'Keep Case', 0, 'USD', '26.95', 'Two-time Academy Award-winner Tom Hanks stars as Michael Sullivan, a father fighting to keep his only son from traveling the ''Road to Perdition''. Directed by Oscar-winner Sam Mendes (''American Beauty''), this towering motion picture achievement has been acclaimed by audiences and critic''s alike as one of the year''s most extraordinary films. \n\nAlso, starring Academy Award-winner'' Paul Newman and Oscar-nominee Jude Law, ''Road to Perdition'' weaves a mesmerizing tale of a father and son bound together by tragedy and betrayal. On an unforgettable journey of honor, vengeance and redemption, they will confront overwhelming odds - and forge an indestructible bond. Hailed for the powerhouse performances of its stars and the stunning impact of its story, ''Road to Perdition'' is an electrifying experience that will stay with you for a lifetime.', '', 'USD', '26.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(513, 513, 'United States', 1, 0, 0, '', '678149-087321', 395, 'Owned', 'Shrek 2', '', '', '', '2004', '2004-11-05', 92, 'Keep Case', 0, 'USD', '29.95', 'Everyone''s favorite larger-than-life hero returns in Shrek 2, the #1 comedy of all time hailed by critics and audiences alike as even better than its Oscar winning predecessor! USA Today proclaims "there are so many jokes and jests, not even a jelly-bellied ogre could consume them all in one sitting." \n\nHappily ever after never seemed so far, far away when a trip to meet the in-laws turns into another hilariously twisted adventure for Shrek and Fiona. With the help of his faithful steed Donkey, Shrek takes on a potion-brewing Fairy Godmother, the pompous Prince Charming, and the famed ogre-killer, Pussiin Boots, a ferocious feline foe who''s really just a pussycat at heart!', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(514, 514, 'United States', 1, 0, 0, '', '678149-167528', 233, 'Owned', 'Win A Date With Tad Hamilton', '', '', '', '2004', '2004-04-20', 97, 'Keep Case', 0, 'USD', '26.99', 'Imagine meeting your favorite big-screen idol and he winds up idolizing you! That''s what happens to Rosalee (Kate Bosworth, Blue Crush), a star-struck small-town girl, who wins a date with handsome Hollywood hunk Tad Hamilton (Josh Duhamel, TV''s Las Vegas). And while it mat be Rosalee''s dream-come-true, it means complete chaos for her best friend, Pete (Topher Grace, TV''s That ''70''s Show). He''s the boy back home who''s deeply, hopelessly - and secretly - in love with her, too.', '', 'USD', '26.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(515, 515, 'United States', 1, 0, 0, '', '678149-195620', 283, 'Owned', 'Shark Tale', '', '', '', '2004', '2005-02-08', 90, 'Keep Case', 0, 'USD', '29.99', 'Oscar (Will Smith), a lowly tongue-scrubber at the local Whale Wash, becomes an improbable hero when he tells a great white lie. To keep his secret, Oscar teams up with an outcast vegetarian shark, Lenny (Jack Black), and the two become the most unlikely of friends. When his lie begins to unravel, its up to Oscars loyal friend Angie (Rene Zellweger) and Lenny to help him stand up to the most feared shark in the water (Robert De Niro) and find his true place in the reef.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(516, 516, 'United States', 1, 0, 0, '', '678149-197327', 135, 'Owned', 'Just Like Heaven', 'Widescreen', '', '', '2005', '2006-02-07', 95, 'Keep Case', 0, 'USD', '29.99', 'Reese Witherspoon stars in the spirited romantic comedy ''Just Like Heaven''. When David (Mark Ruffalo) rents his new apartment, the last thing he wants is company. Then Elizabeth (Reese Witherspoon) shows up, insisting the apartment is hers...until she disappears right before his eyes. He''s convinced she''s a spirit. She''s convinced she''s still alive. As they search for the truth of Elizabeth''s past, their relationship changes from resentment to romance. Also starring Jon Heder, ''Just Like Heaven'' is a delightful film that critics declare is "one of the best romantic comedies to come along in years" (JP Sarni, ''Sirius Satellite Radio'').', '', 'USD', '29.99', '2006-06-19', '2016-11-15 00:00:00', NULL),
(517, 517, 'United States', 1, 0, 0, '', '678149-434224', 145, 'Owned', 'Wallace & Gromit: The Curse of the Were-Rabbit', 'Widescreen', '', '', '2005', '2006-02-07', 85, 'Keep Case', 0, 'USD', '29.99', 'From the Academy Award-winning creators of Wallace and Gromit comes "one of the most enjoyable family films of the year" (Jeffrey Lyons, ''NBC''). When their town''s prized produce starts disappearing, our cheese-loving inventor and his savvy canine companion must use all their wildly imaginative inventions to try to capture a mysterious beast of epic and fluffy proportions!\n\nHailed as "a terrific family movie" (Russ Leatherman, ''CNN and Moviefone.com'') and "whimsical, funny and endlessly inventive" (Roger Ebert, ''Ebert & Roeper''), ''The Curse of the Were-Rabbit'' is a hare-raising adventure for the whole family!', '', 'USD', '29.99', '2006-06-19', '2016-11-15 00:00:00', NULL),
(518, 518, 'United States', 1, 0, 0, '', '678149-439328', 35, 'Owned', 'War of the Worlds', 'Full Screen', '', '', '2005', '2005-11-22', 117, 'Keep Case', 0, 'USD', '36.98', 'An earth-shattering adventure that both "rivets and amazes" (Michael Wilmington, Chicago Tribune), War of the Worlds reunites superstar Tom Cruise and Academy Award-winning director Steven Spielberg for one of the most awe-inspiring cinematic experiences of all time!\n\nA contemporary retelling of H.G. Wells classic, the sci-fi thriller reveals the extraordinary battle for the future of humankind through the eyes of one American family. Fleeing from an extraterrestrial army of killer Tripods that annihilate everything in their path, Ray Ferrier (Cruise) races to keep his family safe. War of the Worlds is an action packed adventure that explodes with spectacular special effects!', '', 'USD', '36.98', '2006-02-03', '2016-11-15 00:00:00', NULL),
(519, 519, 'United States', 1, 0, 0, '', '678149-443325', 270, 'Owned', 'The Ring Two', 'Unrated Edition', '', '', '2005', '2005-08-23', 128, 'Keep Case', 0, 'USD', '29.99', 'Loaded with chilling new scenes and exclusive features, this special unrated edition of ''The Ring Two'' takes you beyond anything seen in theaters!\n\nAcademy Award nominee Naomi Watts reprises her role as investigative reporter Rachel Keller, now determined to start a new life and escape her haunting memories.  But when the vengeful Samara returns, Rachel faces a nightmarish, life-or-death struggle to save herself and her young son in this edge-of-your-seat thriller!', '', 'USD', '29.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
(520, 520, 'United States', 1, 0, 0, '', '678149-456929', 47, 'Owned', 'Madagascar', '', '', '', '2005', '2005-11-15', 86, 'Keep Case', 0, 'USD', '29.95', 'Move it! Move it! for ''Madagascar'', the #1 Family Comedy of the Year, from the studio that brought you ''Shrek'' and ''Shark Tale''. When four pampered animals from New York''s Central Park Zoo accidentally find themselves shipwrecked on the exotic island of Madagascar, the discover it really IS a jungle out there! Ben Stiller, Chris Rock, David Schwimmer and Jada Pinkett Smith headline an all-star cast of hilarious animals, including a quartet of mischievous penguins and legions of lemurs, led by the outrageous King Julien. ''Madagascar'' is a roaring good family film that you''ll go wild for again and again!\n\nPLUS! Before the mission to Madagascar, those zany Penguins stirred up some holiday spirit back at the zoo. Check out the "cute and cuddly" foursome starring in their very own whacked-out film, ''A Christmas Caper''!', '', 'USD', '29.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(521, 521, 'United States', 1, 0, 0, '', '687797-123596', 670, 'Owned', 'Jack&Jill vs the World', '', '', 'United States', '2007', '2008-06-17', 87, 'Keep Case', 0, 'USD', '24.98', 'Jack (Freddie Prinze, Jr.) is a NYC advertising exec with a life as glossy as the ads he spins. Free-spirited Jill (Taryn Manning) is new to the city, with nothing to stand on but her fiery personality and romantic ideals. Opposites attract, and together they author their own manifesto of "rules to live by." But their story takes a turn when the truth about Jill surfaces and their number one ruleBe honest is violated.', '', 'USD', '24.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(522, 522, 'United States', 0, 0, 0, 'Digital', '687797-124999', 1025, 'Owned', 'Transsiberian', '', '', 'United States', '2008', '2008-11-04', 111, 'Keep Case', 1, 'USD', '28.98', 'A trans-Siberian train journey from Beijing to Moscow turns into a thrilling chase of deception, drug trafficking, and murder when Americans, Roy (Woody Harrelson) and Jessie (Emily Mortimer), a pair of fellow travelers, Carlos (Eduardo Noriega) and Abby (Kate Mara) are targeted by ex-KGB detective Grinko (Ben Kingsley). Thomas Kretschmann costars.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(523, 523, 'United States', 1, 0, 0, '', '702727-017728', 122, 'Owned', 'Robotech - Vol. 01: The Macross Saga - First Contact', '', '', '', '1985', '2001-06-19', 150, 'Keep Case', 0, 'USD', '14.98', 'Strap into your Veritech and get ready for the ride of your life! When a mysterious space battleship crashes onto Macross Island in the South Pacific, the future of mankind is changed forever. Realizing that there are hostile forces in the universe, the people of Earth race to rebuild the SDF-1 as their first line of defense against a possible alien attack. But even as they struggle to master the science of Robotechnology, the vengeful Zentraedi armada is approaching the Earth! Don''t miss out on the action as ROBOTECH, the classic animated sci-fi series that''s thrilled millions of viewers for over fifteen years arrives on DVD!\n\nContains Episodes 1 - 6:\nBooby Trap\nCountdown\nSpace Fold\nThe Long Wait\nTransformation\nBlitzkrieg', '', 'USD', '14.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(524, 524, 'United States', 1, 0, 0, '', '707729-101178', 452, 'Owned', 'Lonesome Dove', '', '', '', '1988', '2000-02-15', 372, 'Keep Case', 0, 'USD', '29.98', 'Hailed as a masterpiece by critics and audiences alike, LONESOME DOVE brings to life all the magnificent drama and romance of the west.  This exciting re-creation of Larry McMurtry''s Pulitzer Prize-winning novel captured the American pioneer spirit with its sweeping story and inspired performances.  \n\nRobert Duvall, Tommy Lee Jones and Anjelica Huston star in the tale of two former Texas Rangers who leave the South Texas town of Lonesome Dove on an epic 2500-mile cattle drive to the lush country of Montana.  \n\nAlready a collectible classic, Lonesome Dove is an authentic piece of the American West and a saga that will be treasured for generations.', '', 'USD', '29.98', '2005-09-17', '2016-11-15 00:00:00', NULL),
(525, 525, 'United States', 1, 0, 0, '', '717951-000095', 574, 'Owned', 'Phenomenon', '', '', '', '1996', '1997-12-02', 123, 'Keep Case', 0, 'USD', '29.99', 'Hollywood favorite John Travolta (''Pulp Fiction'') stars in this acclaimed, uplifting story of an ordinary man transformed by extraordinary events! On the night of his 37th birthday, George Malley (Travolta) is knocked to the ground by a mysterious, blinding light and suddenly develops amazing mental abilities! With his newfound knowledge, George astounds everyone in town. But when his incredible powers cause even his oldest friends to turn away, George comes to realize that his wondrous experience has changed him and the lives of everyone around him forever. With an outstanding supporting cast featuring Robert Duvall (''Something To Talk About''), Forest Whitaker (''Species'') and Kyra Sedgwick (''Singles'') - don''t miss this must-see motion picture event!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(526, 526, 'United States', 1, 0, 0, '', '717951-000101', 312, 'Owned', 'George of the Jungle', '', '', 'United States', '1997', '1997-12-02', 92, 'Clamshell', 0, 'USD', '29.99', 'Deep in the heart of the African jungle, a baby named George, the sole survivor of a plane crash, is raised by gorillas.  George grows up to be a buff and lovable klutz (Fraser) who has a rain forest full of animal friends - like Tookie, his big-beaked messenger, Ape (Cleese), a talking gorilla who''s smarter than your average rocket scientist, and Shep, a gray-haired peanut-loving pooch of an elephant!  When poachers mess with George''s pals, the King Of Swing swings into action. But before you can say, "Watch out for that tree," George comes face-to-bark with a few vine-covered obstacles!  You''ll go wild for this "wonderfully wacky comedy" that People Magazine calls "impossible to resist!"', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(527, 527, 'United States', 1, 0, 0, '', '717951-000156', 263, 'Owned', 'While You Were Sleeping', '', '', '', '1995', '1998-02-03', 103, 'Keep Case', 0, 'USD', '29.99', 'You''ll fall in love with While You Were Sleeping, the hit romantic comedy that woke everyone up to adorable Sandra Bullock (Speed, A Time To Kill).\n\nAs Lucy, a lonely subway worker, she becomes smitten with a handsome stranger (Peter Gallagher - Malice). But when she saves his life after he''s been mugged and fallen into a coma, his hilariously offbeat family mistakes her for his fiance! Soon the mix-ups escalate as Lucy fabricates a life between herself and a man she''s never met! And when Lucy falls for his charming brother (Bill Pullman - Independence Day), the situation really gets uproarious - as she''s forced to make a choice between the two!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(528, 528, 'United States', 1, 0, 0, '', '717951-000415', 293, 'Owned', 'Pretty Woman', '', '', '', '1990', '1998-05-19', 124, 'Keep Case', 0, 'USD', '29.99', 'Richard Gere (''Red Corner'') and Best Actress Oscar nominee Julia Roberts light up the screen in this now-classic comedy hit!  When successful corporate mogul Edward Lewis (Gere) meets independent and carefree Vivian Ward (Roberts), their two lives are worlds apart.  But Vivian''s energetic spirit challenges Edward''s no-nonsense, business-minded approach to life, sparking an immediate attraction.  He teaches her about the finer things in life; she teaches him that love could be the best investment he ever made.  Capturing hearts of critics and moviegoers alike, this modern-day rags-to-riches romance entertains with its upbeat blend of humor, passion and unforgettable fun!  And now, you can enjoy ''Pretty Woman'' in this Special Director''s Cut version, which contains footage not previously seen in theaters.  It also includes a complete and fascinating commentary on the making of the film by its director, Garry Marshall!', '', 'USD', '29.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
(529, 529, 'United States', 1, 0, 0, '', '717951-000866', 45, 'Owned', 'Six Days, Seven Nights', '', '', '', '1998', '1998-12-08', 102, 'Keep Case', 0, 'USD', '29.99', 'Big-screen favorite Harrison Ford stars in this nonstop adventure hit about a dream vacation that turns into a hilarious tropical nightmare! A gruff, rough-hewn cargo pilot living in the islands, Quinn Harris (Ford) hates tourists...though he''s not above making a fast buck from a sharp-tongued New Yorker, Robin Monroe (Heche), when she''s desperate for a quick flight to Tahiti! But this already uneasy relationship suddenly takes a nosedive when his weather-beaten old plane is forced down in a storm! Now, stranded together on a deserted isle, Quinn and Robin quickly discover all the perils of paradise. As this mismatched pair find themselves facing danger at every turn, you''re sure to find their misfortunes fueling one of Hollywood''s most entertaining action-comedy hits in years!', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(530, 530, 'United States', 1, 0, 0, '', '717951-001405', 231, 'Owned', 'Father of the Bride', '', '', '', '1991', '1999-04-20', 105, 'Keep Case', 0, 'USD', '29.99', 'In this hilarious update of the much-loved Hollywood classic, Steve Martin turns in a winning performance as George Banks, the befuddled father who has a hard time letting go of his young daughter (Williams) when she unexpectedly announces her plans to wed. Tickling funnybones and touching hearts of critics and audiences alike, this entertaining treat chronicles George''s hysterical trials and tribulations leading up to the big event. Diane Keaton shines as George''s patient, level-headed wife, while funnyman Martin Short lights up the screen as the off-the-wall wedding consultant. Father Of The Bride promises to love, honor and deliver the kind of motion picture fun you''ll thoroughly enjoy!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(531, 531, 'United States', 1, 0, 0, '', '717951-001634', 443, 'Owned', 'Enemy of the State', '', '', 'United States', '1998', '1999-06-15', 132, 'Keep Case', 0, 'USD', '29.99', 'Hot Hollywood favorite Will Smith ("Men in Black," "Independence Day") stars with two-time Academy Award winner Gene Hackman in a high-powered suspense thriller where nonstop action meets cutting-edge technology! Robert Clayton Dean (Smith) is a successful Washington, D.C. attorney who - without his knowledge - is given a video that ties a top official of the National Security Agency (Oscar winner Jon Voight) to a political murder! Instantly, every aspect of Dean''s once-normal life is targeted by a lethal team of skilled NSA surveillance operatives, who wage a relentless, ultrahigh-tech campaign to discredit him and retrieve the incriminating evidence! Also featuring Regina King ("Jerry Maguire," "Boyz ''N the Hood") in an impressive, star-studded cast - get ready for the action to explode as Dean desperately races to reclaim his life and prove his innocence...before it''s too late!', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(532, 532, 'United States', 1, 0, 0, '', '717951-001665', 444, 'Owned', 'The Waterboy', 'Widescreen', '', 'United States', '1998', '1999-03-16', 90, 'Keep Case', 0, 'USD', '29.99', 'America''s favorite wild and zany funnyman, Adam Sandler (''The Wedding Singer''), scores big laughs in a smash comedy where the laughs ''never'' run dry! Just an oddball mama''s boy from the back bayous of Louisiana, Bobby Boucher (Sandler) never wanted anything more than to quench the thirst of the dehydrated athletes who treat him like dirt! But when Coach Klein (Henry Winkler - ''Scream'') makes the call that allows Bobby to finally stand up for himself, it unleashes a torrent of bottled-up frustration...and exposes a talent for tackling that transforms him from a meek "water distribution engineer" to the hardest hitter ever to roam the gridiron! Also featuring award-winning Kathy Bates (''Titanic'', ''Misery'') and sexy Fairuza Balk (''The Craft'') in a hilarious cast of stars - here''s your chance to join the millions everywhere who''ve proudly stood and cheered for ''The Waterboy''!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(533, 533, 'United States', 1, 0, 0, '', '717951-002785', 369, 'Owned', 'Can''t Buy Me Love', '', '', 'United States', '1987', '2002-08-13', 94, 'Keep Case', 0, 'USD', '19.99', 'Nowhere-man Ronny Miller is secretly in love with Cindy Mancini, the prettiest, most popular girl on campus. When Cindy finds herself in a desperate predicament, Ronny steps in to save the day...for a price! Cindy must pose as Ronny''s girl so that her popularity might rub off on him. But the road to popularity takes an unexpected twist when Ronny becomes so "cool" that his former friends feel the chill, Cindy is left totally out in the cold, and Ronny himself discovers that money might buy you popularity, but it can''t buy you love!', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(534, 534, 'United States', 1, 0, 0, '', '717951-002822', 291, 'Owned', 'Romy and Michele''s High School Reunion', '', '', '', '1997', '1999-08-24', 92, 'Keep Case', 0, 'USD', '29.99', 'The Blonde Leading The Blonde.\n\nBig laughs and hot stars make this a can''t -miss comedy in the hilarious tradition of ''Clueless'' and ''Dumb and Dumber!'' Romy and Michele are carefree party girls who reinvent themselves for their 10-year high school reunion! With new wardrobes and wild stories of success, they make a big impression..until a former classmate blabs their real story to everyone! But that''s when Romy and Michele let loose with a surprise of their own..and outrageous results! featuring a sizzling hit soundtrack of favorite hits from the ''80s, it''s the comedy treat ''The New York Times'' calls "Cheerful, Giddy Fun!"', '', 'USD', '29.99', '2005-03-09', '2016-11-15 00:00:00', NULL),
(535, 535, 'United States', 1, 0, 0, '', '717951-003072', 203, 'Owned', 'She''s All That', '', '', '', '1998', '1999-07-13', 96, 'Keep Case', 0, 'USD', '28.98', 'An irresistible cast of Hollywood''s hottest young faces star in this fun, sexy comedy hit about the power of attraction and the pressures of popularity!  Stung when his bombshell girlfriend abruptly dumps him for a TV celebrity, big man on campus Zack Siler wagers with a classmate he can quickly turn any girl... even the school''s biggest geek, Laney Boggs into the prom queen.  He wasn''t, however, betting on falling in love!  After an amazing makeover Laney is transformed from nobody to knockout... but when learns of Zacks deception, it could ruin any chance he had with his newfound dream girl!  With a hip modern soundtrack and a hilarious story that audiences loved, this great comedy is all that... and more.', '', 'USD', '28.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(536, 536, 'United States', 1, 0, 0, '', '717951-003201', 161, 'Owned', 'The Three Musketeers', '', '', '', '1993', '1999-08-24', 105, 'Keep Case', 0, 'USD', '29.99', 'Nab the star-studded comedy-adventure that dazzled moviegoers everywhere! \nIt''s the action-packed tale of three loyal swordsmen (Charlie Sheen, Kiefer Sutherland, Oliver Platt) who are joined by an eager recruit (Chris ODonnell) to protect the King of France. Together, the foursome battle enormous odds in their attempt to defeat an evil royal advisor (Tim Curry) and a seductive envoy (Rebecca De Mornay) plotting to overthrow France''s crown - fighting against both time and scores of enemies! You''ll cheer out loud when these exciting musketeers face danger, fun and adventure at every turn - proving they are the greatest swashbucklers who ever lived!', '', 'USD', '29.99', '2006-10-08', '2016-11-15 00:00:00', NULL),
(537, 537, 'United States', 1, 0, 0, '', '717951-003300', 183, 'Owned', 'Adventures In Babysitting', '', '', '', '1987', '2000-01-18', 102, 'Keep Case', 0, 'USD', '29.99', 'Chris Parker (Elisabeth Shue of Cousin Bette, Leaving Las Vegas) agrees to babysit after her "dread" date stands her up. Expecting a dull evening, Chris settles down with three kids for a night of TV...and boredom. But when her frantic friend Brenda calls and pleads to be rescued from the bus station in downtown Chicago, the evening soon explodes into an endless whirl of hair-raising adventures! Babysitter and kids leave their safe suburban surroundings and head for the heart of the big city, never imagining how terrifyingly funny their expedition will become!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(538, 538, 'United States', 1, 0, 0, '', '717951-003584', 294, 'Owned', 'Hocus Pocus', '', '', '', '1993', '2002-06-25', 96, 'Keep Case', 0, 'USD', '19.99', 'You''re in for a devil of a time when three outlandishly wild witches - Bette Midler (''The First Wives Club''), Sarah Jessica Parker (TV''s ''Sex And The City'') and Kathy Najimy (''The Wedding Planner'') - return from 17th century Salem after they are accidently conjured up by some unsuspecting pranksters! It''s a night full of zany fun and comic chaos once the tricky 300-year-old trio sets out to cast a spell on the town and reclaim their youth -- but first they must get their act together and outwit three kids and a talking cat! Loaded with bewitching laughs, ''Hocus Pocus'' is an outrageously wild comedy that''s sure to entertain everyone!', '', 'USD', '19.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
(539, 539, 'United States', 1, 0, 0, '', '717951-004208', 222, 'Owned', '10 Things I Hate About You', '', '', '', '1999', '1999-10-12', 97, 'Keep Case', 0, 'USD', '29.99', 'A cool cast of young stars is just one of the things you''ll love about this hilarious comedy hit! On the first day at his new school, Cameron (Joseph Gordon-Levitt - ''Halloween: H20'', TV''s ''3rd Rock From The Sun'') instantly falls for Bianca (Larisa Oleynik - ''The Baby-Sitters Club''), the gorgeous girl of his dreams! The only problem is that Bianca is forbidden to date...until her ill-tempered, completely un-dateable older sister Kat (Julia Stiles - ''Wide Awake'') goes out, too! In an attempt to solve his problem, Cameron singles out the only guy who could possibly be a match for Kat: a mysterious bad-boy (Heath Ledger) with a nasty reputation of his own! Also featuring a hip soundtrack - this witty comedy is a wildly entertaining look at exactly how far some guys will go to get a date!', '', 'USD', '29.99', '2006-10-08', '2016-11-15 00:00:00', NULL),
(540, 540, 'United States', 1, 0, 0, '', '717951-005175', 232, 'Owned', 'Father of the Bride 2', '', '', '', '1995', '2000-05-09', 106, 'Keep Case', 0, 'USD', '32.99', 'In the hilarious sequel to Father of the Bride, George has recovered from the trauma of marrying off a cherished daughter, but soon finds himself in another dilemma: not only is his daughter pregnant, so is his wife! Feeling too old to be a father and too young to be a grandfather, he embarks on some crazy antics to recapture his youth. And when the flamboyant Franck (Martin Short) reenters the picture to coordinate a double baby shower, George must face his own unique ''90s-style mid-life crisis.', '', 'USD', '32.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(541, 541, 'United States', 1, 0, 0, '', '717951-007421', 383, 'Owned', 'Down to You', '', '', 'United States', '2000', '2000-07-11', 92, 'Keep Case', 0, 'USD', '29.99', 'Hot screen favorites Freddie Prinze Jr. (Shes All That, I Know What You Did Last Summer) and Julia Stiles (10 Things I Hate About You) sizzle in a fun and sexy comedy where the magic of first love collides with the challenges of real life! From the moment they meet amid the chaos of college in New York City, Al (Prinze) and Imogen (Stiles) begin a romantic journey where true love often competes with the temptation to stray from commitment! As time passes and an outrageous array of friends enter the scene, theyll celebrate all the highs and confront all the lows that greet their passionate affair! Also featuring Henry Winkler (The Waterboy), Selma Blair (Cruel Intentions) and Shawn Hatosy (Outside Providence, The Faculty) in a stellar cast - youll want to join this irresistible couple as they face the futurewith some wildly unexpected results!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(542, 542, 'United States', 1, 0, 0, '', '717951-010469', 92, 'Owned', 'Air Bud 3: World Pup', '', '', '', '2000', '2000-12-12', 83, 'Keep Case', 0, 'USD', '29.99', 'Disney is proud to present the second heartwarming and hilarious sequel to the popular family favorite, Air Bud! Buddy masters two new starring rolessoccer player and fatherhood. Air Bud: World Pup is loaded with laughs and cool soccer action as Buddy teams up alongside U.S. Women''s soccer greats Brandi Chastain, Briana Scurry and Tisha Venturini, meanwhile keeping a protective eye over his adorable new family of soccer-playing puppies!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(543, 543, 'United States', 1, 0, 0, '', '717951-010599', 681, 'Owned', 'Boys and Girls', '', '', 'United States', '2000', '2000-11-14', 94, 'Keep Case', 0, 'USD', '29.99', 'Exciting young stars Freddie Prinze, Jr. (''Down To You'', ''She''s All That'')and Claire Forlani (''Mystery Men'', Meet Joe Black'') ride in a fun rollercoaster to reomance in this sexy comedy hit! Shy bookworm Ryan (Prinze) and the outgoing, fre-spirited Jennifer (Forlani) couldn''t be more different. So when they first meet, they can''t stand each other. When they met again, they ''loathe'' each other! But when they finally reconnect in college, all that friction eventually explodes into red-hot romantic fireworks! With hillarious friends Jason Biggs (''American Pie''), Amanda Detmer (''Final Destination'', ''Drop Dead Gorgeous'') and Heather Donahue (''The Blair Witch Project'') along to pump up the fun, you''ll laugh along as these irresistible boys and girls sort out all of love''s confusing complexities!', '', 'USD', '29.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(544, 544, 'United States', 1, 0, 0, '', '723952-075703', 207, 'Owned', 'Lloyd', '', '', '', '2001', '0000-00-00', 72, 'Keep Case', 0, 'USD', '19.99', 'LLOYD is a sweet and funny 11 year old class clown who''s always getting into trouble with his teachers. Mrs. Crub is the meanest teacher in school. When Lloyd tries to rescue one of his classmates from her cruelty, he is banished to a class for "less enthusiastic" students. There, Lloyd joins three other sub-par students: Troy, Carla, and Storm. Lloyd learns a lesson about love when pretty Tracey becomes the newest class member. For Lloyd it''s love at first sight.\nUnfortunately for sweet Lloyd, he is no match for the handsome Storm the junior high, "rebel without a cause." But with help from his mom, his little brother, and a mysterious magician, Lloyd learns that confidence and self - esteem can still get him the pretty girl in the end. \n\nAka: The Ugly Kid', '', 'USD', '19.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(545, 545, 'United States', 1, 0, 0, '', '728665-390334', 652, 'Owned', 'Blood Thirst / Castle of Blood', 'Double Feature', '', '', '1964', '0000-00-00', 163, 'THINpak', 0, 'USD', '19.99', '''BLOOD THIRST''\nThe blood-drained bodies of women are being discovered all over Manila, so the Police contact a sex-crimes expert to investigate. Soon he discovers the cult of the "Golden Goddess," a monstrous woman who stays young through ritualistic killings.\n\n''CASTLE OF BLOOD''\nWhile in London, Edgar Allan Poe wagers that British journalist Alan Foster can''t spend an entire night in the haunted castle of Poe''s friend Sir Thomas Blackwood. Foster accepts, and once inside the castle, he meets various men and women, who explain to him that they are lost souls being forced to reenact their demises on the anniversary of the day that they occured.', '', 'USD', '19.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(546, 546, 'United States', 1, 0, 0, '', '728665-390532', 651, 'Owned', 'Night Fright / Sisters of Death', '', '', '', '1967', '0000-00-00', 153, '', 0, 'USD', '1.00', 'NIGHT FRIGHT\nWhen two young lovers are viciously attacked by a hideous monster, Sheriff Clint Crawford finds a rocket has mysteriously crashed. Soon, the sheriff realizes that there may be a connection, but it''s too late for Crawford''s partner who becomes yet another victim.  It''s now human wit versus monster insticts as Sheriff Crawford devices a plan to rid of the creature and save the town.\nRUNTIME: 66 MINUTES\n\nSISTERS OF DEATH\nSeven years after a tragic accident involving six high school girls, the survivors are invited to a reunion where a deadly struggle ensues.\nRUNTIME: 87 MINUTES', '', 'USD', '1.00', '2009-09-27', '2016-11-15 00:00:00', NULL),
(547, 547, 'United States', 0, 0, 0, 'Digital', '774212-101175', 937, 'Owned', 'Push', '', '', 'United States', '2009', '2009-07-07', 111, 'Keep Case', 1, 'USD', '26.99', '<b>HANG ON TIGHT</b> as a gang of super-powered paranormal operatives takes you on a white-knuckle thrill ride. The excitement starts when a future-seeing Watcher (Dakota Fanning, <i>War  of the Worlds</i>) convinces a telekinetic Mover (Chris Evans, <i>Fantastic Four</i>) to help steal a briefcase that holds a billion-dollar secret. But to outrun government agents, they must enlist a mind controlling Pusher (Camilla Belle, <i>10,000 BC</i>) who could be their salvation - or their doom. Also starring Academy Award Nominee Djimon Hounsou (<i>Blood Diamond</i>), <i>Push</i> will pull you in completely\n<b>\nACCROCHEZ-VOUS BIEN</b> parce qu''une bande dote de pouvoirs surnaturels vous entranera dans une aventure qui vous gardera au bout de votre sige. Tout dbute lorsqu''une Voyeuse (Dakota Fanning: La guerre des mondes) qui sait prdire l''avenir, arrive  convaincre un Bougeur (Chris Evans: Les 4 fantastiques), dot de pouvoirs tlkinsiques de voler une mallette qui renverme un secret valant un milliard de dollars. Mais pour distancer les agents du gouvernement, il doivent faire appel  une Penseuse (Camilla Belle: 10 000 av J.-C) et  sa capacit de manipuler les esprits. Sera-t-elle la cl de leur salut... ou de leur perte? Mettant aussi en vedette Djimon Hounsou (Le diamant de sang), nomm au Oscars, Push: La division vous hypnotisera du dbut  la fin.', '', 'USD', '26.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(548, 548, 'United States', 1, 0, 0, '', '774212-209239', 131, 'Owned', 'Air Bud: Seventh Inning Fetch', '', '', '', '2002', '2002-06-18', 93, 'Keep Case', 0, 'USD', '29.99', 'Air Bud knocks one out of the park when he takes up baseball in this all-new fun and heartwarming Disney adventure! This time, Buddy joins in and shows that he''s a natural baseball player with major league talent! In the midst of the season, however, a terrible discovery is made: Buddy''s now grown puppies have mysteriously begun to disappear from their new homes! Now it''s up to Buddy to stop the dog-nappings and find his pups before it''s too late!', '', 'USD', '29.99', '2008-01-17', '2016-11-15 00:00:00', NULL),
(549, 549, 'United States', 0, 0, 0, 'Digital', '783722-274514', 934, 'Owned', 'Loaded', '', '', 'United States', '2007', '2008-03-25', 100, 'Keep Case', 0, 'USD', '29.98', 'Tristan Price (Jesse Metcalfe) has everything: money, privilege, loving parents (Erin Gray, John Bennet Perry), a beautiful girlfriend (Monica Keena), and a bright future. But he has always had a need for something more, something wilder. Enter Sebastian Cole (Corey Large), a handsome, charismatic, ruthless coke dealer with a taste for fast cars, fast women, rapid-fire weapons...and revenge. Soon, Tristan will be up to his eyeballs in a seedy underworld of drugs, sex and violence before he has a clue that his new best friend is, in reality, his worst enemy!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(550, 550, 'United States', 1, 0, 0, '', '786936-143782', 64, 'Owned', 'The Parent Trap', '', '', '', '1998', '1999-03-16', 128, 'Keep Case', 0, 'USD', '19.99', '"The Best Family Film In Years!"\n - Diane Kaminsky, KHOU-TV, Houston\n\nWhat if you spent your whole life wishing for something you didn''t know you already had? Hallie Parker and Annie James are about to find out.\n\nFrom Walt Disney Pictures and the creators of Father Of the Bride comes the hilariously fresh and contemporary retelling of the classic hit The Parent Trap.\n\nHallie is a cool girl from California. Annie is a fair rose from London. When the two accidentally meet at summer camp, they think they have nothing in common except--they''re identical twins! Now they are up to their freckles in schemes and dreams to switch places, get their parents back together and have the family they''ve always wished for!\n\nWith "Two Thumbs Up" from Siskel & Ebert, this charming, heartwarming and delightfully clever comedy adventure will enchant your entire family.', '', 'USD', '19.99', '2006-01-11', '2016-11-15 00:00:00', NULL),
(551, 551, 'United States', 1, 0, 0, '', '786936-143812', 261, 'Owned', 'The Parent Trap', 'Vault Disney Collection', '', '', '1961', '2002-05-07', 129, 'Keep Case', 0, 'USD', '29.99', 'Audio commentary by ''David Swift'' and Hayley Mills\nOriginal Theatrical Animated Shorts, Donald''s Double Trouble\n"Caught In The Act: The Making of The Parent Trap" - the Sherman Brothers and "Let''s Get Together" .\n\nWhat could be better than one Hayley Mills? How about two? Special Academy Award-winning actress Hayley Mills (Pollyanna) shines again, this time of playing twin daughters of a divorced couple (Brian Keith and Maureen O''Hara). The girls, who have long been separated, meet accidentally for the first time at summer camp. After discovering that they are long-lost twin sisters, the two concoct an outrageous scheme to switch places in an effort to get their parents back together.\n\nIn her dual role, Miss Mills moves from slapstick to serious, refined to rock ''n'' roll. Her delightful performance, coupled with a charming story, will capture your heart and have you doubling up with laughter!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(552, 552, 'United States', 1, 0, 0, '', '786936-144505', 34, 'Owned', 'Coyote Ugly', '', '', '', '2000', '2001-01-16', 101, 'Keep Case', 0, 'USD', '29.99', 'From hit-making producer Jerry Bruckheimer (Gone in 60 Seconds, Armageddon) comes ''Coyote Ugly'', the intoxicating sexy comedy starring an unbeatable cast of hot, new stars including Piper Perabo (Rocky And Bullwinkle) and Maria Bello (Payback). Moving to New York to pursue her dream of becoming a famous songwriter, Violet Sanford (Perabo) finds herself desperate and broke. Through a twist of fate, the shy, innocent Violet lands a job as one of the barmaids at the hottest nightclub in town - the down and dirty, wild and fun Coyote Ugly. Pouring drinks and overflowing with attitude, the "Coyotes" spend more time on top of the bar than behind it, tantalizing the standing-room- only crowd with their outrageous antics! It''s one wild adventure for a small-town girl chasing her dream in the big city.', '', 'USD', '29.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(553, 553, 'United States', 1, 0, 0, '', '786936-144765', 172, 'Owned', 'Bounce', '', '', '', '2000', '2001-04-10', 106, 'Keep Case', 0, 'USD', '29.99', 'Academy Award winners Ben Affleck and Gwyneth Paltrow create sparks in the hit critics are calling the romance of the year! Buddy Amaral is a smooth-talking, skirt-chasing ad exec who is enjoying his high-powered career. Then, a sudden twist of fate changes everything and leads him into the life of Abby Janello, with whom he eventually falls head-over-heels in love. Also starring Tony Goldwyn and Natasha Henstridge.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(554, 554, 'United States', 1, 0, 0, '', '786936-144772', 48, 'Owned', 'Unbreakable', 'Vista Series', '', '', '2000', '2001-06-26', 107, 'Digipak', 0, 'USD', '29.95', 'Bruce Willis and Samuel L. Jackson star in a mind-shattering, suspense-filled thriller that stays with you long after the end of this riveting supernatural film. After David Dunn (Willis) emerges from a horrific train crash as the sole survivor - and without a single scratch on him - he meets a mysterious stranger (Jackson). An unsettling stranger who believes comic book heroes walk the earth. A haunting stranger whose obsession with David will change David''s life forever.', '', 'USD', '29.95', '2005-02-27', '2016-11-15 00:00:00', NULL),
(555, 555, 'United States', 1, 0, 0, '', '786936-145076', 225, 'Owned', 'Chocolat', 'Collector''s Series', '', '', '2000', '2001-08-07', 122, 'Keep Case', 0, 'USD', '29.99', 'Nominated for 5 Academy Awards including Best Picture, Best Actress (Juliette Binoche- The English Patient), and Best Supporting Actress (Judi Dench-Shakespare in Love), Chocolat is the beautiful and captivanting comedy from the acclaimed director of The Cider House Rules! Nobody could have imagined the impact that the striking Vianne (Binoche) would make when she arrived in a tranquil, old fashioned French town. In her very unusual chocolate shop, Vianne begins to create mouth-watering confections that almost magically inspire the straitlaced villagers to abandon themselves to temptation and hapiness! But it is not until another stranger, the handsome Roux (Johnny Depp-SleepyHollow), arrives in town that Vianne is finally able to recognize her own desires!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(556, 556, 'United States', 1, 0, 0, '', '786936-166583', 208, 'Owned', 'Serendipity', '', '', '', '2001', '2002-04-09', 91, 'Keep Case', 0, 'USD', '29.99', 'Irresistible stars John Cusack (America''s Sweethearts, High Fidelity) and Katie Beckinsale (Pearl Harbor, Brokedown Palace) are drawn together and take a chance on love in this critically acclaimed romantic comedy! In the course of one magical evening, Jonathan (Cusack) and Sara (Beckinsale) meet unexpectedly then part without expectation when she decides they must let fate determine if they are meant to be together. Years later, they are both engaged to others but cannot give up the dream that - despite time, distance and the obstacles that conspire to keep them apart - they will one day meet again! Also starring Jeremy Piven (The Family Man, Very Bad Things) and Molly Shannon (Superstar, Never Been Kissed) in a stellar supporting cast - you''re destined to agree with audiences everywhere who fell for the surprising charms of this delightful big-screen romance!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(557, 557, 'United States', 1, 0, 0, '', '786936-168532', 553, 'Owned', 'Pearl Harbor', 'The Director''s Cut', '', '', '2001', '2002-07-02', 184, 'Custom', 0, 'USD', '39.99', 'In "Pearl Harbor," Rafe McCawley (Ben Affleck) and Danny Walker (Josh Hartnett) are childhood friends who both dream of flying. As the world becomes embroiled in World War II in the early 1940s, Rafe and Danny sign on with the United States Armed Forces, although America is still in an isolationist position. Eager to participate in combat, Rafe is compelled to join the British air fight against the Nazis, leaving his girlfriend, beautiful army nurse Evelyn Stewart (Kate Beckinsale) behind. \n\nWhen Evelyn and Danny are transferred to the military base at Pearl Harbor, Hawaii, they hear the news that Rafe has been shot down and killed. Hoping to move on after grieving, Danny and Evelyn find themselves in love. When Rafe returns alive, the three find themselves in an uncomfortable personal situation that is soon engulfed by the massive surprise attack on Pearl Harbor. \n\nPutting aside their differences, Rafe and Danny join the desperate fight against the enemy invaders. The film''s epic sweep intertwines Rafe and Danny''s stories with the heroic efforts of such characters as "Dorrie" Miller (Cuba Gooding Jr.), a ship''s cook turned fighter, Earl (Tom Sizemore), a courageous base mechanic, and Jimmy Doolittle (Alec Baldwin), the visionary pilot who would lead one of America''s most famous counterattacks of the war. Dan Aykroyd also appears as the code breaking Captain Thurman and Jon Voight as President Franklin Roosevelt.', '', 'USD', '39.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(558, 558, 'United States', 1, 0, 0, '', '786936-174359', 552, 'Owned', 'Pearl Harbor', 'Director''s Cut', '', '', '2001', '2002-07-02', 184, 'Digipak', 0, 'USD', '39.99', 'Alors que la seconde guerre fait rage en Europe, deux amis passionns par les avions s''engagent comme pilote de chasse. Rafe (Ben Affleck, Will Hunting) part combattre en Europe pendant que Danny (Josh Arnett, Virgin Suicides) et la petite amie de Rafe, Evelyn (Kate Beckinsale) sont transfrs  Hawa. Evelyn apprend peu aprs la disparation de Rafe, est se tourne vers Danny pour apaiser son chagrin. Mais Rafe rapparat et le 7 dcembre 1941, les japonais attaquent Pearl Harbor et font entrer l''Amrique dans la seconde guerre mondiale. \n\nIn "Pearl Harbor," Rafe McCawley (Ben Affleck) and Danny Walker (Josh Hartnett) are childhood friends who both dream of flying. As the world becomes embroiled in World War II in the early 1940s, Rafe and Danny sign on with the United States Armed Forces, although America is still in an isolationist position. Eager to participate in combat, Rafe is compelled to join the British air fight against the Nazis, leaving his girlfriend, beautiful army nurse Evelyn Stewart (Kate Beckinsale) behind. \n\nWhen Evelyn and Danny are transferred to the military base at Pearl Harbor, Hawaii, they hear the news that Rafe has been shot down and killed. Hoping to move on after grieving, Danny and Evelyn find themselves in love. When Rafe returns alive, the three find themselves in an uncomfortable personal situation that is soon engulfed by the massive surprise attack on Pearl Harbor. \n\nPutting aside their differences, Rafe and Danny join the desperate fight against the enemy invaders. The film''s epic sweep intertwines Rafe and Danny''s stories with the heroic efforts of such characters as "Dorrie" Miller (Cuba Gooding Jr.), a ship''s cook turned fighter, Earl (Tom Sizemore), a courageous base mechanic, and Jimmy Doolittle (Alec Baldwin), the visionary pilot who would lead one of America''s most famous counterattacks of the war. Dan Aykroyd also appears as the code breaking Captain Thurman and Jon Voight as President Franklin Roosevelt.', '', 'USD', '39.99', '2005-02-27', '2016-11-15 00:00:00', NULL);
