(559, 559, 'United States', 1, 0, 0, '', '786936-184914', 249, 'Owned', 'Snow Dogs', '', '', '', '2001', '2002-05-14', 99, 'Keep Case', 0, 'USD', '29.99', 'Make no bones about it, Disney''s ''Snow Dogs'' is a hilarious, action-packed comedy your whole family will love. Eight adorable but mischievous dogs get the best of dog hater Ted Brooks (Cuba Gooding Jr.) when he leaves his successful Miami Beach dental practice for the wilds of Alaska to claim his inheritance - seven Siberian huskies and a border collie - and discover his roots. As Ted''s life goes to the dogs, he rises to the occasion and vows to learn to mush with his inheritance. Totally out of his element, he faces challenges he''s never dreamed of. There''s a blizzard, thin ice, an intimidating, crusty old mountain man named Thunder Jack (James Coburn), the Artic Challenge Sled Dog Race that''s only two weeks away, and a life-and-death rescue. This fish-out-of-water, tail-wagging comedy is nothing but doggone good fun and a celebration of family - both human and canine!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(560, 560, 'United States', 1, 0, 0, '', '786936-197594', 566, 'Owned', 'Signs', '', '', 'United States', '2002', '2003-01-07', 106, 'Keep Case', 0, 'USD', '29.95', 'From M. Night Shyamalan, the writer / director of ''The Sixth Sense'' and ''Unbreakable'', comes the story of the Hess family in Bucks County, Pennsylvania, who wake up one morning to find a 500-foot crop circle in their backyard.\n\nGraham Hess (Mel Gibson) and his family are told extraterrestrials are responsible for the sign in their field.  They watch, with growing dread, the news of crop circles being found all over the world.\n\n''Signs'' is the emotional story of one family on one farm as they encounter the terrifying last moments of life as the world is being invaded.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(561, 561, 'United States', 1, 0, 0, '', '786936-198010', 401, 'Owned', 'The Santa Clause', 'Special Edition', '', 'United States', '1994', '2002-10-29', 97, 'Keep Case', 0, 'USD', '29.95', 'Superstar comedian and Golden Globe winner Tim Allen shines bright in Disney''s magical, larger-than-life hit comedy that People Magazine dubbed "the most playfully amusing, inventive cinematic...fable in several decades!"  Now in this all-new special edition DVD release, your entire family can enjoy never-before-seen bonus footage, interactive games and more, making this original holiday classic a joyful new experience!', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(562, 562, 'United States', 1, 0, 0, '', '786936-199291', 102, 'Owned', 'The Importance of Being Earnest', '', '', 'United Kingdom', '2002', '2002-11-12', 94, 'Keep Case', 0, 'USD', '29.95', 'Starring Reese Witherspoon (''Legally Blonde''), Colin Firth (''Bridget Joness Diary''), and Rupert Everett (''My Best Friend''s Wedding''), here is the hilarious adventure of two dashing young bachelors and the outrageous deceptions they find themselves in over love! Whenever Worthing (Firth) wants to leave his dull country life behind, he makes visits to the city posing as his fictitious "brother" Ernest. There he becomes smitten with the ravishing Gwendolen (Frances O'' Connor - ''A.I.''). But when Worthing is in town, his playboy pal Algy (Everett) is in the country and falling for Worthing''s young and beautiful ward, Cecily (Witherspoon) - while ''also'' impersonating Ernest! Pandemonium ensues when these two would-be Ernests find themselves face to face and in the predicament of explaining who they really are!', '', 'USD', '29.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(563, 563, 'United States', 1, 0, 0, '', '786936-203387', 252, 'Owned', 'Inspector Gadget 2', '', '', '', '2003', '2003-03-11', 88, 'Keep Case', 0, 'USD', '29.99', 'All the whiz-bang gizmos and cool high-tech gadgets are back in Walt Disney Pictures new live-action family comedy, INSPECTOR GADGET 2 -- premiering only on Disney DVD and Video! Is it possible? Just when things were quieting down in Riverton, Claw stages a daring escape from prison. But "wowser," our favorite stumbling Inspector Gadget has just been put on probation by Chief Quimby for some ultra-honest mistakes. Nonetheless, the chase is on as Claw has his hands full plotting a new "Crime of the Century" that''s pure gold, and the ever-political Mayor unveils G2 -- an all-robot, all-tech, all-girl, next generation of gadget policing. Could it get worse for our hero? What goes down next is the G-ticket of hair-raising, gadget-crazy mishaps, miscues, stakeouts, and showdowns as G1 and G2 try to go-go save the world with help from Brain, niece Penny, and the irrepressibly tricked-out Gadgetmobile!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(564, 564, 'United States', 1, 0, 0, '', '786936-204148', 189, 'Owned', 'Duplex', '', '', '', '2003', '2004-03-02', 89, 'Keep Case', 0, 'USD', '29.98', 'Hollywood favorites Ben Stiller and Drew Barrymore lead a star-studded cast in this darkly hilarious comedy where one wrong move turns out to be a monumental mistake! Young and vibrant New Yorkers Alex and Nancy have just found the perfect place to settle down and share a bright future. But their new home comes with a permanent fixture they didn''t expect; an obnoxious elderly tenant who won''t move out and refuses to die! Pushed to the edge of insanity as their dream home turns into a nightmare, it''s only a matter of time before Alex and Nancy begin to entertain some truly sinister solutions to their problem! Also featuring the ever-popular Harvey Fierstein, written by Larry Doyle and directed by Danny DeVito, Duplex is another laugh-packed crowd-pleaser you don''t want to miss!', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(565, 565, 'United States', 1, 0, 0, '', '786936-208030', 108, 'Owned', 'Sweet Home Alabama', '', '', '', '2002', '2003-02-04', 109, 'Keep Case', 0, 'USD', '29.98', 'This delightfully entertaining romantic comedy stars Reese Witherspoon (Legally Blonde) as sophisticated Melanie Carmichael, a rising New York clothing designer who suddenly finds herself engaged to the city''s most eligible bachelor. But this is no fairy tale romance for Melanie. She has skeletons in her fashion-filled closet that include Jake --- the backwoods husband she married in high school who refuses to divorce her. Determined to end their marriage and sever all ties with her past once and for all, Melanie returns to Alabama. But home starts to tug at her heartstrings, and what she thought she wanted may not be what she wants at all.', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(566, 566, 'United States', 1, 0, 0, '', '786936-209945', 133, 'Owned', 'Hope Springs', '', '', '', '2003', '2004-04-06', 92, 'Keep Case', 0, 'USD', '29.95', 'HOPE SPRINGS is the charming romantic comedy starring Colin Firth, Heather Graham, and Minnie Driver. When a British artist discovers that the love of his life and fiance, Vera, a sexy, sophisticated vixen, is marrying another man, he flees to America to the sleepy New England village of Hope to bury himself in his art and soothe his tortured psyche. Soon, he finds more than a shoulder to cry on when he meets Mandy, a beautiful free spirit who captures his heart -- until Vera suddenly shows up with the surprise of Colin''s life. HOPE SPRINGS is a delightful and engaging comedy about finding happiness when you least expect it.', '', 'USD', '29.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(567, 567, 'United States', 1, 0, 0, '', '786936-221794', 402, 'Owned', 'Santa Clause 2', 'Fullscreen', 'The Santa Clause 2', 'United States', '2002', '2003-11-18', 105, 'Keep Case', 0, 'USD', '29.99', 'Walt Disney Pictures presents an all-new comedy adventure overflowing with holiday cheer. Tim Allen reappears in ''Santa Clause 2'', the hilarious sequel to everybody''s holiday favorite. Scott Calvin (Allen) has been Santa Claus for the past eight years, and his loyal elves consider him the best one ever. But Scott''s got problems. His son Charlie has landed on this year''s "naughty" list, and if Scott doesn''t marry by Christmas Eve -- one very, very short month away -- he''ll stop being Santa forever. Embracing Christmas and the magic of family with heart, warmth, fun and charm, ''Santa Clause 2'' is classic holiday entertainment everybody will enjoy again and again.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(568, 568, 'United States', 1, 0, 0, '', '786936-224290', 371, 'Owned', 'Holes', 'Widescreen', '', 'United States', '2003', '2003-09-23', 111, 'Keep Case', 0, 'USD', '29.99', 'The award-winning best seller comes to life in this  phenomenally fun, adventure-filled movie, starring Emmy Award Shia LaBeouf (Disney Channel''s ''Even Stevens''). Dogged by bad luck stemming from an ancient family curse, young Stanley Yelnats (LeBeouf) is sent to Camp Green Lake, a very weird place that''s not green and dosen''t have a lake. Once there, he''s thrown headlong into the adventure of his life when he and his colorful campmates - Squid, Armpit, ZigZag, Magnet, X-Ray and zero - must dig a hole a day to keep the warden at bay/ But why? Through it all, Stanley and company must forge fast friendship as they try to unearth the mystery of what''s really going on in the middle of nowhere. Filled with humor and heartwarming messages of friendship and teamwork, ''Holes'' is a treasure everyone will dig.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(569, 569, 'United States', 1, 0, 0, '', '786936-224306', 570, 'Owned', 'Pirates of the Caribbean: The Curse of the Black Pearl', '2-Disc Collector''s Edition', '', 'United States', '2003', '2003-12-02', 143, 'Keep Case', 1, 'USD', '29.98', 'From producer Jerry Bruckheimer (''Pearl Harbor'') comes ''Pirates Of The Caribbean: The Curse Of The Black Pearl'', the thrilling, high-seas adventure with a mysterious twist. The roguish yet charming Captain Jack Sparrow''s (Johnny Depp) idyllic pirate life capsizes after his nemesis, the wily Captain Barbossa (Geoffrey Rush), steals his ship the ''Black Pearl'', and later attacks the town of Port Royal, kidnapping the governor''s beautiful daughter Elizabeth (Keira Knightley). In a gallant attempt to rescue her and recapture the ''Black Pearl'', Elizabeth''s childhood friend Will Turner (Orlando Bloom) joins forces with Jack. What Will doesn''t know is that a cursed treasure has doomed Barbossa and his crew to live forever as the undead. Rich in suspense-filled adventure, sword-clashing action, mystery, humor, unforgettable characters and never-before-seen special effects, ''Pirates'' is a must-have epic on the grandest scale ever.', '', 'USD', '29.98', '2006-02-03', '2016-11-15 00:00:00', NULL),
(570, 570, 'United States', 1, 0, 0, '', '786936-224719', 121, 'Owned', 'View from the Top', '', '', '', '2003', '2003-09-09', 87, 'Keep Case', 0, 'USD', '29.99', 'Academy Award-winning actress Gwyneth Paltrow (Shakespeare In Love, Best Actress, 1998; Shallow Hal) stars in this hilarious comedy hit about a small-town girl who''s about to get a taste of the big-time world! No one thought Donna (Paltrow) would go very far. But when she sets her sights on becoming a first-class international flight attendant, Donna throws caution to the wind and takes off in pursuit of her dream! The ride is anything but smooth, however, and Donna''s laugh-packed journey of a lifetime is rocked by more turbulence than she bargained for! Also starring Christina Applegate (TV''s Married With Children), Rob Lowe (Austin Powers trilogy, Tommy Boy), Kelly Preston (What A Girl Wants, Jerry Maguire) and Candice Bergen (Sweet Home Alabama, Miss Congeniality), this charmingly funny treat will send your spirits soaring!', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
