(572, 572, 'United States', 1, 0, 0, '', '786936-227956', 134, 'Owned', 'Chicago', '', '', '', '2002', '2003-08-19', 113, 'Keep Case', 0, 'USD', '29.99', 'Winner of six Academy Awards(R) (2002) including Best Picture and starring Renee Zellweger (Bridget Jones''s Diary), Best Supporting Actress winner Catherine Zeta-Jones (Traffic), Best Supporting Actress nominee Queen Latifah (Bringing Down The House) and Golden Globe winner Richard Gere (Unfaithful) - Chicago is a dazzling spectacle cheered by audiences and critics alike! At a time when crime of passion result in celebrity headlines, nightclub sensation Velma Kelly (Zeta-Jones), and spotlight-seeking Roxie Hart (Zellweger) both find themselves sharing space on Chicago''s famed Murderess Row! They also share Billy Flynn (Gere), the town''s slickest lawyer with a talent for turing notorious defendants into local legends. But in Chicago, there''s only room for one legend! Also starring John C. Reilly (Gangs Of New York) and Lucy Liu (Charlie''s Angels).', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
