(574, 574, 'United States', 1, 0, 0, '', '786936-238679', 175, 'Owned', 'Under the Tuscan Sun', '', '', '', '2003', '2004-02-03', 113, 'Keep Case', 0, 'USD', '29.98', 'From the studio who broght you ''Sweet Home Alabama'' comes the extraordinary romantic comedy starring Academy Award nominee Diane Lane. Based on the #1 New York Times best-selling book, ''Under the Tuscan Sun'' follows San Francisco writer Frances Mayes (Lane) to Italy as a good friend offers her a special gift - ten days in Tuscany.  Once there, she is captivated by its beauty and warmth, and impulsively buys an aging, but very charming villa. Fully embracing new friends and local color, she finds herself immersed in a life-changing adventure filled with enough unexpected surprises, laughter, friendship and romance to restore her new home - and her belief in second chances.', '', 'USD', '29.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(575, 575, 'United States', 1, 0, 0, '', '786936-242638', 593, 'Owned', 'Ladder 49', '', '', '', '2004', '2005-03-08', 115, 'Keep Case', 0, 'USD', '29.99', 'Academy Award-nominated stars Joaquin Phoenix (Best Supporting Actor, ''Gladiator'', 2000) and John Travolta (Best Actor, ''Pulp Fiction'', 1994) ignite the intense action in this heroic tale of ordinary men with uncommon courage! As part of a tightly knit brotherhood of skilled firefighters, Jack Morrison (Phoenix) grows from inexperienced rookie to seasoned veteran as he faces a dangerous job that makes him a hero to strangers but often shortchanges his wife (Jacinda Barrett - ''The Human Stain'') and kids. Then, when he becomes trapped in the worst blaze of his career, things Jack holds most important - family, duty, courage - come sharply into focus.', '', 'USD', '29.99', '2005-09-17', '2016-11-15 00:00:00', NULL),
(576, 576, 'United States', 1, 0, 0, '', '786936-242911', 82, 'Owned', 'National Treasure', '', '', '', '2004', '2005-05-03', 131, 'Keep Case', 0, 'USD', '29.99', 'From Jerry Bruckheimer, producer of ''Pirates Of The Caribbean'', and Jon Turteltaub, director of ''Phenomenon'', comes National Treasure.  It''s the thrilling, edge-of-your-seat adventure starring Academy Award winner Nicolas Cage as Benjamin Franklin Gates. Ever since he was a boy, Gates has been obsessed with finding the legendary Knights Templar Treasure, the greatest fortune known to man. As Gates tries to find and decipher ancient riddles that will lead him to it, he''s dogged by a ruthless enemy (Sean Bean, ''The Lord of the Rings'' trilogy) who wants the riches for himself. Now in a race against time, Gates must steal one of America''s most sacred and guarded documents - the Declaration of Independence - or let it, and a key clue to the mystery, fall into dangerous hands. Heart-pounding chases, close calls and the FBI turn Gates'' quest into a high-stakes crime caper and most exciting treasure hunt you''ve ever experienced.', '', 'USD', '29.99', '2008-01-26', '2016-11-15 00:00:00', NULL),
(577, 577, 'United States', 1, 0, 0, '', '786936-245660', 13, 'Owned', 'Jersey Girl', '', '', '', '2004', '2004-09-07', 102, 'Keep Case', 0, 'USD', '29.99', 'Hollywood favorites Ben Affleck (''Daredevil'', ''Paycheck'', ''The Sum of All Fears'') and Liv Tyler (''The Lord of the Rings'' trilogy, ''Armageddon'') shine in this heartwarming all-star comedy about a guy who think he''s lost it all, only to discover he''s got everything he needs! Ollie (Affleck) is a smooth successful big-city publicist who has the life he''s always wanted - until things take an unexpected turn and he finds himself an unemployed single father back living with his dad in the suburbs. But just when he thinks his life has hit rock bottom, a sexy, no-nonsense video store clerk (Tyler) enters his life and shows Ollie that sometimes you have to forget who you thought you were and acknowledge what really makes you happy. Also starring Jennifer Lopez (''Maid In Manhattan'') and Jason Biggs (''American Pie'') - director Kevin Smith (''Jay And Silent Bob Strike Back'') has delivered another hit critics are calling one of the year''s funniest!', '', 'USD', '29.99', '2006-01-11', '2016-11-15 00:00:00', NULL),
(578, 578, 'United States', 1, 0, 0, '', '786936-277975', 22, 'Owned', 'The Pacifier', 'Full Screen', '', '', '2005', '2005-06-28', 95, 'Keep Case', 0, 'USD', '29.95', 'Walt Disney Pictures presents action hero Vin Diesel (''XXX'', ''The Fast and the Furious'') in a fast-paced comedy form the director of Bringing Down the House! Lt. Shane Wolfe (Diesel) is a tough-as-nails Navy S.E.A.L. who has controlled military operations in every corner of the globe. Now the ultimate test comes when he''s assigned to protect the home front...as in a house loaded with five out-of-control kids! But even when he trades combat gear for diapers and juice boxes, it''s not just a babysitting job...it''s an adventure! Armed with hilarious laughs and tons of great bonus features, it''s the perfect DVD for the whole family to enjoy!', '', 'USD', '29.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(579, 579, 'United States', 1, 0, 0, '', '786936-283167', 8, 'Owned', 'Finding Neverland', '', '', '', '2004', '2005-03-22', 101, 'Keep Case', 0, 'USD', '29.95', 'Set in London in 1904, the film follows J.M. Barrie''s creative journey to bring Peter Pan to life, from his first inspiration for the story up until the play''s premiere at the Duke of York''s Theatre - a night that will change not only Barrie''s own life, but the lives of everyone close to him. David Magee''s screenplay is based on the play "The Man Who Was Peter Pan," written by Allen Knee.', '', 'USD', '29.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(580, 580, 'United States', 1, 0, 0, '', '786936-288339', 51, 'Owned', 'Sky High', '', '', '', '2005', '2005-11-29', 100, 'Keep Case', 0, 'USD', '21.98', 'It all begins at a secret school in the clouds like none on earth: Sky High, the first and only high school for kids with super-human powers going through crime-fighting puberty. At Sky High, the student body throw flames with their footballs, study Villainy with their Chemistry and are divided into Heroes and Sidekicks instead of jocks and geeks. It''s an out-of-this-world yet completely recognizable place where cool gadgetry, rampant bravery and awe-inspiring magical skills mix it up with parental battles, peer pressure and dating trouble--with explosively fun results. This year''s class features some of the best, brightest and most powerfully gifted super-teens ever assembled. And then there''s Will Stronghold. When you''re the son of the world''s most legendary super heroes, The Commander and Jetstream, people expect you to live up to the family name The problem is that Will is starting with no superpowers of his own and, worst of all, instead of joining the ranks of the Hero class, he finds himself relegated to being a Sidekick. Now he must somehow survive his freshman year while dealing with an overbearing gym coach, a bully with super speed and a dangerous rebel with a grudge (and the ability to shoot fire from his hands)--not to mention the usual angst, parental expectations and girl problems that accompany teenage life. But when an evil villain threatens his family, friends and the very sanctity of Sky High, Will must use his newfound superpowers to save the day and prove himself a Hero worthy of the family tradition.', '', 'USD', '21.98', '2006-01-11', '2016-11-15 00:00:00', NULL),
(581, 581, 'United States', 1, 0, 0, '', '786936-292916', 151, 'Owned', 'The Chronicles of Narnia: The Lion, The Witch and The Wardrobe', 'Full Screen', '', '', '2005', '2006-04-04', 135, 'Keep Case', 0, 'USD', '29.95', 'Prepare to enter aother world when Walt Disney Pictures and Walden Media present C.S.Lewis'' timeless and beloved adventure. With the stunningly realistic special effects, you''ll experience the exploits of Lucy, Edmund, Susan and Peter, four siblings who find the world of Narnia through a magical wardrobe while playing a game of "hide-and-seek" at the country estate of a mysterious professor. Once there, the children discover a charming, once peaceful land inhabited by talking beasts, dwarfs, fauns, centaurs and giants that has been turned into a world of eternal winter by the evil White Witch, Jadis. Aided by the wise and magnificent lion Aslan, the children lead Narnia into a spectacular, climactic battle to be free of the Witch''s glacial powers forever!', '', 'USD', '29.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(582, 582, 'United States', 1, 0, 0, '', '786936-292978', 265, 'Owned', 'Pirates of the Caribbean: Dead Man''s Chest', 'Widescreen', '', 'United States', '2006', '2006-12-05', 150, 'Keep Case', 0, 'USD', '29.99', 'Charming rogue pirate Captain Jack Sparrow (Johnny Depp) is back for a grand, swashbuckling, nonstop joyride filled with devilish pirate humor, monstrous sea creatures and breathtaking black magic. Now, Jack''s got a blood debt to pay - he owes his soul to the legendary Davy Jones, ghostly Ruler of the Ocean Depths...but ever-crafty Jack isn''t about to go down without a fight. Along the way, dashing Will Turner (Orlando Bloom) and the beautiful Elizabeth Swann (Keira Knightley) get caught up in the thrilling whirlpool of misadventures stirred up in Jack''s quest to avoid eternal damnation by seizing the fabled Dead Man''s Chest!', '', 'USD', '29.99', '2007-08-09', '2016-11-15 00:00:00', NULL),
