(585, 585, 'United States', 1, 0, 0, '', '786936-697285', 165, 'Owned', 'Everything You Want', '', '', '', '2005', '2006-04-25', 93, 'Keep Case', 0, 'USD', '19.99', 'If you liked "Sweet Home Alabama", you''ll love the delightful romantic comedy "Everything You Want", starring Shiri Appleby (TV''s Roswell) and Nick Zano (TV''s What I Like About You). Fort art student Abby (Appleby), campus life is perfectly swell, including her boyfriend Simon. He''s been Abby''s dream guy forever, but she''s about to get a wake-up call - Quinn, a fun-loving charmer who knows nothing about art until Abby reluctantly tutors him. And as his winsome personality starts winning her over, she finds herself in the middle of a love triangle. Who will she choose? Her oh-so perfect - but imaginary - boyfriend or this flesh-and-blood reality?', '', 'USD', '19.99', '2006-10-08', '2016-11-15 00:00:00', NULL),
(586, 586, 'United States', 0, 0, 0, 'Digital', '786936-705089', 1006, 'Owned', 'Apocalypto', '', '', 'United States', '2006', '2007-05-22', 138, 'Keep Case', 1, 'USD', '29.99', 'From Mel Gibson, director of <i>The Passion Of The Christ</i> and the Academy Award-winning <i>Braveheart</i> (Best Director, Best Picture, 1995) comes the thrilling historical epic <b>Apocalypto</b>. This intense, nonstop action-adventure transports you to an ancient Central American civilization, for an experience unlike anything you''ve ever known. In the twilight of the mysterious Mayan culture, young Jaguar Paw is captured and taken to the great Mayan city, where he faces a harrowing end. Driven by the power of his love for his wife and son, he makes an adrenaline-soaked, heart-racing escape to rescue them and ultimately save his way of life. Filled with unrelenting action and stunning cinematography, <b>Apocalypto</b> is an enthralling and unforgettable film experience.', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(587, 587, 'United States', 1, 0, 0, '', '786936-705270', 454, 'Owned', 'Dj Vu', '', '', 'United States', '2006', '2007-04-24', 126, 'Keep Case', 1, 'USD', '29.99', 'Academy Award winner Denzel Washington (Best Actor, ''Training Day'', 2001) joins forces with blockbuster producer Jerry Bruckheimer and mega-hit director Tony Scott for ''Dj Vu'' - the powerful, fast-paced action-thriller with a spectacular mind-bending twist. Called in to recover evidence in the aftermath of a horrific explosion on a New Orleans ferry, Federal agent Doug Carlin (Washington) gets pulled away from the scene and taken to a top-secret government lab that uses a time-shifting surveillance device to help prevent crime. But can it help Carlin change the past? Hold on to your seat for an explosive and intriguing thrill ride you''ll want to experience again and again.', '', 'USD', '29.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
