(589, 589, 'United States', 1, 0, 0, '', '786936-727012', 334, 'Owned', 'Santa Clause 3: The Escape Clause', '', 'The Santa Clause 3: The Escape Clause', 'United States', '2006', '2007-11-20', 92, 'Keep Case', 1, 'USD', '29.99', 'Tim Allen is back in the big red suit for more adventure and laughs in Disney''s hilarious family comedy. Get ready for a thrilling sleigh ride as the reluctant Santa Claus faces his most chilling and hysterical challenge yet. \n\nAs Christmas nears, Scott Calvin invites his in-laws (Ann-Margret and Alan Arkin) to join the festivities. The holidays take a chaotic turn when Scott discovers a way out of his "Santa Clause" and the mischievous Jack Frost (Martin Short) puts the big freeze on Christmas'' big cheese! Unless Scott can save the day, it''s going to be a very chilly Frostmas at the North Pole and all around the world. Will Scott be able to get his job back in the St. Nick of time? \n\nCelebrate the holidays with ''The Santa Clause 3: The Escape Clause'', complete with exclusive bonus materials, including a musical Christmas Carol-oke feature. It''s a gift the whole family will treasure.', '', 'USD', '29.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(590, 590, 'United States', 1, 0, 0, '', '786936-727531', 361, 'Owned', 'Primeval', '', '', 'United States', '2007', '2007-06-12', 94, 'Keep Case', 1, 'USD', '29.99', 'Inspired by the true story of a legendary 25-foot man-eating crocodile comes the intense, terrifying horror movie Primeval, starring Dominic Purcell (TV''s ''Prison Break'') and Orlando Jones (''Runaway Jury'', ''Evolution''). An American news crew, determined to capture this voracious monster and stop his demonic rampage, travel deep within the darkest reaches of the African jungle to hunt their prey. But Gustave, as the natives call him, is also on the hunt -- always on the move, always elusive, always hungry for human flesh. Heart-pounding fear is nonstop in this edge-of-your-seat nail-biter about the cunning killer who continues killer who continues to blaze his blood-soaked trail of terror.', '', 'USD', '29.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(591, 591, 'United States', 1, 0, 0, '', '786936-731927', 671, 'Owned', 'Becoming Jane', '', '', 'United Kingdom', '2007', '2008-02-12', 120, 'Keep Case', 1, 'USD', '29.99', 'Anne Hathaway (<i>The Devil Wears Prada</i>, <i>The Princess Diaries</i>) gives a radiant performance as a young, love-struck Jane Austen in the witty and engaging romantic comedy <b>Becoming Jane</b> from Miramax Films. It''s the untold romance that inspired the novels of one of the world''s most celebrated authors. When the dashing Tom Lefroy (James McAvoy, <i>The Last King Of Scotland</i>), a reckless and penniless lawyer-to-be, enters Jane''s life, he offends the emerging writer''s sense and sensibility. Soon their clashing egos set off sparks that ignite a passionate romance and fuel Jane''s dream of doing the unthinkable  marrying for love. <b>Becoming Jane</b> also starring the acclaimed Maggie Smith, James Cromwell and Julie Walters, is an enchanting and imaginative film you''ll fall head over heels for.', '', 'USD', '29.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(592, 592, 'United States', 0, 0, 0, 'Digital', '786936-734300', 1035, 'Owned', 'Underdog', '', '', 'United States', '2007', '2007-12-18', 82, 'Keep Case', 1, 'USD', '29.99', 'It''s a bird, it''s a plane, it''s a frog...no, it''s Disney''s <b><i>Underdog</b></i>  a flying, talking canine caped crusader! After an accident in the mysterious lab of mad scientist Dr. Simon Barsinister, an ordinary beagle named Shoeshine finds himself with extraordinary powers...and the ability to talk!  Armed with a fetching superhero costume, Underdog vows to protect the beleaguered citizens of Capital City and, in particular, a beautiful spaniel named Polly Purebred. When a diabolical plot by Barsinister and his overgrown henchman Cad threatens to destroy Capital City, only Underwear...(oops!)...Underdog can save the day.  Based on the original hit animated series <i>Underdog</i>  your family will love watching the next great hero take a big bite out of crime.', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(593, 593, 'United States', 1, 0, 0, '', '786936-735390', 608, 'Owned', 'National Treasure 2: Book of Secrets', '', 'National Treasure: Book of Secrets', 'United States', '2007', '2008-05-20', 125, 'Keep Case', 0, 'USD', '29.99', 'Join Nicolas Cage on a heart-pounding adventure that will have you on the edge of your seat in a race to find the Lost City of Gold. Grounded in history, imbued with myth and mystery, Disney''s <b>National Treasure: Book Of Secrets</b> takes you on a globe-trotting quest full of adrenaline-pumping twists and turns  all leading to the final clue in a mysterious and highly guarded book containing centuries of secrets. But there''s only one way to find it  Ben Gates must kidnap the President. Packed with fast-paced action and crackling humor, <b>National Treasure: Book Of Secrets</b> is a movie your entire family will want to rediscover again and again.', '', 'USD', '29.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(594, 594, 'United States', 1, 0, 0, '', '786936-746754', 603, 'Owned', 'No Country for Old Men', '', '', 'United States', '2007', '2008-03-11', 122, 'Keep Case', 1, 'USD', '29.99', 'Acclaimed filmmakers Joel and Ethan Coen deliver their most gripping and ambitious film yet in this sizzling and supercharged action-thriller. When a man stumbles on a bloody crime scene, a pickup truck loaded with heroin, and two million dollars in irresistible cash, his decision to take the money sets off an unstoppable chain reaction of violence. Not even west Texas law can contain it. Based on the novel by Pulitzer Prize-winning author Cormac McCarthy, and featuring an acclaimed cast led by Tommy Lee Jones, this gritty game of cat and mouse will take you to the edge of your seat and beyond - right up to its heart-stopping final moment.', '', 'USD', '29.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(595, 595, 'United States', 0, 0, 0, 'Digital', '794043-048210', 957, 'Owned', 'A Nightmare On Elm Street 3: Dream Warriors', '', '', 'United States', '1987', '1999-09-21', 97, 'Snapper', 0, 'USD', '19.99', 'Born the bastard son of a hundred maniacs, demented killer Freddy Krueger is back for fresh victims in this hallucinatory shocker co-written by original creator Wes Craven (Scream, Scream 2).\n\nThe last of the Elm Street kids are now at a psychiatric ward where Freddy haunts their dreams with unspeakable horrors. Their only hope is dream researcher and fellow survivor Nancy Thompson (Heather Langenkamp of the original Nightmare), who helps them battle the supernatural psycho on his own hellish turf.\n\nStarring Patricia Arquette (Ed Wood, True Romance) and Academy Award-nominee Laurence Fishburne (The Matrix, Hoodlum) and directed by Chuck Russell (The Mask, Eraser), "Dream Warriors is both a horrific and hysterical trip!" (L.A. Herald-Examiner).', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(596, 596, 'United States', 0, 0, 0, 'Digital', '794043-048227', 958, 'Owned', 'A Nightmare On Elm Street 4: The Dream Master', '', '', 'United States', '1988', '1999-09-21', 94, 'Snapper', 0, 'USD', '19.99', 'Proving there''s no rest for the wicked, the unspeakably evil Freddy Krueger (Robert Englund) is again resurrected from the grave to wreak havoc upon those who dare to dream. But this time, he faces a powerful new adversary!\n\nAs her friends succumb one by one to Freddy''s wrath, telepathically gifted Kristen embarks on a desparate mission to destroy the satanic dream stalker and release the tortured souls of his victims once and for all.\n\nDirected by Renny Harlin (''The Long Kiss Goodnight'', ''Cliffhanger'') and loaded with killer effects and drop-dead humor, this is a "superior horror picture that balances wit and gore with imagination and intelligence" (''Los Angeles Times'').', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(597, 597, 'United States', 0, 0, 0, 'Digital', '794043-048234', 959, 'Owned', 'A Nightmare On Elm Street 5: The Dream Child', '', '', 'United States', '1989', '1999-09-21', 90, 'Snapper', 0, 'USD', '19.99', 'Freddy Krueger returns to deliver a whole new breed of terror in his most fiendishly perverse frightfest yet!\n\nUnable to overpower the Dream Master who vanquished him in ''A Nightmare on Elm Street 4'', Freddy (Robert Englund) haunts the innocent dreams of her unborn child and preys upon her friends with sheer horror. Will the child be saved from becoming Freddy''s newest weapon or will the maniac again resurrect his legacy of evil?\n\nFor this eye-popping installment, director Stephen Hopkins (''Lost in Space'', ''Predator 2'') enlisted make-up wizard David Miller (''The Terminator''), original creator of Freddy''s hideous visage. The result: a face not even a mother could love, and terror beyond your wildest nightmares!', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(598, 598, 'United States', 1, 0, 0, '', '794043-101762', 128, 'Owned', 'Just Friends', '', '', '', '2005', '2006-03-07', 94, 'Keep Case', 0, 'USD', '28.95', 'In high school, Chris Brander (Ryan Reynolds) was a shy, overweight teen with a crush on the beautiful Jamie Palamino (Amy Smart). Unfortunately, Jamie thought of the good-natured Chris as "just a friend." Fast forward ten years, Chris is a suave, fit and successful music executive visiting home and looking for a little payback. Love has other plans for him, though, as he attempts to once again woo Jamie, all the while trying to distract the ditzy, pop-diva client (Anna Faris) he has in tow and a rival suitor (Chris Klein). Soon enough, Chris finds that romancing Jamie has not gotten any easier in this outrageous comedy of errors!', '', 'USD', '28.95', '2006-06-19', '2016-11-15 00:00:00', NULL),
(599, 599, 'United States', 1, 0, 0, '', '794043-103599', 409, 'Owned', 'Hoot', 'New Line Platinum Series', '', 'United States', '2006', '2006-08-15', 91, 'Keep Case', 0, 'USD', '27.95', 'New Line Home Entertainment (''Elf'') and Walden Media (''Holes'' and ''Because of Winn-Dixie'') bring you the family adventure HOOT. When the new kid in town discovers that a local population of burrowing owls are about to have their home destroyed, he teams up with the resident outcast and the school''s offbeat tomboy to take on the town to save the endangered owls. Packed with surprising twists, memorable characters and upbeat humor, HOOT features new music and a special cameo performance from Jimmy Buffett.', '', 'USD', '27.95', '2007-08-09', '2016-11-15 00:00:00', NULL),
(600, 600, 'United States', 0, 0, 0, 'Digital', '794043-103735', 965, 'Owned', 'Final Destination 3', '2 Disc Thrill Ride Edition', '', '', '2005', '2006-07-25', 93, 'Keep Case', 0, 'USD', '29.93', 'Strap yourself in for ''Final Destination 3.'' The most terrifying thrill ride ever! After Wendy and her friends survive a deadly roller coaster ride, they start being killed in even more grousome ways. Wendy realizes the nightmare isn''t over.... Death has returned to finish the job. But can she convine the rest of her friends before it''s to late?', '', 'USD', '29.93', '2009-10-14', '2016-11-15 00:00:00', NULL),
(601, 601, 'United States', 0, 0, 0, 'Digital', '794043-104190', 955, 'Owned', 'A Nightmare on Elm Street', 'Infinifilm', '', 'United States', '1984', '2006-09-26', 91, 'Keep Case', 1, 'USD', '26.99', 'Dig your claws into the chilling masterpiece that spawned the greatest horror franchise in film history -- now remastered and featuring hours of new infinifilm extras. Starring Robert Englund as infamous horror icon Freddy Krueger, this "insomnia-inducing" (Kirk Ellis, <i>The Hollywood Reporter</i>) original from Wes Craven "goes straight to the heart of terror" (Jim Emerson, <i>Seattle Times</i>). \n\nWhen her best friend Tina is brutally murdered, teenager Nancy (Heather Langenkamp) suspects the killer isn''t Tina''s boyfriend but rather a much more horrifying figure from her dreams. Convinced that this vicious murderer is stalking her friends and killing them as they sleep, Nancy enters a desperate race against time to bring him out of her dream world and stop the bloodbath... before she falls asleep and becomes his next victim!', '', 'USD', '26.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(602, 602, 'United States', 1, 0, 0, '', '794043-105531', 75, 'Owned', 'How To Eat Fried Worms', 'New Line Platinum Series', '', 'United States', '2006', '2006-12-12', 84, 'Keep Case', 0, 'USD', '19.99', 'On his first day at a new school, eleven-year-old Billy goes up against the school bully in a challenge that ends up with a total gross-out date... to eat 10 worms in one day! And you thought Brussels sprouts tasted bad! Now Billy has to rise to the challenge because there''s no way he''s going to wiggle out of this one. Based on the best-selling book, this "totally fun movie" (Jane Horowitz, "The Washington Post", "The Family Filmgoer") is a feast for the whole family.', '', 'USD', '19.99', '2008-01-16', '2016-11-15 00:00:00', NULL),
(603, 603, 'United States', 1, 0, 0, '', '794043-121449', 666, 'Owned', 'Semi-Pro', '', '', '', '2008', '2008-06-03', 91, 'Keep Case', 1, 'USD', '28.98', 'Will Ferrell (<i>Blades of Glory</i>), Woody Harrelson (<i>No Country For Old Men</i>) and Andre Benjamin (<i>Four Brothers</i>) star in this hilarious three-pointer of sports action, outrageous laughs and ''70s groove!\n\nIt''s 1976 and the only thing sexier than Jackie Moon (Ferrell) is his incredible career. The owner, head coach and star player of the Flint Tropics  not to mention the smooth vocals behind the hit single "Love Me Sexy"  is at the top of his game. But when it appears the Tropics might not survive an NBA merger, Jackie vows to turn up the heat and lead his team to glory in the most hysterical comedy ever to put the funk back in the dunk!', '', 'USD', '28.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(604, 604, 'United States', 0, 0, 0, 'Digital', '794043-123238', 1019, 'Owned', 'He''s Just Not That Into You', '', '', 'United States', '2009', '2009-06-02', 129, 'Keep Case', 0, 'USD', '28.98', 'Remember that really cute guy who said he''d call...and didn''t? Maybe he lost your number. Maybe he''s in the hospital. Maybe he''s awed by your beauty, brains or success. Or maybe <i>He''s Just Not That into You</i>. An all-star cast  Ben Aleck, Jennifer Aniston, Drew Barrymore, Jennifer Connelly, Kevin Connolly, Bradley Cooper, Ginnifer Goodwin, Scarlett Johansson and Justin Long  looks for love and finds laughs in this savvy, sexy, right-now romcom. Based on the runaway (like some guys you know) bestseller by Sex and the City series writers Greg Behrendt and Liz Tuccillo, <i>He''s Just Not That into You</i> sparkles with zingy <i>aha</i> moments any survivor of the dating wars will recognize. See it with someone you''d like to love.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(605, 605, 'United States', 0, 0, 0, 'Digital', '794043-124198', 929, 'Owned', 'Journey to the Center of the Earth', '', '', 'United States', '2008', '2008-10-28', 92, 'Keep Case', 0, 'USD', '28.98', 'Brendan Fraser stars in this action-packed adventure based on the Jules Verne classic that is sure to deliver fun for the whole family! On a hunch to find the center of the Earth, Trevor Anderson (Fraser), his nephew and their tour guide make a breakthrough discovery that launches them on a thrilling journey into the unknown. On a scramble to find their way back, the group travels through a never-before-seen world, encountering creatures and objects never imagined.', '', 'USD', '28.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(606, 606, 'United States', 1, 0, 0, '', '794043-127816', 691, 'Owned', 'Appaloosa', '', '', 'United States', '2008', '2009-01-13', 115, 'Keep Case', 0, 'USD', '28.98', 'In marshal Virgil Cole and deputy Everett Hitch''s line of work, you shoot quick, you shoot clean and you reload straightaway. No feelings. Feelings get you killed. \n\nPaired as rivals in <i>A History Of Violence</i>, Ed Harris (who also directs, produces and co-scripts) and Viggo Mortensen stand together as friends and for-hire peacekeepers Cole and Hitch in a character-driven, bullet-hard Western based on Robert b. Parker''s novel. As the woman who arrives in town with only a dollar and a keen sense of survival, Renee Zellweger adds feelings - things that can get you killed - to a quest to bring murderer Randall Bragg (Jeremy Irons) to justice. Blood will spill in the town called <i>Appaloosa</i>.', '', 'USD', '28.98', '2009-10-15', '2016-11-15 00:00:00', NULL),
(607, 607, 'United States', 1, 0, 0, '', '794043-457722', 586, 'Owned', 'Austin Powers: International Man of Mystery', '', '', 'United States', '1997', '1997-10-21', 89, 'Snapper', 0, 'USD', '24.98', 'It''s a smashing shagadelic party as Mike Myers (''Wayne''s World 1 & 2'', ''So I Married an Axe Murderer'') and Elizabeth Hurley (''Dangerous Ground'') star in this non-stop, hilarious comedy-adventure.\n\nFrozen in the 60''s, secret agent Austin Powers (Myers) is thawed back into action once again to battle his arch-enemy Dr. Evil.  With his sexy sidekick Ms. Kensington (Hurley), Austin must stop Dr. Evil''s outrageous plot to control the world.  But first, this time-warped swinger must get hip quick and discover that there''s no free love in the 90''s!', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(608, 608, 'United States', 1, 0, 0, '', '794043-466021', 125, 'Owned', 'The Wedding Singer', '', '', '', '1998', '1998-08-25', 97, 'Snapper', 0, 'USD', '24.98', 'You are cordially invited to fall in love with one of the funniest romantic comedies of the year! It''s 1985 and Robbie Hart (Adam Sandler, Happy Gilmore, Billy Madison) is the ultimate master of ceremonies...until he is left at the altar at his own wedding. Devastated, he becomes a newlywed''s worst nightmare - an entertainer who can do nothing but destroy other people''s weddings. It''s not until he meets a warm-hearted waitress named Julia (Drew Barrymore, Scream) that he starts to pick up the pieces of his heart. The only problem is Julia''s about to have a wedding of her own and unless Robbie can pull off the performance of a lifetime, the girl of his dreams will be gone forever.\n\nFrom big hair to Billy Idol (as himself), The Wedding Singer features a hilarious cast and a platinum soundtrack including 80''s hits from CULTURE CLUB, DAVID BOWIE and THE POLICE.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(609, 609, 'United States', 1, 0, 0, '', '794043-472824', 609, 'Owned', 'Pleasantville', 'New Line Platinum Series', '', 'United States', '1998', '1999-03-23', 124, 'Snapper', 0, 'USD', '24.98', 'When ''90''s teens David and Jennifer (Tobey Maguire, ''The Ice Storm'', Reese Witherspoon, ''Freeway'') get zapped into the perfect suburbia of the black & white ''50''s sitcom, ''Pleasantville'', what results is a "visionary adventure" (Peter Travers, ''Rolling Stone'') that Siskel and Ebert give "Two big thumbs up!"\n\nPleasantville''s perfect people include a mild-mannered soda jerk (Jeff Daniels, ''Dumb and Dumber''), a socially repressed mom (Joan Allen, ''Face/Off'') and a father who always knows best (William H. Macy, ''Fargo''). But, when ''90''s pop culture clashes with ''50''s familty values, chaos ensues, turning the town of Pleasantville upside down and black and white into color.', '', 'USD', '24.98', '2008-05-27', '2016-11-15 00:00:00', NULL);
INSERT INTO `details` (`id`, `film_id`, `locality`, `media_dvd`, `media_hddvd`, `media_bluray`, `media_custom`, `upc`, `collectionnumber`, `collectiontype`, `title`, `disttrait`, `originaltitle`, `origin`, `prodyear`, `released`, `runningtime`, `casetype`, `slipcover`, `srpid`, `srp`, `overview`, `easteregg`, `purchcurrencyid`, `purchprice`, `purchdate`, `created_at`, `updated_at`) VALUES
(610, 610, 'United States', 1, 0, 0, '', '794043-475122', 25, 'Owned', 'Blast from the Past', '', '', '', '1999', '1999-07-27', 112, 'Snapper', 0, 'USD', '19.98', 'Meet Adam Webber (Brendan Fraser, The Mummy, George of the Jungle), born and raised in a bomb shelter with his mad scientist father (Christopher Walken, Pulp Fiction) and his sherry swilling mother (Sissy Spacek, JFK).  Adam''s simple childhood has been filled with Perry Como records, The Honeymooners re-runs and good old-fashioned family values.  Now, 35 years later, Adam is about to emerge into a bewildering modern world in search of supplies and a simple girl from Pasadena.  Instead, Adam meets Eve (Alicia Silverstone, Clueless) a modern LA woman, jaded about life and burned by love.  The result is "an engaging romantic comedy that''s charming, funny and hip!"', '', 'USD', '19.98', '2005-02-27', '2016-11-15 00:00:00', NULL),
(611, 611, 'United States', 1, 0, 0, '', '794043-478529', 106, 'Owned', 'In Love and War', '', '', '', '1997', '1999-07-27', 113, 'Snapper', 0, 'USD', '24.98', 'Caught in the crossfire of a world at war, love was the last thing on their minds. But for a beautiful nurse and a heroic young soldier in search of adventure, romance blossomed and changed their lives forever.\n\nSandra Bullock (''Two Weeks Notice'', ''Miss Congeniality'') and Chris O''Donnell (''Batman Forever'', ''The Bachelor'') star in Academy Award-winner Richard Attenborough''s epic love story about Ernest Hemingway and the romance which inspired him to write his masterpiece ''A Farewell To Arms''. A story of desperate love and imminent danger, it chronicles the relationship between the 18-year-old Hemingway and Agnes von Kurowsky, the medical aide who nursed him back to health after a devastating battlefield injury.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(612, 612, 'United States', 1, 0, 0, '', '794043-489129', 586, 'Owned', 'Austin Powers: The Spy Who Shagged Me', 'New Line Platinum Series', '', 'United States', '1999', '1999-11-16', 95, 'Snapper', 0, 'USD', '24.98', 'First he fought for the Crown, now he''s fighting for the family jewels! Mike Myers (<i>Austin Powers: International Man of Mystery</i>) returns as the world''s grooviest superspy in his latest comedy-adventure!\n\nIntent on world domination, diabolical genius Dr. Evil travels back to 1969 and steals Austin''s "mojo". Now Austin must return to the Swingin'' Sixties, recover his mojo and stop his terminally square arch nemesis from liquidating the world. Together with fab CIA superchick Felicity Shagwell (Heather Graham, <i>Lost In Space</i>, <i>Bowfinger</i>), Austin faces off against an army of outrageous villains including a heinous henchman of tremendous girth and Mini-Me, Dr. Evil''s deranged 1/8-sized clone.', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(613, 613, 'United States', 1, 0, 0, '', '794043-499425', 90, 'Owned', 'The Bachelor', '', '', '', '1999', '2000-04-18', 102, 'Snapper', 0, 'USD', '24.98', 'Faced with the choice of getting married within 24 hours or losing a $100 million inheritance, unrepentant bachelor Jimmie Shannon is suddely desperate to get to the altar. The problem is, his adorable and independent girlfriend, Anne, has seen through his act and won''t touch him with a ten-foot pole. With the priest waiting in the wings and the minutes counting down, it ma take 1000 brides to help Jimmie discover the true meaning of love in the timeless romantic comedy critics call "...highly inventive, wildy funny..."', '', 'USD', '24.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(614, 614, 'United States', 0, 0, 0, 'Digital', '794043-506123', 963, 'Owned', 'Final Destination', 'New Line Platinum Series', '', 'United States', '2000', '2000-09-26', 98, 'Snapper', 0, 'USD', '24.98', 'His entire high-school class is going to Paris, but Alex Browning (Devon Sawa, <i>Idle Hands</i>) can''t seem to shake his fear of flying. Once aboard the plane, he has a violently disruptive premonition which he and five of his classmates including Clear Rivers (Ali Larter, <i>Varsity Blues</i>, <i>House On Haunted Hill</i>) and Carter Horton (Kerr Smith, TV''s "Dawson''s Creek") kicked off the plane. As the students watch the plane depart, they witness the horrifying disaster that proves the deadly premonition true. Now having dodged death once, the terror begins in full as fate hunts them down one-by-one. Soon the five survivors will discover you can''t cheat death in this bone-chillingly-suspenseful film that critics call "A first class edge of your seat thriller!"**\n\n-**<i>Paul Wunder, WBAI', '', 'USD', '24.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(615, 615, 'United States', 1, 0, 0, '', '794043-532726', 201, 'Owned', 'Ever After', '', '', '', '1998', '1999-03-02', 121, 'Keep Case', 0, 'USD', '19.98', 'Once upon a time...\n\n"A dazzling rendering of the Cinderella story," --The Washington Post, brought new life to an age-old legend and made us believe in the strongest magic of all: the power of the human heart. Drew Barrymore and Anjelica Huston star in this enchanting adventure about having the courage to make your dreams come true.\n\nA "modern" young woman of the 16th century, Danielle (Barrymore) is as independent and wise as she is beautiful and kind. Against remarkable odds, she stands up to her scheming stepmother (Huston) and works miracles on the lives of everyone around her, including the crown prince of France (Scott)!\n\nNow you can relive this captivating retelling of the classic fairy tale. No matter what you''re looking for, "action, romance adventure... ''Ever After'' delivers it all!" --ABC-TV.', '', 'USD', '19.98', '2006-10-08', '2016-11-15 00:00:00', NULL),
(616, 616, 'United States', 1, 0, 0, '', '794043-561122', 425, 'Owned', 'The Lord of the Rings: The Fellowship of the Ring: D2', 'Collector''s DVD Gift Set', '', '', '2001', '2002-11-12', 208, 'Custom', 0, 'USD', '79.98', 'Based on J.R.R. Tolkien''s masterpiece, The Lord of the Rings: The Fellowship of the Ring is an epic adventure of good against evil, the power of friendship and individual courage. The saga centers around an unassuming Hobbit named Frodo Baggins who inherits a Ring that would give a dark and powerful lord the power to enslave the world. With a loyal fellowship of elves, dwarves, men and a wizard, Frodo embarks on a heroic quest to destroy the One Ring and pave the way for the emergence of mankind.', '', 'USD', '79.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(617, 617, 'United States', 1, 0, 0, '', '794043-566424', 424, 'Owned', 'The Lord of the Rings: The Fellowship of the Ring', '', '', '', '2001', '2002-08-06', 178, 'Keep Case', 0, 'USD', '29.95', 'Based on J.R.R. Tolkien''s masterpiece, The Lord of the Rings: The Fellowship of the Ring is an epic adventure of good against evil, the power of friendship and individual courage. The saga centers around an unassuming Hobbit named Frodo Baggins who inherits a Ring that would give a dark and powerful lord the power to enslave the world. With a loyal fellowship of elves, dwarves, men and a wizard, Frodo embarks on a heroic quest to destroy the One Ring and pave the way for the emergence of mankind.\n\n2-Disc Set - 3 in-depth programs that reveal the secrets behind the production of this epic adventure, including: "Welcome To Middle-earth", "The Quest For The Ring", "A Passage To Middle-earth"; 15 featurettes originally created for lordoftherings.net, which explore the locales and cultures of Middle-earth and include interviews with cast members Elijah Wood, Ian McKellen, Viggo Mortensen, Liv Tyler and others. Exclusive 10-minute behind-the-scenes preview of the next "Lord Of The Rings" theatrical release, "The Two Towers"; Enya "May It Be" music video; An inside look at the Special Extended DVD Edition of "The Lord Of The Rings: The Fellowship Of The Ring"; "The Two Towers" video game preview; Original theatrical trailers.', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(618, 618, 'United States', 1, 0, 0, '', '794043-602825', 587, 'Owned', 'Austin Powers in Goldmember', 'Inifinifilm', '', 'United States', '2002', '2002-12-03', 94, 'Keep Case', 0, 'USD', '26.98', 'He''s found his mojo, baby, and now Austin Powers (Mike Myers, <i>Shrek</i>) strikes gold in his newest 24-karat shagadelic comedy-adventure!\n\nThe "sshhh!" hits the fan when Dr. Evil and Mini-Me escape from prison. Joining forces with the superfreaky Goldmember, they kidnap Austin''s father, master spy Nigel Powers (Oscar winner Michael Caine*), in a dastardly time-travel scheme to take over the world. Before you can say "Shake Your Booty," Austin cruises to 1975 and teams up with sexy Foxxy Cleopatra (Beyonce Knowles, R&B Group Destiny''s Child) to stop Dr. Evil and Goldmember from their mischievous mayhem.\n\n*Michael Caine, 1999 Best Supporting Actor, <i>The Cider House Rules</i>.', '', 'USD', '26.98', '2005-02-28', '2016-11-15 00:00:00', NULL),
(619, 619, 'United States', 1, 0, 0, '', '794043-651021', 427, 'Owned', 'The Lord of the Rings: The Two Towers', 'Collector''s DVD Gift Set', '', 'New Zealand', '2002', '2003-11-18', 214, 'Custom', 0, 'USD', '79.92', 'The Fellowship has broken, but the quest to destroy the One Ring continues.  Frodo and Sam must entrust their lives to Gollum if they are to find their way to Mordor.  As Saruman''s army approaches, the surviving members of The Fellowship, along with people and creatures from Middle-Earth, prepare for battle.  The War of the Ring has begun.  Nominated for six Academy Awards including Best Picture.', '', 'USD', '79.92', '2005-02-28', '2016-11-15 00:00:00', NULL),
(620, 620, 'United States', 1, 0, 0, '', '794043-693328', 426, 'Owned', 'The Lord of the Rings: The Return of the King', 'Collector''s DVD Gift Set', '', 'New Zealand', '2003', '2004-12-14', 250, 'Slip Case', 0, 'USD', '79.92', 'The final battle for Middle-earth begins. Frodo and Sam, led by Gollum, continue their dangerous mission toward the fires of Mount Doom in order to destroy the One Ring. Aragorn struggles to fulfill his legacy as he leads his outnumbered followers against the growing power of the Dark Lord Sauron, so that the Ring-bearer may complete his quest.', '', 'USD', '79.92', '2005-02-28', '2016-11-15 00:00:00', NULL),
(621, 621, 'United States', 1, 0, 0, '', '794043-696121', 428, 'Owned', 'The Lord of the Rings: The Two Towers: D2', 'Special Extended Edition', '', '', '2002', '2003-11-18', 222, 'Digipak', 0, 'USD', '39.99', 'Frodo Baggins and The Fellowship continue their quest to destroy The One Ring and stand against the evil of the dark lord Sauron.\n\nThe Fellowship has divided and now find themselves taking different paths to defeating Sauron and his allies. Their destinies now lie at two towers - Orthanc Tower in Isengard, where the corrupted wizard Saruman waits and Sauron''s fortress at Baraddur, deep within the dark lands of Mordor.', '', 'USD', '39.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(622, 622, 'United States', 1, 0, 0, '', '794043-749728', 315, 'Owned', 'The Notebook', '', '', 'United States', '2004', '2005-02-08', 124, 'Keep Case', 0, 'USD', '27.95', 'Behind every great love is a great story.\n\nAs teenagers, Allie (Rachel McAdams) and Noah (Ryan Gosling) begin a whirlwind courtship that soon blossoms into tender intimacy. The young couple is quickly separated by Allie''s upper-class parents who insist that Noah isn''t right for her. Several years pass, and, when they meet again, their passion is rekindled, forcing Allie to choose between her soulmate and class order. This beautiful tale has a particularly special meaning to an older gentleman (James Garner) who regularly reads the timeless love story to his aging companion (Gena Rowlands).\n\nBased on the best-selling novel by Nicholas Sparks, ''The Notebook'' is at once heartwarming and heartbreaking and will capture you in its sweeping and emotional force.', '', 'USD', '27.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(623, 623, 'United States', 1, 0, 0, '', '794043-756528', 253, 'Owned', 'Elf', 'Infinifilm', '', '', '2003', '2004-11-16', 95, 'Keep Case', 0, 'USD', '29.95', 'One Christmas Eve long ago, a small orphan baby crawled into Santa''s bag of gifts and was carried off to the North Pole. Named Buddy(Will Ferrell) and raised by Papa Elf (Bob Newhart), it soon became clear that he didn''t fit in as he was much bigger than all the other elves. Determined to find a place where he truly belongs Buddy sets out to find his real Dad-in Mew York City!\n\nBuddy soon discovers that the big city is no place for an elf and his Dad (James Caan) is on the naughty list! But most importantly, he find that the world is seriously lacking in Christmas spirit causing Santa all kinds of problems!\n\nSo with the help of a beautiful department store elf (Zooey Deschanel), Buddy tries to teach his Dad and the world the true meaning of Christmas spirit and to prove to everyone that Santa (Ed Asner) really exists!', '', 'USD', '29.95', '2005-02-28', '2016-11-15 00:00:00', NULL),
(624, 624, 'United States', 1, 0, 0, '', '794043-810527', 50, 'Owned', 'Son of the Mask', 'Platinum Series', '', 'United States', '2005', '2005-05-17', 86, 'Keep Case', 0, 'USD', '27.95', 'More mischief...more mayhem...more magic!  The Mask is back.  A decade after wreaking havoc in Edge City, the legendary Mask of Loki finds its way into the hands of cartoonist Tim Avery (Jamie Kennedy), whose new son is born with the Mask''s spectacular powers.  The newborn boy an d the family''s jealous dog engage in a boy versus bowser battle royale for control of the Mask that turns the household upside down.  But the really BIG trouble begins when Loki himself (Alan Cumming), the god of mischief, comes looking for his Mask and he''s willing to do whatever it takes to get it back.  Co-starring Traylor Howard and Bob Hoskins.', '', 'USD', '27.95', '2008-01-17', '2016-11-15 00:00:00', NULL),
(625, 625, 'United States', 1, 0, 0, '', '794043-848025', 144, 'Owned', 'Wedding Crashers', 'Uncorked Edition: Full Screen', '', '', '2005', '2006-01-03', 128, 'Keep Case', 0, 'USD', '29.99', 'Guided by a set of "wedding crashing rules," John Beckwith (Owen Wilson) and Jeremy Grey (Vince Vaughn) can charm their way into any wedding...and into the hearts of every bridesmaid. But at the biggest nuptials of the year, John breaks the rules and falls for the daughter (Rachel McAdams) of the US Secretary of Treasury (Christopher Walken), and Jeremy is left at the mercy of her "stage-five-clinger" sister (Isla Fisher). Being there for his buddy, Jeremy follows John to the family''s huge estate for a weekend that may even be too wild for these professional party guys.', '', 'USD', '29.99', '2006-06-19', '2016-11-15 00:00:00', NULL),
(626, 626, 'United States', 1, 0, 0, '', '796019-791199', 91, 'Owned', 'Hoodwinked', 'Full-Screen Edition', '', '', '2005', '2006-04-28', 81, 'Keep Case', 0, 'USD', '29.98', 'So you think you know the story of Little Red Riding Hood.\nDon''t be to sure...One of your favorite fairy tales is turned upside-down and inside-out in what the L.A.Times called "high-energy, imaginative entertainment." Whit irreverent storytelling, spunk and wit, Hoodwinked delivers a comedy caper for the young, the young at heart and everyone in between. When the police arrive at Granny''s cottage in the woods to answer a domestic disturbance call, it looks like just another open-and-shut case. But Red, Granny, the Big Bad Wolf and the woodsman are not your usual suspects, as they have their own dark secrets, wily deceptions and conflicting accounts of the crime. Together, they must put aside their differences and find their own original twist on Happily Ever After in this "raucous, genre-busting, animated gem(Entertainment Weekly, The Must List."', '', 'USD', '29.98', '2006-06-19', '2016-11-15 00:00:00', NULL),
(627, 627, 'United States', 1, 0, 0, '', '796019-791694', 373, 'Owned', 'Doogal', '', '', 'United States', '2005', '2006-05-16', 77, 'Keep Case', 0, 'USD', '28.95', 'Meet Doogal, an adorable candy-loving mutt on a mission to save the world. In this delightful 3D computer animated adventure, Doogal must prevent the evil sorcerer Zeebad (Jon Stewart) from freezing the earth forever. Joining Doogal (Daniel Tay) on his quest are pals Dylan (Jimmy Fallon), a guitar-playing rabbit, Ermintrude (Whoopi Goldberg), an opera singing cow, and Brian (William H. Macy), a bashful snail. Along the way, they learn that the most powerful weapon of all is their friendship-which even Zeebad''s magic cannot destroy.', '', 'USD', '28.95', '2006-10-08', '2016-11-15 00:00:00', NULL),
(628, 628, 'United States', 1, 0, 0, '', '796019-794657', 665, 'Owned', 'Scary Movie 4', 'Unrated & Uncensored: Widescreen Edition', '', 'United States', '2006', '2006-08-15', 89, 'Keep Case', 1, 'USD', '29.95', 'The <i>Scary Movie</i> gang is back for their funniest, most fearless installment yet, featuring an avalanche of hysterical celebrity cameos, including Carmen Electra, Charlie Sheen, Dr. Phil, Shaquille O''Neal, and Lil'' John, plus many more fun surprises! This time, the lovable, dim-witted Cindy (Anna Faris) and her overheated pal Brenda (Regina Hall) return to help clueless hero Tom (Craig Bierko) save the world from a ruthless alien invasion. In true <i>Scary Movie</i> tradition, the story weaves through a series of hilarious and twisted parodies of movies like<i> War of the Worlds</i>, <i>The Grudge</i>, <i>The Village</i>, and <i>Saw</i>. In <i>Scary Movie 4</i>, nothing  and we mean NOTHING  is off limits!', '', 'USD', '29.95', '2009-09-27', '2016-11-15 00:00:00', NULL),
(629, 629, 'United States', 0, 0, 0, 'Digital', '796019-795951', 976, 'Owned', 'Pulse', 'Unrated: Widescreen Edition', '', 'United States', '2006', '2006-12-05', 88, 'Keep Case', 0, 'USD', '29.95', 'The year''s most original horror film, <i>Pulse</i> takes fear into new territory - the very devices we trust to get us through the day. When the dead discover a means to contact the living through electronic devices, cellphones and computers become open gateways to monstrosities and destruction. Starring Kristen Bell (<i>Veronica Mars</i>), Christina Milian (<i>Love Don''t Cost a Thing</i>), Ian Somerhalder (<i>Lost</i>) and Rick Gonzalez (<i>Coach Carter</i>), <i>Pulse</i> is loaded with terrifying thrills and gruesome special effects, and capped with an astonishing surprise ending.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(630, 630, 'United States', 0, 0, 0, 'Digital', '796019-804967', 966, 'Owned', 'Grindhouse Presents "Death Proof"', 'Limited Edition', 'Thunder Bolt', 'United States', '2007', '2007-09-18', 113, 'SteelBook', 0, 'USD', '29.99', '<i>DIRECTOR QUENTIN TARANTINO DELIVERS</i> an adrenaline shot to the heart with <i>Death Proof</i>, a "tribute to balls-out pedal-to-the-metal car chases" (Pete Hammond, <i>Maxim</i>). Featuring exhilarating high-speed action, jaw-dropping stunts, and some of the most quotable lines since <i>Pulp Fiction</i>, <i>Death Proof </i>"goes faster, and funnier, than you thought possible...and then it goes further" (Ty Burr, <i>Boston Globe</i>). Kurt Russell stars as a sociopathic stuntman whose taste for stalking sexy young ladies gets him into big trouble when he tangles with the wrong gang of badass babes. Their confrontation escalates into a hair-raising, 18-minute automotive duel with one of the girls strapped to the hood of a thundering Dodge Challenger that "earns a place of honor among the great movie car chases" (Scott Foundas, <i>LA Weekly</i>).', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(631, 631, 'United States', 1, 0, 0, '', '796019-805322', 645, 'Owned', '1408', 'Widescreen', '', 'United States', '2007', '2007-10-02', 104, 'Keep Case', 0, 'USD', '29.95', 'Based on a story by suspense master Stephen King, 1408 is a gripping "roller-coaster of a head trip" (Owen Gleiberman, Entertainment Weekly) that will have you on the edge of your seat. John Cusack delivers "a tour de force performance" (Stephen Farber, Hollywood Reporter) as a skeptical writer investigating paranormal events. When he insists on staying in the reportedly haunted room in 1408 at the Dolphin Hotel against the grave warnings of the hotel manager (Samuel L. Jackson), he discovers the room''s deadly secret an evil so powerful, no one has ever survived an hour within its walls. In the tradition of King''s The Shining and Misery, 1408 is "a psychologically thrilling movie that leaves you gasping in the end" (Desiree Belmarez, Denver Post).', '', 'USD', '29.95', '2008-08-30', '2016-11-15 00:00:00', NULL),
(632, 632, 'United States', 0, 0, 0, 'Digital', '796019-806299', 967, 'Owned', 'Grindhouse Presents  Planet Terror', 'Limited Edition', '', 'United States', '2007', '2007-10-16', 105, 'SteelBook', 0, 'USD', '29.95', 'Director Robert Rodriguez (Sin City) is back with a rip-roaring, zombie-infested rollercoaster of a movie that "sure as hell keeps you hanging on for the ride" (Peter Travers, <i>Rolling Stone</i>). Rose McGowan Freddy Rodriguez, Bruce Willis, and an all-star cast fight for their lives in the ultimate showdown between an army of flesh-eating mutants and a motley group of rag-tag survivors. Featuring one of the most memorable screen heroines ever and the now legendary mock <i>Machete</i> trailer, "<i>Planet Terror</i> is a total blast  funny. gloriously gory and over the top" (Christy Lemire, <i>Associated Press</i>).', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(633, 633, 'United States', 0, 0, 0, 'Digital', '796019-810678', 961, 'Owned', 'Awake', '', '', 'United States', '2007', '2008-03-04', 84, 'Keep Case', 0, 'USD', '28.95', '<b>SEXY AND SUSPENSEFUL,</b> <i>Awake</i> turns the disturbingly real phenomenon of "anesthetic awareness"  in which surgery patients, though completely paralyzed, are conscious of everything they are experiencing, including the pain  into a "completely absorbing" thriller (Roger Ebert). When failed anesthesia leaves a rich young tycoon (Hayden Christensen, <i>Star Wars</i>) alert but immobilized during open-heart surgery, he overhears a devious plot to have him killed. Co-starring Jessica Alba (<i>Sin City</i>) and Academy Award nominee* Terrence Howard (<i>Crash</i>), <i>Awake</i> does "for operations what <i>Jaws</i> did for the beach" (Frank Scheck, <i>Hollywood Reporter</i>).\n\n*2006: <i>Hustle & Flow</i>.', '', 'USD', '28.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(634, 634, 'United States', 0, 0, 0, 'Digital', '796019-810883', 969, 'Owned', 'Hell Ride', '', '', 'United States', '2008', '2008-10-28', 83, 'Keep Case', 0, 'USD', '19.97', '<b>From Executive Producer Quentin Tarantino</b> (<i>Grindhouse Presents: Death Proof</i>) and Writer/Director Larry Bishop (<i>Mad Dog Time</i>) comes this lean, mean mayhem machine - fully loaded with bikers, babes, and booze. Michael Madsen (<i>Kill Bill Vol. 1 & 2</i>), Eric Balfour (TV''s <i>24</i>) and legendary "Easy Rider" Dennis Hopper are part of a wild motorcycle gang bent on avenging the death of one of their own. With Vinnie Jones (<i>The Condemned</i>) as the crazed arrow-wielding rival gang leader, <i>Hell Ride</i> is a savagely enjoyable good time where the women are hot, the bikes are even hotter, and the action never stops!', '', 'USD', '19.97', '2009-10-14', '2016-11-15 00:00:00', NULL),
(635, 635, 'United States', 0, 0, 0, 'Digital', '796019-814713', 1031, 'Owned', 'The Promotion', '', '', 'United States', '2008', '2008-09-02', 86, 'Keep Case', 0, 'USD', '24.95', 'Seann William Scott (''American Pie'', ''The Rundown'') and John C. Reilly (''Walk Hard'', ''Talladega Nights: The Ballad of Ricky Bobby'') star in this hilarious workplace comedy. Scott, a career assistant manager seems a shoo-in for the opportunity to run the chain''s new store  that is, until a Canadian transfer (Reilly) starts to compete for the job too. Fists fly in a no-holds-barred battle as each man one-ups the other while their mortified wives and co-workers look on. Featuring Jenna Fischer (TV''s ''The Office'') and Lili Taylor (TV''s ''Six Feet Under'') and a host of other outrageous characters, ''The Promotion'' is "a witty, smart comedy" (Scott Foundas, ''LA Weekly'') that will have you rolling down the aisles in laughter.', '', 'USD', '24.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(636, 636, 'United States', 0, 0, 0, 'Digital', '796019-815314', 977, 'Owned', 'Pulse 2', '', '', 'United States', '2008', '2008-09-30', 88, 'Keep Case', 1, 'USD', '19.97', 'Jamie Bamber (''Battlestar Galactica'') stars in this terrifying sequel that picks up where the original ''Pulse'' left off. The dead have found a way back to our world  and the human survivors have taken to remote areas to escape. When a young girl goes missing, both her father and mother must cross a city of the dead to learn the terrifying truth. Intense, suspenseful, and terrifying, ''Pulse 2'' will frighten you straight through to its shocking ending.', '', 'USD', '19.97', '2009-10-14', '2016-11-15 00:00:00', NULL),
(637, 637, 'United States', 1, 0, 0, '', '796019-816977', 692, 'Owned', 'Outlander', '', '', 'United States', '2008', '2009-05-19', 115, 'Keep Case', 0, 'USD', '19.97', '<b>IN THE YEAR''S MOST ACTION-PACKED SCI-FI ADVENTURE,</b> Jim Caviezel (<i>The Passion of the Christ</i>) stars as a futuristic soldier who crash-lands on Earth with a hellish, fire-breathing monster in a time of warring Viking tribes. Fusing advanced technology with Iron Age weaponry, he must unite the fierce Vikings and hunt the bloodthirsty beast before it kills them all. Featuring Ron Perlman (<i>Hellboy</i> films), Sophia Myles (<i>Underworld</i> films), and John Hurt (<i>Indiana Jones and the Crystal Skull</i>), <i>Outlander</i> is "visually spectacular" (Michael Wilmington, <i>Chicago Daily Herald</i>), combining stunning special effects, fast-paced action, and a fantastic story to explosive effect.', '', 'USD', '19.97', '2009-10-15', '2016-11-15 00:00:00', NULL),
(638, 638, 'United States', 0, 0, 0, 'Digital', '796019-817011', 978, 'Owned', 'Pulse 3', '', '', 'United States', '2008', '2008-12-23', 91, 'Keep Case', 1, 'USD', '19.97', 'Nearly a decade after terrifying events of <i>Pulse 2</i> the dead still walk the earth  having entered our realm through electronic devices. Justine, raised with her fellow human refugees in the remote no-tech survivor camp, is now a 17-year-old girl who dreams of the world they''ve left behind. When an abandoned laptop links her to a mysterious outside caller, Justine risks everything to see if life has resumed back in the forbidden city. More frightening than ever, <i>Pulse 3</i> is an intense and shocking conclusion to the <i>Pulse </i>trilogy.', '', 'USD', '19.97', '2009-10-14', '2016-11-15 00:00:00', NULL),
(639, 639, 'United States', 0, 0, 0, 'Digital', '799613-136496', 1013, 'Owned', 'Dark City', 'Deluxe 2 Disc Set', '', 'United States', '2008', '2008-04-25', 107, 'Digipak', 1, 'USD', '29.95', 'Presented in a film-noir aesthetic, a tale of love, mystery, and murder unfolds in the shadowy and depraved netherworld of the Gotham-like "City of Angels". Lured by femme fatale, Molly Breathless (Ava Rose), detective Nick Caprice (Tommy Gunn) spirals down into a world of fervent sexual escapades. His desire for love and her struggle for power brew the cocktail of inevitable dissolution and demise.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(640, 640, 'United States', 0, 0, 0, 'Digital', '842498-030516', 985, 'Owned', 'Shutter', '', '', 'Thailand', '2004', '2007-03-27', 97, 'Keep Case', 1, 'USD', '15.94', 'After Tun and Jane hit and kill a girl with their car, they flee the scene, hoping to distance themselves as quickly as possible from the horrific incident. But that soon proves harder than they''d anticipated, as the two, and even their friends, are haunted in various ways by a ghostly presence. Photographer Tun doesn''t believe in the supernatural, but he finds it harder and harder to dismiss the creepy ghost-like shadows that keep appearing on his photographs.', '', 'USD', '15.94', '2009-10-14', '2016-11-15 00:00:00', NULL),
(641, 641, 'United States', 1, 0, 0, '', '85192-78232', 33, 'Owned', 'Troy', '', '', '', '2004', '2005-01-04', 162, 'Keep Case', 0, 'USD', '29.95', 'Brad Pitt picks up a sword and brings a muscular, brooding presence to the role of Greek warrior Achilles in this spectacular retelling of The Iliad. Orlando Bloom and Diane Kruger play the legendary lovers who plunge the world into war, Eric Bana portrays the prince who dares to confront Achilles, and Peter O''Toole rules Troy as King Priam. Director Wolfgang Petersen recreates a long-ago world of mighty warships, clashing armies, the massive fortress city and the towering Trojan Horse. "In the tradition of Braveheart and Gladiator, Troy is epic moviemaking at its very best!" (Clay Smith, ACCESS HOLLYWOOD)', '', 'USD', '29.95', '2006-01-11', '2016-11-15 00:00:00', NULL),
(642, 642, 'United States', 0, 0, 0, 'Digital', '876964-001632', 1022, 'Owned', 'Red', '', '', 'United States', '2008', '2008-10-28', 93, 'Keep Case', 0, 'USD', '26.98', 'Avery (Brian Cox), a reclusive, older man, has a best friend in his dog, <i>RED</i>. When three teens kill Red without reason, Avery sets out for justice and redemption, attempting to follow the letter of the law. But when the law fails him, and the boys'' father (Tom Sizemore) clearly defines right and wrong in his own way, Avery must avenge himself by any means.', '', 'USD', '26.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(643, 643, 'United States', 0, 0, 0, 'Digital', '8-804119-400865', 927, 'Owned', 'Italian Job', 'Collector''s Edition', '', 'United States', '2003', '2003-10-28', 119, 'Keep Case', 0, 'USD', '29.95', '1.\nA band of thieves, led by Charlie Croker (Wahlberg), pulls off the ultimate heist by rigging the stoplights of the city of Los Angeles so that they can drive right out of the city with a carful of gold (in a safe that they''re stealing back after Croker''s double-crossing ex-partner, played by Edward Norton, stole it from Croker first), with nothing but green lights, while everyone else gets red lights, thus keeping the roads plugged with the largest traffic jam in L.A. history, and the police from pursuing them. \n\n2.\nThe Minis and Charlie Croker return in this remake of the 1969 Brit classic with the action relocated to Los Angeles. Career criminal Charlie Croker learns he has been double crossed and takes his gang  inside man Steve, computer genius Lyle, wheelman Handsome Rob, explosives expert LeftEar and veteran safecracker John Bridger  to L.A. to orchestrate the biggest traffic jam in history and steal a fortunes worth of gold bullion.', '', 'USD', '29.95', '2009-10-14', '2016-11-15 00:00:00', NULL),
(644, 644, 'United States', 1, 0, 0, '', '883904-102908', 627, 'Owned', 'Stargate: The Ark of Truth', '', '', 'United States', '2008', '2008-03-11', 102, 'Keep Case', 1, 'USD', '26.98', 'This thrilling feature-length film picks up where ''Stargate SG-1'' left off, thrusting the Stargate team - Daniel Jackson (Michael Shanks), Vala (Claudia Black), Teal''c (Christopher Judge), Sam (Amanda Tapping) and Cam (Ben Browder) - into their most exciting adventure yet. In search of an ancient artifact they hope can defeat the oppressive Ori, the team learns that the Ori are set to launch a final assault on Earth and a double-crossing I.O. operative is aboard the ''Odyssey''!', '', 'USD', '26.98', '2008-08-30', '2016-11-15 00:00:00', NULL),
(645, 645, 'United States', 0, 0, 0, 'Digital', '883904-109624', 903, 'Owned', 'Dead Like Me: Life After Death', '', '', 'United States', '2009', '2009-02-17', 87, 'Keep Case', 0, 'USD', '26.98', 'When George and her colleagues get a new boss whose focus is on moving souls quickly and enjoying life without consequences, the team begins to break the strict grim reaper rules. While her friends fall victim to their desires for money, success, and fame, George breaks another rule by revealing her true identity to her living family. As the reapers struggle with their roles on Earth, they each find that death can be just as complicated as life.', '', 'USD', '26.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(646, 646, 'United States', 0, 0, 0, 'Digital', '883904-134671', 901, 'Owned', 'Quantum of Solace', '', '', 'United States', '2008', '2009-03-24', 106, 'Keep Case', 0, 'CAD', '22.99', '<b>Daniel Craig returns as James Bond!</b>\nOn a nonstop quest for justice that crisscrosses the globe, Bond meets the beautiful but feisty Camille (Olga kurylenko), who leads him to Dominic greene 9Mathieu Amalric0, a ruthless businessman and major force within the mysterious Quantum organisation. When Bond uncovers a conspiracy to take control of one of the world''s most important natural resources, he must navigate a minefield of treachery, deception and murder to neutralise Quatum before it''s too late!\n<b>\nDANIEL CRAIG est de retour dans le rle de James Bond!</b>\nPlong dans une qute de justice sans rpit, Bond sillonne le globe en tous sens avant de rencontrer la superbe et imptueuse Camille (Olga Kurylenko), qui le conduit  Dominic Greene (Mathieu Amalric), un homme d''affaires impitoyable ainsi qu''une force de premier plan au sein de la mystrieuse organisation Quantum. Lorsque Bond dcouvre l''existence d''une conspiration visant  prendre le contrle d''une des plus importantes ressources naturelles de la plante, il doit faire face  un cocktail explosif de tratrise, de duperie et de meurtre pour neutraliser Quantum avant qu''il ne soit trop tard!', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(647, 647, 'United States', 0, 0, 0, 'Digital', '883904-138174', 948, 'Owned', 'Valkyrie', '', '', 'United States', '2008', '2009-05-19', 120, 'Keep Case', 0, 'USD', '29.98', '"Tom Cruise gives one of the best performances of his career" (Jeffrey Lyons, NBC/<i>Reel Talk</i>) in this action-packed film from the director of <i>The Usual Suspects</i> and <i>X-Men</i>. Based on the incredible true story of Colonel Claus von Stauffenberg (Cruise) and his ingenious assassination plot targeting Adolph Hitler, this engrossing thriller reenacts the daring operation to eliminate one of the most evil tyrants the world has ever known. Co-starring Kenneth Branagh, Bill Nighy, Tom Wilkinson, Terence Stamp and Eddie Izzard, <i>Valkyrie</i> delivers gripping suspense and pulse-pounding excitement from start to finish!', '', 'USD', '29.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(648, 648, 'United States', 1, 0, 0, '', '883929-012350', 487, 'Owned', 'I am Legend', 'Full Screen Edition', '', 'United States', '2007', '2008-03-18', 101, 'Clamshell', 0, 'CAD', '31.98', '', '', 'USD', '19.99', '2008-05-27', '2016-11-15 00:00:00', NULL),
(649, 649, 'United States', 0, 0, 0, 'Digital', '883929-013852', 960, 'Owned', 'Alien Raiders', '', '', 'United States', '2008', '2009-02-17', 85, 'Keep Case', 1, 'USD', '24.98', 'Fresh veggies on Aisle 1. Fresh kills throughout the store. Something terrible is happening at Hastings Market. Something bloody. Something deadly. Something inhuman. And caught up in the grisly horror inside the market are shoppers turned hostages, unearthly alien terrors...and a dedicated commando band of raiders on a search-and-destroy mission to stop the intruders dead cold no matter where they hide.\n\nFrom Raw Feed, creators of the <i>Rest Stop</i> and <i>Otis</i> shockers, comes the sci-fi/horror tale Alien Raiders, a nerve-shredding battle for human survival against aliens that invade our world by invading our bodies. Be alert. Beware. Be afraid. The creatures'' next host could be your neighbor. Your kid brother. No  it''s <i>you</i>!', '', 'USD', '24.98', '2009-10-14', '2016-11-15 00:00:00', NULL),
(650, 650, 'United States', 1, 0, 0, '', '883929-024698', 661, 'Owned', 'Fool''s Gold', 'Full-Screen Edition', '', 'United States', '2008', '2008-06-17', 112, 'Keep Case', 0, 'USD', '28.98', 'Matthew McConaughey and Kate Hudson go for the gold (and the diamonds emeralds and rubies) as a just-divorced couple who bicker and banter their way through an adventure- and laugh-packed undersea treasure hunt. McConaughey is Finn in love with his ex (Hudson) and in deep with gangster Bigg Bunny. After eight years of searching Finn gets a clue to the whereabouts of the Queen''s Dowry a fabulous fortune that mysteriously disappeared in the Caribbean in 1715. Now all he has to do is get the gold get the girl and get going before Bigg Bunny gets him. Directed by Andy Tennant (Hitch) Fool''s Gold glitters with danger action romance comedy great one-liners and a great time to be had by all!', '', 'USD', '28.98', '2009-09-27', '2016-11-15 00:00:00', NULL),
(651, 651, 'United States', 0, 0, 0, 'Digital', '883929-032617', 902, 'Owned', '10,000 B.C.', '', '', 'United States', '2008', '2008-06-24', 109, 'SteelBook', 0, 'USD', '29.99', '', '', 'USD', '29.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(652, 652, 'United States', 0, 0, 0, 'Digital', '883929-073795', 1037, 'Owned', 'Yes Man', '', '', 'United States', '2008', '2009-04-07', 104, 'Keep Case', 0, 'USD', '19.99', 'Carl Allen has stumbled across a way to shake free of post-divorce blues and a dead-end job: embrace life and say yes to everything. Take a bungee plunge? <i>Yes</i>. Accept call-now TV offers? <i>Yes</i>. Learn Korean? <i>Yes</i>. Grab the first flight to anywhere? <i>Yes</i>. Win your dream girl? <i>Yes</i>. Crack up fans with a feel-good, laugh-loaded romp? <i>Yes!</i> Working every funny bone in his nimble body and every muscle in his hilariously mobile face, Jim Carrey plays Carl in a <i>YEScapade</i> about opening up to life''s possibilities - especially when those possibilities include romance with an intriguing, free-spirited musician (Zooey deschanel). From the director of <i>Bring It On</i> and <i>The Break-Up</i> comes an invitation to discover the comedy power of yes.', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(653, 653, 'United States', 1, 0, 0, '', '94045-40112', 23, 'Owned', 'The Mask', 'Platinum Series', '', '', '1994', '1997-09-03', 101, 'Snapper', 0, 'USD', '24.99', 'Jim Carrey (Liar Liar, Dumb and Dumber) stars as mild-mannered bank clerk Stanley Ipkiss, who discovers a mysterious ancient mask that brings his innermost desired to wild, screaming life! Now, together with Cameron Diaz (A Life Less Ordinary, My Best Friend''s Wedding) and his sidekick Milo, this wise-cracking green tornado is taking Edge City over the top in this romantic-action-comedy that will leave you S-s-s-s-smokin''!', '', 'USD', '24.99', '2005-02-27', '2016-11-15 00:00:00', NULL),
(654, 654, 'United States', 1, 0, 0, '', 'Disc ID: 0A7A-FE23-2F1B-8616', 74, 'Owned', 'Band of Brothers: Disc 5', '', '', '', '2001', '2002-11-05', 120, 'Digipak', 0, 'USD', '19.99', 'Disc 5 of 6-Disc Box-Set: Part 9, 10\n\nPart 9: WHY WE FIGHT\n\nEasy Company finally enters Germany, to surprisingly little resistance, and has a chance to relax for the first time in a long time. A patrol in a nearby forest discovers an abandoned Nazi concentration camp, still filled with emaciated prisoners. The local citizenry, unbelievably disavowing knowledge of its existence, is made to clean it up, as the news arrives that Hitler is dead.\n\nPart 10: POINTS\n\nOnce home to the top officers of the Third Reich, Easy Company enters the Bavarian town of Berchtesgaden, and captures "Eagle''s Nest," Hitler''s mountaintop fortress. Facing imminent deployment to the Pacific Theater, the men compare their "points" to see who has earned enough to go home. However, the Japanese surrender ends the war. A closing vignette tells what happened to the men of Easy Company after they returned home.', '', 'USD', '19.99', '2006-02-04', '2016-11-15 00:00:00', NULL),
(655, 655, 'United States', 1, 0, 0, '', 'Disc ID: 0C1E-D834-C26E-BB18', 689, 'Owned', 'Darkman / Darkman II: The Return of Durant', 'The Franchise Collection', '', 'United States', '1990', '2007-08-07', 188, 'Keep Case', 0, 'USD', '19.99', 'Darkman: \nDirected by Sam Raimi (Spider-Man films), with all-new 5.1 surround sound, the original adventure introduces Dr. Payton Westlake, on the verge of a major breakthrough in synthetic skin when a gang obliterates his lab and changes his life forever.\n\nDarkman II: The Return of Durant\nThe crime-fighting master of disguise returns for revenge against the sadistic villain Durant in this pulse-pounding sequel to the hit film.', '', 'USD', '19.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(656, 656, 'United States', 0, 0, 0, 'Digital', 'Disc ID: 0D3C-6819-7BDB-85FB', 942, 'Owned', 'Supervolcano', '', '', '', '2007', '0000-00-00', 102, 'Keep Case', 0, 'USD', '19.99', 'Amidst the stunning wilderness of Yellowstone National Park, steam and hot water bubble and hiss from thousands of colorful, mineral-encrusted springs and vents. These hot springs, geysers and bubbling mud pools are all outward manifestations of a huge body of magma residing not far beneath the surface. It''s a subterranean sea of molten lava that scientists are sure will burst through the Earth''s crust  it''s just a question of when. And if the resulting super-volcanic eruption is anything like the last one on earth  which plunged the world into darkness for six years, tipped us into the last Ice Age and reduced the human population to just 2,000 people  we''re in for one explosive ride. \nBased on the predictions of top volcano experts and the detailed planning and evacuation strategies of government agencies, this sobering, factual drama shapes possible events into a compelling human experience. Watch as state-of-the-art computer graphics integrated with mock-factual sources reveal the horrifyingly realistic build-up to the Yellowstone eruption and the climax itself. Learn what effects the eruption may have across the globe  environmentally, politically, economically and socially  as the massive ash cloud drifts into the upper atmosphere. And glimpse the fragmented world that such a cataclysmic geological event would surely leave behind.', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(657, 657, 'United States', 0, 0, 0, 'Digital', 'Disc ID: 15B0-2616-DE1D-288F', 974, 'Owned', 'Poltergeist II: The Other Side', '', '', 'United States', '1986', '2003-08-26', 91, 'Keep Case', 0, 'USD', '19.99', 'The sinister supernatural forces return in this heart-pounding otherworldly thriller filled with "jolting, state-of-the-art special effects" (Leonard Maltin). The Freeling family (JoBeth Williams, Craig T. Nelson, Heather O''Rourke) settles into a new home following the annihilation of their former residence by terrifying visitors from the netherworld. But the spirits of the dead are still hell-bent on luring the family''s clairvoyant daughter Carol Anne to "the other side"!', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(658, 658, 'United States', 1, 0, 0, '', 'Disc ID: 2CBF-BA2C-3A79-9E51', 71, 'Owned', 'Band of Brothers: Disc 2', '', '', '', '2001', '2002-11-05', 125, 'Digipak', 0, 'USD', '19.99', 'Disc 2 of 6-Disc Box-Set: Part 3, 4\n\nPart 3: CARENTAN\n\nTwo days after D-Day, Easy Company is sent to take the town of Carentan, engaging in a successful battle that results in several casualties. Some soldiers, including Pvt. Blithe (Marc Warren), have a difficult time adjusting to combat. After 36 days in Normandy and several fierce battles, Easy returns to England, but their celebrations are short-lived, as news comes that they''re moving out again.\n\nPart 4: REPLACEMENTS\n\nDue to heavy casualties, a group of fresh paratrooper replacements joins Easy Company in time for a massive drop into German-occupied Holland for Operation Market-Garden. While met with no resistance in Eindhoven, Easy and a cluster of British tanks are repelled from a nearby town by a superior German force, sustaining many casualties as they retreat. The Allied plan to enter Germany through Holland and end the war before Christmas fails.', '', 'USD', '19.99', '2006-02-04', '2016-11-15 00:00:00', NULL),
(659, 659, 'United States', 1, 0, 0, '', 'Disc ID: 2F9D-3A55-E34A-AD03', 551, 'Owned', 'Back to the Future', 'Collector''s Edition', '', '', '1985', '2002-12-17', 111, 'Keep Case', 0, 'USD', '14.99', 'The year is 1985 - but not for long. Because teenager Marty McFly (Michael J. Fox) is about to be blasted back to 1955 aboard the plutonium-powered DeLorean created by eccentric genius Doc Emmet Brown (Christopher Lloyd). But when Marty accidentally keeps his parents-to-be from falling in love, it triggers a time-shattering chain reaction that could vaporize his future - and leave him trapped in the past! Now Marty''s last hope is to change history before the clock runs out on his one-in-a-million chance to get himself Back to the Future!\n\nPowered by spectactular special effects, unforgettable songs and outrageously imaginative action, it''s an exhilaratingmotion picture triumph you''ll want to experience time and time again!', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(660, 660, 'United States', 1, 0, 0, '', 'Disc ID: 3CB2-7AE2-892B-EA79', 475, 'Owned', 'Star Wars V: The Empire Strikes Back', 'Widescreen', 'Star Wars: Episode V: The Empire Strikes Back', 'United States', '1980', '2004-09-21', 127, 'Keep Case', 0, 'USD', '29.99', 'It is a dark time for the Rebellion. After a devastating attack on their ice base on the frozen planet of Hoth, the Rebels are scattered by Imperial pursuit. Luke Skywalker seeks out the mysterious Jedi Master Yoda in the swamps of Dagobah, while Han Solo and Princess Leia outrun the Imperial fleet to the beautiful Cloud City of Bespin. In an attempt to convert Luke to the dark side, the evil Darth Vader lures young Skywalker into a trap. In the midst of a fierce lightsaber duel with the Sith Lord, Luke faces a terrible truth about the Skywalker legacy.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(661, 661, 'United States', 0, 0, 0, 'Digital', 'Disc ID: 4DD9-5232-3A36-AD42', 975, 'Owned', 'Poltergeist III', '', '', 'United States', '1988', '2003-08-26', 97, 'Keep Case', 0, 'USD', '19.99', 'They''re back...again! And they''re still looking for Carol Anne (Heather O''Rourke) in this riveting and climactic finale to the Poltergeist trilogy. Sent by her parents to live in a Chicago high rise with her aunt (Nancy Allen), uncle (Tom Skerritt) and cousin (Lara Flynn Boyle), Carol Anne must face demons more frightening than ever before, as they move from invading homes to taking over an entire skyscraper! "Ingenious and cleverly executed" (<i>Los Angeles Times</i>) special effects highlight this haunting chiller that takes terror to new heights!', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL),
(662, 662, 'United States', 1, 0, 0, '', 'Disc ID: 4DFE-350A-8FD5-CE5F', 491, 'Owned', 'Omen III: The Final Conflict', '', 'The Final Conflict', 'United States', '1981', '2006-10-17', 108, 'Keep Case', 0, 'USD', '29.98', 'Damien Thorn''s wrath of destruction and death has been more child''s play...until now. This terrifying third installment of the Omen series, presenting Damien as an adult with a full grasp of his power and his destiny, will grip you from its foreboding beginning until its shocking end! "Directed with cleanly elegant visual flair" (''The Science Fiction, Horror And Fantasy Film Review''), ''The Final Conflict'' is the culmination of Damien''s apocalyptic story...a terrifying vision that will haunt you the end of days!\n\nTo all the world, Damien Thorn (Sam Neill) is a philanthropist who has helped rescue the world from a recession. But when he becomes the U.S. Ambassador to England, Damien fulfills a horrifying biblical prophecy. He also faces his own potential demise when an astronomical event brings about the second coming of Christ. Determined to thwart his holy arch-nemesis, as well as a group of priests intent on killing him, Damien begins his most destructive rampage yet.', '', 'USD', '29.98', '2008-05-27', '2016-11-15 00:00:00', NULL),
(663, 663, 'United States', 1, 0, 0, '', 'Disc ID: 5C55-E8BF-3CB5-7390', 492, 'Owned', 'Damien: Omen II', '', '', 'United States', '1978', '2006-10-17', 107, 'Keep Case', 0, 'USD', '29.98', 'Lee Grant and William Holden lead an all-star cast in this "stylish" (''The New York Times'') and jarring follow-up that takes you into the black heart of the ''Omen'' series. Every bit as terrifying and foreboding as the original shocker, ''Omen II'' is "one of the best sequels this genre has seen" (''Horrorwatch'')!\n\nSince the sudden, suspicious death of his parents, Damien (Jonathan Scott-Taylor) has been in the care of his wealthy aunt (Grant) and uncle (Holden). Now in military school, Damien relentlessly plots to seize control of his uncle''s business empire -- and ultimately the world. And anyone attempting to unravel the mystery of his connection to the grisly events that occur around him will meet with an equally horrific and cruel demise!', '', 'USD', '29.98', '2008-05-27', '2016-11-15 00:00:00', NULL);
INSERT INTO `details` (`id`, `film_id`, `locality`, `media_dvd`, `media_hddvd`, `media_bluray`, `media_custom`, `upc`, `collectionnumber`, `collectiontype`, `title`, `disttrait`, `originaltitle`, `origin`, `prodyear`, `released`, `runningtime`, `casetype`, `slipcover`, `srpid`, `srp`, `overview`, `easteregg`, `purchcurrencyid`, `purchprice`, `purchdate`, `created_at`, `updated_at`) VALUES
(664, 664, 'United States', 1, 0, 0, '', 'Disc ID: 8BD0-71E9-4791-150B', 73, 'Owned', 'Band of Brothers: Disc 4', '', '', '', '2001', '2002-11-05', 132, 'Digipak', 0, 'USD', '19.99', 'Disc 4 of 6-Disc Box-Set: Part 7, 8\n\nPart 7: THE BREAKING POINT\n\nHaving thwarted the Germans at Bastogne, the exhausted Easy Company must now take the nearby town of Foy from the enemy. Several are killed and wounded in fierce shelling, compounded by the incompetence of their commander, Lt. Dike (Peter O''Meara), about whom Winters (Damian Lewis) can do nothing. Easy takes Foy, but at an enormous cost.\n\nPart 8: THE LAST PATROL\n\nEasy Company arrives in the Alsacian town of Haguenau near the German border, and is ordered to send a patrol across the river to take enemy prisoners. Lt. Jones (Colin Hanks), fresh from West Point and eager for combat experience, volunteers to lead. While successful, the mission costs another paratrooper''s life, prompting Winters (Damian Lewis) to ignore the order to send a second patrol the next night.', '', 'USD', '19.99', '2006-02-04', '2016-11-15 00:00:00', NULL),
(665, 665, 'United States', 1, 0, 0, '', 'Disc ID: 92ED-F2AC-5918-7FAB', 549, 'Owned', 'Back to the Future: Part III', '', '', '', '1990', '2002-12-17', 119, 'Keep Case', 0, 'USD', '14.99', 'Stars Michael J. Fox and Christopher Lloyd are joined by Oscar winner Mary Steenburgen in this rousing, full-throttle conclusion of the epic time-traveling adventure trilogy from executive producer Steven Spielberg and director Robert Zemeckis.\n\nFulfilling a long-time fantasy, Doc Brown has decided to live in the Old West of the 1880s. But when he''s in danger of meeting an untimely end, Marty travels back in time to rescue him. There''s just one problem: Doc is so smitten by schoolteacher Clara Clayton (Steenburgen) that he can''t think straight! Now, it''s up to Marty to keep Doc out of trouble, keep the DeLorean running, and keep the past, present and future on track so they can all get back to where - and when - they belong! Filled with all of the trademark ''Back to the Future'' gadgetry, action, imagination and humor, it''s a spectacular finale to one of the most popular adventure-comedy film series of all time!', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(666, 666, 'United States', 1, 0, 0, '', 'Disc ID: CCFA-3584-CEC2-4D2C', 68, 'Owned', 'Band of Brothers: Disc 1', '', '', '', '2001', '2002-11-05', 125, 'Digipak', 0, 'USD', '19.99', 'Disc 1 of 6-Disc Box-Set: Part 1, 2\n\nPart 1: CURRAHEE\n\nPart 2: DAYS of DAYS', '', 'USD', '19.99', '2006-02-04', '2016-11-15 00:00:00', NULL),
(667, 667, 'United States', 1, 0, 0, '', 'Disc ID: D84D-F896-B392-5896', 473, 'Owned', 'Star Wars IV: A New Hope', 'Widescreen', 'Star Wars', 'United States', '1977', '2004-09-21', 125, 'Keep Case', 0, 'USD', '29.99', 'The Jedi Knights have been exterminated and the Empire rules the galaxy with an iron fist. A small group of Rebels have dared to fight back by stealing the secret plans to the Empire''s mightiest weapon, the Death Star battle station. The Emperor''s most trusted servant, Darth Vader, must find the plans, and locate the hidden Rebel base. Princess Leia, a captive Rebel leader, sends out a distress signal that is intercepted by a simple farm boy, Luke Skywalker. Seizing his destiny, Luke takes up the challenge to rescue the princess and help the Rebellion overthrow the Empire, along with such unforgettable allies as the wise Obi-Wan Kenobi, the cocky Han Solo, the loyal Chewbacca, and the droids R2-D2 and C-3PO.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(668, 668, 'United States', 1, 0, 0, '', 'Disc ID: D96A-A569-D2A5-2DF2', 690, 'Owned', 'Darkman III: Die Darkman Die', 'The Franchise Collection', '', 'United States', '1995', '2007-08-07', 87, 'Keep Case', 0, 'USD', '19.99', '''Arnold Vosloo'' returns as Dr. Peyton Westlake, a.k.a. Darkman, the crime-fighting master of disguises.  In this action-packed adventure Westlake matches wits with underworld drug-dealing villain Peter Rooker (''Jeff Fahey''), who will do anything to unmask the secret of Westlake''s superhuman strength.\nAgreeing to an experimental operation on his ravaged body, Westlake is flung into a vicious game of survival for himself, his priceless research and the lives of two innocent people.  One false move and he will be locked into darkness forever.\nFrom Executive Producers Sam Raimi and Robert Tapert, creators of the original film, ''Darkman III: Die Darkman Die'', like its predecessors, is jam-packed with surprises, staggering special effects and never-ending thrills.', '', 'USD', '19.99', '2009-09-27', '2016-11-15 00:00:00', NULL),
(669, 669, 'United States', 1, 0, 0, '', 'Disc ID: E117-6385-D67A-2125', 550, 'Owned', 'Back to the Future: Part II', '', '', '', '1989', '2002-12-17', 108, 'Keep Case', 0, 'USD', '14.99', 'Brace yourself - as the most spectacular history-altering adventure of all time continues in the hit sequel that proves lightning can strike twice!\n\nMarty and Doc (Michael J. Fox and Christopher Lloyd) have barely recovered from their first time-traveling adventure when they launch themselves once more into the space-time continuum. But this time around, their history-tweaking antics in the year 2015 create a frightful, alternate 1985 Hill Valley where bully Biff Tannen is rich, powerful and Marty''s dead! Now, their only chance to fix the present is by going back to 1955 all over again. But can Doc and Marty patch up the past without igniting a universe-shredding time paradox? Fire up the trusty DeLorean and find out - as the powerhouse team of executive producer Steven Spielberg and director Robert Zemeckis rev up another round of brilliantly inventive, comically super-charged time-hopping action in ''Back to the Future Part II''!', '', 'USD', '14.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(670, 670, 'United States', 1, 0, 0, '', 'Disc ID: E90E-439F-94BA-2CEF', 72, 'Owned', 'Band of Brothers: Disc 3', '', '', '', '2001', '2002-11-05', 123, 'Digipak', 0, 'USD', '19.99', 'Disc 3 of 6-Disc Box-Set: Part 5, 6\n\nPart 5: CROSSROADS\n\nWinters (Damian Lewis) leads a risky mission on a Dutch dike, resulting in a resounding victory, for which he is promoted to Battalion Executive Officer. Dissatisfied with his new, largely administrative job, Winters is concerned about the leadership of the three companies he now commands. After a weekend pass to Paris, news arrives of a massive Axis effort in the Ardennes Forest, threatening to break the Allied lines. Easy Company races in to hold the line, ill-equipped for the bitterly cold weather and the entrenched battle ahead. \n\nPart 6: BASTOGNE\n\nIn the dead of winter, in the forest outside of Bastogne, Belgium, the men of Easy Company struggle to hold the line alone while fending off frostbite and hunger, having arrived with no winter clothes and little supplies and ammunition. Medic Eugene Roe (Shane Taylor) is overwhelmed, on edge and close to combat exhaustion when he finds friendship with a Belgian nurse. Easy Company spends a miserable Christmas in the trenches, and receives the news that the German army''s demand for surrender was met with Gen. McAuliffe''s defiant answer: "Nuts!"', '', 'USD', '19.99', '2006-02-04', '2016-11-15 00:00:00', NULL),
(671, 671, 'United States', 1, 0, 0, '', 'Disc ID: F45A-5749-D9DC-71C7', 474, 'Owned', 'Star Wars VI: Return of the Jedi', 'Widescreen', 'Star Wars: Episode VI: Return of the Jedi', 'United States', '1983', '2004-09-21', 135, 'Keep Case', 0, 'USD', '29.99', 'In the spectacular final chapter of the ''Star Wars'' saga, Luke Skywalker and Princess Leia must travel to Tatooine to free Han Solo by infiltrating the wretched stronghold of Jabba the Hutt, the galaxy''s most loathsome gangster. Reunited, the Rebels team up with tribes of Ewoks to combat the Imperial forces on the forest moon of Endor. Meanwhile the Emperor and Darth Vader conspire to turn Luke to the dark side, and young Skywalker is determined to rekindle the spirit of the Jedi within his father. The Galactic Civil War culminates in the ultimate showdown, as the Rebel forces gather to attack the seemingly defenseless and incomplete second Death Star in the battle that will determine the fate of the galaxy.', '', 'USD', '29.99', '2005-02-28', '2016-11-15 00:00:00', NULL),
(672, 672, 'United States', 0, 0, 0, 'Digital', 'Disc ID: FF7C-2886-14E5-34BD', 956, 'Owned', 'A Nightmare on Elm Street 2: Freddy''s Revenge', '', 'A Nightmare on Elm Street Part 2: Freddy''s Revenge', 'United States', '1985', '1999-09-21', 86, 'Snapper', 0, 'USD', '19.99', 'Five years have passed since Freddy Krueger (Robert Englund) was sent howling back to hell.  But now, a new kid on Elm Street is being haunted every night by gruesome visions of the deadly dream stalker.  And if his twisted soul takes possession of the boy''s body, Freddy will return from the dead to wreak bloody murder and mayhem upon the entire town.\n\nWhen ''A Nightmare on Elm Street'' made a killing, horror fans shrieked for more. Soon the diabolic Freddy was resurrected with a vengeance - along with some of the most terrifying special effects ever to splatter the screen. Look for Robert Englund minus his Freddy face in the opening sequence. He''s a real scream!', '', 'USD', '19.99', '2009-10-14', '2016-11-15 00:00:00', NULL);
